var comments = [{"rating": 3.894, "workload": 8.688, "withdrew": 114.0, "comments": [{"comment": "This is my first course in the OMSCS program. I have a background in Java from undergrad and write C/C++ code daily for work. This review will be based on that experience.This class has 4 projects, 10 quizzes, and 2 tests. The quizzes are easy, and the tests are pretty hard.Project 1 - PR 1 was on a VM using C code. Some say that this project was the hardest, but for me this project was pretty simple. It was asking about buffer overflow exploiting and concepts similar to this. The write up for this project is tough. Make sure you leave out no details and truly explain what is going on.Project 2 - PR2 was a little different. For PR2 you opened up a VM and ran some malware that was given to you. You then have to read through the execution of it and figure out which malware was triggered and which wasn't. Sounds easy enough? Wrong, many of the people in this Fall 2018 class did terribly on this assignment because the criteria for executing or not executing is not very clear. My advice, work with some classmates and talk about each exploit 1 by 1.Project 3 - PR 3 was pretty cool. You got to play with some RSA cryptography stuff. This project is written 100% in Python 3. This project does take some time and have some major GOTCHA's but with some due diligence, this project can be finished quickly and you will actually enjoy it.Project 4 - PR4 for me was the toughest. You were doing things like XSRF attacks, sql injection, and things similar to phishing. Have 0 experience in HTML, PHP, or JS, I found this project to be extremely difficult. Others did not.Test 1 & 2 - I HATE reading text books, but for these tests, I highly suggest that you at least follow along in the text book while the lecture is going on. I took test 1 using ONLY the lecture and got less than a 70. STUDY THE BOOK FOR THE EXAMS.Quizzes - If you read the lecture notes or even studied the book a little bit the quizzes will be a breeze.The TA's for this semester were FREAKING AWESOME. They are absolutely helpful if you ask the right questions. The teacher was not around much, but the TA's for this class this semester from what I heard were the best anyone has had in any class so far. Kudos to them.OVERALL: I would definitely say this was a semi-good opener for the OMSCS program. I HIGHLY suggest that you start working on the projects soon after they are released. This will keep you up to date with all the people in the slack channel. OH, JOIN THE SLACK CHANNEL. It will make life so much easier. There were discussions on the daily about the projects and the best plan of attack. Once in a while you will even see someone slip and release a bit of information that wasn't supposed to be released. JOIN THE SLACK CHANNEL.Bit of advice: As stated at the top, C/C++ are my strong suit so I helped a lot of my fellow students with Project 1. When it came time for project 2, it was nice to have people to compare thoughts with about the Malware. Helped me get a high grade on the project. Then those same people when project 3 came around were there to bounce ideas and strategies off as well. Finally in project 4 where I struggled the hardest, I had people willing to help me understand because I had made friends with them and helped them along the way.", "rating": "Liked", "workload": "8 hours/week", "author": "IHzkxkh7jDeRr9IIfa6Hrg2D04U2", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/5/18, 11:52 AM"}, {"comment": "Solid class.The projects require you to apply mindset of an hacker to attack/analyze different vulnerabilities, which is different from traditional programming. You don't have to write much code really, but the code could be tricky.Personally, I don't do well on exams, so I spent more time on projects and quizzes which I almost got full points. Didn't read the book and got a 62 on the first exam.", "rating": "Liked", "workload": "10 hours/week", "author": "eyaGanDy0ydeTiuyle5pWs2wuCk2", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/7/18, 1:47 AM"}, {"comment": "This course has been unfairly maligned by many as a \"slacker\" course - perfect for something to pair up because there's very little effort needed. This may be true if you already know all the skillsets in the course - malware analysis, C, GDB, web dev, python, RSA, etc. If you do not already know at least half of these things, some of these items will make you struggle on at least one or two of the 4 projects.With that said, I went into this course with low expectations in terms of content and what I'll gain out of it - and I was wrong. There was a lot of material and knowledge that I had gained from this class. The TAs were extremely caring and helpful. (The prof was absent which is par for the course for OMSCS).The course materials were well done and makes understanding of new concepts very easy. I went into the course without knowing much of the security-related aspects and did not have too much trouble with them.Rumors are the course contents will undergo some non-trivial revisions for the next semester.", "rating": "Liked", "workload": "4 hours/week", "author": "kEUKFU3QJTdgl9kl08AFkq2esZH3", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/7/18, 12:30 PM"}, {"comment": "", "rating": "Loved!", "workload": "8 hours/week", "author": "CyD3LfafRjSwlaqIDUIZJaS1fP12", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/11/18, 4:46 AM"}, {"comment": "I found 2 of the 4 of the projects to be rather difficult but doable if you start early. As for the tests, they are medium in difficulty. They are difficult enough that getting an A is very hard but not so hard that you couldn't get a B if you simply watched the lectures and took notes. This is only my second course. Compared to computer networks, the quality and difficulty of the class is comparable. You do learn a lot, and some of the topics are truly fascinating.", "rating": "Neutral", "workload": "6 hours/week", "author": "HXxB2iJFanevx6y2f0vqXr1pjUj2", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/12/18, 11:54 AM"}, {"comment": "This was my first course at Gatech. Coming from electrical engineering background with limited programming experience, I must say this was a fun class. Lecture videos are boring but need to pay attention for exams. Quizzes are open book and easy. Two exams in total but tricky. 4 projects in total through out the course. You better want to start working on projects as soon as you receive them. Very well written projects and knowledgeable. Prof is not much active on piazza but TAs are really helpful and much more active.", "rating": "Liked", "workload": "8 hours/week", "author": "IZ7og1MEWpQImntt2jhZ7FUIEdk1", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/15/18, 8:27 AM"}, {"comment": "This was my 8th course in the OMSCS program. I've been disappointed in the program as a whole, and just want to finish up as quickly as possible with easy courses, so I was pleasantly surprised to find this course quite engaging. This was is no small part due to the TAs, who were extraordinarily active on slack and piazza, and very quick with grading.Pros:TAs were great. This will vary between semesters, so I guess Fall 2018 people were just lucky.Projects were engaging. In the first project you get to put on your hacker hat and do a buffer overflow attack (minimal C required), which was awesome (around 10 hours, including writeup). The second project involves some malware analysis (about 4 hours). Third project is hacking RSA encryption, which was way more fun than expected (around 10 hours), and the fourth project was hacking a webpage (8 hours or so if you have javascript experience, but if you don't know JS you could potentially spend way more time on it).You have regular open book quizzes. These are great from a pedagogical perspective - regular checks on understanding help you study more frequently, and make you engage with the material more.Cons:The lectures are a little boring. The first half are kind of common sense, while the second half are very dry and mathematical.Overall, this was one of my favorite courses I've taken at GT. It's a very light workload, but the projects will make you think, and I feel great now that I finally understand RSA. I paired it with computer networks, and feel that I could have taken a 3rd easy course at the same time.", "rating": "Liked", "workload": "5 hours/week", "author": "FyUS0J6Me9cYrpRq7s4VfElHc6E3", "difficulty": "Easy", "semester": "Fall 2018", "time": "12/18/18, 4:05 PM"}, {"comment": "Paired this with CN as my first semester in OMSCS. The class was very well run and quite fun. TAs are always there to help and you should have no problems at all when it comes to course management. Projects usually get 3-4 weeks each and first one is the toughest but that has plenty of time for you to figure out, which is C and learning to use GDB. I had prior knowledge of C and had some idea about GDB but took more than 20 hours to complete. Thereafter the course gets easier. Tests are based on textbook and some udacity lectures but nothing out of the ordinary. If you have understood the material well during the lectures and textbook reading you will be fine. Quizzes are similar.10 quizzes 2% each should give you full grade. (Note only 2 attempts allowed unlike previously unlimited attempts though open book quizzes). 2 exams 10% each. You shouldn't lose a lot here if you study well. 4 projects 15% each. Auto graded portion should get you full grade if you get everything right which is about 70-80% of the projects. Write ups for the projects is the only place where you should lose a lot of points since even getting 90/100 will mean you lose 1.5% on each project which adds up quickly to 6% total for 4 leaving little room for the tests to go wrong.If you need fairly relaxed but fun semester go for this class. I got to learn a lot related to Security in general so I enjoyed the class. If you already work in this field (Computer Security) then you may not learn much.", "rating": "Liked", "workload": "10 hours/week", "author": "pzDqA6AAuZfRYZUqkudgQbjn4di1", "difficulty": "Easy", "semester": "Fall 2018", "time": "12/22/18, 8:07 AM"}, {"comment": "The second easiest course I have taken in this program. I like security staff but the knowledge learned in this course basically is just a \"introduction\". Don't expect you can become a geek after taking this course. You cannot even learn how to write a single virus detection tool from this class. The first and last project are interesting, other projects are just some tedious work.", "rating": "Neutral", "workload": "10 hours/week", "author": "CnzLpXdnZGXbeQQAmujuq3gvp2G3", "difficulty": "Easy", "semester": "Fall 2018", "time": "12/23/18, 12:54 AM"}, {"comment": "", "rating": "Loved!", "workload": "6 hours/week", "author": "EkL1Rlay8EUPgJXSNQcYkj0RKih2", "difficulty": "Easy", "semester": "Fall 2018", "time": "12/29/18, 1:19 AM"}, {"comment": "I took this course in Fall 2018. It was a great course to take as your first course. I liked all project, except the 2nd one.", "rating": "Liked", "workload": "10 hours/week", "author": "vn41RdQXouXZXI46i3STaMR4jrl2", "difficulty": "Medium", "semester": "Fall 2018", "time": "1/2/19, 11:17 AM"}, {"comment": "Imagine creating a (non-phishing) mirror website that looks exactly like the original but sends an email with the username and password you enter.Imagine making a sorting program open a new shell purely by manipulating the data input you give it.If these sound exciting and cool, you will love this course!\"Go ahead, make my day!\"The course consists of:Lectures: Cover the material well, and very manageable difficulty level (legalese for \"it was easy, folks!\"). Got away with watching them semi-regularly.Readings: All the \"required\" readings are from one textbook. You do not need them for the exams, but I recommend reading them for fun if you are into that sorta thing. I did not ever read any of the \"recommended\" readings, though some of them looked fun too. Some day.. some day..Quizzes: There was a quiz every week (10 in total)- all open book, limited attempts. You definitely need the textbook for these and I recommend getting the ebook because a lot of the quizzes were simply testing your ctrl+f skills. That said, by the end of the term I realized they did cover a good breadth of topics and helped you learn something. Each quiz takes about an hour to do (with ctrl+f and literally no reading or even lecture-watching)Exams: There were 2 exams, non-cumulative. You only had to watch the lectures (Tip: 2x them with subtitles) and review the quizzes to do really well. There were a few questions from the readings, but some of them were mentioned in passing in the lectures and even if you missed those, you'd get a pretty good score. I spent about 20 hours studying for each exam, not counting the time I watched the lectures before.Projects: Saved the best for the last. 4 projects. 3 of them different degrees of fun. Project 2 was dull, but guess you can't have everything. This is the real deal, and everything you'd learn from this class.The first took me ~12 hrs (I know C, gdb and some systems stuff already), the second took me like 10 but I spent at least 3 hours checking and re-checking answers (no coding in this one). The 3rd took me about 8 hrs (just requires basic Python) but I already heard some algorithms mentioned on Slack, so first timers probably took longer. The last project took me 20 hours since I had no javascript background, but just pushing on helped.In total, I spent about 35 hrs on lecture watching and 100 hrs on everything else (Reading for fun, Slack and Piazza activity not included).That reminds me- I would be remiss not to mention the awesome Slack channel and the great TAs who basically ran the class and were super helpful and without whom this class would be a real drag. Special mentions for Jeff, David and Brent- you guys were great!Seriously, without the TAs (and the projects), you could simply strike out this section and write off this course as a failure.\"It's time to call bullshit. On what? Every thing\"If you are like me you'd think this sounds like an ad for this class so far, so let me balance it out with the minuses.The lectures are not great. Would you rather listen to someone who is clearly passionate about the material but rambles unto eternity or someone who delivers content in a crisp fashion but speaks in a robotic monotone such that the coolest topics sound like he is reading the draft of his user license agreement, only at at 2x the speed of sound? I personally preferred the former because the rambling gave me a ton of time to write real notes but honestly, I can't believe somebody can talk about cryptography like the walking dead.The professor (the second guy from above) is entirely absent in the course. If not for the lecture videos, I'd think he were mythical.The course could include a lot more fun topics and/or projects- it seemed like watching a teaser to a good movie, but never getting to see the real movie. if they ever change it I hope they add extra credit assignments with more advanced exploits. On that note, I'd also welcome a discussion after each project on what people did and what else they could have done.They do not change the graders across projects. I happened to get stuck with the worst grader for mine and he literally lopped off points on the report while others who wrote much less specifics got a 100. Thankfully, he seemed like the black sheep, but I wish they had rotated graders for different projects.\"Is it safe?\"Take it if you want a light (or semi-light depending on your programming skills) course to pair with something else. Definitely take it if this is your first semester and you are not sure of what to take.You can easily get an A in this course if you complete everything (exams, quizzes, projects). One piece of advice is - don't take it too easy and end up with an 88 or 89- there may not be a curve most of the time!Hasta la vista , baby!", "rating": "Liked", "workload": "10 hours/week", "author": "Vqd9ePz78iNmjJuYYuJlyY2gJiH3", "difficulty": "Easy", "semester": "Fall 2018", "time": "1/3/19, 2:20 PM"}, {"comment": "I took this class my first semester because I was interested in the field of cyber security, and I have to say that I really enjoyed it. There are 10 open book quizzes that are really easy, so be sure to complete those for 10% of your grade. The book is not a requirement but the quizzes and tests all are based on chapters from the book, so having a copy of it will be extremely helpful. There are two close-everything proctored tests that are extremely confusing, the wording on every question is so vague that no matter how much you study, you are bound to do bad on them.The best part of this course are the 4 projects, they all expand on the content from the lectures/book and are really fun and interesting to complete, they can be a bit confusing but are a great learning experience. Project 1 is probably the hardest, although project 2 is rather confusing and lacking in instructions, project 3 is difficult but doable and project 4 is extremely fun.The professor is completely absent from the course, I think I saw him post once on piazza in the first week of classes, but was otherwise missing the entire semester. The head TA is pretty much the same, I found out halfway through the semester who it was but he is mostly missing as well, with the occasional post on piazza. Some of the TAs are great and active on slack, but the worst thing about this course is their lack of organization. The TAs don't know how to properly distribute tasks among themselves and us the students end up paying for it, they are so disorganized and the lack of leadership from the head TA and professor only makes it worse.Overall, I think it's an interesting course and would recommend it for a first semester, but be patient and expect to reach out to TAs multiple times to get them to fix mistakes they made that end up affecting your grade.", "rating": "Liked", "workload": "5 hours/week", "author": "gIVgXNbSiSYaUJ0Iy1gJ0CaO26B2", "difficulty": "Easy", "semester": "Fall 2018", "time": "1/4/19, 5:09 AM"}, {"comment": "This is an introductory course on information security. It is one of the easier courses which doesn't need not more than 9 hrs per week. I learnt a lot of things which I didn't learn in undergraduate course of mine.", "rating": "Liked", "workload": "8.5 hours/week", "author": "QBo7T9W4nMRGrRtTEXRA0e2sA653", "difficulty": "Easy", "semester": "Fall 2018", "time": "1/7/19, 7:54 AM"}, {"comment": "Course content and quizzes/tests were pretty easy. Projects were of medium difficulty. There were around 20 video lectures, 10 quizzes, 2 exams, and 4 projects. Wish I had more feedback on projects/tests in terms of what I got wrong.", "rating": "Liked", "workload": "8 hours/week", "author": "a9dbtHfMh5XZaPET3w7MMeydRqG2", "difficulty": "Medium", "semester": "Fall 2018", "time": "1/7/19, 12:42 PM"}, {"comment": "This was a fun course. The videos are semi-terrible (sorry Prof's, I know you tried... but the point of a tablet and pen is to USE them, not just hold them and basically have a powerpoint). There is information in the videos you need for the tests, which are sorta tricky and had memorization required. So watch them (2x speed for Ashok and 1.5x for Wenke). The quizzes are sort of a joke, you can answer all the questions with the book. Really the best (and perhaps only truly good) part of the course, are the 4 projects. I feel like I know what stack overflow is, how to examine malware, I have some idea what crypto is and how to attack it, and I know the general concepts of XSS, and javascript attacks.I would not take this course to become a hacker or learn to defend against them -- IF you know anything about the field. You will be bored to tears probably. If you don't know anything about security and want to find out -- it's great.The projects are actually somewhat hard, #1 and #4 were hardest for me, it really depends what your skill set is. I'm good in python so #3 was easy.Also, very important. The TA's were incredible. They were EXTREMELY active and, more importantly -- very kind. It was the kind of professional attitude / human compassion that really brought a lot of life and warmth into the course.Fellow students were also amazing, I know for a fact I would not have been able to complete the 4th project without the tips, advice and help from others, so thanks to everyone.", "rating": "Liked", "workload": "10 hours/week", "author": "I07SekgvkTN0TrDcc4iJuI6XekE2", "difficulty": "Medium", "semester": "Fall 2018", "time": "1/9/19, 10:39 AM"}, {"comment": "With no prior computer security training, this was a great introduction to the field and concepts. Not the hardest class since there's a descent amount of busy work with quizzes and writing papers but 4 projects delve into some very interesting, if basic, computer security concepts. You'll be by no means a l33t hacker but you'll definitely feel like you're seeing the \"under-hood of the car\" if you don't normally program using assembly or command line tools. Some neat tricks, relatively low workload, and fairly good lectures (say no to Isbell!) make it a shoe-in for people new to the field with an elective to spare.", "rating": "Liked", "workload": "15 hours/week", "author": "o2VrhMXkRSbqXihLON4GkyMWACs2", "difficulty": "Medium", "semester": "Fall 2018", "time": "1/10/19, 6:37 PM"}, {"comment": "I found the course to be a good introduction to security. The lectures were fine, and readings were a bit dry. However, the projects are very interesting and helped me to go in depth into the topics: buffer overflow, malware, cryptography and web security. The course involves some C, Python, JavaScript, HTML and PHP. Projects 1, 3 and 4 take some time to complete, so be sure to start early.The TAs were very responsive and helpful in providing guidance on how to complete the project and giving small hints when students were stuck. Piazza was very active and helpful. Recommend as a first course or a summer course, even though the summer schedule is quite compressed (quiz almost every week, and project due every 2-3 weeks).", "rating": "Loved!", "workload": "10 hours/week", "author": "zlT7V1FYTUfEGKjJFmYf22PQNRk2", "difficulty": "Medium", "semester": "Summer 2018", "time": "7/27/18, 6:37 PM"}, {"comment": "Solid", "rating": "Liked", "workload": "6 hours/week", "author": "rQ61CbkDbsUTGGMQhLnNoFa9IwK2", "difficulty": "Easy", "semester": "Summer 2018", "time": "7/28/18, 7:13 PM"}, {"comment": "Professor Lee was a no show on Piazza, which means the TA's ran the course. They did a decent job for the most part. Piazza wasn't particularly active and most of the interaction was via Slack. This meant that a lot of questions about the projects were repeated, over and over, in the Slack channels, along with a wave of activity just before a project was due.The workload was very manageable. This was a summer course, and compared to the workload in GIOS, this required about half the effort.The textbook is atrocious, and is designed to cram as many standards and terminology into the printed pages as possible. The quizzes are verbatim from the book, so you'll need it to do well there. Lectures were much better. The first half of the course is by Professor Ahamad, who rambles a little bit, but sets a nice pace for taking notes. The second half is by Professor Lee, who moves very quickly, and you'll need to pause the video if taking written notes.The projects were the better part of the course, and covered topics such as stack overflows, malware analysis, encryption and web security. Most of them don't take a lot of work, but you'll likely get stuck and need to walk away for a bit. Therefore, you really shouldn't leave them for the last minute.Ultimately, it's a decent introduction to Info Sec for a software engineer. If you are looking to specialize in Information Security as a Security Engineer, you'll need to supplement this class with additional training.", "rating": "Neutral", "workload": "8 hours/week", "author": "z0k64w4i49SKJyUkBsdQBcWJV4t2", "difficulty": "Easy", "semester": "Summer 2018", "time": "7/31/18, 2:09 PM"}, {"comment": "If there is a reason to take this course, it's the projects. There are four projects where you get to experience how near-real-world information security attacks are carried out and how they can be mitigated, including buffer overflow, malware analysis, asymmetric keys, and XSS, CSRF, and SQL injection attacks. Many project tasks were very challenging and there were times where I was nearly pulling my hair out, but then you figure it out and you're on top of the world. The rest of the course felt somewhat rushed considering the summer semester schedule. This involved Udacity lectures (which I enjoy in OMSCS courses), textbook readings (you can just skim for quiz answers), 10 quizzes, and 2 closed-book cumulative exams. Overall the course was enjoyable and I learned a lot, though a good chuck of the information in lectures and the textbook I had already learned once in preparation for the CompTIA Security+ exam a couple years ago. Luckily this course brought back how this information is more useful to me as a computer scientist. The Piazza forum posts were primarily helpful when it came to working through the projects, and there were a number of helpful students on the Slack channel as well. The distributed office hours with TAs can be confusing at times (all live, there are no recordings), but by putting those in my calendar early on I was able to take advantage of a couple of them. I did think it was strange that the only thing that I witnessed the professor's involvement in was the lecture videos, so he must be a busy guy.", "rating": "Liked", "workload": "17 hours/week", "author": "QeYWbWRrbFVofK0jLnPMzB4xtbl1", "difficulty": "Hard", "semester": "Summer 2018", "time": "7/31/18, 5:49 PM"}, {"comment": "There is a huge amount of reading and many long lectures you must do. Can't really skim as much as in some other classes. Project aren't too difficult but teach effectively and are insteresting. Tests are not difficult but are frustrating (poorly written, ambiguous questions).", "rating": "Liked", "workload": "10 hours/week", "author": "EaLcS6wqx5gUU6NTmd9MkYKNDzM2", "difficulty": "Easy", "semester": "Summer 2018", "time": "8/1/18, 12:09 PM"}, {"comment": "This course gives a fairly good overview of most of the topics in information security. The lectures are alright. There are to professors that switch off depending on the topic. I find Wenke Lee's lectures to be very boring since he is just reading something word-for-word.Quizzes are pretty much pointless. The questions are taken straight from the book so they don't teach all that much. However, be sure to stay on top of the due dates because (at least in the summer) they can be a bit erratic.The first project can be a bit challenging, but once you have that ah-ha moment it is pretty straightforward. Be prepared for writing reports for a few of the projects. The second project requires no programming but the first, third, and fourth projects require C, Python, and HTML/JavaScript, respectively.Don't expect the professor to make any appearances. Don't expect much from office hours since the TAs take turns running them, and most decide to have them on the Slack channel which I did not find useful since you couldn't post questions ahead of time and it was difficult to find the discussion later.I would reccomend this as a first course to take, a summer course, or as a course to pair with something more difficult.", "rating": "Liked", "workload": "3 hours/week", "author": "aISgmIzxKogZWcp8QbIfSzTehKr1", "difficulty": "Easy", "semester": "Summer 2018", "time": "8/1/18, 8:29 PM"}, {"comment": "So this was my first summer course, and third overall course in the OMSCS program. Although I expect to receive and A, my feelings are very mixed about this class. On the one hand, three of the four projects were excellent (more on those in a moment). On the other, the quizzes and exams did not really seem to instill in me any huge amounts of security knowledge, and frankly I don't think they added much to the class at all.The four projects covered security topics ranging from low-level stack overflows, to OS manipulations via malware, to RSA algorithms, all the way to basic web browser security exploits. Projects 1, 3, and 4 were the only parts of the class which required coding, and all were adequately challenging and thought-provoking to learn the subject material. Project 2 could use a refactor in my opinion, as it mostly revolved around utilizing a pre-existing security tool on a VM to search for specific exploit characteristics (by search I mean cntrl-F through a few webpages on the VM).As far as quizzes and exams went, if you went through the relevant book chapters, made flashcards of all the bold-faced words, and studied those cards until each definition was burned into your head, you would probably do well enough. This effect could easily have been replicated in my opinion by just handing each student a document containing all those definitions, and utilizing the quizzes for this type of material. A far better approach to the exams would have been some sort of hand-written coding assessment detailing a security exploit, the reason why an exploit occurred, and its fix (very similar to the 4th project's written portion).Overall, the saving grace of this class were its projects. The lectures were also good.PS. From what I understand there is an extra-credit assignment worth 10 whole percentage points given ONLY in the normal Spring/Fall semesters. As the Summer semester did not have this assignment, I think a number of people expecting an easy A were a little surprised by the difficulty of the exams.", "rating": "Neutral", "workload": "10 hours/week", "author": "bjFWOW0L9mcF5u2qOHZSSn3kpdD3", "difficulty": "Easy", "semester": "Summer 2018", "time": "8/4/18, 4:53 PM"}, {"comment": "This was my third class and my first one during summer. Overall I enjoyed the topics and the projects. The schedule felt a little rushed however the subject was very interesting and well worth my time.** Structure **10 quizzes = 20% of gradeOpen book and can be taken many times while open.2 exams = 20% gradeClosed book and proctored.4 projects = 60% gradeStack overflow attacks, malware analysis, cryptography, and web vulnerabilities.** Pros **Covers plenty of topics in Information Security.Information is up-to-date and relevant to the current market.Projects are very interesting and provide hands-on experience.Overall, the TAs did a very good job at managing the class. Questions and grades were answered/returned promptly.** Cons **Quizzes feel like busy work as they are literally taken straight out of the book. It is highly recommended to purchase the suggested book.Professors were completely absent from the class. Maybe they were on vacation?The coverage of each topic can feel a little shallow, but given the amount of information that is covered I can understand why.** Conclusion **This was a good summer course that complements Network Security (both classes are taught by professor Wenke Lee). Recommended as a summer course or introduction into OMSCS.", "rating": "Liked", "workload": "4 hours/week", "author": "zxPTQsZpQfaoaLT2N18XzVr2qb02", "difficulty": "Easy", "semester": "Summer 2018", "time": "8/5/18, 12:30 AM"}, {"comment": "Overall this was a course worth taking. This course covers a survey of security topics, from software security to encryption to the business/practice side of security considerations. The material is not super deep, but I found myself getting very interested in a few of the topics and choosing to learn more on my own. The course consists of 10 quizzes, 2 exams, and 4 projects. The course schedule is provided from the beginning, so it's easy to plan your time in the course well.The quizzes come nearly straight from the books and lectures, and are designed as more of a learning/review tool than something to punish you (each quiz was approximately 2% of the final grade). The textbook is not very great if you're trying to read everything, but I took the approach of printing off the quiz and using it to guide my reading. This worked fairly well. Exams are multiple choice, and also come mostly from the book and lectures. The exams are a level at which is difficult to make a high A, but pretty easy to make a C or higher with minimal lecture/textbook participation.Projects are pretty fun. There is some amount of written analysis for three of them, but it's fairly low key (not a formal report). You'll do things like use GDB debugging to find and exploit overflows in software, look at the effects of malware on a compromised computer, explore some website exploits like XSS and XSRF, and learn to break badly-implemented encryption. Overall there is not a lot of programming - only some minor Python code in the encryption unit and mostly what you're doing is implementing some mathematical functions provided in the lectures. You'll use some Javascript, SQL, and HTML in the web security project, but it's very minimal. Overall the projects are fun and do help the learning process. There was plenty of time to complete them, even in a summer term, and they count for a substantial portion of the grade.The course was mostly run by TAs. The professor was largely absent, but it didn't really affect the course much. The material is survey level, and TAs were able to answer any questions that were had. TAs were competent, polite, and helpful. They responded fairly quickly on any issues that occurred in the course. The lecture videos were not very good - one professor was very long winded to the point of not caring anymore, and the other was very succinct to the point of not learning enough about the material. But it was good enough to learn what you need for the quizzes and exams, so it was fine.It is pretty easy to earn an A or B in this course by simply following the course structure and turning things in on time. It is slightly harder to come out of it knowing the material well. I put in about 6 hours per week on average, not counting some side explorations I did on the material. My suggestion is to take the course and do everything, but leave some room to explore certain concepts more deeply on the side. You'll likely encounter plenty of things you're interested in and need some time to look further. This is a great course for pairing or low-stress summer work.", "rating": "Liked", "workload": "6 hours/week", "author": "5Xa4zOVzKcbHbZ2MRsi35IxjO3I2", "difficulty": "Easy", "semester": "Summer 2018", "time": "8/6/18, 10:04 AM"}, {"comment": "I don't think the structure of this course has changed since it was created \u2013 10 quizzes (20% of grade), 4 projects (60% of grade), 2 exams (20% of grade) \u2013 but I still enjoyed it. The book is quite dull, and has some repetitive content, but reading it is important for the quizzes and exams. Getting 100% of quiz points is easy but tedious, and I would argue that it's worth it for pushing your grade to an A. The exams don't do much to reinforce the content since it means drilling T/F and multiple choice questions, and some of the questions seemed out of left field. The head TA mentioned they are changing the exams for future offerings of the course, but I don't know what this means. The lecture videos are mixed - some interesting, and some just regurgitate the book. The projects are the most engaging part of the course, and do a good job of reinforcing some of the topics. There is so much time to complete each project, and I was able to do the work in a handful of days. I wished there were more of these practical exercises. Grading and feedback is fair, and the TAs are pretty active on Piazza, though the professor is not visible at all on the forums. The peer feedback for this semester was amazing, and anytime I was stuck on a project issue, my fellow students came to the rescue. There are office hours held by TAs, but these are not recorded, and I didn't attend any of them due to my time difference from the US.", "rating": "Liked", "workload": "15 hours/week", "author": "5F6gx1fHF9PV6bQUKaG8qlDXDuI3", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/7/18, 5:34 AM"}, {"comment": "Overall, I thought this was a great class to take over the summer. It wasn't too hard especially towards the end. The subject was very entertaining even if the textbook and lectures could come off dry sometimes. The lecturer for most of the second half was much better than the first lecturer. TAs were very responsive to any concerns we had. The best part of this class by far was the projects. The projects really help you learn the material.", "rating": "Liked", "workload": "12 hours/week", "author": "8XS7IJ6s1xfJFo6TQKimR20IHcw1", "difficulty": "Easy", "semester": "Summer 2018", "time": "8/8/18, 9:16 PM"}, {"comment": "This course was complete rote definition memorization straight out of the book for quizzes/exams. Just use the existing quizzes on Quizlet and you can get at least 70-75% on the exams just from that. (I didn't do the readings.)The lectures are okay- they pretty much just summarize the content of the book.The projects for the most part are worthwhile, but I feel like the grading is overly slanted towards getting very specific points correct. Project 3 in particular had an auto-graded section that I just bombed because multiple answers were dependent on getting certain hashed values correct. Came out with a B solely because of that project. I've heard other semesters had extra credit offered, and it would be nice to have had that opportunity.Overall I would say this course is below-average. When you get things incorrect for the project, the grading isn't helpful about specifying what you should have done differently, which means that the course doesn't offer much as a learning experience beyond what is already accessible in any security textbook.", "rating": "Disliked", "workload": "3 hours/week", "author": "facebook:101533731139153568/", "difficulty": "Medium", "semester": "Summer 2018", "time": "12/18, 6:19 PM"}], "difficulty": 2.333, "enrolled": 907.0, "id": "CS6035"}, {"rating": 4.444, "workload": 17.848, "withdrew": 0.0, "comments": [{"comment": "This is a very good introductory course on operating systems. I did not have undergraduate CS background. The course is very hard for me but I learned a lot. Familiar with C is a plus. Projects took tons of time even though they are only weighted for 40%. To prepare for the exam, I watched the lecture videos several times and I think that helps.", "rating": "Liked", "workload": "20 hours/week", "author": "wajI1ZJN4QNDh2kWy7CYpHmbOUA3", "difficulty": "Very Hard", "semester": "Fall 2018", "time": "11/27/18, 8:08 PM"}, {"comment": "This was my first class. It was a wonderful introduction to systems concepts.While there are people that picked up C along the way, I was thankful that I took CS50 on edx prior as it introduced me to memory/pointers, C data structures and makefiles. There were plenty of other items that one needed to learn on the fly as they started the class and it was good to get some C knowledge first.Some architecture background (for example registers and caches) is a nice to have but it is possible to figure it out during the semester.Overall, I found both the projects and exams hard but doable. This was a great class.", "rating": "Loved!", "workload": "20 hours/week", "author": "jk5nanoLtYh6zBEsF9x86UxyuFs2", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/9/18, 8:17 PM"}, {"comment": "This was a very well--organized class. The TAs were very involved. Tony was great. I think the lectures are easy to understand. I got much better at C programming from this course. As someone who's a software engineer, I found I was pretty familiar with most of the concepts - the course doesn't delve too much into detail, so I maybe didn't learn as much as I expected. The midterm was manageable. I did almost 0 work on the weeks there wasn't a project due, and up to 15 hours to complete a project (though less for others). Would definitely recommend as a first class, it's not too hard. The concepts are kind of all over the place so detail is spared throughout the course", "rating": "Liked", "workload": "3 hours/week", "author": "nheiVQ4FeAVEO3cN0MnFtd5nsr13", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/10/18, 11:03 PM"}, {"comment": "I really enjoyed this class and am a little sad it's over. The material is not ridiculously hard but there's a lot of it, particularly in the 2nd half of the course. In order to succeed, I recommend 3 things:Join the class slack. There's a lot of collaboration among students in exam and project channels. You can get a lot of help from your fellow classmates.Know C. Make sure you understand the concept of pointers (including pointers to pointers and pointers to functions) and working with strings. You can learn as you go but it's helpful to know something ahead of time.Start projects early. I can't stress this enough. You have 4 weeks for pr1 (probably less in Summer) which seems like a lot but there are 4 different parts, each with a client and a server. Project 3 is also a huge undertaking.For the most part I really enjoyed the projects. There are some repetitive components (by project 4 I was a little tired of multi-threading things with pthreads) but each project had us working with different components. Project 3 has a significant design component and you aren't given much direction regarding how to implement your solution. I had many moments of frustration but the end product is something I was extremely proud of.The exams are challenging, ensuring that you understand the material and didn't just memorize facts. I found the final much more challenging than the midterm.", "rating": "Loved!", "workload": "15 hours/week", "author": "vqKBxfk5VUTEOGVfUJwEpyD0hm82", "difficulty": "Hard", "semester": "Fall 2018", "time": "1/23/19, 1:24 PM"}, {"comment": "I loved this class. Professor Ada went above and beyond to be involved with the class. She was very responsive via email (I literally got a response back within hours) and did weekly office hours.The TAs for this class were extremely standout. They're always hanging out in the 6200 Slack (one of the TAs actually paid out of pocket to host a private Slack instance so that there's search history available for everyone, which is extremely useful for the projects). They're always around to offer hints and help with the projects.The lectures themselves were long, but really great and informative. The readings for this class were also extensive, so prepare yourself. However, watch the lectures first and then do the reading. Professor Ada does a great job in making the papers a lot easier to understand.This class is no walk in the park, but it's also not hard as long as you try to stay consistently on top of the lectures. All of the projects are released about a month ahead of time, so get started the first moment they open. I also know the first instinct for a lot of people when met with coding problems is to charge ahead and start coding. I highly advise you to not do that. First, read through the README. And then maybe do it again. It might leave you confused, but they're extremely thoroughly worded to help guide your architecture of your programs. Then, read through all of the code. (Everything is in C, so start brushing up on C, particularly with string manipulation and pointers.) I found it extremely helpful to read through everything and then leave comments with TODOs to mark up the entrypoints of where I needed to code.The midterm and final were also pretty challenging. The course covers a LOT of content, so study up on the study guide and the sample tests that are provided. Make sure you are VERY solid on the math portions towards the end of the semester, since they are likely to be heavily tested.This was my first course in OMSCS and I'm really looking forward to the rest of the courses if they're all as fun and engaging as this one. I don't have an undergrad CS, nor did I have prior experience with C (though I code everyday in Golang and dabble in Rust, which helped a lot), so don't be afraid to come into this course even if you have experience with neither. You can definitely pick C up along the way if you start your projects early and do a lot of Stack Overflow/Googling.", "rating": "Loved!", "workload": "10 hours/week", "author": "iukRspsQvnNvi4R4cQBK5qlgLQL2", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/14/18, 4:54 AM"}, {"comment": "3 projects, a midterm and a final make up the grading with 1 additional project for extra credit that's only graded if needed as well as class participation.First and foremost, this is a fun and worthwhile course. You can tell the professor cares about the topic and about the students. The TA crew is phenomenal and there's a dedicated private slack for the course.That being said, if you don't know C or can't recall your C-fu from many moons ago then be prepared to double your workload. It's all C, all the time in GIOS. As a web developer, I had forgotten most of the C I had previously learned and probably spent 40+ hours on project 1 but YMMV based on your C competency. You may not enroll as a C developer, but you'll certainly leave as one.The exams are difficult and are a combined 55% of your grade. The final had something close to 20 dense lecture hours and the questions were definitely indicative of that.All of that may sound ominous but if you put in the work then you're likely going to get at least a B AND learn a ton. There aren't any free lunches in GIOS, but there is a generous curve that rewards those who keep working and stick it out. This course currently has about a 40% drop rate, but it also has about a 40% A rate.I wish I would have taken this course as my matriculating intro course to the program.", "rating": "Liked", "workload": "20 hours/week", "author": "Dx7SJYvYYXa1ku0gXHSQvoxWghp1", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/17/18, 12:35 AM"}, {"comment": "Overall, I really thought this was a good course. I have a BSc in CS, but it's been a few years, and I don't work in the industry. While I did have an undergrad OS course, I thought this one covered the basics, but also went deep enough for a graduate level course.The projects were the high point. They were well structured, and had just enough framework in place that you had to do around 50% of the work to complete the project, but didn't have to reinvent the wheel (for parts that built on previous parts, there was either code or binaries to fill in the previous work). Exams were very fair, but take them seriously - they are written in such a way that you can't BS your way through them. They really do test your knowledge...I would highly recommend this course as a first course.", "rating": "Liked", "workload": "10 hours/week", "author": "l50Yb1FNwxZTr7PA2bumDbrMv253", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/17/18, 11:53 AM"}, {"comment": "GIOS was the perfect start to OMSCS. The course is managed really well. Prof Ada and TA's are very involved. The content is good, projects are challenging and exams are tough.There were 4 projects ( a 2nd one was an extra credit project). The project were in C. I had minimal exposure to C and that made project 1 really challenging. By project 3 I was fairly confident in my C skills. Project 4 was fairly easy as compared to the other two.The mid-terms and final term exams were tough and application based.I would highly recommend this course.", "rating": "Loved!", "workload": "25 hours/week", "author": "gwJTvNI638M6r7cnFV2T0h7lOoA3", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/17/18, 8:05 PM"}, {"comment": "Hard course, but I loved it and found it incredibly valuable.Projects are tough, but rewarding. Echoing many others here, make sure you are proficient in C. Not just familiar, but proficient. Otherwise, budget for 1.5-2x these listed workloads.The tests are hard, but fair. The most challenging part of the exams I found was simply budgeting time to study properly. The projects were often so demanding that I lacked spare time to keep up with and review the weekly material properly. Instead, I had to scramble a bit to catch up about 2.5 weeks ahead of the two exams. This works, but at the cost of better long-term retention.", "rating": "Loved!", "workload": "25 hours/week", "author": "Dn6G6AuXoUZr2KrioNGnJL5YAju1", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/17/18, 10:42 PM"}, {"comment": "This course offered a good amount of introductory material about operating systems. We had two exams (midterm and final) that where both closed book/closed notes and 3 Projects with the option of a 4th extra credit project. Each exam covers a good amount of material and concepts to master. I found this to be the more challenging part of the course as you must understand the concepts well to do well in the exams. I recommend watching the lectures a few times while taking notes and making sure you understand all the concepts prior to moving on to the next lecture. The projects were time consuming but doable. I used one of the recommended books as reference for the projects and found it to be a great resource (Linux Programming Interface book). I would recommend using safaribooksonline (it is free for gatech students) to get access to this book and other books the professor and TAs mention as reference (C programming books, etc.)", "rating": "Liked", "workload": "10 hours/week", "author": "ynUPQyTWsdRt4VHlDCDXLRHMvrM2", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/18/18, 10:18 AM"}, {"comment": "My Background for Reference :computer science undergradprofessional software engineer for 2.5 years experienced in Java, Python, and JavaScriptrusty on the CThis was my first course in the OMSCS program and I took it alone, which ended up being a wise choice. While it wasn't terribly difficult, it was definitely time consuming, even if you have solid programming skills. The course is very organized. All the information to succeed is pretty much given to you. There are study guides as well as practice exam questions which will help you target your studying.The lectures are very well put together and must have taken a ton of time to create initially. Each week there is a lecture that takes anywhere from 3-5 hours to watch if you do any decent note-taking. The concepts are well-explained and will give you the material you need to do prepare for the projects and exams. There are research papers that you are recommended to read as well. Read them if you can. If you can't it's not the end of the world.I learned the most when preparing for exams. If you study appropriately, you should do fine on the midterm. I re-watched lectures and did the study guide and sample questions. It felt like there was much more material to cover on the final. I studied much more for the final and felt way less prepared for it.The material seemed more difficult as well, so study smart. I skipped a good chunk of the research papers in the second half of the course.The projects were the best part of the course. The instructions are pretty clear and you'll learn a ton coding them. Definitely join the Slack channel; I gained invaluable information from other students that I would have never figured out on my own. Disclaimer: I take a while to do assigments.Project 1 (various client/server programs):very time consuming since it is really like 4 mini projects in one; I probably spent around 70-80 hours on it, give or takeprobably takes the longest since you're getting a feel for the course and ramping up your C skillsif you can get through this one, you should be fine for the restProject 2 (extra credit):1.5 page paper designing your own experiment based on prompts they provide; maybe 8 hours on the high endonly graded if you're on the edge of a letter gradeProject 3 (Proxy Cache Server):There is much less hand-holding on this assignment and you will have to come up with your own designprobably took me 50-60 hoursProject 4 (RPC):this one is mostly learning the RPC librariestook me probably 20 hoursOverall, it was a great course and I learned a ton. I'm using this as a segue into Advanced Operating Systems.", "rating": "Liked", "workload": "20 hours/week", "author": "Wk92nZZYpmWmY2rkWhi6wjG0ulU2", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/19/18, 7:32 PM"}, {"comment": "The course was extremely stream lined and well organized. There is a strong interconnect between project and lectures. Prof. Ada was highly engaged and passionate in driving the course. Her office hours were regular, and she took the pains to clarify doubts students had. That said, this class also expects a lot from students; it does help if you know C, but even if you don't, expect to put in a lot of efforts into projects. Lectures are detailed, with a lot to unpack with an array of tough to understand papers. However, it helps to ask for help, and no question was treated as a dumb one.Exams were not very tough, but they really tested your knowledge, especially the math portions that cannot be guessed. TAs were also very knowledgeable and supportive, especially Tony, Hobin, VJ and Ioan. The class communication is usually through Piazza, but the slack channel was very active, especially after the release of a new project.I'm impressed with this course, because everyone involved was genuine and had a real interest in making sure the students understand OS concepts.", "rating": "Loved!", "workload": "20 hours/week", "author": "tabiEMuKL0hRlfhdUNgrY5Q2Idq1", "difficulty": "Very Hard", "semester": "Fall 2018", "time": "12/27/18, 5:12 PM"}, {"comment": "Great but difficult course. The language used is C in on a VM running Linux. This was my first time really using Linux and a VM so the initial start/setup was difficult for me but once i got everything up and running. it was better. Still difficult, involving multi-threading clients/servers and ways to lock data from other processes. Not recommended for a first course and make sure you watch all the lectures in order to complete the projects. TA's are helpful and other students in slack channel were very helpful.", "rating": "Liked", "workload": "8 hours/week", "author": "PAnVwMDcKOhxu9wApW7WqDawilu1", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/31/18, 10:28 AM"}, {"comment": "I highly recommended this classes.The prof and TA are highly involved and very responsive. Prof. Ada answers question on Pizza and weekly office hour (via Youtube live). The TAs mostly response via Pizza and Slack.The courses has 3 coding assignments and two exams (mid & final). The courses also provides lots of chances for extra credits. The most difficult assignment is the 2nd one; the first one is also challenging if you don't know much about C (like me).If you want to take this class and are very new to OS and how the underlying hardware works, I will recommend reading the book \"Three Easy Piece\". It's very related to this course.", "rating": "Loved!", "workload": "15 hours/week", "author": "3lY5w4LxWqVvOj14vbGN1UOLvQm1", "difficulty": "Hard", "semester": "Fall 2018", "time": "1/5/19, 8:24 PM"}, {"comment": "this was my first omscs class and i do not have an undergrad degree in cs. it was not a good first class for me since i was not good at adjusting to this whole studying after work thing and getting into the routine of it all with a significant workload waiting for me.the material difficulty was not high, but i struggled at first since i found the course lecture videos very tedious and useless. the professor read the slides word for word most of the time and provided little depth or clear explanations. eventually i figured out that i really should be reading/watching other materials to actually learn the subject matter and then watch the official lecture videos to get a sense of what we were expected to know.the papers i gave up on reading after the midterm, thankfully other students put together summaries and the stuff you need to know is covered in lecture videos.the projects were challenging and fun(like a 80/20 split), i had 0 C experience going into the course. START EARLY.", "rating": "Liked", "workload": "25 hours/week", "author": "xVWjSIfSW7Po6TnFMzE2JrSY0tz1", "difficulty": "Hard", "semester": "Fall 2018", "time": "1/7/19, 1:57 AM"}, {"comment": "I loved this course. The prof is amazing, she is always available, mostly helping students clear their doubts. The TAs are also proactive and will help you in all aspects of the course.", "rating": "Loved!", "workload": "15 hours/week", "author": "4P7vGkMMwcfY1dbllHU7jOHiKO02", "difficulty": "Medium", "semester": "Fall 2018", "time": "1/7/19, 3:20 AM"}, {"comment": "This is the hardest course for me so far (my third class). I had a little C program background and didn't have any OS class before. The concept was intensive at the beginning because of all the new terminology and mechanism, policy, abstraction so on so forth. So is the first project. To a lot of people experience programmer, it might be just a review but for me, it was a catch-up. I spent more three weeks just doing warmup part of project 1 (worth 20% of project 1, probably only earn me 2 points of 100 final grade). And don't think it will get better, it will get worse on project 2 and worst on project 3 in term of the workload.I thought won't be liking the close book mid and final much. But I was wrong, the reviewing process before the test helped me to look into the concepts and practice the quiz and calculation on my own. The test is still hard but you learned from it. I like the TAs, they are very active in Piazza and on Slack channel. I also think and thank that a great class attracts a lot of great students, learn with them and from them is another gain in this class. Cheers to my classmates!", "rating": "Loved!", "workload": "25 hours/week", "author": "TVMuhcH8hNUShV4FV083Is3NJPR2", "difficulty": "Very Hard", "semester": "Fall 2018", "time": "1/8/19, 9:49 PM"}, {"comment": "I actually took Intro to OS in Spring 2019, but I had to drop it before the first project is due. I strongly recommend that you have a STRONG foundation in C before attempting this course. There are people who do well with little knowledge of C, but I am a professional develop in function languages and I found the first assignment VERY time consuming to correctly finish. I previously took an Introduction to C programming course a few years ago, so I felt I would be OK for this course. If you are looking for an A or a B without a VERY high amount of stress, I strongly recommend you take a few non-graded MOOCS in C and read at least a few books before attempting this course. I am a functional programmer for my day job, and I found the first project to be very challenging. Also, begin the assignment as soon as it is assigned, because TA's can be difficult to reach outside of office hours.", "rating": "Neutral", "workload": "30 hours/week", "author": "etzTifuAV3cQKWAVR8pAmtSrQt23", "difficulty": "Hard", "semester": "Fall 2018", "time": "2/12/19, 10:00 PM"}, {"comment": "As someone new to the concepts of OS, I enjoyed most of the content of the course. The lectures were put together well and mostly managed to keep my interest. I haven't taken the final yet, but the midterm was pretty fair.The projects are the real weakness of this course. The first project was a little bit interesting and forced us to get familiar with concurrency patterns. The trouble with this project was that the autograder became super flakey about a week before the deadline. It seems to be the fault of udacity, so I don't blame the TAs for this part. I found it frustrating, however, when I lost points due to grader malfunction and the TAs were nowhere to be found when it came time to adjust for the false negatives.The later projects did not have these same technical issues, but they were incredibly tedious and, IMO, not very educational. They essentially took the form of: 1) implement and utilize this one concept from lectures 2) now make it multi-threaded. Enough with the concurrency, already! I learned nothing during the second and third time making something multi-threaded. Oh, and the second project asked use to call a curl library. What is point?If you enjoy writing boilerplate C code, maybe you'll enjoy these projects. For me, they were a massive waste of time and energy and did little to reinforce the concepts of the course.", "rating": "Neutral", "workload": "12 hours/week", "author": "zmKcBlwbvdWeUbDyKQ4IgsTti6y2", "difficulty": "Medium", "semester": "Summer 2018", "time": "7/24/18, 11:54 AM"}, {"comment": "3 projects, 2 tests. The tests are fair enough. However, warning to anyone taking this during the summer, this class can really get away from you quickly and there is a ton of material.The projects are by far the worst component of this course. The instructions for projects are extremely vague, leaving much up for interpretation or having to ask TAs for clarification. You will spend most of your time researching and learning the various internal and external APIs rather than programming anything cool. The code for the APIs are extremely messy and extremely difficult to work with in my opinion. Also, there are a limited number of submissions that can be made to Bonnie per day which makes it more difficult to test your programs. Therefore, you have to spend additional time developing your tests on top of the already tedious and time consuming projects.In combination of the mundane material and frustration at the vague projects. This class has been miserable. I'm just glad it's over.", "rating": "Strongly Disliked", "workload": "12 hours/week", "author": "hmkpc4oCrHYGXvrsEWjfiD820n92", "difficulty": "Very Hard", "semester": "Summer 2018", "time": "7/28/18, 4:28 PM"}, {"comment": "I did not have any experience in C, and this was my first exposure to operating systems concepts. Prior to this class, I took ML, CV, AI, and RL. Prior to this class, I read through OSTEP and Computer Systems: A Programmer's Perspective, to prepare.The projects pushed me to ramp up my knowledge of C very quickly, and apply concepts learned in class.The TAs were the most responsive I have ever seen, replying in less than half an hour in many cases.Most useful feedback I have ever received on an assignment, for project 1.Professor Ada was very involved. She knew the ins and outs of every assignment, and held weekly office hours.Professor Ada and the TAs were transparent about why they weighted the exams and assignments the way they did, and how they graded. They were also understanding with regards to Bonnie issues, and the TAs helped us out with local testing.Deadlines for the first two projects were extended.It was a very collaborative environment. Students helped each other out with enthusiasm. The interop testing especially in Project 1 was very useful.Resource recommendations were excellent: I will likely continue to refer to OSTEP, The Linux Programming Interface, and Beej's Guides in the future.The instructors actively solicit feedback for every project, and this shows in the quality of the projects. The projects came with clear instructions in a readme, helpful tips, and no mistakes in the code. I liked that we were required to document our approach and think about ways to improve each assignment. This enhanced my understanding and retention of what I learned while doing the project.I wish we could have gotten our grades and feedback for Project 2 before taking the final. Perhaps hiring more TAs would help, but maybe the class budget is constrained for summer semesters.I also have difficulty learning from video, without an accompanying textbook. I was grateful for the class-compiled transcripts, but it was a bit hard to follow since it was just verbatim. I liked OSTEP and The Linux Programming Interface, but to do well on the exams, we really have to focus on what is presented in lecture. It is probably too much to ask, but it would be great if there was a guide (similar to Beej's, perhaps) for the course. Maybe I'm a rarity though, and most students learn perfectly well from videos.It would have been nice to see our answers alongside the correct answers for the midterm, but that's not too important.I didn't find the exam guides very useful --- I would have preferred more questions in the style similar to that of the actual exams. The quizzes and sample questions in udacity helped, but there were only so many of them, and I found the questions on the midterm and final to be much harder.I found the papers very dry, took the advice of one previous reviewer, and didn't read them. The lectures cover the points that may be on the exam.Overall, I love this class and would absolutely recommend it to anyone.", "rating": "Loved!", "workload": "20 hours/week", "author": "Q23NRP1XGlaWhnFpeKtvW7rIBlw1", "difficulty": "Medium", "semester": "Summer 2018", "time": "7/30/18, 5:49 AM"}, {"comment": "This course was my third course in the OMSCS and I chose it after seeing its great reviews here.The course provided a lot of insight on the inner workings of OSes and had 3 projects rather than the usual 4 due to the relatively shorter summer semester.Projects were all in C and pretty challenging especially if one hasn't worked with C. Make sure you know abit of C before thinking of starting out on this.Assigned readings were interesting and relevant. Best part are they were manageable and easily understandable if read after watching the lectures.Lectures from the instructor are great and exams were very challenging but fair. The instructor and her TAs are great providing alot of insight and help on Piazza and during office hours.In general, I found the content really great and this is must do course for any one interested(even slightly) in OS stuff.", "rating": "Liked", "workload": "13 hours/week", "author": "2mbBTQUsQUU1XvYGp6HfNw83Gkk2", "difficulty": "Hard", "semester": "Summer 2018", "time": "8/6/18, 4:27 AM"}, {"comment": "This course covered the basics of OS constructs and theory and does it very well with the exceptionally made lecture videos.The TAs are indeed something else - they are extremely hard working and will bend over backwards to help you in times of need. They're absolutely world-class.One thing that almost made me hesitate to rate this a 5* course was that the projects seemed to be more about applied knowledge rather than the actual theory behind the OS constructs. The projects were basically creating multithreaded HTTP and file servers, parsing network packets, and calling RPC servers - projects that I would expect in a networking class. I was expecting projects more along the lines of writing a simple, primitive OS? Maybe these projects are in the next class (AOS)? For what the projects are, they were well designed, fun, and were sufficiently challenging and thought provoking.Like all OMSCS projects, procrastinate at your peril. Some projects may appear simple until they aren't because of some small thing that just refuses to get resolved. Project submissions are limited to 10/day.You don't need to know C to do well in this class - it appears a good number of people in the class had no previous C (or even programming) experience. But knowing at least about pointers and gdb will save you a good number of hours of struggling. Even someone like me who makes a living writing C found some of the projects to be tricky. It didn't help with taking this in the summer with the compressed schedule.The midterm and final needed a good bit of studying to do well on. They really tested a thorough understanding of the subject matter.There's a TA-run private Slack channel specifically for this class, which was very useful in digging up older, informative discussions. (Remember to contribute to the slack fund, you mooches).", "rating": "Loved!", "workload": "17 hours/week", "author": "kEUKFU3QJTdgl9kl08AFkq2esZH3", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/6/18, 6:12 PM"}, {"comment": "Very good course if you want to practice your C and write Multi-threaded code for client/server applications.", "rating": "Loved!", "workload": "25 hours/week", "author": "bBbu0oZg8fU19il18Za4j8qehDl1", "difficulty": "Hard", "semester": "Summer 2018", "time": "8/18/18, 2:58 PM"}, {"comment": "A great class! For people who is not majored in computer science before, this course will significantly improve your understanding of basic computer component such as operation system, kernel, CPU etc. The projects are somehow difficult, but if you start earlier, those projects are definitely accomplishable", "rating": "Liked", "workload": "15 hours/week", "author": "CnzLpXdnZGXbeQQAmujuq3gvp2G3", "difficulty": "Medium", "semester": "Summer 2018", "time": "10/22/18, 12:31 PM"}, {"comment": "This course taught by Prof. Ada is very well run. The lectures do a good job of explaining the material and Prof. Ada holds regular office hours to help clarify things. Her involvement was very helpful. The TAs were very good in this course as well, but grading was a bit slow. I took this as my second course in the program. I took it in the summer, so there were only 3 main projects instead of 4, and then there was a midterm and a final. There were also a few required papers to read. If you are comfortable with OS implementations and how they function and are comfortable writing in C, you could probably skip this class. But even though I had an undergrad OS class about 3 years ago, I found this course to be sufficiently challenging and I learned a lot from it.All the projects are programming in C and they can take quite a bit of time to work through and debug, especially if you aren't super comfortable writing and debugging in C. The assignments were available early enough to allow you to have enough time to work on them. The midterm and final are closed book and fairly difficult and are carefully worded to make sure you understand the material. But there is a generous curve in the class. If I remember correctly, somewhere in the low to mid 80s usually ends up being an A, and somewhere in the low to mid 60s ends up being a B. I would highly recommend this course and I think if you put in the work it's not too difficult to pass.", "rating": "Liked", "workload": "13 hours/week", "author": "se0k7bFAdfM8EpTPnnAuhtJEUxx1", "difficulty": "Medium", "semester": "Summer 2018", "time": "11/5/18, 8:09 PM"}, {"comment": "The instructor, ta's and piazza/slack channels where a great help in this class when doing the projects and exams. If you keep up with both pizza and slack, youll have an exponentially easier time with the course material and exams than if you ignore them. Glad to have taken this class as my first class in the omcs program.", "rating": "Loved!", "workload": "15 hours/week", "author": "iG3yQl35UpMJJL8YMpJyFf5MLCz2", "difficulty": "Very Hard", "semester": "Summer 2018", "time": "1/4/19, 1:08 PM"}, {"comment": "This was an excellent course with interesting programming assignments. Highly recommended!", "rating": "Loved!", "workload": "10 hours/week", "author": "MgirjMhS5SYLw73NHeMqufPAhrN2", "difficulty": "Medium", "semester": "Summer 2018", "time": "4/3/19, 1:01 PM"}, {"comment": "Overall, this class was really well ran. Appreciated the active TA community and that Ada was present / hosted most of the office hours. The number one thing I would suggest (like many) is to start the projects early. I didn't do that for the second project and greatly regretted it.The projects were my favorite part of class but also can be extremely time consuming, knowing C is very helpful and suggested on class pre-reqs. The tests weren't cumulative and were written fairly. But keep in mind the second half of class had considerably more content than the first.Overall, great class and glad it was my first in the program.", "rating": "Loved!", "workload": "15 hours/week", "author": "XGaU42aBN7Pn0jYEjzRb5aCcFDq2", "difficulty": "Hard", "semester": "Spring 2018", "time": "4/29/18, 3:13 PM"}, {"comment": "This was my first class in the program and I absolutely loved it. Coming into this I was hoping for a solid introduction to OMSCS, computer science, and C and I would say that it was very successful on all fronts. I\u2019ve consolidated my thoughts / tips about the class below based on topic.ProjectsThe project code always contains a base set of functionality which you enhance. PR1 for example gives you most of the code for a working C program, you just need to cover the business logic (creation/parsing of a GETFILE protocol message).TA\u2019s always provided the CMakelists file if you prefer to use CLion and that also makes things easier.PR1 \u2013 GETFILE PROTOCOLI had very little C experience before this and I was a bit scared coming into the first project. Consequently, I began PR1 as soon as I could and finished about two weeks early. I spent a lot of time in the beginning establishing best practices for how to do things. It forced me to work slowly and do a ton of research on various C aspects, but by PR3-4 I was very confident in my C ability.PR2 \u2013 Extra credit research projectI went above and beyond and did the experiments, which was not required. It took me about 4 hours to complete.PR3 \u2013 Shared memory-based IPCThis one was pretty easy for me. I completed it in about 6 hours total, including both parts.PR4 \u2013 RPCThis program is basically PR1 and PR3 where RPC abstracts all of the communication. It\u2019s pretty easy, but took me about 12 hours to complete because I stumbed on the MT section.Knowing CI was completely new to C coming into this and excited to get some exposure. The first project will force you to use strings. Working with strings in C can be challenging. If you're like me and eager to learn new lower level languages, this class is perfect for you.The other thing that was pretty complicated was the implementation of a thread pool. You don't have to do it like this, but in terms of performance its the best way. Once you get a working thread pool implementation, you can use it for subsequent projects in the class.TestsTest 1 \u2013 25% of your grade. I found it harder than the second exam. Median was a 76%.Test 2 \u2013 30% of your grade. IMO, it was easier than the first exam by a long shot.TAsOverall, the TAs were highly responsive, but very shame based. I suppose it\u2019s an industry problem. The expectation is that you know the readme very well. Questions about well defined things on the readme or C related questions you can google will get you ridicule. Always try to find the answer on your own before you ask.TipsUse the study guide to study for the test. It seems obvious but, I studied everything I could get my hands on for the first test and felt like I made it much harder on myself. I found that other students were doing similar things. Since this is an introductory class, there are certain topics in which the rabbit hole goes deep. Make sure that you\u2019re studying the material as it relates to GIOS.I would strongly recommend using CLion. They make an IDE for every language used in the OMSCS program and its heavily used in the industry. I ended up installing this on my Ubuntu VM and using it from there.There is a slack for this class and I would recommend it. The TA\u2019s are very responsive.I would recommend the environment setup they use. I tried doing PR1 on my mac and had all sorts of problems.For debugging, there are a few tools which will make your life easier. I found these to be most helpful:Telnet \u2013 must have for the first part to test your server before you finish the clientWireshark \u2013 to confirm whether client or server is breakingCLion debugger \u2013 self explanatoryThere is always a performance metric component to the test. These are based on the readings assigned during the semester. Know those very well, it\u2019s low hanging fruit on the exam.Execution flows are a big part of this class. If you don't understand the math, I strongly recommend that you draw out the flow. The questions on the test are usually small enough that you can draw them out to achieve the answer. This is what I did for test 1 and 2 and it worked out well.At the end of the class, they added a lot of material and I felt like the amount of time required increased per week. Take this into account after the midterm and stay on-top of your lectures.Some of the last readings are unnecessary and very long. The RPC reading, for example, is unnecessary, dense, and 40 pages long. Since it was not present on the study guide, I skipped reading it altogether and it paid off.", "rating": "Loved!", "workload": "12 hours/week", "author": "mK22RSHBJpOcqNjLZK0T0vZ4ux62", "difficulty": "Medium", "semester": "Spring 2018", "time": "4/29/18, 5:22 PM"}, {"comment": "This course was very challenging for me because I did not have any prior experience with C (despite all of the warnings). If you already know C, then you're probably fine and this might even be alright to take as a first course. I would definitely not recommend following the approach that I did though by thinking I could pick up C on the fly; as far as I can tell, I spent way more time on the projects than most of my peers, and most of that time I was way out in left field anyway. If you're still determined to take this course without knowing C first (hey I get it, I was stubborn too), then do yourself a favor and go pick up a copy of The Linux Programming Interface (I found one pretty cheap at a local used books store) right now, because it'll be your lifesaver for the first few projects.That said, even though I really struggled with the programming assignments, I still really enjoyed the class and feel like I learned a lot from it. The lectures are great: clear and easy to follow; the professor actually does office hours every week and goes over some great and useful stuff; the TAs are super helpful (and a pretty funny and entertaining bunch on Slack!); and all-in-all the course was very well organized. I am definitely going to miss this class!", "rating": "Liked", "workload": "38 hours/week", "author": "7OXexWMRhQh9wboLIdTV3MyL8br2", "difficulty": "Very Hard", "semester": "Spring 2018", "time": "4/29/18, 11:26 PM"}, {"comment": "Great class and great introduction to the OMSCS program for me. I came in without much background in C and found the projects(especially the first one) to be hard. If you know C well then you won't have this problem. I spent a significant amount of time catching up on C. The class material was not that complicated. The instructor is very clear in her explanations and was present almost every week during office hours. One of the best things about this class was the slack channel and the TAs on there. They were very active as were the fellow students and it was fun discussing projects. The class is very well run and I highly recommend it to anyone. Ended up with an A.", "rating": "Loved!", "workload": "20 hours/week", "author": "gbWBLxTBR3ajgkp1CRvi1myuteB3", "difficulty": "Medium", "semester": "Spring 2018", "time": "5/7/18, 8:40 PM"}, {"comment": "Great class. As someone who did not know C before taking it, some of the projects were BRUTAL. However I learned a ton, much of which is applicable to my work and any software development job.Highly recommended if you feel like you have a gap in knowledge in what is happening under the hood when the code is running, what is really happening with threads and memory, etc. At the end they go into virtual machines, distributed computing and cloud computing which was really interesting too.The class was extremely well run, the Professor and TA's were always available to assist and answer questions on Piazza. Even on Sundays sometimes!I did not like how heavy the grading favors the tests - I spent 100+ hours on the projects and probably less than 10 studying for the exams, but the exams are weighted as 60% of grade. However this may be necessary because projects do not go into a lot of the information presented in the course. And apparently last semester the curve was such that a 55% gave you a B, so maybe it doesn't matter too much.", "rating": "Loved!", "workload": "15 hours/week", "author": "wVtJiEwHfScskw1Rc6Nuvz6C05a2", "difficulty": "Hard", "semester": "Spring 2018", "time": "5/1/18, 5:25 PM"}, {"comment": "This was my first class in the program, and I really enjoyed it. I came into this course with plenty of C knowledge, and I thought I understood Operating Systems concepts well (turns out I did not). I would say with my background, this course is more like a medium difficulty because of the amount of content, but for those new to C or OS concepts, I suspect it would be quite hard. That said, it is an achievable course, and with the generous curving policy it does not aim to make your life difficult. If you complete the work and give the class a fair shot, you will probably earn a B. Earning an A takes a bit more work.Projects are described in better detail on other reviews. With my C background, Pr1 took about 10-12 hours, Pr2 took about 4-6, Pr3 took about 8, and Pr4 took about 5. I would say they are difficult, but at no point did I feel like I was lost without any clue what to do next. If you reference the readme, make use of search functionality in Google, Piazza, and Slack, and when that fails, ask relevant questions, the projects are quite achievable without any existing C knowledge. But I will admit they would be quite difficult if you haven't been exposed to much C. I would say you could double or triple my times if you're trying to learn C along the way. It would be a good way to learn C, for what it's worth.Exams are difficult. I thought I understood OS material already, but the course went much deeper into how things work under the hood. It does a good job of exposing you to important academic research in the field, and gives you some of the early building blocks of how things came to be. The exams are multiple choice and fill-in-the-blank for calculations, but they are far from easy. You will not do well if you haven't absorbed the lecture material and given the paper readings a fair shake. The exams are both quite fair, though. The practice questions provided give you a very good view of what will be on the test, but again, they are not easy.The course makes it very easy to participate. A TA has opened up a private paid slack instance which to me was invaluable this semester. It allowed many people a place to get more instantaneous help with projects and material, as well as get to know each other and create decent relationships, for an online program. If Piazza isn't your thing, this is a great resource to have. Either Slack and Piazza participation counts for a small portion of the final grade, but there are plenty of opportunities to contribute.My advice on this course would be to brush up on basic C concepts, and hit the ground running. Use the first week to get ahead on lectures and readings, so that when the first project comes out you can start work immediately. The only people I observed struggling with it to the point of not completing it were those who started it halfway through the deadline. There is generous time given to complete the projects, which makes it ripe for procrastination, but do not. I would also advise you to get ahead on the second half of the course - the material on the final is about 2 times the content of the material on the midterm, so work quickly through that material to allow plenty of time to review for the final.If you come in with some interest in the subject, it is a very rewarding course. I like that it doesn't hold a grade over your head, which helps with enjoyability... but you do have to do the work to obtain it. In my opinion it makes an excellent first course, as it is well-run, the TAs are available and helpful, the professor actively participates despite the large class sizes, and the projects are well put together and help expand on the material you learn.", "rating": "Loved!", "workload": "13 hours/week", "author": "5Xa4zOVzKcbHbZ2MRsi35IxjO3I2", "difficulty": "Hard", "semester": "Spring 2018", "time": "5/2/18, 7:23 PM"}, {"comment": "Great class. I learned a lot from the projects and the lectures were clear and well planned. Definitely get started on the projects early and having some knowledge of C is a must. It's possible to learn C as you go, but your weekly workload will be substantially larger and honestly, you already have enough to learn in the class. I felt like the grading breakdown was fair, with ~50% projects and ~50% tests. There are extra credit opportunities. The professor and TA's are all very active on piazza and slack; probably one of the most active in the courses I have taken so far. This is great because questions get answered very quickly. There are 4 projects, with one of them being extra credit only. I would say all 3 projects require substantial time, with project 1 being the most work. Be prepared to spend at least 30-40 hours to do project 1 or project 2.", "rating": "Loved!", "workload": "18 hours/week", "author": "UFB2PrD13ShvuWoPKPYbzTbdnmy1", "difficulty": "Hard", "semester": "Spring 2018", "time": "5/3/18, 1:03 PM"}], "difficulty": 3.625, "enrolled": 0.0, "id": "CS6200"}, {"rating": 4.394, "workload": 15.652, "withdrew": 228.0, "comments": [{"comment": "I just finished this course on Fall 2018. Generally it is a good course and the professor Kishore is an OS expert.We are required to: watch the lecture video, read 2 assigned paper, finish 4 projects (project#4 needs lots of time), midterm and final test without books.You can get most out of the course if you can read all the 40+ papers during year 1980-2010 (but it is nearly impossible as it consumes too much time).Projects are challenging and require both C and C++ skills.For midterm and final tests, you should read the previous tests provided by the course, and they will be quite helpful.", "rating": "Liked", "workload": "15 hours/week", "author": "Q9j21rtfcKZjqswh5Y4huUkD1qh1", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/12/18, 3:08 AM"}, {"comment": "AOS is the closest we have in OMSCS to a dedicated distributed systems course. The course is about 30% OS, 70% distributed systems. For this reason, I think this class is very important for anyone in CS to take until we get a proper distributed systems course.The workload is comprised of:2 exams, the final covers around twice the material as the midterm4 projects, the last project being twice the work as prior projectsweekly lectures46 papersThe course is back loaded. The workload ramps up considerably in the last 4-6 weeks.It's a survey course, so it covers the seminal systems research papers over the last 4 decades to the modern age. There is a lot of information here. If you read and understand every paper, as Professor Kishore recommends, this course easily hits 20+ hours/week. I started to suffer from information overload, and skipped the last 20 papers.Fortunately, reading the papers isn't necessary to get a good grade. Watching the lectures and reading the prior exams is enough to do well in the midterm and finals. I still highly recommend reading the more interesting papers though, if you can. You will learn a lot.The projects are tough, but really good. I found them far more relevant than IOS (you use grpc for instance, not ancient rpcgen). Writing barrier algorithms was probably my favorite. On the downside, the projects are far less structured than IOS. The requirements can be a little vague, and there is no Bonnie for testing your project. You have to figure out the tests yourself, and be confident in your solution before submitting it.There is no hand holding in this course! But it's a really great course, and my favorite in OMSCS so far.", "rating": "Loved!", "workload": "18 hours/week", "author": "WRLDyDaYY7OUmUb8hmAheQxtD8K2", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/14/18, 4:28 AM"}, {"comment": "The professor for the course really knows his stuff and the material is really interesting focusing on distributed systems. It is very much recommended to have a strong understanding of C and C++ since the projects use this. (Projects are kinda hard but exciting as well).Lecture videos and past exam material are also instrumental for the two exams which are administered via proctortrack.There is quite a bit of assigned reading on this course with each student having to make 2 paper summaries. Extra credit is offered for piazza participation and one extra project.I would highly recommend this course for anyone in the omscs. Beware of the effort needed though time wise for the projects and reading papers. It would definitely help to take GIOS first as well :-)", "rating": "Loved!", "workload": "15 hours/week", "author": "2mbBTQUsQUU1XvYGp6HfNw83Gkk2", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/21/18, 2:55 AM"}, {"comment": "This class is more like introduction to distributed system than advanced OS. There are lectures about historical OS architecture at the beginning, but then it jumps into distributed system topics. So if you expect a class like where you implement a simplified version of OS functionality, this is not for you.Assignments are hard and time-consuming, so be prepare to start way before the deadline. There are 4 (+ 1 extra credit) and all in C / C++. Also you have one more ramp-up project which gives you 5 pts or so at the beginning. Exams are certainly difficult and require too much memorization to me. The previous exams provided were very helpful but I don't think it was useful learning experience, rather it was just like studying and spend so much time purely for grades. Also this class gives you so many additional papers to read, while you need to pick only 2 among them and submit your summarization. I doubt that many people read all of papers which were listed in our syllabus.Due to so heavy workload, I gave up fully absorbing some part of lectures which actually I am interested in.. my fault, but I think it'd be helpful if the class gave me more focus on them. Also I assume not everyone is interested in exploring architecture of very old systems (while the idea is still valid in this era) in a shallow but rapid way.Overall, I certainly leant some but ended up in just keeping my focus on getting grade B+. Depending on how much you can allocate your time in this class, YMMV. But I don't recommend taking this class as one of a pair with another class.", "rating": "Neutral", "workload": "20 hours/week", "author": "4oD0WVLeRgRl6f4XGAD99vfr90J2", "difficulty": "Hard", "semester": "Fall 2018", "time": "3/3/19, 2:48 PM"}, {"comment": "Actually took this during Fall 2018, but the option isn't available in the dropdown at the time of writing this review.I took this as my 7th class in OMSCS, and definitely enjoyed it. Most of the grade came from the 4 projects:Implement hypervisor CPU scheduler and memory manager (C)Implement and improve various concurrency primitives (C)Implement asynchronous server/client with gRPC (C++)Implement the MapReduce framework with gRPC (C++)I disliked the first project, but thought the other three were great. Going into this class, I had some C experience but no C++ experience (but had dabbled with Rust, so I understood issues of ownership), and had no trouble picking up enough C++ to be productive. I thought the projects were interesting, useful, and appropriately scoped (re: amount of work, time allotted, etc.).There were a lot of readings for this class - I didn't have time or energy to read everything, but I read a lot and learned a lot from those papers. This class uses the actual research papers that introduced a lot of the concepts central to distributed computing and operating system design in the '80s and beyond, so it was interesting to see how those papers had influenced the landscape of today's operating systems.The lectures were fantastic. It's very obvious how much Prof. Kishore cares about the subject material and the students.I definitely recommend this class. It could even be a good first class, if you're feeling ambitious (though it might be wise to start with IOS first).", "rating": "Loved!", "workload": "15 hours/week", "author": "M9tOKm39FWSq4bE9Nj3fVzMgWVH2", "difficulty": "Medium", "semester": "Summer 2018", "time": "1/27/19, 7:28 PM"}, {"comment": "As mentioned by other reviewers, this class is broad. It focuses more on distributed systems and the contributions of theoretical operating systems than the details of current, commercial operating systems. The test questions are very similar to previous years' questions. I made quick passes through the lectures, memorized the three or four previous classes' tests, and got a B on both the midterm and the final: that was above average for this class. Course grades are curved or scaled after all of the test and project grades are in.The part of this class that I really enjoyed was the projects. I've got a moderate amount of C/C++ experience: three or four classes in recent history plus some self-study. These really stretched my skills and helped me improve my ability with these languages. The final project (MapReduce) took me about twice as long as the first project. I was able to finish the first project with about two days of solid work (8-10 hours per day) and the final project with about four days. Your experience will vary.There's one hint I wanted to add that I didn't see below: guess on the tests. If you're not sure of the answer, then make inferences from the question, flesh out an answer from whatever dim memory you've got of the subject, etc. I did so, and was rewarded.", "rating": "Liked", "workload": "15 hours/week", "author": "RnOwfjcbIicockYRPl5Y59Zo5rJ2", "difficulty": "Hard", "semester": "Spring 2018", "time": "5/13/18, 1:02 AM"}, {"comment": "Great course, but very difficult and time consuming if you want to learn everything in this class.Midterms and final are difficult, but end of course is curved fairly significantly. Project 4 will take you a long time, half of the projects in C, half in C++. Worth reading and learning a bit of C++ if you have only worked in C, like me.One of my favorite if not my favorite course so far.", "rating": "Loved!", "workload": "20 hours/week", "author": "JjQxRdhFjRcEAwof97ntpoozCvo1", "difficulty": "Very Hard", "semester": "Spring 2018", "time": "5/8/18, 9:21 AM"}, {"comment": "This was my first course in OMSCS, and although this class is known to be difficult, I found it to be very valuable and enjoyed Prof Kishore's enthusiasm. I had very little experience coding in C++, and I had never coded in C before. The first two projects were in C, while the last two projects were in C++. I put it in a lot of hours into this class, trying to learn C/C++ as well as trying to succeed on the projects. Because of the extra effort, I did really well on the projects.My favorite projects were Project 2 (C) and Project 4 (C++). For Project 2, we had to use the libvirt API to create a CPU scheduler and memory coordinator to manage virtual machines with varying resource usage. For Project 4, we had to create an implementation of the MapReduce using gRPC - this was the biggest project in the class and was also the final one. They gave us 4 weeks instead of 2 weeks to finish it, and I think I spent 3 weeks total on the project.I found the exams to be difficult because you basically had to memorize a lot of information. This class covered several different operating systems and algorithms that were developed decades ago. Old midterms and finals were already on T-Square, so if you had to time to go through all of the old tests and skim through the research papers, then you would do fine on the tests. I definitely preferred the projects over the exams though.The class is curved at the end though, so as long as you start on the projects early and score really high on them, and not completely bomb the tests, you can get an A in the class.", "rating": "Loved!", "workload": "20 hours/week", "author": "qTSuvmjyfPd5V8qOPSilj4dk4FS2", "difficulty": "Very Hard", "semester": "Spring 2018", "time": "5/13/18, 2:22 PM"}, {"comment": "This was my first course in the OMS CS program. I only took one course this semester, and I am thankful that I did. This course was very intense, and very interesting. All projects were done using C and C++. I suggest a good working knowledge of C/C++ or it will require a lot of extra effort for projects that are difficult in themselves. The lectures are very well done, and very informative. There is a lot of information and a lot of fine detail in the lectures. On top of the long project assignments, there are 15-20 papers that are required readings. A close to average Midterm score can be achieved without reading the papers, but just read the papers. The exams themselves are entirely essay based, 25-30 questions, and are quite difficult. The course requires a lot of work, but I am happy to have taken it.", "rating": "Loved!", "workload": "15 hours/week", "author": "MMi8lvpTffNDzWsx56j3tHZp2p32", "difficulty": "Very Hard", "semester": "Fall 2017", "time": "12/17/17, 2:10 PM"}, {"comment": "Fourth class in the program (previously taken IOS, SDP, IIS). I agree with the general consensus of the reviews already posted here. The projects are difficult (would be extremely difficult if your C/C++ background is very limited). Tons of papers to read. The exams are also difficult, though previous exam solutions are extremely helpful. Exam questions don't seem to strictly repeat, but tend to cover the same concepts.The workload isn't extreme. I had some experience in C/C++ and most of the projects took 20-30 hours, with the exception of project 4, which is a huge project and took me well over 40 hours. I generally spent 6ish hours on papers and lectures per week.Overall, the class is informative, well-run, and the projects are useful and interesting. I enjoyed the class very much and wouldn't hesitate to recommend to anyone.", "rating": "Loved!", "workload": "16 hours/week", "author": "mMKMQ8O3kvegXTtHoN77W1gOOLt1", "difficulty": "Hard", "semester": "Fall 2017", "time": "12/12/17, 1:11 PM"}], "difficulty": 4.145, "enrolled": 245.0, "id": "CS6210"}, {"rating": 0.0, "workload": 0.0, "withdrew": 0.0, "difficulty": 0.0, "enrolled": 0.0, "id": "CS6238"}, {"rating": 3.632, "workload": 8.114, "withdrew": 250.0, "comments": [{"comment": "I really liked this course, I had a beginner knowledge of networking and advanced knowledge of Python, which really set me up to learn what the course was about instead of scrambling to figure out the language or basic concepts like I am in most other classes due to my background. If I didn't know Python, this would have been much more difficult for me. The projects are basically due every 2 weeks, all the test material is given at the beginning of the semester; the only thing you can't work ahead on is the projects. The TAs are extremely responsive and attentive, which is a huge advantage as the professor is non-existent. Stacia was the head TA for the first half of the course, and like others said, she runs a tight ship and doesn't take attitude from anyone (and seems to be overworked), but that worked with my personality style so I had no issues. Halfway through, she was replaced and the other TAs had to scramble to cover the workload Stacia previously covered. The other TAs did a great job carrying the course to completion and worked extremely hard. Most of the topics are interesting, the projects are really captivating IMO, but the readings are pretty boring. Overall, good class and wonderful TAs -- the class would have been a disaster without them.", "rating": "Loved!", "workload": "10 hours/week", "author": "wQ4i20zy2WbPsSsHWVqxnB9Bjhf1", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/8/18, 8:13 PM"}, {"comment": "Overall, I didn't like this course. Most of content was really interesting, but the grading was pretty strict, the professor was nowhere to be seen, and the TAs weren't very helpful. There are 7 projects and 3 tests total in this class. The tests aren't bad as long as you study. Projects 2 and 3 were a bit tricky because they were easy to mess up on, but once you get past them the rest of the class is smooth sailing. As others have mentioned, halfway through the semester our head TA was randomly fired and the other TAs had to scramble to fill her spot. Honestly, I was a bit happy the head TA was gone because she was a bit mean and abrasive. For example, a lot of students had issues with the provided VM we were supposed to use for Project 1 (the file system kept randomly locking). Instead of being helpful and trying to resolve the issue, the head TA blamed us for the issue and refused to take us seriously when dozens of us posted on Piazza about our issues solely because they weren't able to replicate the issue on their machine. I had a friend (very competent person who would have done well in this course) drop solely because of the VM issues during the first project and how unhelpful the TAs were. The course became so ridiculous with the TA drama that the professor stepped in (who hadn't been seen in months) and showered us with extra credit assignments, which I didn't mind. Overall this was a class with interesting content, but I don't think I'd recommend it (especially not as a first course).", "rating": "Disliked", "workload": "10 hours/week", "author": "v09v8SzC6sbVx1rMwzQoua0aWgB2", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/10/18, 8:26 AM"}, {"comment": "I took this course because I was anticipating a very challenging Fall at work. As it turns out, work was very challenging and this course didn't squeeze my time like other courses in this program do. Overall, the course content was informative, but not particularly interesting. Unlike other courses, the ideas in the lectures are not particularly thought provoking. The projects were a breeze (except for the last one - start that one as soon as you get it) and didn't really teach much. I did manage to dramatically increase my knowledge of networking, but it was a informational type of knowledge; meaning, you won't walk away from this class with any useful networking skills. I would only recommend this course if you are too busy to take a more demanding course; otherwise, go find something more interesting to study.", "rating": "Neutral", "workload": "5 hours/week", "author": "MgirjMhS5SYLw73NHeMqufPAhrN2", "difficulty": "Easy", "semester": "Fall 2018", "time": "12/16/18, 12:24 PM"}, {"comment": "Professor very helpful and manages the course very professionally. TAs are extremely efficient and helps the student community very well. As long as you are up to date with the lecture material and regularly doing the projects, you should be good. Do not fall behind because given the course load, it will be difficult to make yourself up to date quickly. Tests are difficult. Even though test questions are multiple choice, lecture materials need to be studied meticulously.", "rating": "Loved!", "workload": "15 hours/week", "author": "5v1Tr8NyEZaH0XkFyx5FBTLwkIv2", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/17/18, 12:39 PM"}, {"comment": "The course is nice as it is trying to cover several aspects of networking but on a high level. There are several extra credits opportunities were offered. There is almost assiy every two weeks which requires two days of work and three exams which requires alot of reading.", "rating": "Liked", "workload": "8 hours/week", "author": "Nq9tVMqSmlg5Ib1GiwRF8rD9sJh1", "difficulty": "Easy", "semester": "Fall 2018", "time": "12/18/18, 12:11 AM"}, {"comment": "Taken with Software Analysis and Test for my first semester at OMSCS. Some of the labs are fun, some seem to be more tedious. Overall, not a super hard course if you put the time in. Tests are not worth much so it's really just doing well in the labs and decent enough on exams. Ended up with an A and didn't do any extra credit.", "rating": "Neutral", "workload": "8 hours/week", "author": "y8S90orUfWS2AXYFig77yOOAGe73", "difficulty": "Easy", "semester": "Fall 2018", "time": "12/18/18, 9:08 AM"}, {"comment": "I once got asked in an interview \"How does Internet work?\", and I bombed it, so I really wanted to take this course to find out what I should have said. Overall, it's a pretty good course, with regular, fairly simple projects, and I think now I might be able to do better in that interview.The semester was marred a little by the drama of head TA Stacia leaving abruptly, which was a big loss to the course. This meant that the first half (with Stacia) was very well organized, with a lot of guidance on the projects. The second half wasn't as good, with more 'configuration' style projects, rather than real coding.Overall, it was a good first course that can easily be paired with any other course. But without Stacia, I'm not sure that students in 2019 will have as good an experience.", "rating": "Liked", "workload": "3 hours/week", "author": "FyUS0J6Me9cYrpRq7s4VfElHc6E3", "difficulty": "Very Easy", "semester": "Fall 2018", "time": "12/18/18, 4:45 PM"}, {"comment": "Stacia is hands down one of the best TAs, it was a shame that there was some drama in the middle of the semester which led to her stepping down or getting fired. The rest of the TAs were incompetent and always graded written work terribly, just scanning for keywords in the prompt when I clearly answered the question that doesn't include copying the question word for word.I already came in knowing a some computer networks and security from work and IIS, but the whole topic is just a bore.", "rating": "Strongly Disliked", "workload": "7 hours/week", "author": "NIeO2yom7bhrtBKnq80tTCJflIw2", "difficulty": "Very Easy", "semester": "Fall 2018", "time": "12/19/18, 4:17 AM"}, {"comment": "Not sure where to start. The class itself focuses more on teaching you about computer networks in general rather than teaching you to work with them and doing projects in networking. 7 projects, of which 4 are python based, need little coding (maximum I coded was maybe 3-4 pages in total for the course but you must understand python and programming to know what you are doing). You will enjoy the class and if you are comfortable with python and know basics about networking you will learn new things and it will be an easy class for you. Tests are easy too. The overall structure of the class is very well laid out though some projects may require you to spend a weekend (20-30hrs) to make sure you get full grade for them. Since most projects are autograded, if you do well on them the class should bag you an easy B and little more effort should get you a very comfortable A.Now this semester the class had to go through some issues. Stacia Stokes (the head TA) was let go in the middle of the semester and it seemed like she was pretty much ticking all the right boxes as a head TA so nobody understood what happened. After that the class went a little numb for a while. Projects 2-3 had videos to help students complete the projects made by stacia which were super helpful but once she was let go, the videos for later projects made by some other TA were terrible. They were not clear and it may not be the TAs fault probably the course just had management issues so nobody knew what was going on. So the class definitely ran into problems mid semester.Once that happened in order to literally make up for they threw an additional 7% extra grade points. You literally had to do nothing but give feedback on the class VM to get 6% of the 7%. This meant almost everyone would get an A or a B since the official class already had a 5% extra graded portion for the last project. So 12% extra grade was just ridiculous and made the class too easy to get an A. The 7% will most likely not be there next semester cause it felt like a lame attempt to convince students not to badly rate the class anyway.All in all I would probably still suggest this class if you want to learn some interesting stuff about Computer Networks. The class may not be helpful for anything real world since it just briefly teaches all the concepts and doesn't go deep into something but it should be an easy class for a semester if you dont want too much work load. Easy B. Little more effort and comfortable A.", "rating": "Liked", "workload": "12 hours/week", "author": "pzDqA6AAuZfRYZUqkudgQbjn4di1", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/22/18, 8:25 AM"}, {"comment": "The easiest course I have taken in this program. Actually. the content itself is not very easy, but basically you don't need to understand everything very well in order to get an A grade. Almost more than 10 extra points makes me no need to take the final in order to get A.", "rating": "Neutral", "workload": "7 hours/week", "author": "CnzLpXdnZGXbeQQAmujuq3gvp2G3", "difficulty": "Very Easy", "semester": "Fall 2018", "time": "12/23/18, 12:59 AM"}, {"comment": "Very interesting course, learned a lot. Some projects can be challenging, had to work more than 12 hours on some of them, the most challenging are in descending order Project 2 - Project 3 - Project 7 - Project 6. If you count the time required to finish the group projects and the time required to watch the udacity lectures and read the papers, is around 18 hours per week.I have never worked on Python before, but I had a strong networking background.The lectures were very interesting, the projects very fun but got some troubles to understand what I had to do on some of them losing some time, also we got some troubles with the virtual machines.My advice, plan every project ahead, understand what you need to do and make a plan to do it, dont jump into programming without being clear you can lose a lot of time if you do so. For the tests, study the lectures and papers in the week they were assigned, don't wait to the end or you won't be able to finish study on time.Overall I loved the course, but I don't consider it an easy course (to pair with a harder course for example), however this is my first course and I don't have anything to compare with.", "rating": "Loved!", "workload": "18 hours/week", "author": "pNJaYjJRzcNggkt7VQk8TeGsM192", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/26/18, 12:52 PM"}, {"comment": "This is a good choice for the first course with a lot of extra credits. I guess a majority of students in the class must have gotten B+ and above, if not A . Lectures are very superficial and I did not get any real knowledge about networks after completing this course. Also it is annoying that the lectures are not current/relevant with missing portions making it look like you're watching a poorly edited movie.Earlier projects were a little bit interesting, like implementing distributed networking algorithms. TAs were supportive, but did not really encourage creativity. I noticed that some of my fellow classmates got rude answers for questioning assignment structure or when they tried to come up with alternate ideas for implementing. It would have helped if the assignments gave more information about the algorithms we were trying to implement, because they were totally tangential to lecture material.As others had noted, instructor was mostly absent, but she was the most helpful and the most respecting of students. She tried her best to clarify on doubts just before the exams and also helped us wade through tough papers.This is a class to get good grades(IMO), you just have to scramble a bit every two weeks to submit a project and exams were mostly easy. Right now, it is not a good class to learn about networking, but if the lectures and assignments are revamped(as the instructor kept promising), this course has potential to become a better one.", "rating": "Liked", "workload": "10 hours/week", "author": "tabiEMuKL0hRlfhdUNgrY5Q2Idq1", "difficulty": "Easy", "semester": "Fall 2018", "time": "12/27/18, 4:59 PM"}, {"comment": "This was my first OMSCS class. My undergrad was in CS but I hadn't taken Networking before. I work as a software engineer- typically work 50+ hours a week. This class was initially interesting and I learned some really cool stuff. However, I attribute that to the nature of networking instead of the course, itself. Projects are really quite easy. Project 2 and 3 are the hardest and I finished them in one weekend day. The amount of extra credit given was ridiculous.. really easy A because of these opportunities. The exams were annoying. They didn't test understanding- more just tricky questions. I would recommend it as a first course since it's low time commitment and easy.", "rating": "Disliked", "workload": "5 hours/week", "author": "pZWVLqULHGNGG20Z8T4RXv9k3ho2", "difficulty": "Easy", "semester": "Fall 2018", "time": "1/2/19, 8:09 PM"}, {"comment": "It was alright", "rating": "Neutral", "workload": "2 hours/week", "author": "dJlqGCfNdxQQ0PS4StSzjwDdIPm1", "difficulty": "Medium", "semester": "Fall 2018", "time": "1/3/19, 11:59 AM"}, {"comment": "I took this in my first semester, along with IIS, and it's my understanding that it has been revamped, so it's not as easy as some of the reviews make it out to be. I found the material very dry and boring, I honestly didn't like this course much at all. There are 3 proctored tests that cover udacity lectures and assigned reading papers, the TAs provide review questions before each exam so you can have a study guide, they are extremely helpful so make sure to study them. There are 7 projects total: the first project is extremely easy, it's pretty much 50 free points. Projects 2 and 3 are the most difficult and where many of us struggled, so make sure to dedicate some extra time to them. Projects 4 and 5 are the only projects with no programming, they are analysis based on some research papers, this also makes them the most boring and the ones I disliked the most. Project 6 is the only fun and interesting project of the course, but it's being replaced by something else so it doesn't matter anymore. Project 7 (final project) is confusing but really easy once you understand it, it took me about 8 hours to complete but I know some people spent over a week trying to figure it out, so pay close attention to the logistics. There are lots of extra credit opportunities so take advantage of that if you need it, I did terrible on project 2 and it tanked my grade to a C for the whole semester but I pulled of an A with all the extra credit available. We had a head TA (Stacia) for the first half of the course, she ran a tight ship and had full control of the course making it run smoothly, professor Konte was nowhere to be found in this first half. Stacia was fired in the middle of the semester, we weren't given a reason but suddenly professor Konte became active and the other TAs tried to keep the course afloat, there were many issues because of this but hopefully they regroup and manage to fix the course for later semesters.", "rating": "Disliked", "workload": "5 hours/week", "author": "gIVgXNbSiSYaUJ0Iy1gJ0CaO26B2", "difficulty": "Medium", "semester": "Fall 2018", "time": "1/3/19, 7:22 PM"}, {"comment": "I would say this course overall was somewhat worth taking. I had a pretty extensive background in networking prior to this exam having worked as a penetration tester and as a system administrator, but I wanted a bit more theory to balance out my practical experience. The course content was not very deep, but it did cover a lot concepts like buffer bloat, a few routing algorithm implementations, and some SDN that I felt was useful. There was the opportunity to get some extra credit in case you really messed up a project. I personally found the exams to be really hit or miss, and I consistently scored below average. I felt the questions were difficult to parse sometimes, and missing more than a few guaranteed a B or C on the exam (I believe this is accurate). I would STRONGLY recommend getting Project 2 and 3 to pass ALL TESTS. In Project 3 I placed a ``break``` in the wrong spot and ended up only passing 8/9 tests. I thought I would do alright on this project, but ended up with a 40/150. This severely constrained my ability to earn an A, so I strongly recommend getting ALL TESTS to pass. Sounds obvious, right? Like all CS classes, you are better off knocking out all homework/projects as SOON as they are assigned. Failing to do this means you will not have the time to be able to ask the TAs for help. Nothing but my own fault for not doing this.", "rating": "Liked", "workload": "12 hours/week", "author": "etzTifuAV3cQKWAVR8pAmtSrQt23", "difficulty": "Medium", "semester": "Fall 2018", "time": "1/7/19, 10:10 PM"}, {"comment": "Honestly, wasn't a huge fan of this class. Feel like the lectures were kind of shallow and didn't really go very in depth on common algorithms and the like for networking. The assignments didn't stimulate much learning either and one of them was simply updating config files, the time to complete ranged from 2 hours to 7 hours. Test 1 I thought was fairly good and required application of concepts we learned, think Test 2 missed the mark. Neither of them required more than 5 hours of studying.The TAs were alright and the head TA definitely ran a tight ship for better or worse. There was mention that they are upgrading the assignments for Fall 2018 so might be better then but at this point kinda disappointed I wasted a class on CN.", "rating": "Disliked", "workload": "5 hours/week", "author": "XGaU42aBN7Pn0jYEjzRb5aCcFDq2", "difficulty": "Easy", "semester": "Summer 2018", "time": "7/28/18, 7:35 PM"}, {"comment": "Fairly boring lectures, very dry material. Projects were okay. Head TA has a horrible attitude and is clearly on a power trip. Never once heard from the actual professor.", "rating": "Neutral", "workload": "5 hours/week", "author": "SUk2bvIiF4ft3aqCXs3Dceve0hO2", "difficulty": "Easy", "semester": "Summer 2018", "time": "7/29/18, 8:45 AM"}, {"comment": "I didn't enjoy this class. I didn't enjoy comp networking in undergrad either so this is just a subject I dislike, I guess. The material is very boring although some of the security stuff toward the end of the class was a little more interesting we didn't do much with it though. The lectures are quite boring and I just tried to get through them as quickly as possible. Tests were proctored and not to bad to study for. There was a mid term and final.There were 5 project in this summer session. The first was using mininet and topology design. The second was more topology design, switches, routers, etc.. and required some basic python programming. The third was more of an experiment, run the tests and write about what you found. The fourth was about firewalls and required basic python. The fifth was about bgp and utilized mininet again. For the projects its important to note that the way you submit them to canvas was different for every project. Which I thought was very odd and cost you 15 points if you submitted it incorrectly. They said it was because of the grading scripts. I don't know if that is supposed to be a gotcha or just poor design. Sometimes the file format you were supposed to submit were listed in a random piazza post by a student who had to ask about the format of the file submission. Just pay close attention to that and make sure you ask if its not clear in the directions.There was 80 points of extra credit as well.TA's were active on piazza and tried to answer questions there. I don't recall the instructor ever really interacting other than at the very last week.If I could go back to the beginning of the summer I would have chosen a different class. I don't recommend it unless you're gung-ho on comp networking.", "rating": "Strongly Disliked", "workload": "5 hours/week", "author": "15d5f8be-d845-4b2e-8b9d-7a2a", "difficulty": "Easy", "semester": "Summer 2018", "time": "a90f15fb7/31/18, 8:20 AM"}, {"comment": "The material in this class was very interesting. Head TA Stacia runs the class extremely well and is great about holding regular office hours and preparing review material. There was a substantial amount of reading in the second half of summer. Projects are in python.", "rating": "Loved!", "workload": "12 hours/week", "author": "N99w7wWFlZe52RYZQlcrEsU5tKD3", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/2/18, 4:23 PM"}, {"comment": "Great cohort - very active group; provided excellent tools to verify outcome of our projects. Projects are of low to moderate complexity, but interesting ones. Projects 2, 4 and 5 provided good opportunity to learn new concepts. Big shout out to TAs (esp. Stacia).", "rating": "Loved!", "workload": "10 hours/week", "author": "k62CkAVoYjSeNr4iyepEif4RmZJ2", "difficulty": "Easy", "semester": "Summer 2018", "time": "8/2/18, 9:10 PM"}, {"comment": "This course is a great course for new students or as part of a harder semester. The teaching is solid, the syllabus is clear, the projects are doable and the exams are fair.Most projects have a 5 hour period of confusion while one figures out what's going on and then they become pretty doable.", "rating": "Liked", "workload": "10 hours/week", "author": "XE4BA5iSbadmPqc0pYLVwMKpvET2", "difficulty": "Easy", "semester": "Summer 2018", "time": "8/3/18, 8:34 PM"}, {"comment": "Enjoyed the course and walked away with a much better understanding of the topics. The projects were interesting and engaging; as always, it is best to front load. I noticed many students who started late and had a predictably bad time.The course assumes an understanding of networking fundamentals, so recommend brushing up on that if you don't have this background. The class refers a free online Stanford course that fits the bill, but best not to wait until the semester is underway to do so.Many research papers to read. TAs were helpful and responsive (one in particular), and overall this was a very well-run course. Only drawback was that the professor was almost entirely absent, with somewhat dated lectures coming from a professor who has been at another university for a few years now.", "rating": "Liked", "workload": "13 hours/week", "author": "Dn6G6AuXoUZr2KrioNGnJL5YAju1", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/9/18, 3:42 PM"}, {"comment": "solid coursesetting up the VM in the beginning mightbe tricky but after that it is pretty smooth sailing. the assignments were straightforward in python and the TA (Stacia) is an absolute star. :)", "rating": "Loved!", "workload": "5 hours/week", "author": "q9tFqUj3MrhDGocMTOKiPgRfC7D3", "difficulty": "Easy", "semester": "Summer 2018", "time": "9/1/18, 1:12 PM"}, {"comment": "The lectures were fantastic. As others have mentioned, the assignments typically had a ramp-up period but were then not too bad. Tests were fair and used lenient multiple choice grading.", "rating": "Liked", "workload": "10 hours/week", "author": "7OjkLJGKZvRGh6A673D6WR4q8fq1", "difficulty": "Easy", "semester": "Summer 2018", "time": "9/17/18, 1:15 AM"}, {"comment": "It is deceptive to think that you need less than 25 hours a week to succeed for this program. While I have finished watching all videos several days ahead of time, the projects were still challenging.", "rating": "Liked", "workload": "25 hours/week", "author": "yWLvqAx9jZPawA7cA8zlFNbtVzL2", "difficulty": "Hard", "semester": "Summer 2018", "time": "9/25/18, 2:18 AM"}, {"comment": "Course was good. Great lectures, fair tests. START EARLY ON THE ASSIGNMENTS AND PLAN YOUR LOGIC BEFORE WRITING CODE!!! This will save you the 10 hours of confused debugging I saw a lot of students going through and will likely reduce the time to complete the difficult assignments from 10+ hours to no more than 2-3. The hardest assignments ultimately required no more than 50 lines of pretty straightforward code, so if it takes you 15 hours, it's because you didn't completely understand the requirements before starting to write code.", "rating": "Liked", "workload": "15 hours/week", "author": "9ypClZbmd2dyoFIvepwkFfBxtXg2", "difficulty": "Medium", "semester": "Summer 2018", "time": "9/26/18, 10:21 AM"}, {"comment": "This class is overrated. Lectures are opaque and slides often covered with tons of unintelligible scribbles that make them impossible to study from. The assignments often didn't line up with the content of the lectures either. Lack of autograder with instant feedback is a major downfall. Tests were okay but some questions felt very nitpicky. No contact with the professor who was supposed to host some kind of extra credit discussions but everyone just ended up getting it for free.", "rating": "Disliked", "workload": "10 hours/week", "author": "CtQ0DcBe0dZXomeKmksYLIjTlnj1", "difficulty": "Easy", "semester": "Summer 2018", "time": "10/28/18, 3:15 PM"}, {"comment": "Relatively easy class and with extra credit I finished with over 100%. Disappointingly some of that extra credit was awarded to the whole class because the professor screwed up. Professor is also not present and the lectures are by someone no longer at Georgia Tech. You will be learning old stuff, but still very relevant given the underpinnings of TCP/IP haven't changed that much in 30 years. Head TA, since removed in Fall 2018 I believe, I found to be a challenging personality. Some programming experience for a few of the projects will be extremely helpful. Most of the projects are done inside of a virtual machine, which generally worked well enough. Albeit it's a network simulator that could sometimes be flakey producing inconsistent results.", "rating": "Neutral", "workload": "10 hours/week", "author": "IyXiVZbU00TI100dEGFikX1Ax6K2", "difficulty": "Medium", "semester": "Summer 2018", "time": "12/19/18, 10:07 AM"}, {"comment": "Exams 3 proctored exams, all closed-notes. All multiple choice questions. Take notes and watch the lectures in advance so you can focus on the projects when they are released. TAs release exam review questions and solutions before each exam. Those were most helpful for studying.Readings Research papers were interesting. Liked it when TAs posted questions to guide the reading or projects.Projects 7 projects/labs. Most of the grade so do well on them. You can't work ahead. Project specifications are clear. Lots of unnecessary, repeated questions about projects on Piazza. Read the project docs closely and watch any project videos the TAs share. These go a long way to help you understand what you have to do. I liked the 2nd and 3rd projects on writing distributed network algorithms; they were the most interesting projects with Python coding. The last three projects required more configuration and less coding.Homework NoneInstruction While the lecture videos are clear, the diagrams and text on the screen is generally messy. Could be better. TAs were helpful on Piazza. The professor was largely absent until midway through the course when the head TA (Stacia) was let go. Stacia was great, and the TAs always responded quickly. I didn't experience VM problems but some students did.Pre-reqs None. Some introductory material on networks, TCP handshake, and Python coding will help.Overall I had little to no networking knowledge prior to this course so I learned a lot. I didn't find the content super interesting, but it is useful. Good to know more about TCP/IP, distributed networking algorithms, congestion, traffic engineering, and software defined networking. It's a good choice of a first course in the program. It was my 7th.", "rating": "Neutral", "workload": "7 hours/week", "author": "ttgsHfEZI9PvRCNqT300KNobIS52", "difficulty": "Easy", "semester": "Summer 2018", "time": "12/28/18, 7:04 PM"}, {"comment": "Not recommended. You need to finish three boring reports in the middle of the semester(although you can definitely earn full credits). The exams are very boring.", "rating": "Disliked", "workload": "8 hours/week", "author": "dcEVp5XthAOw65I0HeRCQnQAHW62", "difficulty": "Easy", "semester": "Spring 2018", "time": "3/27/18, 1:04 PM"}, {"comment": "For the life of me, I cannot fathom why anyone would give this course a positive review. Perhaps they don't know what they are missing. Prior to this, I took 6220, 6290, and 8803-08 (HPC, HPCA, and Compilers) and found them all to be engaging and enjoyable. They were tough at times, but I felt it was time well spent. I learned a lot, and found the things I learned to be relevant and empowering.6250 was not of the same caliber by a large margin, and was very disappointing overall. If I had known then what I know now, there's no way I would have considered taking it.1) The content is poorly organized. There's little structure or hierarchy to the topics. It's a random smattering of things. 2) The depth is shallow. The quizzes are inane. 3) The assignments are either borderline trivial, or frustrating due to tricky technicalities.I don't fault the TA's or the instructor. I believe they are doing their best with what they were given. I think they have tried to make incremental improvements as time has gone on, but there really is no saving it. All the lectures and assignments should be thrown away and the course redesigned from scratch.", "rating": "Strongly Disliked", "workload": "8 hours/week", "author": "3UR5W8Hqd7MMmBxpBqIcMiilntI2", "difficulty": "Easy", "semester": "Spring 2018", "time": "4/28/18, 2:06 AM"}, {"comment": "Background: This is my first course in the OMSCS program and I intentionally took this course for two reasons. First, I was interested in learning more about computer networks. Next, from reviews on OMSCentral, this seemed to be on average one of the easier courses, so it provided a good stepping stone into the program. I have an aerospace degree and have worked in the world of defense software for about 4 years now.Pros:The head TA (Stacia Stokes) is very attentive and present on Piazza. Two thumbs up here.Each project has enough time to complete.The lectures, articles/readings, and projects do tie together for the most part.You do learn a lot about both the historical and modern concepts of network programming. They don't go too deep, but that's mainly because there is a lot of ground to cover.Two instances of extra credit were offered (one for weekly discussions, another for an extra portion of the last project)Cons:The articles were difficult to read through. Interesting topics, but the important points were buried in the article (typical techincal paper...).The lecture videos can be a bit jumpy in its explanations, though it still holds to the overall lecture topic.I had hoped to do a little more with software-defined networks (SDN's)Projects 2 and 3 were intense (but if you get past those, you'll be fine.)Test questions could sometimes be vague, and thus difficult to answer.ProctorTrack may be more of a pain than it's worth.Overall I'm happy with this course. I recommend it as a first course for anyone starting the program without a network background. This course uses Python, so you'd benefit from already knowing it, but that's not a necessity. Time spent each week really varied and depended on the project. I probably spent time more than I needed to, so take that into account for the \"weekly workload\" stat.", "rating": "Loved!", "workload": "15 hours/week", "author": "IMzmgWYfhGPtLfoinuUAEtkD8i03", "difficulty": "Medium", "semester": "Spring 2018", "time": "4/30/18, 4:53 PM"}, {"comment": "If you want to get A with little to medium effort, this class is good. Some projects are fun and interesting (you need to know Python in advance, though) but some just require you to do some experiment and report your observation under unstable VM environment which is bit tough. There was even some bug in a given code and we had a hard time to get a result which we expected from the material. Exams are also tough (or at best, boring to prepare). It requires just tons of memorization.To get A, secure full score for projects (60 points). Get an extra credit (you can get 5 points by participating some discussion threads). And try to get 60%+ for exams. You even don't need to watch video lectures or read most of papers for the grade.Personally I wish I could have more experience on SDN through projects (implementation).", "rating": "Neutral", "workload": "5 hours/week", "author": "4oD0WVLeRgRl6f4XGAD99vfr90J2", "difficulty": "Easy", "semester": "Spring 2018", "time": "5/5/18, 3:48 PM"}, {"comment": "I don't want to say this was an easy course because it was my first one and I have nothing to compare, having said that I got an A. The three tests were multiple choice and T or F. The projects were not too complicated; they required some planning first. The projects are coded in Python using a provided VM with all the tools included. The extra credit included participation and a second part in the last project that was totally doable. I recommend it as a first course. The videos were not that bad, and you'll have to read 10 to 14 papers in total to be able to do the projects and for the tests.", "rating": "Liked", "workload": "12 hours/week", "author": "t4xmekRC99WNTuHsV6Q2OkIPUVt2", "difficulty": "Medium", "semester": "Spring 2018", "time": "5/5/18, 9:57 PM"}, {"comment": "This was my second course after having taken Software Analysis and Test in my first semester. The course was interesting with a number of papers required to read. The assignments were doable and the tests were multiple choice which tested the content(lectures and papers) quite fairly.I'd recommend this as a first course given the great amount of help and active participation on Piazza(especially by the Head TA Stacia). It provides a great welcome into the program. You'll enjoy it more if you also have little networking experience. The content is great as a introduction to the Networking world. I figure a veteran in the OMSCS or Computer Networking wouldn't find it engaging though(unless you're doing it for the relatively easier A :-) )Great class overall though. Helped me learn quite a bit on networking concepts which I had no prior knowledge of and polish up on my quite rusty Python skills.And I must say the TAs do a great job given how large the class can get. Great Work on that front!!", "rating": "Liked", "workload": "8 hours/week", "author": "2mbBTQUsQUU1XvYGp6HfNw83Gkk2", "difficulty": "Medium", "semester": "Spring 2018", "time": "5/7/18, 9:22 AM"}, {"comment": "Good way to get an introduction to how OMSCS courses are run without a lot of pressure. TAs are pretty good, instructor participation is okay, topics are covered at a high level, and the coding projects are relatively easy.This course felt easier than it needed to be. Like they stretched the material to fill the course instead of going deeper into the topics.", "rating": "Neutral", "workload": "2 hours/week", "author": "T0ACd58AApPslk17oPcaVpaOlxr1", "difficulty": "Easy", "semester": "Spring 2018", "time": "5/9/18, 4:02 PM"}, {"comment": "This course is an easy A if you have inexhaustible patience.The \"professor\" is AWOL. If you ask me her name in a year, I'll have forgotten it.The head TA is combative and easily frustrated.The course lectures are shallow and poorly organized--a hodgepodge of unrelated topics. There is no book. The journal articles are dry but at least somewhat interesting.The programming projects are usually broken. Some have suggested that this is a Python debugging course first and a networking course second. They are correct.The writing projects are easy 100s. If you find yourself unable to reproduce the desired experiment results, don't sweat it. The project code is probably broken (again).", "rating": "Strongly Disliked", "workload": "2 hours/week", "author": "nS85o2vNGvNbm434Zh5VInDVX5B3", "difficulty": "Very Easy", "semester": "Spring 2018", "time": "5/14/18, 12:36 PM"}, {"comment": "I really liked the course and the accompanying projects (very easy python stuff, even though I'd never used python before). Tests were boring and unnecessary since then didn't really teach me anything, but they were a big part of the grade.", "rating": "Liked", "workload": "8 hours/week", "author": "CW6OSwugtUNBLpUCJ85f4DcS8gj1", "difficulty": "Easy", "semester": "Spring 2018", "time": "5/15/18, 6:50 AM"}, {"comment": "This was my first class in the program. I took this class first because I don't have a lot of computer science courses under my belt, this is a foundational course I think any good software developer should take, the reviews indicated this is a relatively low workload course (compared to, e.g., Machine Learning and the like), and I am good with Python (and this class uses Python).First, the good points. I feel like I learned a lot about principles of system design and why the Internet is designed the way it is. The projects were a good mix of \"implement this algorithm\", \"configure a virtual network\", and \"reproduce and analyze the results from this academic paper\". The last item, reproducing and analyzing an academic paper, was particularly nice because it exposed me to how computer science research is actually done, experience that I did not have. That said, reading the papers and writing the report did eat up a lot of time, especially compared to the actual programming portions of the projects (I am an experienced Python programmer, so this part was a breeze). None of the projects were group projects, so that is also a huge plus. The lectures were mostly engaging, with enthusiastic presenters.Now, some negatives. The tests were usually not well designed. There were three, and only the first seemed to do a good job asking interesting questions that required advanced thinking about the concepts; the other two were filled mostly with what seemed like arbitrary tidbits from the readings and lectures, and were sometimes ambiguously worded. Also, some of the projects' instructions were not clear and the TAs sometimes did a poor job with clarifications, resulting in more anxiety and confusion about the projects than should have been there. Lastly, the professor made approximately two appearances all semester, one of those being during finals week to assign three entire papers to read and respond to for extra credit, taking the place of \"weekly discussions\" we were promised throughout the semester. This was poor form, and someone complained that this violated GA Tech policy of not assigning other work during finals week, so we all got extra credit without the need to participate in discussion or read the papers. Fine, but why not just do the discussions as indicated on the syllabus?Overall, I was happy with the course. It was a good first course for OMSCS, and I feel like the positives outweigh the negatives, so I would take it again. And, although I perhaps put in more hours than others with a more relevant background, I found the time commitment very manageable, given I have a full-time, minimal other commitments, and was taking only this class. Also, I read all of the assigned papers in full, which maybe bumped up my hours compared to other reviewers here. Just start projects as soon as possible, and you'll be OK.", "rating": "Liked", "workload": "15 hours/week", "author": "DajGLD4bCwffB82qTMaeJxzec6v1", "difficulty": "Medium", "semester": "Spring 2018", "time": "6/1/18, 3:21 PM"}, {"comment": "This is a good intro to the program, because the subject matter is so foundational / ubiquitous, and because the class is quite manageable and there are extra credit opportunities.The curriculum, as designed by the original Professor, was quite good, in my opinion. A nice variety of papers to read, and I found the lectures to be well designed / delivered, and quite cogent and lively. The tests were all single-answer / multiple-choice, and relatively straightforward, if you had boned up on the material. The projects were also quite manageable, given sufficient time; 2 and 3 were among the most challenging, but it's pretty smooth sailing after that front-loaded difficulty.In the Spring 2018 iteration, the current Professor (Maria Konte) was more or less MIA until the latter third of the course, and even then they only made occasional, brief appearances. However, she was a very positive, clarifying presence whenever she did weigh in.There were a number of TA's who were friendly and helpful, but from whom we heard little. A lot of that appeared to be due to the fact that the lead TA (Stacia Stokes) seemed not to be a big fan of delegation. Others have noted her propensity to run a tight ship, and that is true, but is not necessarily a positive if you don't like your grad school experience to be akin to being the lowest ranking seaman in the Navy. She publicly castigated / punished students she apparently considered to be overly creative / curious, or insufficiently enamored of her top-down approach, on a number of occasions (as she seems to conflate them with the lazy or unmotivated as being \"problem students\".) Left something of a bad taste in my mouth, but she did competently bring the enterprise to its prescribed destination, I suppose, so... \u00af_(\u30c4)_/\u00af Caveat discipuler.", "rating": "Liked", "workload": "10 hours/week", "author": "Jajl3OsZ3Ifxy4QO7IxY01ny7mO2", "difficulty": "Easy", "semester": "Spring 2018", "time": "6/10/18, 3:30 PM"}, {"comment": "I personally chose this course because I was going to have a busy few months during this semester so I needed a course that was manageable given the time limitation. This course was well managed with great material, awesome TAs who were very responsive, and definitely gained a deeper knowledge of networking infrastructure. Recommended as a compliment to a harder and more time consuming course or if you want a stress free class to enjoy the summer!", "rating": "Liked", "workload": "8 hours/week", "author": "ivRg2ebDrcVoJJxUk5u0rBISyJx1", "difficulty": "Easy", "semester": "Spring 2018", "time": "6/23/18, 1:04 PM"}, {"comment": "Solid", "rating": "Liked", "workload": "6 hours/week", "author": "rQ61CbkDbsUTGGMQhLnNoFa9IwK2", "difficulty": "Easy", "semester": "Spring 2018", "time": "7/28/18, 7:06 PM"}, {"comment": "I think this class is easy. Python is enough for this class. The homework is some easy problems use mininet and a virtual machine. If you are new to OMSCS, I think this class is a good choice. you can learn a lot about computer networks, and the workload is just fine.", "rating": "Liked", "workload": "15 hours/week", "author": "obDAa2oAfiTJHpgqK1r5IjuUnjk2", "difficulty": "Medium", "semester": "Spring 2018", "time": "7/30/18, 5:16 PM"}, {"comment": "This was a competently if unenthusiastically taught course though moderately interesting material. I'm glad I know how these things work now, but in retrospect, I don't think I was the target audience. I took this to gear up for IIS, which I'd heard is the closest thing OMSCS has to a course on cryptography. Still, if the efficient delivery of packets gets you tickled, you'll get to read a lot of interesting papers on exactly that in this course.", "rating": "Neutral", "workload": "10 hours/week", "author": "DH8uzIKaclWKUDzx4ddvo2wz2RV2", "difficulty": "Easy", "semester": "Spring 2018", "time": "8/20/18, 1:17 PM"}, {"comment": "Coming from a non CS background, I found the course very interesting. It is definitely worth it if you are rusty in networking or have never taken an undergrad version of the course before. The head TA at the time was exceptionally helpful when it came to getting personalized attention. This was great for me, since this was my first OMSCS course. BTW the first project is hard. I recall one other one being time consuming and somewhat difficult. The rest are relatively easy. Overall, it was good!", "rating": "Liked", "workload": "6 hours/week", "author": "HXxB2iJFanevx6y2f0vqXr1pjUj2", "difficulty": "Medium", "semester": "Spring 2018", "time": "11/8/18, 11:37 AM"}, {"comment": "Not a difficult course for me but I still enjoyed as it exposed me to aspects of networking I wasn't aware of previously and went more in depth on some things I did know. Lots of research papers to read, so be aware if you are a slow reader like I am.", "rating": "Liked", "workload": "8 hours/week", "author": "0ldoTegxLwZhW2klkgJCU8tmY8X2", "difficulty": "Easy", "semester": "Spring 2018", "time": "1/3/19, 9:24 AM"}, {"comment": "The course is really more of a survey course with really simple projects which individually don't take more than a night's of work. Personally, I found the topic to be not super exciting but that is not helped by how the course was conducted both with what the projects entailed. In addition, there was a whole fiasco about the head TA Stacia who was very much on top of communicating to students who was let go in confusing circumstances. The whole situation was confusing for students as we weren't sure how this affected us.", "rating": "Strongly Disliked", "workload": "8 hours/week", "author": "sZrw2bLpuucJxzdrcBdGZd6bxXL2", "difficulty": "Easy", "semester": "Spring 2018", "time": "1/3/19, 11:40 AM"}, {"comment": "The assignments and exams are not too much related to the lecture video.", "rating": "Strongly Disliked", "workload": "10 hours/week", "author": "y3erFP4fMpRbVcNr3lBf1Ucs3VU2", "difficulty": "Hard", "semester": "Spring 2018", "time": "3/9/19, 12:33 AM"}, {"comment": "I hope they're still maintaining this site - I didn't see Fall 2018 as an option, but that's when I took this class. A good class with 3 or 4 projects and pretty straightforward tests. If I had taken this class first, I would have thought this program was very simple. I don't think any project took more than a day (5- 8 hours), and no accompanying reports were required for the coding projects. A good intro class and mostly interesting. Had a high enough grade going into the final that I didn't really study or read the last set of papers (and still did fine).", "rating": "Liked", "workload": "5 hours/week", "author": "UiTuFUQEBVWpdyEKTggLb1hc5q82", "difficulty": "Very Easy", "semester": "Spring 2018", "time": "3/27/19, 9:12 PM"}, {"comment": "A new instructor has taken on this course and it should now be known as \"Python programming with Computer Networking concepts\". The second project required some students to spend 40-80 hours (over a two week period) even with knowledge of Python. The recorded lectures are very dry and not comprehensive. The TAs were a bit behind the times at first but have improved as the semester progressed. Took as my first course and would not recommend as such.", "rating": "Disliked", "workload": "20 hours/week", "author": "aBVDiDLsMZae7CI8eQbuP9cRzyL2", "difficulty": "Hard", "semester": "Fall 2017", "time": "10/30/17, 8:55 AM"}, {"comment": "This course has definitely changed. I ended up withdrawing at the last minute (though I likely would have gotten a B had I stayed in). The class goes over some interesting concepts but I felt like the routing and switching projects were a little over the top. I think this class has moved from \"easy intro to modern networking concepts\" to a wide-ranging class that can be hard to understand what is required for projects. Overall, I would recommend against taking this class unless you work in telecom or are planning to work in a field directly related.", "rating": "Disliked", "workload": "15 hours/week", "author": "wFUeh14b6Ug541hutU0FIbavCOM2", "difficulty": "Hard", "semester": "Fall 2017", "time": "6/7/18, 1:06 PM"}, {"comment": "Zero involvement whatsoever from the professor all semester. So far as I can tell, she has only held office hours one or two times and posted in Piazza a similar number of times. The quality of the assignments has huge variance; I found some of the assignments interesting and did feel like they taught me something about networking (an area in which I have no previous experience). Others, though, have a number of issues ranging from poor descriptions, poorly written and formatted provided code, and just being a huge waste of time. Grading for the homework is sometimes nonsensical as well. Some of the lectures are good, others are insufficient to explain the material with the level of detail appropriate for a course at this level. Exams are difficult and not conducive to real learning. I'm on track to get an A, but feel like I've learned much less than I feel like I should have.The course was able to succeed at all only because of huge commitment and involvement from the head TA (Stacia Stokes), who is excellent. Not recommended for those who are considering this only as an elective.", "rating": "Disliked", "workload": "8.5 hours/week", "author": "66VRqANhSwTJxvS1sl0WDCu9kAw2", "difficulty": "Medium", "semester": "Fall 2017", "time": "11/4/17, 11:51 PM"}, {"comment": "This is one of the first courses I took in OMS. Overall the course has been awesome. The course is very well structured and the projects have clear, well-written requirements. I would definitely recommend it to new students. MAJOR kudos to Head TA Stacia Stokes this semester for always going above and beyond and staying on top of everything!", "rating": "Loved!", "workload": "20 hours/week", "author": "7OXexWMRhQh9wboLIdTV3MyL8br2", "difficulty": "Easy", "semester": "Fall 2017", "time": "11/5/17, 9:32 AM"}, {"comment": "This is a great course if you're interested in lots of details on how computer networks operate. My favorite parts were learning about the original design principles of the internet (since it was a department of defense project), and how TCP flows and congestion control work. I used to do a lot more backend work, and this class has given me some better background info on some of the projects I was working on.The projects are a split between programming interview / competition style Python algorithms, and lab reports based on experiments conducted using a simulated network. The 2nd and 3rd projects are hard especially if you haven't had much programming experience. The lab report assignments can be very time consuming, since there's a lot of graphs to embed into google docs documents and explanations to give. The tests are moderatly difficult to hard, so make sure you study. The later readings really pile up, and can be fairly dense and dry. The lectures are great overall, but can be a little unclear in explanations. The professor has also been mostly absent during the course, and has only given us one or two office hour videos. Luckily, the best parts of the course have been the amazing student resources. The Brainscape flash cards, the test prep notes, and the great questions have really made the class a lot better. Our TA (Stacy Stokes) has done a really great job in posting weekly office hours answering questions to help explain projects. Piazza can be hit or miss, since there's a TON of threads, and it's hard to find important imformation even when threads are pinned.Summary: Recommended. If you're a solid programmer, this is a good first course to take.", "rating": "Liked", "workload": "13 hours/week", "author": "c95GMfzlRaX1MGOgcuA5EDfy31l1", "difficulty": "Medium", "semester": "Fall 2017", "time": "11/5/17, 7:09 PM"}, {"comment": "I learned a lot in this class despite it being fairly easy. There were 8 projects and 3 tests total. I'll expand on this review later...", "rating": "Loved!", "workload": "5 hours/week", "author": "ak1SyKQeX8TDGsrZvvoWWkkLV822", "difficulty": "Very Easy", "semester": "Fall 2017", "time": "12/6/17, 8:45 AM"}, {"comment": "This was my first OMCS course and my day-job is in Network Engineering. So I consider myself better prepared than most for the course topics.First of all, like reviews from the summer semester, the course professor barely interacted at all. I recall an office hours for the first test and there was one set of discussion questions. The class was essentially ran by the Head TA, who did a fine job, but it was disappointing to miss that expert-level interaction. And for a course with 400+ students, that's quite an ask for the Head TA.It will definitely help if you have some background in computer networking, especially in Part 1 of the course. Some fairly complicated networking topics are not explained with an appropriate level of detail. If you don't have the background on standard routing and switching technologies you'll likely need to do supplemental research to handle the first two projects.The tests cover a lot of material and the questions are fairly subjective overall. It can be tough to know what the \"best\" answer is. Still, they aren't unfair and if you complete the test preparation questions you should be fine.Some reviews have characterized this course as \"Network Programming in Python\". This is hardly accurate. The course clearly lists at least an introductory level in Python is required. The first two projects are probably the hardest of the semester, but both can be completed with around 50 lines of code. The real challenge is in understanding the algorithm. The code itself requires nothing more than the ability to use variables, follow control logic, and pass messages, all capabilities learned in any introductory computer science course. The undergraduate networking course required implementations in C, and those projects were much more time-consuming then anything found here.Overall, I recommend the course to anyone interested in Computer Networks as an operational discipline. If you just want to know how to write networking code as an applications developer, this course isn't for you.", "rating": "Liked", "workload": "7 hours/week", "author": "z0k64w4i49SKJyUkBsdQBcWJV4t2", "difficulty": "Easy", "semester": "Fall 2017", "time": "1/3/18, 2:27 PM"}], "difficulty": 2.502, "enrolled": 1142.0, "id": "CS6250"}, {"rating": 2.911, "workload": 12.785, "withdrew": 73.0, "comments": [{"comment": "Do not take this course. It is really hard because there is no guidance at all. The videos do not correspond to the projects. The quizzes are awful and everything is hard not because of the topic but because the Tas and the professor think you should learn on your own. This is going to be my first B or C. I took this class in Fall 2018, half of the students dropped.", "rating": "Strongly Disliked", "workload": "40 hours/week", "author": "ZuvxcFQeE2VHhAm3tcChB34FLa62", "difficulty": "Very Hard", "semester": "Fall 2018", "time": "12/30/18, 1:47 PM"}, {"comment": "This was my first class in OMSCS. It was a good experience. Lets see if I can summarize my experience in Pros and Cons Pros: 1) Net work security as a subject was interesting. Learned quite a few new terms and concepts. Did not know that the malware creators are becoming so advanced 2) The assignments were good. detailed explained. difficulty level were OK. not too difficult and not too easy. languages used were python and javascipt regular knowledge of Linux and some script was good to have 3)Piazza was active and most TAs were responsive. they even corrected a few incorrectly graded quiz 4) Grading was fair except for Project 2 which was really bad, the median was below 50 Con: 1)The videos on udacity are bad, the quizzes even worse. they come out of nowhere. even before a subject is explained there are bunch of questions asked2) The quizzes sometimes I feel were not worded properly and were ambiguous causes regrade. 3)As mentioned earlier, Project 2 was very javascript heavy and people like me with no background on front end were struggling . there were also several artificial conditions to be met to get things done which makes things difficult.", "rating": "Liked", "workload": "12 hours/week", "author": "d364kt9PybSaYbhIFx0GIV20DQE2", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/6/18, 12:46 AM"}, {"comment": "This was the worst course I have ever taken across multiple universities and multiple different programs. I have an MS in this field, have worked in this field for years, and literally was not able to complete Project 2 at all. I earned 100% or close to it on all the other projects, but that project has the most absurd set of requirements I have ever seen.Disregard everything the syllabus or anything else says about the course requirements or prerequisites. You need an expert level knowledge of Python, Javascript, HTML, CSS, Chrome extension development, executable disassembly in Linux and Windows, radare2, ida pro, ANGR, SNORT, Wireshark, and machine learning just to do the projects -- and you won't have time to get it if you don't. Each of the projects would be either a full semester or 1/2 semester course at any other school -- and the course makes absolutely no attempt to teach you any of the things you need to know in order to complete any of them. The teaching philosophy is \"go read the papers the professor wrote\". The lectures are a high level overview of small pieces of the information you need, but make no attempt to actually get into detail on anything -- they're completely useless. In fact, they remind me of CIS101 type lectures in terms of their depth. Additionally, the projects are so poorly defined that they have to be continually questioned and re-questioned to get some idea of what the TAs are actually looking for.And the quizzes. Everyone's favorite. If you've ever taken a Comptia test, this is equivalent. Not in difficulty, in the requirement to memorize obscure (and often incorrect) bits of useless information hidden deep in the depths of 10+ year old research papers in order to find the least incorrect answer in the confusing mess of distractors. Each quiz violates every principle of multiple choice exam development, using the most confusing language possible to artificially inflate the difficulty. Every question is a trick question.The professor and the TAs? Dismissive, don't care, basically tell the students to go jump in a lake any time questions they don't like are raised. That's the only time the absentee professor shows up, in fact, is to berate students whose questions he doesn't like.Final exam? Well, they pretend it's not exactly a final by omitting two lectures from the lecture list for the final, so that they can make it required outside of the final exam timeframe required by the university. It's the kind of technicality a lawyer would love, I suppose. And they use proctortrack, and they require you to use a mirror to show the rest of the room around you, and threaten to give you a zero on the exam if they can't see your mirror scan well enough -- and you can't re-do the mirror scan, and you can't see the mirror scan in the 1\"x1\" display in proctortrack, so there's no way to know if you did it well enough. Multiple requests to show the room with the webcam or rotate the laptop around were ignored or answered with \"use a mirror\". The course is actually more focused on anti-cheating than it is on teaching the material -- which is a shame because the course subject is a very interesting subject, and if taught well this would be a premiere course in this program. ETA: Well, the final is finished and graded. Class-wide, we identified over 20 of the 35 questions as being incorrect, contradictory, or otherwise broken. They didn't publish the class average, but based on the industry professionals in the course, my guess is the average was less than 40%. We'll see what final grades are when they're posted.This course is a dumpster fire. I would not recommend that anyone ever take it.", "rating": "Strongly Disliked", "workload": "40 hours/week", "author": "6Vu3hNq1tiO71WhpSHBlovi830F2", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/26/18, 9:57 PM"}, {"comment": "Worst class in the entire program. The professor is absent the entire course. The videos teach nothing, and the assignment instructions are useless. The course is essentially taught by google. By that I mean to learn anything or have any idea how to do the assignment you need to google everything. Then the kicker is the absent TA\u2019s show up just enough to accuse students of plagiarism because they had to google ideas on how to do the assignments. What a joke of a class. Do not take.", "rating": "Strongly Disliked", "workload": "30 hours/week", "author": "fjYSazZUFTPDDMizXCFar4SY7k43", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/17/18, 9:10 AM"}, {"comment": "Every aspect of this class failed to live up to the standards I expect from a GT grad program (online or not).tldr; Don't take this class unless you have to.This class is not hard. It is poorly designed and poorly administrated. I averaged 18 hours a week on it and got a B. That should be broken down to 6 hours of productive work and 12 hours of frustration/time wasted. On almost every lab, some requirement was elaborated on in a piazza thread by the instructor in a way that changed the approach to doing the lab.I'll start with the positives to be fair. This is a very interesting topic. I enjoyed learning about it in spite of the way the course was being run. The scope of the material is ambitious and that is not a bad thing. The slack channel was very helpful and active because nothing brings people together like complaining about the same things.On the other hand: Weekly quizzes and the final are checking if you can use ctrl+F effectively on slides/papers. Most questions are word for word from a lecture or paper except usually with a trick like one word had been changed. Many questions do not use logically sound English.Labs requirements aren't well communicated. (One lab's write-up was an 106 page slide deck smh). If you happen to be very familiar with the topic ahead of time you will probably get by. If you are not familiar your best bet is another student walking you through it. The lecture material does not. The lab material was heplful maybe half the time. These topics include python, javascript, chrome extenstions, HTML, CSS, Disassembly code, android architecture, Regex, Machine Learning basics.The lectures are barely worth mentioning because they do little more than provide a 2 minute version of the topics you'll have to do a whole lab on. They aren't really good or bad. You need to watch them for the final/quizzes which will test how well you can memorize random statements out of them.I'll give the instructor and TAs the benefit of the doubt that they were doing their best to make a good class, but that was not the result. Poor requirements and incorrect grading created a negative feedback loop on piazza very quickly. Students got angry. The staff got defensive. Nobody had a good time. Learning suffered.", "rating": "Strongly Disliked", "workload": "18 hours/week", "author": "4B4VBW0jAOQ8t4Fy3emCLI2ckFi1", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/18/18, 10:17 AM"}, {"comment": "This course is one of the medium difficulty courses with 5 projects. I will highly recommend doing Intro to information security before this subject as there are one or two lessons of that course which is used here.", "rating": "Liked", "workload": "12 hours/week", "author": "QBo7T9W4nMRGrRtTEXRA0e2sA653", "difficulty": "Medium", "semester": "Fall 2018", "time": "1/7/19, 8:02 AM"}, {"comment": "By far the worse class I have taken during my post high school academic career across 4 different colleges/universities. The course REQUIRES you to have reverse engineering experience and looking at assembly code, have an in depth understanding of server and client side programming in javascript and using ajax calls, AND have experience in analyzing .pcap files. If you have not had any experience in any of these, you will have an extremely hard time in this class. The instructor is completely absent during the semester and the TAs will try to help but there were multiple times when a TA's answer was literally \"This is a graduate level class and if you don't put in the time, we can't help you.\" when students had spent 30+ hours on a single project...The lectures are not even worth watching because they are 20-25 min that at a 30,000 ft view explain a concept that help you in no way in doing the projects.I would put the class structure in the following fashion: lectures (20-25 min videos): This is a car. readings(often 3-4 research papers): a car has an engine and a transmission. Projects: There is a malfunction in the V8 engine of this car. find it and fix it using the manual on google.", "rating": "Strongly Disliked", "workload": "25 hours/week", "author": "5k9988xLmqbjfNmx5KZSeQO8aRf2", "difficulty": "Hard", "semester": "Fall 2018", "time": "4/5/19, 1:28 PM"}, {"comment": "I strongly don\u2019t recommend taking this course. For those who want an easy A, it will cost many hours struggling with understanding the project requirements. For those who already have relevant experience and background, it will not extend in-depth knowledge.I took the course in hope of extending my knowledge in network security due to the strong interest in this topic. Professor Li probably is an excellent researcher and expert in this field, but the course is not well organized and taught. The lecture videos don\u2019t talk about the tools and techniques necessary for completing the projects. This is specifically true for project 2 and I believe many students dropped after finishing project 2.Pros:A wide range of topics are covered in the lecture videos .Classmates are helpful in both Piazza and Slack.Cons:The prerequisite for programming background is misleading. It says that prior programming experience with C or Java is recommended. This is not true. The projects use Python, JavaScript and HTML.Videos are completely irrelevant to the projects. It covers a wide range of topics but it\u2019s way too generic and are not helpful for the implementation of the projects. I feel like it\u2019s a waste of time.Recommended readings are over-assigned. 1 out of the 12 lessons is assigned every week. Here are the numbers, the recommended readings are a 358 pages book for lesson 3, 11 papers/webpages for lesson 5, and 6 papers (15 pages on average) for lesson 6. I would say it is more than a full-time PhD candidate\u2019s reading. Most importantly, those reading materials are not relevant to the projects, you must spend extra hours on the projects.The write-ups of the five projects are all full of confusions and errors. During the first several days of the release of each project, students would raise bunch of questions on Piazza and Slack to clarify the requirement and instructions. The TAs also had to change the policy in the middle of the projects several times, which was horribly frustrating, especially for those who started the projects earlier.Prof. Li is entirely absent from the class for the whole semester. Some of the TAs never reply emails.", "rating": "Strongly Disliked", "workload": "12 hours/week", "author": "aa831vhc4LPem103wjeKOCObXRE2", "difficulty": "Medium", "semester": "Summer 2018", "time": "7/29/18, 10:06 PM"}, {"comment": "Pros:broad coverage of network security topicshands on experimental projectsCons:class videos are shallowoverloaded assigned reading which may not be related to course videos or projectsrequirements of some projects are not clearno guidelines for final exam", "rating": "Neutral", "workload": "8 hours/week", "author": "ynMvNF8uu8W9GaPamuZavIn4Plo2", "difficulty": "Easy", "semester": "Summer 2018", "time": "7/31/18, 10:09 PM"}, {"comment": "This class is sort of terrible in a lot of ways, but fun as well. I took this summer 2018.Pros:projects are pretty interesting and you learn a lot doing themQuizzes are stupidly easy, but they play tricks with wording.easy A if you have the time to figure out wtf they want from youCons:the projects, while interesting, are terrible with defining requirements. Literally awful at it. You will spend so much time figuring out what the projects actually are asking you to do. It is insane how much time was wasted figuring out the project requirements.the quizzes I was talking about before are stupidly easy, but they are barely like the exam. There's no practice exam, and the quizzes don't help to study for the final.The quizzes are written through a language barrier, which would be fine, but the problem is the questions also sometimes have careful tricks in their wording. This is going to sound confusing, but there will be a lot of times where you'll be wondering about what the question is really intending to convey so that you can answer it correctly. You'll know the concept it's asking about 90% of the time, but you'll get shot in the foot by wording if you're not careful. It's done to a degree that isn't constructive because each quiz might only have like 4-10 questions.I frame busted my life dude. project 2 is terrible. seriously.There were no office hours. I heard nothing about video conferences either. Totally absent on slack and piazza.The TA's are very hard to reach. I only posted twice to them because I knew I wouldn't get an answer, and indeed I didn't. whack. Props to one TA William Lucas though for being quite helpful. And also props to the students who hashed out the requirements on Piazza with the TA's kicking and screaming.I also took IIS before this with the same professor. Honestly I have yet to see any actual proof that Professor Lee actually exists. I'm pretty sure he's just a concept used to refer to a loose collective of overworked graduate students that are laundering money through the university for a professor's salary and trying to funnel it into their crappy startup idea preventing ridiculous FERPA violations from happening in American universities.", "rating": "Liked", "workload": "20 hours/week", "author": "mXu7i5U8GjNsmGpZUCyDAYXZ8Vy2", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/1/18, 3:01 PM"}, {"comment": "Really. Never, take the course, no extra credit, no curve. And really slow in grading and answering question on piazza. You will regret.", "rating": "Strongly Disliked", "workload": "20 hours/week", "author": "8udVaCgcPBPbNQ6AU7BciHxh2iq1", "difficulty": "Easy", "semester": "Summer 2018", "time": "8/3/18, 3:51 PM"}, {"comment": "This course has a lot of potential, but was one of the least enjoyable for me. The projects are interesting except for project 2 which is a complete nightmare in that the test cases used for grading don\u2019t match the percentage point distribution in the write-up, and there are multiple unrelated components that take a lot of background learning to understand. The final has a large amount of true false questions where you need to pick the answer specified in the lectures even if you can find more accurate and up to date information from other sources in the CS/network security field.", "rating": "Neutral", "workload": "10 hours/week", "author": "0r4KPf0sv8MV9GmBK7szM6pTksI2", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/8/18, 11:16 AM"}, {"comment": "Course is easy, but the absence of Professor and TAs make it somewhat headless.In summer, there were 5 projects & 1 final exam.The 5 projects descriptions were pretty poorly written, needing a lot to be clarified with TAs - who weren't always readily available.The final exam was 1 hour everything closed proctortrack exam. There are total 33 questions, worth a total of 100. They are all from the lectures.", "rating": "Neutral", "workload": "10 hours/week", "author": "ORodtp3R0jbJuAM9K5Iwxxra4px1", "difficulty": "Easy", "semester": "Summer 2018", "time": "8/8/18, 3:12 PM"}, {"comment": "This review is for Fall 2018. That option was not yet available in the drop down. This course has undergone a significant rework as of Fall 2018, based on the students feedback.Quizzes are predominantly from the required readings and research papers. Not from the lectures only as stated in the previous feedbackProjects are significantly tough. Add to the complexity, the wordings and some parts of the projects are frustratingly ambiguousGrading projects takes a LOOONG time. Project 2 grades and feedback didn't come until project 4 is released, making it really hard for students to make a decision on whether to drop it or not.If you get the code completely working, you will get good grades. If it is partially working, expect to get close to nothing.Leaving out some of the instructions like uploading all the files everytime in canvas will result in 0 marks. In contrast, Other courses are okay with just uploading changed files and their autograder works fine.10 hours per week is a really underestimated efforts. You should have been in the slack channel for project 2 or project 3 to see how many hours students put in. Each of them were well over 40 hours each. This is coming from someone that is half way in the program with a perfect GPA and have done well in many of the courses.Syllabus doesn't do justice to pre-requisites and preparation needed for the course.Project 2 - Requires Regular expressions, writing a Chrome browser extension, HTML, CSS, JavaScript, JSONProject 3 - Windows malware analysis, angr, Wireshark, Cuckoo, Android malware analysis, control flow graph analysis, Jadx, Apktool, Android emulator, adb, Javaproject 4- Snort, Wireshark, Python, pcapProject 5-Python, pcap", "rating": "Disliked", "workload": "20 hours/week", "author": "VodUHVanDihzf0X7hpedlRLByaN2", "difficulty": "Hard", "semester": "Summer 2018", "time": "10/23/18, 8:05 PM"}, {"comment": "This course serves as an introduction to network security. The vast amount of the frustration comes from one project that needs to be upgraded. Specifically, the autograder requires an obsolete approach to be used that makes a solution require 20-30 hours for 25% of the project grade rather than 1-2 hours. No one simply wants to make the effort to upgrade that project and the course to the level of AI or CV. I shared in the frustration but I have experienced the same in SAT so I can't single out this course as being especially awful. The quizzes require careful reading but are pretty easy points. The difficulty of quizzes and tests are exactly like IIS.I would only recommend this to students who are brand new to network security due to the broad range of topics covered. The depth and projects are nowhere near the cutting edge and won't be helpful to anyone with experience in this field. To those new students, I also recommend a minimum of 8 GB of RAM for the virtual machines that have to be run for the virus analysis. My old 6 GB computer had the absolute minimum required to complete the assignment.", "rating": "Liked", "workload": "18 hours/week", "author": "AAhVG90JRcQCBBqwZwGK78TaucU2", "difficulty": "Medium", "semester": "Summer 2018", "time": "12/3/18, 9:45 PM"}, {"comment": "NOTE: This is actually for Fall 2018. I ended up dropping the course.This is possibly the worst course I've ever taken in an academic setting. For reference, I am a Network Engineer who deals with cybersecurity concepts on a regular basis, and have taken both Computer Networks and Intro to Information Security. I also have my undergrad from Tech (and a former TA) so I'm familiar with difficult courses. I'm the target audience for the type of person who should enjoy this class.Unfortunately, this course is difficult due to absenteeism and apathy from both the professor and TA staff, and one particularly poorly designed project.I ended up dropping this class during Project 2. This project is infamous and was warned about from prior semesters. Instead of revamping the project or providing any context, the professor/TA doubled-down on it. The professor and TAs were virtually non-existent in both Slack and Piazza, and the best advice came from a former student of the class. After spending a week and a half and 60 hours on the project, primarily banging my head against Part 2 of the project and running out of time, I was forced to drop.With any project there is a fine line between providing guidance and providing the answer. Graduate Intro to OS does a fine job of providing guidance even if it is frustrating at times. The only response I received from the TAs, after typing in detail the various things I had tried and the issues I was having, was a curt \"Look at the paper again\".Considering this course is a requirement for the Online Cybersecurity program, I hope it is reviewed in a new light and significant changes are made, because as is it is a black mark on the fine Georgia Institute of Technology.", "rating": "Strongly Disliked", "workload": "20 hours/week", "author": "z0k64w4i49SKJyUkBsdQBcWJV4t2", "difficulty": "Hard", "semester": "Summer 2018", "time": "12/10/18, 4:36 PM"}], "difficulty": 3.025, "enrolled": 442.0, "id": "CS6262"}, {"rating": 2.958, "workload": 6.833, "withdrew": 0.0, "comments": [{"comment": "If you've taken Computer Networks and Info Security like i have, there is not very much new technical material in the course - except for the ladder logic project, which was different and cool. The extra papers were good reads, but the official text was dry and verbose. One could almost do without it, but not quite, if getting an A is the goal. One specific gripe is with the tests, which are a large percent of the grade, not being worthy. Overall, just OK and possibly redundant. I'd rather have taken something else.", "rating": "Neutral", "workload": "10 hours/week", "author": "xwNa7JhJF8S78tDEDvc3o6tleCB3", "difficulty": "Easy", "semester": "Fall 2018", "time": "12/14/18, 1:46 PM"}, {"comment": "The exams were taken almost exclusively from the lectures. Take good notes as this is all you can have for the exams (limited notes only for exams, no open book). The text books and other readings were not used much at all. The projects were interesting, but the was little to no feedback on them after the were graded - no explanations, examples, or answers - just the instructors private comments. Some of the project requirements are vague, so be VERY careful when answering them. In this case, MUCH more information is better. Some of the test questions were ambiguous and I think one of them was flat out wrong (the \"correct\" answer was actually a sub-set of one of other excluded groups), but the head TA cited some extra material not covered anywhere else to show how they considered this answer \"correct\". You should have taken the Information Security (CS6035) class as a prerequisite as one of the projects leans heavily on material covered there, so definitely NOT a good 1st course. Grading for the class seemed to take way to long (last day of semester and still waiting for a final grade for one assignment).", "rating": "Liked", "workload": "6 hours/week", "author": "A1YQduYfJMh6nHr7PcYSLdhGEbx1", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/16/18, 9:36 AM"}, {"comment": "This course was excellent!The material was well summarized by the professor in the video lectures and it gave a concise overview of the many aspects of CPS security.The assignments were challenging but the TAs did it a good job in hinting us in the right direction when needed.The use of Piazza was well organized and everyone from the Professor, to the TAs, to students participated well in the discussions.The paper presentation also gave everyone the chance to get exposure to several research topics on this field.Lots of reading and lots of work on projects but well worth the time.", "rating": "Loved!", "workload": "8 hours/week", "author": "EvJb4zRPHxf43znBW0xPTV4H4xS2", "difficulty": "Medium", "semester": "Fall 2018", "time": "1/1/19, 11:09 AM"}, {"comment": "For context, I have a background in security, including being in charge of security architecture, being a CISO twice, and a (lapsed) CISSP. Given that, I didn't think I'd learn a ton in this course, but that was not the case.It turns out that, when you look at security through the lense of Cyber-Physical Systems and Industrial Control Systems, a lot of things you think are settled or solved are still open questions. In fact, we are creating new \"legacy\" situations every day as we invite all sorts of networked devices (with questionable security, monitoring, and updateability) into our lives. IoT, anyone?As far as logistics, there were inevitable hiccups, but the TAs were on top of it and worked hard to make sure that we could learn. Very flexible and supportive.Dr. Beyah has an engaging lecture style and covers the material well. I recommend this course if you have an interest in security, how infrastructure works, and what the \"new infrastructure\" (IoT, AVs, etc.) will be and how to secure it.", "rating": "Liked", "workload": "5 hours/week", "author": "FkqhSTOsG3d2KjDg4DCNqFKIPJK2", "difficulty": "Medium", "semester": "Fall 2018", "time": "1/15/19, 6:36 PM"}, {"comment": "I found the course to be pretty interesting as it made me explore a different aspect of security which was quite an unknown zone for me and it had some decent projects though I really disliked the pacing of this course. Piazza was quite active for the most part with TA's/students sharing articles/papers/news outside of the course content but still related to the subject matter. I really loved the documentary related to Stuxnet that was shared - well worth a watch.I took the summer version - and there were 3 projects. First project was quite easy and required the use of Schneider Electric's SoBasic. Second project was related to the protocols that you will study during the course - Modbus/DNP3 - I personally did horrible on this one as I was in the middle of relocating between countries due to my Job. But the class median on this project was quite high so I think it would have been doable, I just did not have the time to do it properly. The third project was nice and a bit tricky also - it required knowledge of using gdb to ultimately exploit a buffer overflow vulnerability. There was a 15 point extra credit on this project also.Exams were fair, questions did not seem ambiguous but they were extremely short. They give you 2h 50mins for the final exam that you can complete in 10 minutes - I don't understand the point of this. The first exam was 1 hour and frankly it had more questions where some \"thought\" was needed and there the 1 hour time was somewhat justified. Final exam is cumulative.Coming to the pacing - I don't know who has decided this schedule but there's practically nothing that happens during the first few weeks and very little even in the first month and then you finally get something to do from the mid-term till the end. It would be really worthwhile to adjust the schedule and put two projects before the midterm instead of just one. Currently, the workload is a bad factor to judge this course on. Not saying the workload is too much, it's just not indicative of the reality - I don't think I ever spent 7 hours per week, but certainly spent 20+ hours on the 3rd project trying to figure out a silly error.Overall, it was a decent course. My complain is the awkward pacing and the fact that the grading is quite weird - you basically have to do great on everything. With 100% in two projects and 90% in both exams, I still ended up with only a solid B since the second project pretty much screwed me over as I got a 50%. And since the overall class median/average is quite high, you cannot expect a curve. So if you have some important personal/job related stuff come up after the mid-term, then it could affect your performance in some projects.", "rating": "Neutral", "workload": "7 hours/week", "author": "vS5RXT5ehldXZhorr2AJz3BGBNy1", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/7/18, 6:01 PM"}, {"comment": "I took this course for Fall 2018, and withdrew as I had unplanned international travel right on the timelines for Project 2.This is a very interesting course. Don't come in expecting to learn the standard C/Java like programming assignments. This is a new domain (was at least new for me). If you come in with that curiosity, you will enjoy this course.Teaching assistant team for this course is really good. Tohid is clearly passionate about this course and domain and does a fantastic job.Course has three projects and 2 exams. Generally projects use non-traditional protocols and technologies such as ladder logic, somachine, mininet, modbus, etc. So there is a ramp up time before every project. But the learning curve is not too steep. If you start early, you will do well.Median for this course is quite high given that lot of people do well. There is also an extra credit assignment (Between 1 to 3 % points). So don't expect a curve for this course.Piazza for this course is probably the best organized one in the entire OMSCS program. Tohid creates a thread for every part of the project and all the discussions are generally captured in that one place. It is much better than wading through several threads of totally disorganized topics in some of the other courses.Office hours are also recorded, which is another plus.Paper presentation was tried for the first time in this course in Fall 2018. It gives a very good exposure to a bunch of research topics on this field. If you are complaining about lack of an evaluation component in the first 4 weeks, here is one that you can pick. It is much easier to see a video done by one of the peer students for 20 minutes compared to reading through 40-50 research papers through the semester.", "rating": "Loved!", "workload": "10 hours/week", "author": "VodUHVanDihzf0X7hpedlRLByaN2", "difficulty": "Medium", "semester": "Summer 2018", "time": "10/27/18, 9:23 PM"}, {"comment": "Definitely not a easy class especially want a A grade. The projects are not easy, but if you take CS6035 and CS6250 before this class, those project won't be a big deal. The extra projects are difficult, especially the first. TA didn't provide any information regarding the extra projects, and the knowledge we need to accomplish those projects didn't come from the lecture. I spend a whole weekend tried to figure out the right way to perform MITM attack. Overall, I think this is a interesting course, although may not be very useful", "rating": "Neutral", "workload": "10 hours/week", "author": "CnzLpXdnZGXbeQQAmujuq3gvp2G3", "difficulty": "Hard", "semester": "Summer 2018", "time": "12/17/18, 7:46 PM"}, {"comment": "As others have stated, this is a bad course, and the worst security course in OMSCS (I have taken all the other ones before this). The professor clearly doesn't put any effort into the class or the tests. The projects are hard to interpret, but not too bad once you get past the setup time.The real issue I had with this class were the tests. They are about 20 multiple choice questions that are terribly worded with answers that all make sense depending on the context that you do not have. Its more or less his opinion really, so you have to spend a ton of time trying to figure out what he believes is the best answer and not what is actually the best answer.TAs were good. They had to deal with almost all aspects of the class because the professor was non-existant but they did a good job with that overall. I strongly recommend not taking this class, even if you want an easy A. Its not worth the time or effort you will spend.", "rating": "Strongly Disliked", "workload": "10 hours/week", "author": "e8ICUxD2kvWf7kOowWPv4qpEUvi1", "difficulty": "Easy", "semester": "Spring 2018", "time": "5/10/18, 2:41 PM"}, {"comment": "The professor reads directly from the book for all lectures (so no need to buy them). The projects are virtually unrelated to the curriculum (line logic PLC programming and low-level stack overflow coding - seriously?). TA's are not buttoned up - assignment dates are arbitrary, deliverables change last minute, etc.. Professor makes 0 appearances during the semester. Unfortunately, it didn't meet the GT bar...", "rating": "Strongly Disliked", "workload": "16 hours/week", "author": "N9UkncEvOubLG72huaEki2Y9NqH3", "difficulty": "Medium", "semester": "Spring 2018", "time": "12/14/18, 10:03 PM"}], "difficulty": 2.417, "enrolled": 0.0, "id": "CS6263"}, {"rating": 4.16, "workload": 12.533, "withdrew": 186.0, "comments": [{"comment": "Great class. Really enjoyed it. Nolan was an awesome TA.", "rating": "Loved!", "workload": "12 hours/week", "author": "glijNJigtvNN3U66PMCgeDDEStF2", "difficulty": "Medium", "semester": "Fall 2018", "time": "1/2/19, 9:52 AM"}, {"comment": "This was my first class in the program. At first I felt a little overwhelmed by the amount of information and especially the project #0. Once I passed through the first half of the semester it became much easier. After projects #0 & #1 projects all started to make more sense. Nolan deserves a nice bonus for going above and beyond for his TA work. Overall, I entered the class with very limited computer architecture knowledge and finished with a solid understanding of the area at a graduate level. I recommend this course to anyone who is fascinated by how computers work.P.S. My course was in Fall 2018. OMScentral feedback page did not allow me to choose Fall 2018 and the only closest option was Summer 2018.", "rating": "Loved!", "workload": "12 hours/week", "author": "KO6QTk7wEdTCBu8PH9bG5xcU8FO2", "difficulty": "Hard", "semester": "Summer 2018", "time": "1/6/19, 2:03 PM"}, {"comment": "I took this course in Fall 2018 (didnt find that option while writing this review)I found this course informative and hard. There were lots of nitty-gritty details about the processor architecture discussed and these needed to be applied during the exams to solve problems. I found the midterm exams quite tough and ran out of time trying to solve these detailed problems. The exams were open book but only on notes that were hand written. All my notes are online and printing them out was not an option for me. So, this made the exams pretty much closed notes for me and was unnecessarily tougher due to thisI throughly enjoyed the projects which were inline with the weekly topic and helped understand the topics better. They were all C based and understanding code navigation (using csope or anything similar) helps.Overall, I found this course well organised and informative. IMO its quite hard for as a 1st course", "rating": "Loved!", "workload": "15 hours/week", "author": "2DZdkeLXKuSNSWOFQAP8E493xyy1", "difficulty": "Hard", "semester": "Summer 2018", "time": "4/4/19, 12:48 AM"}, {"comment": "Great course. I have no background in computer architecture before, therefore It's could be hard at the beginning. But if you got through the course, you will definitely learn a lot a lot. The grades for both project and exam are very generous, I got overall 98 at the end. The leader TA Nolan is awesome! He is the best TA in this program I have ever seen.", "rating": "Loved!", "workload": "15 hours/week", "author": "CnzLpXdnZGXbeQQAmujuq3gvp2G3", "difficulty": "Medium", "semester": "Spring 2018", "time": "5/5/18, 2:36 PM"}, {"comment": "This was my first class in the program. While it wasn't a subject I was initially interested in, I learned a lot and had a good experience. The lectures were very clear and well paced. The exams were very much in the spirit of the lectures and were not difficult, although you should study for about week in preparation.Additionally, the main TA, Nolan, was incredible. He was very attentive, caring, quick to respond and knowledgable. I was surprised by the amount of collaboration and camaraderie among the class. The other TAs were almost inactive (as far as I could tell. May have done things behind the scenes), however, Nolan was so good it didn't matter.The only thing that could be improved were the projects. Each project was essentially running a simulated processor with a test program, tweaking the inputs of the processor, and seeing how it performed differently. Then, there would be a code section were you alter the code of the processor and see how it performs.The first section taught me a lot about processors, however, the code portion was more tedious than informative. This is because the simulator is a huge C++ code base that is somewhat poorly written. Most of the time involved in the projects is trying to understand what the code is currently doing. The feedback loop is also very long because running the simulation normally takes about 30 minutes real time.The saving grace here is that the TAs allow you to compare results on a simulation other than the one for the project. So you can know for sure if you have the right answer.This could all be mitigated if the instructions gave you more direct guidance. \"Edit function, foo, so that it does x instead of y.\"Overall, though, good class, great TA(s).", "rating": "Liked", "workload": "9 hours/week", "author": "zwa1ZdwLgqM474uNxhim2RZ6uNz2", "difficulty": "Medium", "semester": "Spring 2018", "time": "5/6/18, 6:12 PM"}, {"comment": "Overall the course is good, lectures are meaningful, up to date with current technologies and Nolan as a TA was awesome. However the work on projects are tedious and time consuming. The projects are not stimulating at all and I had a hard time bringing myself to doing it. Overall, if you pace yourself properly (and not keep things for the last moment), it is not a difficult class at all. Make good notes throughout the course and keep it handy during exam. Professor allows the notes to be used during exam and it will help you give pointers to solve problems.", "rating": "Liked", "workload": "15 hours/week", "author": "5v1Tr8NyEZaH0XkFyx5FBTLwkIv2", "difficulty": "Medium", "semester": "Spring 2018", "time": "5/7/18, 7:45 PM"}, {"comment": "Solid class.", "rating": "Liked", "workload": "7 hours/week", "author": "eJG0cxSZxTUv08RYPXyqL4T6blz1", "difficulty": "Medium", "semester": "Spring 2018", "time": "5/10/18, 11:30 AM"}, {"comment": "If you are already familiar with related concepts already, especially pipelines, cache, and out of order execution, this course is not that difficult. However, if it's your first course into computer architecture, this could be very difficult. In the labs, we have to go through part of a CPU simulator written in C++ and figure out how to make proper modifications.", "rating": "Liked", "workload": "15 hours/week", "author": "PxAiB2KudcbP6HWz14umdLIayNm2", "difficulty": "Hard", "semester": "Spring 2018", "time": "12/12/18, 12:39 AM"}, {"comment": "This was a pretty great course. The lectures are well done, and the tests were straightforward. The projects were on the challenging side, but not because the concepts themselves were difficult (though they aren't a cakewalk either... ). The main challenge in the projects is development in a simulator that is old, very poorly documented, somewhat nebulous, and doesn't seem to follow a coherent design. That being said, it isn't really a problem, just time consuming.I took a similar course in undergrad, but this class goes more in-depth into actual algorithms and designs, and peels off several layers of abstraction to get into the core of CPU architecture design and theory. I would definitely recommend it, but do be prepared for the projects!", "rating": "Loved!", "workload": "8 hours/week", "author": "Sdq0fsqxXIgTfxEVZ1SagUW4rcj2", "difficulty": "Easy", "semester": "Spring 2017", "time": "9/27/17, 2:59 PM"}], "difficulty": 3.8, "enrolled": 210.0, "id": "CS6290"}, {"rating": 3.3, "workload": 16.45, "withdrew": 0.0, "comments": [{"comment": "tldr: Don't take this class, you will not get any value from the course, and the homework and lectures are terribleThis is NOT an embedded systems course. This is a course about compilers, and most of it is his research which is not going to be helpful for anyone working in or wanting to work in the embedded world.The logistics of the course is a nightmare, there is 1 month left and we have received a grade for 1 homework assignment and have 1 project 1 homework assignment and the final all due at the end of the month.The course material is also questionable at best. We go over vliw architectures at the beginning which is interesting, then the remainder of the course is on his research in compiler optimizations which will be useless for anyone in industry.The lectures are terrible, the homework and projects are vague and hard to understand what is being asked. Do not take this class.This is my first course, I am hoping my remaining courses are a completely different experience.", "rating": "Strongly Disliked", "workload": "16 hours/week", "author": "m2EQnAnO8ZVAkykUUsLm9mvvKLO2", "difficulty": "Hard", "semester": "Spring 2019", "time": "4/7/19, 5:39 PM"}, {"comment": "Good god. This class to me was hard. Background is BS in Electrical Engineering, minor in computer science. Currently working as a web developer at a big tech company.Another note, this is my first class in the program; big mistake. Very hard, and my fundamentals for this low level was not where it needed to be. I felt like I could handle the challenge, but with working full time and the difficulty of transitioning to school with this class was too much to handle. Writing this with 2 weeks left before the final and I feel like I'm still drowning in this class. Our first project was a group one, and groups had to be reorganized because so many people withdrew from the class. Concepts are difficult and information feels scattered sometimes. Very difficult for me. Didn't feel like I had time to complete everything and the material is so dry. Made a mistake taking it, made a mistake not dropping it.", "rating": "Strongly Disliked", "workload": "25 hours/week", "author": "BmZHtXu0p9eMkqFyAi9qgQxYatA2", "difficulty": "Very Hard", "semester": "Fall 2018", "time": "11/26/18, 9:36 PM"}, {"comment": "About to finish up first semester only taking this class.I am a Mechanical engineering BS with some limited CS experience. I found this to be a good transition course. Concepts were generally easy to pick up on. First project (only group project) was the only real issue, workload for someone without much background was very difficult and time consuming.The homeworks and second project were all pretty easy and doable given the timeframe. A good transition to software concepts and work for me.", "rating": "Liked", "workload": "10 hours/week", "author": "4TrISJTuRVdBb1Zim5lPhb9tD422", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/5/18, 10:59 AM"}, {"comment": "This class was a logistical train wreck. Interesting concepts for the most part, but overlapping assignment due dates, snail's pace feedback, scatterbrained lectures, and a single exam as a comprehensive final at the end of the course with no types of tests/quizzes before then made for a very poor experience.Project 1 is quite involved (creating a scheduler for a compiler) and working in teams of 3 is not great when people are still dropping the course. This project is hard enough that if one of your team members drops out or goes AWOL, you are in for some extreme pain. Make sure you have a strong background in C/C++. I had a little bit of experience but still needed to learn a good bit for this project. At a minimum you'll want to at least understand pointers and basic function writing in C++. Also, the instructions really gloss over a number of mundane details which means the project is going to take a lot longer than you might first expect.The 4 homeworks were fair, but it took forever to get grades back. It wasn't until the final week we got back assignments 3 and 4. That gives you just enough time to study for the final, which they say covers everything, which is great since there are no other exams in the course to give you an ide of how to study. Also regarding feedback, neither project 1 or 2 was returned to us, so going into the final 60% of the course grade was unknown or undetermined.As far as the conceptual content, the material is somewhat interesting but the second half of the course is a bit messy and lost in tangents because it basically covers all the professor's research. You get a bunch of 40 page journal papers to read in addition to watching the lectures. The lectures themselves have a bunch of spots where things aren't adequately explained and sometimes it feels like the professor recorded the narration while he was driving for all the thought he put into the clarity of his words.Overall, this course seemed promising but ended up being quite a disappointment.", "rating": "Disliked", "workload": "15 hours/week", "author": "zrlgTCYjyoYqhDn8oXFipmhhtJt2", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/13/18, 2:12 PM"}, {"comment": "CS-6291 Embedded System Optimization (see also: CS-8803 - Embedded Software)CourseI enjoyed the course because I like the material, and I knew what to expect, but some may find the material formidable.I have completed several OMSCS courses, and can review the course in context with other OMSCS courses. I have software development experience, so I was prepared to take this course. The course introduced new concepts, and reviewed compiler concepts.Embedded systems are pervasive and their role can only expand. The course compares CISC and RISC, examines chip complexity for general purpose CPUs versus chip complexity for embedded processors. RISC and especially ARM are the primary focus for most lectures. Issues such as pipeline, register count, datapath, memory and register banks, instruction latency and code size are studied. The volume of material covered is vast.The course is presented as three distinct parts. Part one, \"Embedded Systems\" places specific focus on VLIW and VEX and increased parallelism. Topics include Computer Architecture, VLIW, ISA, Datapaths, Registers and Memory, and Branches. Part two, \"Compilers for Embedded Systems\", presents an overview of compilers, then examines Control Flow Analysis and Liveness Analysis. This part deals heavily with graph theory, and includes register allocation and liveness analysis (fairly complex topic).Part three, \"Compiler Optimizations\", is a deeper dive into Register Allocation, Optimizations for Code Size, Differential Register Allocation, Storage Assignment, and Parallelized Load&Store, optimizations which cooperate to improve performance, reduce code size, or decrease power consumption. Innovations expand addressable registers, improve data througput and instruction parallelism through banked memory and registers, DSP and NP specifics, et al. Network Processor optimizations are also considered.Lectures & ReadingsThe lectures require substantial time, but are worth watching. Dr. Pande does a good job explaining the material in the lectures. The lectures are dense, and you will spend substantial time each week keeping up with the lectures. Lecture content is back-loaded, and once you complete the first project, the majority of the lectures (and readings) lie ahead. Plan to accelerate your viewing and reading midway through the course.The papers (there are a large number of papers), the VLIW and VEX documentation, and the textbook readings provide an enormous volume of material to cover. Be prepared to read, a lot. The volume of readings was overwhelming, nearly abusive.ProjectsThere are two substantial projects. Both projects are challenging and require that the student demonstrate understanding of the relevant embedded concepts. The first project took about 50-60 hours (average 60), the second about 30-40 (average 40). Students were given 4-6 weeks for each project.The first project was a group project (3 students) to 'schedule' instructions on a VLIW (parallel) machine. The project required parsing the assembler for a substantial subset of the VEX instruction set, rescheduling instructions to preserve semantic behavior, reducing critical path length and thus improve runtime performance. The project required C++, parsing, and graph processing.The second project was an individual project where students determine how to improve performance or code size for programs built to run on a Raspberry Pi. This project requires that the student profile code, determine hot functions, choose heuristics, and compile functions for both ARM and THUMB instruction sets based upon heuristics and measurements.Students needed a Raspberry Pi 3+, needed to cross-compile for ARM, transfer programs to the Pi, run experiments, and produce a substantial report.HomeworksLest you find time to sleep, there are four homework assignments to consume your weekends. Each homework consists of multiple parts and demands extensive work and precise attention to detail. The homeworks compel one to deep dive into algorithms presented in lectures and papers. Keep current with lectures and readings and the homeworks will be less painful. One homework required coding, the others merely benefited by writing optional code (write the scripts and automate the manual work, you will be glad you did). Expect to spend 10-20 or more hours on each homework.Final ExamsThe final exam was cumulative. Since the amount of material is enormous, you need to learn the material as you progress through the course. The exam is fair, and tests important concepts explored by projects and homeworks. If you understand the projects and homeworks, the exam holds few surprises. However, the exam is 33% of the course grade, closed book, proctored, and over 3 hours long, so it could be very stressful.OverallThe amount of work required was enormous.Grading on the first two homeworks was quite brutal.The course requires tons of reading and tons of work.Over half the students who started the course dropped.The high drop rate eviscerated project groups, and forced reorganization.Concepts were not hard to learn, well supported by lectures and readings.Piazza became calmer and the remaining students were very helpful.Office hours were excellent; TAs and Dr. Pande very involved and helpful.Grading was glacially slow. One cannot blame the TAs as the assignments are extremely detailed. Some revisions to organization could enable more automated grading.The various optimizations can appear chaotic and unrelated, but when you consider them as a variety of approaches to improving various challenges in embedded systems architectures, the course is fairly logical and well organized.Nomenclature aside the homeworks require more time than some projects in other courses. The course has essentially 6 projects. There are some rough patches to the projects and homeworks, so ask questions on Piazza. The TAs were above average, but they do not hold your hand.Only one homework was graded by drop date (less than 8% of grade), the third and fourth homeworks were not graded until the middle of final exam week. Grading for the first project was not completed until after the final exam, and the second project and final (50% of grade) are not yet completed.Class averages were low:homework: 77%, 85%, 80%, 84%project: 90%, ?final: ?", "rating": "Neutral", "workload": "20 hours/week", "author": "google:109493400105693972152", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/16/18, 2:46 AM"}, {"comment": "This is NOT an embedded systems course. This is a compiler course with the word \"embedded\" thrown in loosely. 99% of the optimization techniques mentioned in the course apply to all kinds of computing systems. Optimization techniques other than compiler are not touched upon.The concepts taught are fairly easy to understand. The instructors make the class a little tougher because of labor intensive homework assignments and projects. There is not much you can learn by doing those assignments but the grading is generous, so you can get an easy B.The final exam was through Proctor Track and closed book. The questions were a bit vague in my opinion and did not do a good job of testing my understanding of the subject.If you think this can be a light-weight course to pair with a heavy course, think again. The mid term project and the homework assignments are quite labor intensive. Average work load is fairly low but it peaks when the assignments are due.", "rating": "Neutral", "workload": "10 hours/week", "author": "qrIPNwCKeydCwsC00NrlE0SV4Cb2", "difficulty": "Easy", "semester": "Fall 2018", "time": "12/17/18, 1:03 PM"}, {"comment": "LecturesThey are well designed and walk through the problems in full detailCourse ContentThe first half is greatLearn about Vex and a VLIW architectureLearn about compiler and register allocation strategies.The second half is purely based on the research conducted by the professor and his team. The lectures only provide an introductory base for the paper and it is upto to the student to learn more. This workload is quite much.AssignmentsAre straight-forward and easy to solveProjectsThe first group project requires coding ability in C++ and to make something worthwhile requires good understanding of the topic as we are working with a real life example.But the grading is not tough and easy to score.Final ExamWas on ProctorTrack, questions mostly from the assignments. Exam had a high average.", "rating": "Liked", "workload": "10 hours/week", "author": "swTAsqGzS5MdSiPGiG8dMqw7Fv22", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/18/18, 12:36 AM"}, {"comment": "First, the good. Professor Pande is very enthusiastic about the course, his lectures are clear and useful. He holds office hours regularly and is present on Piazza and participates in discussions. The readings cover the required material, and although difficult to understand at times are adequate to complete most of the homework and projects.The course is extremely difficult. The grading is inconsistent (different TAs), and not timely in any way. Project 1 and 2 grades were not available until after the final exam. The homework grades for 3 and 4 were available a day or two before the final.Project 1 is a relatively difficult assignment to write in C++ a scheduler to reschedule a VEX assembly file using a variety of different scheduling methods. Test early and often, as the testing is non-trivial and non-obvious. The grading was relatively reasonable, but as mentioned above it was not graded until the end of the course. This is also a group project and groups were formed and reformed as students dropped. An extension was given due to this.Project 2 is an analysis project -- basically take code provided by the course and run it on a Raspberry Pi and analyze it. Then adjust the mix of instruction types and test again and again using different methods. It's non-trivial, but not difficult. Again, not graded until after the final exam.The homeworks were difficult and grading was not timely.The final exam is comprehensive, proctored with proctortrack, and very difficult.Unfortunately we had little idea what our grades would be until after the final was graded and posted. You get no chance to figure out if you should drop the course until it's weeks too late.Learned a great deal, it's a good course but a difficult one, hopefully better TAs in the future will resolve some of the grading issues and make it a little better to deal with.", "rating": "Disliked", "workload": "30 hours/week", "author": "6Vu3hNq1tiO71WhpSHBlovi830F2", "difficulty": "Very Hard", "semester": "Fall 2018", "time": "12/26/18, 10:15 PM"}, {"comment": "This was a tough class. The material is properly complex (i.e. actual graduate-level thinking required) and the volume of material is high compared to some of the other classes. The tests are comprehensive, so you will actually need to pay attention to the lectures in order to be successful.The projects are fun! The group project was fun, but I'm never a fan of group projects at school thanks to potential impacts on grades from other folks who don't necessarily pull their weight or drop the class without telling you.If you are interested in compilers at all, this is a good class and enjoyable. It is tough, so be prepared for the workload.", "rating": "Liked", "workload": "20 hours/week", "author": "h6BAinmJTagvhdSBVtoG7gRLofA2", "difficulty": "Hard", "semester": "Fall 2018", "time": "4/4/19, 10:05 PM"}, {"comment": "Just finished this course (Summer 2018). For me personally, I expected it to be challenging going in as it was only my second course in the OMSCS program and I have no formal background in CS, or relevant work experience for that matter (I am an Officer in the U.S. Navy with a nuclear engineering background). I did however, have a pretty solid background programming in C and Python, which proved useful. The workload was manageable while also working full time. The course was condensed (summer course), so it moved rather quickly. It was not crazy difficult, but it was not easy.I found the course material very interesting. The online lectures almost go hand in hand with the books and were mostly strait forward to follow. If you are like me however, and have had no formal background in computer architecture (VLIW architecture specifically), assembly language, a good working knowledge of compilers (i'm talking under the hood of compilers), or C++, it can be a bit intimidating at first, but it is still very doable. With a lot of reading and some external research, I was able to overcome the rather steep learning curve within the first few weeks.This course was broken up into three major topics. The first is a \"review\" of computer architecture, with the emphasis being on a VLIW design philosophy. The second is a deep dive into compilers. The third section focused on four different and unique compiler optimizations (specific to embedded systems) which is the main point of the class, and really the most interesting part. The optimization portion was pretty thick with register allocation being one the most fundamental and key concepts to grasp along with lots of graphs and graph theory.For the summer course we had four homework assignments, which required a bit of time and effort to complete. For at lease two of the assignments, I had to write Python scripts to aid in executing some of the algorithms used, as doing them by hand was not practical. Overall, if you go through the lectures and use the textbooks to supplement, the homework assignments are not bad, they just take a little time to complete.The project was a group project, so you will need to partner up with others in the class. The project was advertised as one project broken up into two parts, which were completely unrelated, so really its two separate projects, both done with the same groups. The first project was quite the monster. We effectively made our own scheduler, which was done in C++. I had to learn C++ and do the project in parallel, so it took a bit of time. Also, the project description as written was insufficient to do the project, and do it correctly. This is really my first complaint about the class. Once you start getting into the meat of the project, you will quickly discover that there is much more that has to actually get done then appears at first glance. My recommendation is get the exact expectations from the TA's off the get go....for everything. The second project requires the use of a Raspberry Pi board which you will need to purchase if you don't already have one, and a little bit of C programming. Again, had some issues with the project description and required lots of clarification from the TAs. Also, to make things a little stressful, project due dates overlapped with due dates for HW assignments (by only a few days in both cases), so you really can't waste any time.The projects also required the use of the Deepthought clusters at GaTech, which you will be given access to. For me, and just about the entire class, this worked for about one day after which, I lost access to and was never able to get on again. If this happens to you, don't waste time while the TA's go through the hoops of submitted trouble tickets and figure the issue out. My recommendation is to install and understand how to use Vagrant. I was able to do the projects using the Ubuntu Trusty32 box which is made available and by using the Raspberry Pi board with Raspbian installed.The final exam was the only exam for the class, and was not easy. It was cumulative in nature and took a good bit of time for me to complete.Lastly, second and really my main frustration for this course was the TA's. Going into the final exam, Piazza at a glance looked something like 40 unread post, 17 unanswered questions, and 34 unresolved followups (actual stats). Piazza was like a ghost town, and the TA's were the ghosts. Usually 2-3 day turnaround time to get a question answered, and it was usually some vague one sentence answer which wasn't useful. You will rely on your classmates in Piazza to be successful. To be fair, the TA's were very reasonable with grades and everything was graded fairly.Overall, I actually did enjoy the class as I found the material quite fascinating. I think the class would be easier if you went in well versed in C++, have taken a computer architecture course, and are comfortable with assembly language and assembly notation. The class could be improved if the project descriptions were rewritten and the TA's were a bit more involved on Piazza. If they fixed these issues, I think this class has the potential to be awesome. Also, for someone with such little prerequisite knowledge, I did very well in the class.", "rating": "Liked", "workload": "15 hours/week", "author": "Begvn791w6dL5BBHT1oBaJaPSKh2", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/4/18, 2:07 AM"}, {"comment": "This course covers compiler optimizations for embedded systems.The punchline is that when you compile a program for a desktop operating system, you're not sure what exact processor the application is actually going to be run on. Because of this, desktop processors offer a fairly generic interface: your compiler creates machine code that can be run on a desktop processor in general, and specific processors then optimize that machine code dynamically according to the features of that processor. But when you're developing an application for an embedded microprocessor you usually know the exact specs of the microprocessor that your code will be running on: your compiler can optimize your code to that particular microprocessor, taking that burden off of the microprocessor, allowing the microprocessor to run more quickly and consume less energy.If you're interested in that, then this course is very interesting and illuminating. Despite my issues with the course, I enjoyed it. And you can read other reviews under the former course number: \"CS-8803-004: Embedded Software\".For the summer class, we had four homework assignments, two group projects, and a final. The homework assignments took me 5-10 hours each. The first group project--scheduling 4-wide VLIW code from a 1-wide sample--took me about 30 hours. The second group project--compiling media benchmarks to a RaspberryPi target and profiling the results--took me 10-15 hours. The final focused on the material covered by the homeworks and projects: I didn't focus any final-study on anything that wasn't in the homeworks or projects and I did well on the final. Like other reviewers, I wrote Python scripts to help me solve a couple of homework problems that would have taken too long to solve manually: when the assignment would ask for a \"best\" solution and there were many possible permutations, I wrote scripts. Where the projects required an Ubuntu machine, I performed my work on a local VM rather than using the GATech Deepthought cluster.In some cases, the TAs were very helpful, and in some cases they weren't very helpful. Grading on a few of the homeworks/projects was very fast and efficient. In other cases, grading was slow and frustrating. In particular, the students disputed two or three \"correct\" answers in the first homework. To the TA's credit, they followed up and credited the responses that we demonstrated to be correct.But in general, especially in our first homework, both projects, and our final, we did a lot of puzzling out exactly what was being asked for, or sorting through incorrect instructions. The final in particular took me almost the entire three hours for trying to decipher the questions: there were grammatical errors, poor formatting, unclear instructions--especially about what parts of our work and/or solution needed to be written down--and actual errors in the questions that made it difficult to complete the test. I did well, so I'm confident that I wasn't just misunderstanding the questions.In general, the course feels \"rough\". If you look back over all of the course reviews--under both course numbers--that's the consensus. Well, that's fine enough for the first couple of runs, but this course has now been running for a couple of years. So I'm a bit frustrated at that. But ultimately I did enjoy the course and I did feel like I learned a lot.", "rating": "Liked", "workload": "12 hours/week", "author": "RnOwfjcbIicockYRPl5Y59Zo5rJ2", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/5/18, 11:46 PM"}, {"comment": "OverviewThis was my second class in OMSCS and with no prior experience in computer architecture, assembly, C++ or compiler theory, I found it challenging. As others have stated, the course starts with computer architecture with a focus on VLIW then moves to compilers and wraps up with optimization techniques. I found it very interesting to learn the differences between RISC and CISC processors as well as the VLIW processor design philosophy. Embedded processors are everywhere (cars, phones, network equipment, control systems, etc.) and their unique power and performance requirements drive a much different processor design. In particular, embedded processors rely the compiler to do many of the optimizations that would typically be done on-chip in a desktop processor. Professor Pande clearly has passion in this area and several of the optimizations presented in the last part of the class are based on research that he has published in collaboration with others.ProjectsThere are 2 projects in the course, and they are both done with a partner. You will be asked to pair up on your own so be sure to jump on Piazza as soon as this process starts so that you don't get left in the dust. The first project was to build a scheduler which would take assembly-like input (VEX), build a graph data structure and then produce a parallel schedule. This project required C++. The second project really required more analysis and little to no coding. You will be benchmarking a couple of programs on the Raspberry Pi and then determining which functions should optimized. Although I absolutely love tinkering with the Raspberry Pi, I didn't find this project interesting at all. One of the whiz kids in my class gave a detailed post about how one of the design goals of recent ARM processors was to completely eliminate the need to perform the sort of analysis that we were asked to do. The instructions for the second project were particularly poor and several fundamental questions went completely unanswered by the TAs. This is maybe the biggest area that could be improved.NOTE: As others have mentioned, the project instructions talk about using the DeepThought system to compile and run your code but this is a complete waste of time. The entire thing can be done from a VM on your local machine and DeepThought is fraught with issues. I strongly recommend that you do not waste a single second on DeepThought. I suspect the TAs were new this semester and will help you avoid this pitfall in the future by updating the instructions.HomeworkThere are 4 homework assignments which each took a bit of time to complete. Homework 2 required C++ programming but all the other assignments were theory only. I found it helpful to have a good diagramming tool (Lucidchart in my case) since several of the questions asked us to produce visualizations.Final ExamI thought the comprehensive final was fair but there were a few mistakes in the instructions that left me hoping the question would be thrown out. We were given 3 hours and I needed the whole time to complete. I think the homework assignments and lectures helped to prepare me, although I didn't read a couple of the assigned papers and I'm confident that hurt me.SummaryThe content of this class was interesting and helped me fill in some gaps from my undergrad (computer architecture, assembly and compiler theory). Project 1 was fun but Project 2 felt completely obsolete and poorly supported. The homework assignments were a bit time consuming but manageable. Overall I would recommend the course.", "rating": "Liked", "workload": "15 hours/week", "author": "WIpoDbrHW2VD5P2zA5XzyP4PSGB2", "difficulty": "Hard", "semester": "Summer 2018", "time": "8/7/18, 9:29 AM"}, {"comment": "Just finished up Embedded Systems for the Summer of 2018. As an embedded hardware engineer, and having a strong hardware background in school, I found this class absolutely fascinating. It sort of fills a lot of \"low level gaps\" that you don't ever really think about when it comes compiling code for embedded hardware. You will definitely need a strong C/C++ background going into this class. Other classes that I had under my belt from undergrad that helped me were Digital Logic, Digital Design, and Microprocessors. Working as a full time professional, I found the work load manageable.I am not sure how this class flows during a normal spring / fall semester, but the summer semester it did feel pretty condensed and very quick pace, there was absolutely no down time in between lectures, projects, and home works. The home works and projects overlapped. During the first project, i had to stop working it, get the one of the homeworks done, and then pick the project back up, which i found kind of annoying. If you think you might need a slower pace, I would recommend taking this class in the fall or spring.The lectures were done very well. Dr. Santosh is very thorough, clear, and concise. There were a few errors in some of the lectures, but they were usually pretty obvious when you came across them, and there was an erratta provided to give you a heads up. The lectures followed the reading material very well, which included the textbooks, and the assigned academic papers (some written by the professor himself). The class is very well organized and broken down into 3 distinct sections:Review of Computer Architecture and crash course into VLIW design philosophy.Compilers Compilers Compilers. Front end and back end.Compiler Optimizations (my favorite part of the class).The very first lecture you dive head first into assembly language, if you have never had any experience with assembly, you might have some catching up to do, but i dont think it would be too overwhelming. This class assumes you have a working knowledge with the fundamental processor architecture building blocks, such as ALU's, IR's, Registers, Memory, Program Counters ect... so the first section is a pretty quick refresher, but it doesn't really go into the hardcore nuts and bolts of how an ALU works for example. Parts 2 and 3 use a ton of graph theory, and a ton of graph theory algorithms , which i found fascinating. I had almost NO background in graph theory, and I was able to manage just fine.For the summer semester, we had 4 homeworks and 1 project broken down into two different parts. The projects were pretty distinct from each other, so it felt like two separate projects rather than 1 project. Both projects were group projects. The home works were pretty straight forward, they pulled from the reading material and lectures, but they were pretty involved. When the homeworks get into the graph theory, I found myself writing programs to help solve the problems as they are not very practical to do by hand. For this, i mostly used Python. Homeworks were \"pen and paper\" style.The first project was the most intense part of the entire course. It was done in C++. I work mostly in C, so brushing up on my C++ was pretty quick, if you haven't had either, you will be at a disadvantage. I easily spent more hours on this project than I did on all 4 homeworks and project 2 combined, and then some. Enter my first complaint of the course: the project 1 description. it was vague, ambiguous, impervious to clarity, and riddled with copy/paste errors. I am not saying this to just complain, it really was pretty bad. It needs to be revised (See other reviews of this class, they will say the same thing). The TA's were basically absent from piazza to to provide clarification, which was pretty frustrating. I had asked for clarification on one of the requirements via the project description (which was unclear), and I did not receive a response until the night before the project was due, by then I had already \"made an assumption\", which ended up being incorrect. I had also already turned the project in, which I had to redo a pretty good chunk of my code and resubmit, which was absolutely miserable. The Deepthought Clusters stopped working about 2 days into the project, and this issue was never resolved. To overcome this, I ended up just putting vagrant on my machine and avoided using Deepthought all together. Some students wasted a good bit of time with service tickets / requests to no avail and a lot of wasted time. Despite all of this, I absolutely loved the project, it makes practical, a lot of theory and gives you a lot of appreciation for it.Project 2 was pretty straight forward, and had an open ended element to it, which opened the door for creativity, which i really appreciated. For this project you needed to purchase a raspberry pi board, as the focus of the project was around ARM processors. This project was mostly analysis and very little coding, it did, however, seem to be sort of dated, as we were not using the most up to date ARM compiler. Not as interesting as the first project. Project description again, lacked in clarity one certain parts, some of which were never clarified by the TA's. Deepthought still was an issue, and by this point , I think everyone was just using Vagrant.The final exam was pretty terrible. For being 33% of your entire grade, and the only exam, it was a little bit stressful. It was cumulative, so it was a ton of material that it covered. I didnt really know what to expect. It is done via Proctor Track, which i felt like was completely inadequate for how they expected you to enter your responses. There were also mistakes on the actual exam questions, which i was hoping they were going to throw out, but I dont think they did. It was 3 hours, and it took most of the time to complete.My only other complaint with this class was the TA's, as i hinted above. Im not sure if they were just super busy or what, but they were just not around at all. Being a smaller class size, the student to student interaction was definitely not as active as other larger classes I have had, but the TA's EASILY averaged a 2-3 day turnaround time with questions. Probably the worse TA experience I have had in the OMSCS program to date.Grading was done very fairly.Overall, I thought this class was pretty great, and recommend it for any hardware guys out there. This class certainly has a lot of potential, and is certainly one of my favorites in the OMSCS program. I think if they were to clean up the project descriptions, and just avoid Deepthought all together, it could be improved.", "rating": "Loved!", "workload": "20 hours/week", "author": "nDs6JQPklgNAStad8d9OzgwxB2h1", "difficulty": "Hard", "semester": "Summer 2018", "time": "8/8/18, 10:24 PM"}, {"comment": "This was my 7th class in the program, and by far my least favorite. The homeworks were fine, straightforward enough but the answer keys were never given. This made it very difficult to study for the final when it was unclear what the correct answers were to some of the homework questions. The first project was building a scheduler for VLIW code and I think I learned more about C++ (had never used it before) than actually scheduling. The second project used a Raspberry Pi and to be honest - was incredibly pointless. If you do enough research into what the project is asking you do to, you'll realize that it is completely obsolete. The exam had a lot of weird questions and typos that made the questions even more confusing and was pretty poorly written.The biggest annoyance I had with this class was the lack of responses from the TAs on Piazza. It would take days to weeks to get a response to a simple question, and most questions were left unanswered past the due dates for projects or homeworks that they were asking about. Even at the end of the semester there were almost 40 unread/unanswered posts.Overall, I would not recommend this course until the revamp the homework/projects/test.", "rating": "Disliked", "workload": "5 hours/week", "author": "yFnUXa2MjoNG4OvvDn4DV3SG12v2", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/15/18, 11:15 AM"}, {"comment": "I took this Fall 2018. Overall this course offered a good overview of(1) Design choices at the instruction-architecture level to meet a tailored use (specifically embedded systems).(2) Basic functioning of compilers.(3) Practice reading and understanding academic papers that focused on compiler optimizations.I took it as my first course, very manageable on its own, and looking back i could have paired it with an \"easy\" course. However, do not mistake this class for a give-me, it had some very difficult portions and was closer to Computer Engineering than Computer Science for some sections.Assignments:4 Homeworks, all were straightforward as long as you ask some questions and review the material.2 Projects. First one is a group project, second was individual.1 Test, the final. Not easy, but fair and tested very similar concepts from the graded assignments and lesson material.Coding was only required for 2 of the assignments:HW2 involved coding, in C++ .Project 1: was very difficult for me, it involved coding with graph algorithms and C++ to build an instruction scheduler.Project 2: coding was not needed, but a few bash scripts and/or python dramatically sped up how fast you completed it.Lectures & Course Material (Books):In my opinion, ok. The book is a little old, but the foundational concepts it teaches are certainly still applicable.The lectures had small errata/errors hear and there, but TAs were responsive in addressing them.The advice I would give is go to the office hours! Professor Pande showed up to every single one, along with the TAs, and all were more than willing to answer questions or address concerns to point you in the right direction. Also, and this is probably every OMSCS class, but start the assignments as soon as possible, especially project 1!! It is very do-able, but the 2 week delay my team took to get started turned it into a semi-hell for the last 3 weeks of it.", "rating": "Liked", "workload": "16 hours/week", "author": "eVM0zwl4jzLjin5KakurzsfZWYt1", "difficulty": "Hard", "semester": "Summer 2018", "time": "1/14/19, 2:08 PM"}, {"comment": "Looks like this is the first review of the course, but it's just because it used to be 8803 - see the one with embedded in the name for some relevant reviews.I really liked the course, and a lot of it had to do with the main TA's involvement on Piazza. The assignments are pretty straightforward, and the projects are not too bad as long as you get ahead on them and don't wait until the last minute. Exam was meh - ProctorTrack sucks but what else is new.", "rating": "Loved!", "workload": "3 hours/week", "author": "pdQpZcnRPxO2YTfYt9FsKNUPgWe2", "difficulty": "Medium", "semester": "Spring 2018", "time": "4/29/18, 7:38 PM"}, {"comment": "Enjoyable course, we got to look under the hood of compilers and learn about different optimization techniques as they apply to embedded systems. The projects were time consuming and interesting. My only complaint is that due to the nature of the projects they took a long time to grade so we didn't know about 75% of our grade until the week of finals. But everything was graded fairly and carefully with good feedback so all's well that ends well I suppose.", "rating": "Liked", "workload": "12 hours/week", "author": "KCfFLF4MYXOiFUgBw96q5ZoP6Ew1", "difficulty": "Hard", "semester": "Spring 2018", "time": "5/6/18, 4:06 PM"}, {"comment": "This class was very much a mixed bag. The course material is interesting and the professor understands it well, but the lectures often were a little convoluted and hard to follow. The assignments and projects seemed a little rough; most of them were updated to include clarification/correction after being initially assigned. I believe this is the first time this class has been offered online. After another semester or two, once the kinks are worked out, I could see this being a very good class.My biggest complaint with this class was definitely with the first (group) project. It felt like my group spent as much time trying to parse the project description and figure out the project requirements as actually complete the project. On the last weekend before it was due, we probably spent a combined 45-50 man-hours (on a 3-person team) trying to complete it and still didn't finish. I think the instructors realized that the project was more difficult than they anticipated, because they ended up grading it very generously (I received full credit even though the project was incomplete). The second project was also much more reasonable.", "rating": "Neutral", "workload": "10 hours/week", "author": "opJsYqOOebgjk17Vz8BhQVQt2hc2", "difficulty": "Hard", "semester": "Spring 2018", "time": "5/9/18, 11:33 AM"}, {"comment": "This is a compilers for embedded systems class. Nothing else. Also i took it Fall 18, doesnt seem to be a choice. Ended up with a B. The homework is often hard and long. Grading is super tedious, picky... etc. Half the time the assignments arent even close to clear on what should be done. They will release 4 revisions of the homework, sometimes the night before it is due. So even if you completed your homework the day it is assigned, you have to re do it the day before it is due. Group project was like 12k lines of code. One of my partners quit two weeks in accomplishing nothing, and the other one, made things more stressful. Awful class. Avoid at all costs. Avoid at all costs. Avoid at all costs. Avoid at all costs. Avoid at all costs. Avoid at all costs.", "rating": "Neutral", "workload": "50 hours/week", "author": "EBjItJNxD8hBbXp0MJbiymn1VAk1", "difficulty": "Very Hard", "semester": "Spring 2018", "time": "3/25/19, 9:14 PM"}, {"comment": "I wasn't sure what to expect coming into this class, though I was both happily surprised and disappointed. If you're looking for a class about embedded systems/software, this isn't for you. This class is really about code size vs execution, optimizations you can do, when it makes sense to do said optimizations, and coming-up-with/discussing/profiling several heuristics around those optimizations.The lectures themselves were only alright, but the projects were phenomenal.", "rating": "Liked", "workload": "15 hours/week", "author": "VGwn29OLPKf2m1s6TCvpQNqC28u1", "difficulty": "Hard", "semester": "Spring 2017", "time": "11/6/18, 2:27 AM"}], "difficulty": 3.7, "enrolled": 0.0, "id": "CS6291"}, {"rating": 3.667, "workload": 9.072, "withdrew": 105.0, "comments": [{"comment": "I really liked this as a good first course, it taught me a lot about Java, Android development, and software testing. I disliked the group project very much - but only because my group couldn't even seem to compile a program successfully. The assignments were very well put together and I felt challenging. The only thing I disliked is the TAs seemed to have really ridiculous grading - they would take a massive amount of points off for small things and then miss fairly large things.", "rating": "Loved!", "workload": "10 hours/week", "author": "Kh2g46hhh8hWh09wDpMTN3nv4nO2", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/4/18, 9:14 AM"}, {"comment": "Great First Course for OMSCSThis was my first course in OMSCS. I came into it with an academic background in mathematics, but my day job requires use of java. If you aren't familiar with java, do yourself a favor and study up on it before the course. This course gives you a great opportunity to learn some java, learn how to use piazza, canvas, github, work with a team remotely, and just get the essence of OMSCS.The first couple of assignments were straight forward and easy to complete. Once we started working with Android Studio, I had to do a lot of research to see how it worked, but was able to complete assignments working less than 10 hours a week. This time requirement went up with the individual project. I had a good group and our app was fully functional, but we put a lot of time and effort into it, up to 15 hours a week. I spent some extra time on the final project in an attempt to earn some extra credit.Tasks are assigned and collected on a weekly basis. There is one assignment/deliverable each week. They are due on Friday 12AOE, which is Saturday 7am EST. There were no extensions and they will not release assignments early. Be ready to work each week. Professor & TA's are very active on piazza and hold a weekly office hour on YouTube Live. Assignments were sometimes easy and sometimes challenging, but I was always able to confidently submit my assignments (except the uml diagram, but I got a 100).Don't expect grades to be returned in a timely manner. It took upwards of 3 weeks to a month to get grades back, though the grading always seemed fair, and they honor grade challenges.", "rating": "Loved!", "workload": "12 hours/week", "author": "X2kwenzQ99gKGoW0Rc0hjdfcyk23", "difficulty": "Easy", "semester": "Fall 2018", "time": "12/4/18, 12:43 PM"}, {"comment": "My background: Majored in Mechanical Engineering, knew how to code, but by no means an expert, best language python, never coded in Java or Android Studio beforeMy thoughts on this class: Sometimes I felt like I wasn't learning much, and the weekly assignments were a lot to deal with. You have one week exactly per assignment, and no more, which for me made this class tough to pair with another. As soon as I finished an assignment for SDP, I'd try to work on class 2, but wait! There's already another assignment due for SDP. That said, it's a solid first course to get into the groove of the program, I did learn some stuff about, well, the software development process.Class Structure:Weekly assignments, due on Friday nights. (Saturday 5am in California Time)1 group project that spans 3-4 weeks, a part due each week. 3-4 people/group. Involves building a simple app with Android Studio. Having never done this before (but having made a few very simple iPhone apps), I found it to be not that bad. I dislike Android Studio, but I managed. Toughest thing in the whole class is implementing a database on Android Studio for the group project, but thankfully someone else in our group did this. Documentation is important for group project.All other assignments are weekly and done individually. Instructions are very clear and must be followed to the letter, in a sometimes annoying but ultimately helpful way. All assignments are very doable for novice coders. If you can make an if-else statement, you can pass this class. Having never coded in Java before, I survived, though with a healthy dislike of how Java deals with Strings!Final Thoughts:Good first class. Take this class first, and don't pair it with another class. The weekly assignments makes the pace of two classes too stressful. Also I didn't like that the assignments were released Saturday morning because I don't have access to a printer at home. I would drive to work on Saturdays to print. Not fun. -Sometimes I felt like I wasn't learning anything, but only later did all the assignments come together. Overall glad I took this class to bring me up to speed on a lot of CS terminology I wasn't previously aware of (White/Black box testing, UML diagrams, etc). As I transition from mechanical engineering to CS work, I'm finding the terms I learn in class constantly pop up. Ergo, this class is doing something right. -Watch the videos a week earlier than listed on the syllabus so you immediately know what that week's assignment is about. -Teacher + TA's were great, always on Piazza.If not for the weekly assignments, I'd pair this class with another one. I tried to, but ultimate dropped it because of the frantic nature of weekly assignments. Maybe double up the assignments and give everyone two weeks to do it?", "rating": "Liked", "workload": "8 hours/week", "author": "gmsSdLtObhhSfKCrcjLR3pJlp8H3", "difficulty": "Easy", "semester": "Fall 2018", "time": "12/8/18, 5:39 PM"}, {"comment": "An excellent class to begin OMSCS - but caution should be thrown to full time devs - you probably know quite a lot of the things being taught.For non-devs, this is absolutely essential in understanding the software development process, collaboration, testing, version control and even Android mobile development - which depending on your classmates is a lot of fun or a lot of stress.", "rating": "Liked", "workload": "16 hours/week", "author": "2koveLZG8VZlEWlEGAwQttkYogy1", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/18/18, 10:13 AM"}, {"comment": "Overall an easy class however grading is slow so you go through most of the class without any idea of how you are doing. Basically, if you're doing something wrong, by the time you get your grades, its too late to fix it. Also, grading is really petty. If you do 99% of the assignment right but a few small details, they mark off like 50%. A large portion of the group project grade is based on whether your group members said you contributed. Me and another group member did 95% of the group project work through out the project but because other group members scrambled the night that it was due and we didn't, they said that we didn't contribute. Overall it was a decent class but I wouldn't recommend as your first class because it might turn some people off to the program if they thought all classes were this disorganized.", "rating": "Disliked", "workload": "10 hours/week", "author": "tHJZDRGa3cWSO74cU6yC2L3e9ZI3", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/19/18, 11:13 AM"}, {"comment": "Background: studied software engineering in undergrad and work as a developer, so I just took this as an easy class to pair with ML4T.The class isn't bad, but I'm not sure I learned anything new. The assignments were very easy, but the group project did take a little bit of time (so roughly halfway through the course was the heaviest period). Unless you're a pretty inexperienced programmer or want a very easy semester, I wouldn't take this course on its own.", "rating": "Liked", "workload": "8 hours/week", "author": "7OjkLJGKZvRGh6A673D6WR4q8fq1", "difficulty": "Very Easy", "semester": "Fall 2018", "time": "12/19/18, 6:11 PM"}, {"comment": "Overall, this class felt like a waste of time/effort. Again we have the requirement of a group project, this experience wasn't bad, but it does add unnecessary difficulties. I work 40+ hours per week, and have a family as many in the program do; the way I make this work is that I have to adhere to a pretty strict schedule...I go to bed early and get up early, but now with group work, I have to change schedule to meet up and do work at a time I'm pretty much dead to the world. For working professionals, this is a ridiculous requirement; I can only assume the main motivation behind group work is so that there are fewer projects to grade. As another reviewer mentioned, the grading was glacial in this course; 6-7 weeks to get some grades back. There is no possibility to learn from mistakes and correct before making the same mistakes again. Also the UML portion felt like a complete waste. I took the course as a requirement, if you have any experience you will likely learn little to nothing.", "rating": "Disliked", "workload": "8 hours/week", "author": "eXYbSr2qlVgOdx5JZOdURXsV1qq2", "difficulty": "Easy", "semester": "Fall 2018", "time": "12/21/18, 8:44 AM"}, {"comment": "A great course. Prof. Orso is a great instructor, and is hilarious. I was fun learning how to create an Android application (both for the group project and individual assignment). The course truly strengthened my skills in Java.I have 2 slight complaints though: 1) I would have liked to learn more about common Java frameworks (Struts, Sprint, Groovy, etc.) 2) The TAs did take a long time to mark the assignments, however, they were very generous when it come to re-grade requests.I would recommend this course as a first course for the OMSCS program.", "rating": "Loved!", "workload": "25 hours/week", "author": "s9ABDIzNFkMKsb1onBYzIaJhdyW2", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/21/18, 2:50 PM"}, {"comment": "My first course. It was hard for me since I had little programming experience. I spent 20 hours per week. There were homework every week, a group project and a individual project. I was lucky enough to get an A.", "rating": "Liked", "workload": "20 hours/week", "author": "1E74P88uWbYL8fRsbIpg7REHXbr2", "difficulty": "Hard", "semester": "Fall 2018", "time": "1/6/19, 10:14 PM"}, {"comment": "Pros: Coming from a non-software background (mechanical engineering undergrad), I think this was a great intro course to software development. I STRONGLY suggest taking this class with another course (saving it to pair with a medium/harder class). All the topics were very relevant and applicable to work (as a software engineer). Android project was my favorite although it is nice to have some teammates on your team that know a thing or two about android app development, and can meet locally. NO EXAMS, only assignments and projects. Super relaxing in terms of the grading since no need to stress over exams. As long as you do the assignments properly and on time, you'll be ok.Cons: Homeworks are released every Friday night and due the following Friday night. It can get annoying since its hard to work ahead if you have something in particular that you want to do for that week/weekend or manage your time in a more flexible way. Some assignments take less time and others take more time... so your week is kind of \"up for grabs\" depending on the assignment, makes it hard to schedule other things in your life (depending on what your priority is of course). TA's are a bit hard to get a hold of, and grading takes a while.", "rating": "Loved!", "workload": "6 hours/week", "author": "0kwOdzeEedPH3uucYl14k2uxXNE3", "difficulty": "Very Easy", "semester": "Fall 2018", "time": "1/8/19, 11:05 AM"}, {"comment": "This was a very good first course as the workload was light and not overly challenging. I think it also taught a lot of good fundamentals of software development, such as agile methods and testing. I liked the office hours format - students would submit questions ahead of time, and the professor and head TAs would discuss on YouTube. Very helpful! My only complaint was that grading was very slow, which could be frustrating. Overall though, I definitely recommend.", "rating": "Liked", "workload": "10 hours/week", "author": "4Nc84MPfA4V8JWKc9eOVgNYTH152", "difficulty": "Easy", "semester": "Fall 2018", "time": "1/8/19, 5:42 PM"}, {"comment": "SummaryThis was my first class in the program. Very light, easy class. Good as a first class or to pair with another.My BackgroundSoftware Engineering with less than 1 year of experience. No undergraduate or graduate degree in Computer Science. Use Java & Github at work daily.Estimated Workload:~5 hours per weeks, maybe slightly more during the group project.Summary of assignmentsGithub Basics - Follow a set of instructions.Implement a simple Java function and write test cases.Code up a simple 1 screen Android app with a few buttons and basic logic.UML diagram for an app (this ends up being the app in the group project) (no coding)Group project (over 4 weeks, 1 deliverable per week) - Vocabulary Quiz App a. UML diagram (no coding) b. Documentation - Design, Functionality etc (no coding) c. Test cases & basic app (coding) d. Final app (coding)Write test cases for a black box app (no coding)White box testing - Given a few scenarios, identify which white box framework they fall into.Individual project - Code up the black box in part 6. (over 3 weeks, 1 deliverable per week)TakeawaysRead the instructions in assignments very carefully. You can easily miss points for silly things like mislabeling etc.Assignments are released every Saturday morning and due the following Friday. Many students complained about this but I actually liked it. Use part of Saturday/Sunday/Monday to work on the assignment (each homework shouldn't take more than 5 hours). Use Tue/Wed/Thu to monitor Piazza, watch office hours, and make any minor changes. Submit the assignment on Friday.Both projects are pretty easy. Even if you get a bad group for the project, you can probably code up all of it yourself in under 20 hours (over the 4 weeks, so 5 hours per week)Office hours once a week - professor shows up along two head TAs.Assignment grading is slow, usually more than a month to get grades back.Android ResourcesLearn how to set up buttons, user input, and sql lite databases. Skim through these resources. The 3rd assignment will also give you some experience with basic Android.Udemy ($10-$12) - I went through the first 1/3-1/2 of this course. (https://www.udemy.com/the-complete-android-oreo-developer-course/)Udacity Android Basics: User Input (https://www.udacity.com/course/android-basics-user-input--ud836)Udacity Android Basics: Data Storage (watch the section on SQL light) (https://www.udacity.com/course/android-basics-data-storage--ud845)", "rating": "Liked", "workload": "8 hours/week", "author": "rm8mWo7kDbcNzxHoshsNobrWuAB2", "difficulty": "Very Easy", "semester": "Fall 2018", "time": "2/12/19, 11:23 PM"}, {"comment": "This course is well-suited for entry-level students in OMS CS. You learn about how standard software development processes are applied to create Android apps using Java. Do NOT take this course if you have already taken DB Systems, as they do share a number of similarities (though they are not the same).", "rating": "Liked", "workload": "12 hours/week", "author": "IMzmgWYfhGPtLfoinuUAEtkD8i03", "difficulty": "Medium", "semester": "Fall 2018", "time": "3/3/19, 5:00 PM"}, {"comment": "I thought the class was OK. I took it as my first class, but have since taken four others. The TAs ran it extremely well and had the best office hours I've yet seen in the program. Unlike other classes I've taken, Professor Orso actually makes appearances on Piazza and in the office hours, and it's nice to see some actual involvement in the class. This is a very useful class if someone is in the program to make a career change and doesn't have a software background, but someone with existing experience in the field won't learn much. It is, however, a nice class to get accustomed to the format of OMSCS, as the first several weeks have a very small workload.The group project is hell. It was a ton of work compared to the rest of the class and is a very jarring transition. Making matters worse is the fact that I am in the Eastern time zone and was paired with teammates in California, which made meeting as a group tough. During the four weeks of the group project, I was probably working 15-20 hours a week on this class, with the rest of the semester being no more than 3 or 4 hours per week. I will note, however, that I got paired with a very gung-ho group who went very above-and beyond the requirements for the app. You can probably get an A with a lot less work than what we put in, but that's going to depend on what kind of group you get. Obviously, my situation is preferable to the opposite extreme, but it was a rough few weeks.Besides the group project, I enjoyed the class. You won't get any frustrations coming form a lack of structure or organization and it serves as a great intro to OMSCS in general. It's also nice as it's one of the few classes other than GA that counts toward multiple specializations, so if you're on the fence between Interactive Intelligence and Computing Systems like I was, it would make a really good intro to the program.", "rating": "Liked", "workload": "10 hours/week", "author": "4znA12YWdgRwwd8oCc6pAELKxpg2", "difficulty": "Medium", "semester": "Fall 2018", "time": "3/5/19, 11:15 AM"}, {"comment": "I am slightly surprised that so many people rate this class highly. It's kind of disappointing in many ways. The head TA on repeated occasions (I won't out them by name here) is condescending and frankly never helpful. Their responses to Piazza posts (and given the fact that they answer the majority of posts) actively discouraged me from ever engaging with Piazza because I was concerned about asking a question that felt \"stupid\" or simple.The projects are probably the worst part about the course. Many of them are simple, quick assignments that can be completed in a few hours if you have some Java knowledge. However, the layout and structuring around the projects (and the individual project itself) is a nuisance. The major issue is the assignment time frame. I took the course in the summer term, so the full semesters may be different. Each assignment was released on a Saturday and then due the following Saturday (7 days). No exceptions or previews. This means that if you have something come up for work, another class, etc. then good luck. You still have the same time frame. Not all classes in OMSCS give info ahead of time about projects. But when you expect students to turnaround an assignment in a single 7 day time window, there should be some level of foresight given upfront so they can plan for things. I had multiple occasions where I had to rush and turn in a subpar assignment because on Monday morning my work commitments would pile up for the week and I was left to choose between slacking off at my job or skimping on a course assignment.The second major issue with the projects is that they are structured in an order which can actually hurt you later. For example, there's a project around the 4th or 5th project that requires you to build a testing suite around a program that doesn't actually exist, and you aren't supposed to implement the program. However, in the individual project (which is 20% of the course grade), you are then expected to implement the program AND it must pass your test suite from weeks prior without making any changes to the test suite. This means that if you misunderstood a requirements, didn't plan for something, etc. in the earlier project, then you'd potentially harm yourself in the later assignment (as you may have incorrect test cases based on assumptions at that point that you aren't allowed to change). Why is this necessary? It just seems like poor planning for the course structure.The final issue with the projects is that some of them simply feel watered down and unhelpful. The second part of the individual project involved the instructions saying that you had to change your program from part 1 because of \"updated customer requirements\". In the real world, this happens. But in a graduate level course, what justifies this as an assignment? It is hard to see how that part of the project is anything more than busy work.Grading is slow and obtuse. They have a ton of students and about 6-7 TAs. The rough math comes out to 40-50 students per TA, which is actually about average for many courses. I am a TA for a course that has an assignment of about 45 students per TA. In SDP, they don't release grades for weeks. 8 weeks into the course, they have only finished grades for the first 4 (out of about 10-12) assignments. There is only a week left in the official course. So, they are considerably slower at grading than other courses in OMSCS, and don't expect feedback about earlier parts of large assignments before you complete the later parts. They also don't give any details about the grading for projects, so don't expect to understand where your grade comes from until the release grades, either.Finally, the course material is fine. If you have any experience in software development, it is going to seem basic and boring. There's nothing new or novel covered in the course. In fact, I honestly would put the course on par with an undergraduate SE course. It's inoffensive, and there is a grade for completing the quizzes so they \"force\" you to go through the materials. There are no exams, however, so there's no pressure to actually pay attention and absorb the material (unless you don't have any SE background and the material is new to you). The projects only require a cursory knowledge of the week's lessons.", "rating": "Strongly Disliked", "workload": "8 hours/week", "author": "g4f0CHMh6DVOBQpL1Gd2bAJSGTc2", "difficulty": "Easy", "semester": "Summer 2018", "time": "7/25/18, 2:26 PM"}, {"comment": "This was my second course in the program. I have worked as a software developer for a few years but had not been involved in building complete applications so I thought I could learn a few things. I certainly learned a few things here and there but a lot of it seemed like common sense to me due to my work experience. Overall the class was very easy. It would take about 5 hours a week at most to take care of everything due for that week. The only exception to this was the group project. Despite the compressed schedule during the summer there were times I felt like I wasn't taking any class at all. The class covers the software development lifecycle and testing methodologies but never really goes in depth into any of the topics. As a result you will walk away with a basic familiarity of the material but nothing more. If you have absolutely no development experience this can be useful but I don't see much value in this course for anyone who has even a little bit of experience. The grading was very slow and as I write this having turned in my last project there is still about 50% of the work left to grade. The instructor is very enthusiastic and explains the material well. I enjoyed the lectures and the projects. I just wish we could have covered the material in more depth. In conclusion I would recommend this class to anyone coming from a non CS background and has not worked in industry. For the others, there is not much to learn here and your time and effort would be better spent taking one of the other classes.", "rating": "Liked", "workload": "5 hours/week", "author": "gbWBLxTBR3ajgkp1CRvi1myuteB3", "difficulty": "Easy", "semester": "Summer 2018", "time": "7/27/18, 10:25 PM"}, {"comment": "I have been a developer for 20+ years. This is my 9th class in the program. The material in this class is incredibly important for any software engineer to know. The lectures were very well done and the assignments/projects used the material from the lectures.Unfortunately, this semester (summer 2018) was run very poorly. My impression from Piazza was that the TA dislikes working with people. This is common with engineers, but is not a good trait for a TA.The assignment documentation lacks detail, and the TA's attitude was, \"take your best guess.\" This is not helpful in a class that is supposed to be teaching good development habits. A developer should never \"take a guess\" on a specification.The lack of details in the assignments and individual project make work that should have been fun (but easy) significantly more difficult than it had to be for no return in learning.On the other hand, the group project was very well designed. It was great idea to allow us to grade our teamates. This forced everyone to contribute and get along. I really enjoyed the team project.", "rating": "Strongly Disliked", "workload": "10 hours/week", "author": "V81fiaU1LTft3FQ5JHJRc5VThKo2", "difficulty": "Easy", "semester": "Summer 2018", "time": "8/2/18, 9:45 PM"}, {"comment": "Overall a very straight-forward class but there are almost no rubrics to be graded against unless they are baked into the assignment themselves (such as builds passing). Group project made me realize I never want to do a group project in another OMSCS class ever again. Minimal buy-in from others and like others have said, if you have a background in development it introduces nothing new. Usual case of TAs not always being helpful which is probably due to the number of TAs. Professor was very enthusiastic about the material but the fact that the grades are slow to come out and also drive later assignments really killed my enjoyment of the class.", "rating": "Neutral", "workload": "5 hours/week", "author": "FeK04WrdEFPVBr3cvmZjStxtLMm1", "difficulty": "Easy", "semester": "Summer 2018", "time": "8/2/18, 6:45 PM"}, {"comment": "I enjoyed this course. Dr. Orso is actively and enthusiastically involved in it, and the lectures and assignments are well produced, fun, and educational. If you're a long-time professional developer, there's not a lot of new stuff to cover, but this is a great summer class for fulfilling a Computing Systems core course requirement. I did learn a lot about Android development, and I enjoyed learning about the TSL generator for category partition testing. I didn't enjoy the group project though. The formal docs were mostly a waste of time, and I did much more than my share of the project coding. So, the group project skewed my overall workload (hrs/week) way up.", "rating": "Liked", "workload": "16 hours/week", "author": "qLehN8qTJRNGUfwHjde72W0bJy62", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/3/18, 5:29 PM"}, {"comment": "I am fairly new software developer so I got a lot out of this course (Java, git, android). Their grading was too slow but they were pretty generous so you wil get A easily as long as you submit the assignments on time.Assignments are due every Friday midnight and released Saturday morning. It helped me not to procrastinate so I was okay with it. But when you work in group projects, you might not want to schedule anything Thursday or Friday evening lol.There is one individual and one group project that are in android. For individual assignment, even without android experience, it was very easy. Group project, on the other hand, was so much harder so it was very challenging to complete it. I really wish that they provided more resources on Android. Udacity lectures on Android was not enough for our group project. But i dont think they will so be prepared to study Android on your own for this course!", "rating": "Loved!", "workload": "10 hours/week", "author": "ydQSB8tJKWRJmUfliQK7q97yujk1", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/6/18, 12:10 PM"}, {"comment": "A very straight-forward class which you can easily ace if you have some programming experience. The course uses java and android as programming languages (all but one of the individual assignments were in java, group project was andriod as was one of the assignment). I had java experience but no andriod but this did not prove to to be a challenge. Grading was slow but lenient. Important to read the assignment instructions carefully since the grading is tied to completing each ask. Office hours were good and a the professor and head TA's were open to provide hints/tips, so make sure that you go over the office hours video offline.Over all a good but easy class.", "rating": "Liked", "workload": "10 hours/week", "author": "z1yU7mORBge35jKGs0I5u9oVvvE3", "difficulty": "Easy", "semester": "Summer 2018", "time": "8/14/18, 12:28 AM"}, {"comment": "Easy class, but took in summer. Course had multiple assignments in a week few times. Would be a good Spring or Fall course. Students might not like, the assignments rolled out Saturday morning ET and were due next Friday midnight. Worked for me, spent the weekend in bulk of work and if necessary corrections during the week.Prof Orso is great, however he was travelling most of the term and couldn't make it to few office hours. TAs Erin and Will were great. I wish they used more interactive way for office hours than YouTube Live.", "rating": "Liked", "workload": "9 hours/week", "author": "5JVeIPG3F1MgHf0pjCrfrCRtzAf2", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/16/18, 9:01 AM"}, {"comment": "Overall I liked this course. I am PMP certified and work in an Agile DevOps team, so not a lot of the video content was new but it was a good refresher. I really enjoyed the Android project and learned a lot. I am tempted to take some of the other Software courses now.", "rating": "Liked", "workload": "6.5 hours/week", "author": "FWfqs50lxmhvcwP1skQjb8mNfVn2", "difficulty": "Easy", "semester": "Summer 2018", "time": "9/28/18, 10:15 PM"}, {"comment": "This class is the perfect example of how to teach. I loved it because the professor is always there with you and the TAs are helpful. There are 7 assignments and 2 projects. One group project and one individual project. My experience was good overall. I learned and refreshed my knowledge. I took this course in the fall of 2018.", "rating": "Loved!", "workload": "12 hours/week", "author": "ZuvxcFQeE2VHhAm3tcChB34FLa62", "difficulty": "Medium", "semester": "Summer 2018", "time": "10/28/18, 9:18 AM"}, {"comment": "I actually took (am taking this class on Fall/2018, but figured to give feedback sooner than later). If I ever invent the time machine; this is what I would do, in order of priority: 1) Change my SDP selection to another course in OMSCS 2) Try to prevent the biggest catastrophes in the modern world like: WWI, WWII, 9/11. 3) Buy shares of the following companies as soon as they became public: Apple, Google, Microsoft, Amazon.Save your time and money and choose another class. I am not a CS person (I am an Engineer) and still didn't learn didly squat on this course. Professor doesn't give a crap; TAs give single-sentence answers to Piazza questions (don't give a crap either); and, worse of all, there is a lot of busy work fabricated difficulty on the class that has absolutely nothing to do with the material announced at the course curriculum. These are the only reasons for you to take this class: 1) You want an easy A and absolutely don't care if you learn anything valuable through your OMSCS time 2) I can't come up with a second reasonMy feeling is that this class was part of the initial GATech push for OMSCS; before it got its chops, and GATech was begging any/all of its professors to turn any material that could be turned into classes.Use your OMSCS time wisely.", "rating": "Strongly Disliked", "workload": "4 hours/week", "author": "BOrATJWJeSeQORFh9FS5BQKEYol1", "difficulty": "Very Easy", "semester": "Summer 2018", "time": "11/11/18, 5:43 PM"}, {"comment": "If you don't know anything about software engineering, taking this isn't a bad idea.If you've ever worked at anywhere remotely serious about software engineering than this isn't a course that you'll get anything out of.", "rating": "Neutral", "workload": "10 hours/week", "author": "mXu7i5U8GjNsmGpZUCyDAYXZ8Vy2", "difficulty": "Easy", "semester": "Summer 2018", "time": "12/11/18, 4:20 PM"}, {"comment": "I had mixed feeling about this course. As a new student, I carefully choose a not too hard course to start. This course gave me a little trouble in the beginning. For one assignment, I was one day late due to a late start and a seemingly easy issue that I can't get correct answer in piazza discussions. I struggled with this little problem until finally the professor pointed to the issue. I fixed it and submitted the assignment, but got half credit. I did feel that one of the course video is misleading that caused this mistake. Like some others have pointed out, you will be surprisingly got a low score for some unimportant minor things. I got a low score for another assignment, and even wanted to withdraw the course. Luckily, I stick to to it, and scored a lot better in later assignments and projects. I admitted that I learned a lot from this course, git, java, android, some database UML, whitlebox/blackbox testing, and most important of all, never give up. Eventually, I got A despite some mistakes or unfortunate situations. It's good experience that I suffered in the beginning, while enjoyed at the end.", "rating": "Liked", "workload": "12 hours/week", "author": "Rn7guZ9GWbQQwVExeRuszJJXGR82", "difficulty": "Medium", "semester": "Summer 2018", "time": "12/19/18, 9:03 PM"}, {"comment": "The professor is clearly passionate about a specific topic that is part of the course, software test. Therefore, in my opinion, there is too strong of an emphasis given to it; while some other topics of SW process are not even mentioned (code review is one that comes to mind). Especially since there is another course that is focused on SW test only. Didn't like the TAs. The vast majority of the Piazza replies from them were single sentenced referring students to other posts, even though they could clearly add more value to the topic if they bothered spending more than 5 seconds on the response. This is usually a reflection on the importance the professor gives to the course and the students.It would take an average of about 8 weeks for grades to come out. Which makes even less sense when the quality of the feedback given is taken into account. The TAs could easily be replaced with auto-graders as they clearly followed a very strict (and obscure) rubric with no variations/exceptions and provided no feedback on the assignment other than \"great job\" if you got 100% or three-word sentences referring to a rubric that the students don't have access to when you got something wrong on an assignment. Flat out ridiculous. This created a fabricated level of difficulty to the class, which I think they realized later in the course and gave the opportunity for a 20% extra credit on the individual project for something that was supper easy to obtain.Even if you are going through this program only for the degree and care very little about what you learn; save your money by selecting something else. There are other courses that offer an easy A but are not as wasteful of your time and money as this one.", "rating": "Disliked", "workload": "4 hours/week", "author": "BOrATJWJeSeQORFh9FS5BQKEYol1", "difficulty": "Very Easy", "semester": "Summer 2018", "time": "12/22/18, 12:58 PM"}, {"comment": "This course is a good one for those who want to be a software developer. The course includes knowledge about how to develop software, how to use git, how to cooperate with teammates, how to test etc. Overall, this course gets me familiar with the development process. If you are a software developer already, this course may be too easy for you. The TAs are helpful, but the course videos are boring.", "rating": "Neutral", "workload": "10 hours/week", "author": "obDAa2oAfiTJHpgqK1r5IjuUnjk2", "difficulty": "Medium", "semester": "Summer 2018", "time": "1/9/19, 3:52 PM"}, {"comment": "If you have software development experience this class is quite easy. It consists of watching lectures, attending/watching office hours, doing weekly assignments (most are programming but some are design), a group project, and an individual one.StructureWeekly assignmentsGroup projectIndividual projectProsGood introduction to software development practices.Relevant to today's professional development.Good emphasis on Test-Driven-Development with multiple assignments focused on this.Assignments were interesting and very manageable.TAs and professor were very active and involved in the class.Group project team mates pulled their weight and the app was quite interesting.ConsThe biggest issue I personally had with the class was that some assignments felt like busy work. Given that we had something due every Friday, it seemed like some assignments were put together to just give the students something to do.Having deadlines on Friday (early Saturday morning in the US) caused some scheduling conflicts. The professor defends this practice by saying that this encourages students to start the assignments early and discourages procrastination.The grading is very slow and tends to lag behind anywhere from one month to two months.Group project team mates are randomly chosen based on a survey which can lead to widely different experiences.Overall this is an easy class for someone who has professional working experience. Other reviewers have mentioned that the group project is quite bad, however in my experience I was lucky to have good team mates that pulled their weight.", "rating": "Liked", "workload": "5 hours/week", "author": "zxPTQsZpQfaoaLT2N18XzVr2qb02", "difficulty": "Easy", "semester": "Summer 2018", "time": "1/10/19, 3:00 PM"}, {"comment": "Was an ok class overall. It was truley only the group aspect of the course that caused the most grief as it leans itself into potentially forcing one team member to carry the others.", "rating": "Liked", "workload": "15 hours/week", "author": "iG3yQl35UpMJJL8YMpJyFf5MLCz2", "difficulty": "Medium", "semester": "Summer 2018", "time": "1/11/19, 9:20 AM"}, {"comment": "Not too hard of a course if you have Java experience. The group project is in the middle, making it an ideal course to pair with another course that has a heavy work load toward the end of the semester. The topics are well covered and easy to grasp, but there are a couple projects that are grind it out, type that make the class less enjoyable.", "rating": "Liked", "workload": "9 hours/week", "author": "3ujo5fcHXJhVG4yjNShDPdU6Kmb2", "difficulty": "Medium", "semester": "Spring 2018", "time": "4/23/18, 5:25 PM"}, {"comment": "Course lectures provide good examples and walkthroughs. There's a historical context for each lesson which I liked.The Android lessons need more work. The group project involves making a Wheel of Fortune app. The implementation is somewhat important, but the bulk of the grade comes from the design documents and project plan that your group creates. I didn't know much in terms of Android development so going from the first individual Android assignment to the group project was a bit of a stretch. Someone else in my group was knowledgeable about Android which helped. You don't get to choose your group, but you can assign preferences for meetings times. Hint: choose to meet early in the week before project deadlines.Individual project is implementing a command line utility. The focus is on testing and refactoring. It's straightforward, and while the black-box testing assignment doesn't provide much in the way of learning, I did find the overall project helpful for thinking about test cases and inputs.Good course to kick off the OMSCS program and pair with a harder course.", "rating": "Liked", "workload": "6 hours/week", "author": "ttgsHfEZI9PvRCNqT300KNobIS52", "difficulty": "Easy", "semester": "Spring 2018", "time": "4/25/18, 7:04 PM"}, {"comment": "After having many years of industry experience, I felt this course is very basic and assignments/projects were okay not great. Well, If you are just into software industry and trying to learn basics, this may be a good course.", "rating": "Neutral", "workload": "8 hours/week", "author": "TPzp2pgygKVTIRvpNVt4Cct1VG72", "difficulty": "Easy", "semester": "Spring 2018", "time": "4/26/18, 1:45 AM"}, {"comment": "I am glad that I've taken this as the starting course of OMSCS. Overall, it is a very gentle and basic class to learn Java and software design & testingVideo & Office Hour: it is short and fun to watch. Prof.Alex is very engaged and TAs are involved with Office Hour and have been on the Piazza all the time. Thumb up to Head of TA and Erin, who are most responsible TAs I've encountered so far in my education.Assignment & Project: 7 Assignment 1 Group Project and 1 Individual Project First 3 Assignments teach you to write simple Java program in IDE. Group Project is to step-by-step design and to build an Android App. I think it is a good intro for software development process, including documentation, UML, test plan and even some database skill to prepare the overall structure of the app. But don't worry about you have to do it all by yourself. Highly suggest you get a better computer in order to run the android studio smoothly. It saves your testing time for quite a bit. I think the Individual project is a little bit easy and less practical in term software design. Though it covered the course content of black-box testing and refactoring, we didn't get to practice that on a complete software program.(It is a small command line utility)If you think you don't have any CS background, you could take this course as the only one and first course. If you have any background in Java or familiar with another programming language, I would suggest you to take this class with another medium or easy class in your first semester or take it in the summer.Enjoy this class with good discussion and helps from classmates!", "rating": "Loved!", "workload": "10 hours/week", "author": "TVMuhcH8hNUShV4FV083Is3NJPR2", "difficulty": "Medium", "semester": "Spring 2018", "time": "5/1/18, 8:08 PM"}, {"comment": "Simply the waste of time. Avoid it if you can. I mainly took it to pair with a hard class, but apparently there are other better-use-of-time classes for that. Worst part is the head TA. She is a I-know-it-all and not very helpful. TAs enforce an environment on Piazza where students can't help others. I felt bad for some students who genuinely put in all the effort but got stuck in some trivial parts of assignments. But TAs would never give a simple straight answer. It would rather be circular and useless.Oh, and grading is super slow and frustrating. I didn't know more than 55% of my grade till last week of semester.", "rating": "Strongly Disliked", "workload": "6 hours/week", "author": "c2vTLn8aGcWK8dicJPRXZnGTR0i1", "difficulty": "Easy", "semester": "Spring 2018", "time": "5/3/18, 11:06 AM"}, {"comment": "This course was a lot of fun. I could see where anyone with significant development experience might find it boring but I myself enjoyed it and encourage any new OMSCS student to take it. Dr. Orso was active on Piazza and held regular offices hours. Lecture material was well put together and entertaining. The TAs were very active on Piazza. There was only one group project that lasted about 3 full weeks. For individual homework, I advise that you do pay close attention to details. The material isn't very difficult but you will lose a large number of points for small mistakes that could have easily been avoided by reading the assignment more closely.", "rating": "Loved!", "workload": "15 hours/week", "author": "XRxVfdewqJZ1yZWXI9v6klFutW62", "difficulty": "Easy", "semester": "Spring 2018", "time": "5/4/18, 2:53 AM"}, {"comment": "If anything, take this class if you like your lectures spoken with a cool Euro accent.I think the grading was generous. As long as you read the assignments very carefully, you should get > 95% on all assignments. I read on the forum, though, that many complained about getting major points off, but that's their own fault for not following directions. What else... forums are very active. If you ask a question, you'll get many answers within an hour or so.The Lead TA's are awesome! They provided really good feedback in Piazza, and at least one TA used to answer questions in the Slack channel.As much as I loved this course, the only I didn't like were the Friday deadlines. I was calling in sick every Friday to finish my assignments, until my boss pulled me into a breakout room to have a 1-on-1. He thought I wanted 3-day weekends every week. lol.In summary, take the course if you want to learn Android, or if you want to learn techniques on how to write quality code.", "rating": "Loved!", "workload": "10 hours/week", "author": "t5AVIqFXxibViDcJmSsgTpc2twc2", "difficulty": "Medium", "semester": "Spring 2018", "time": "5/8/18, 2:26 AM"}, {"comment": "This course is of medium difficulty. For someone having java/web development experience, this course would not hold any value. I am a mainframe programmer from a decade and hardly had any experience with java coding experience, so i learned few basics about java coding and also android development. The lectures were good, but did not taught me anything new as i am already used to work in agile environment.Grades are always late and no one knows for what marks will be deducted. I lost few marks in some assignments because of fat-fingering few spellings.", "rating": "Neutral", "workload": "5 hours/week", "author": "pEuhdC6wriMroDFM8VlTQJ1hTZk2", "difficulty": "Medium", "semester": "Spring 2018", "time": "5/9/18, 9:35 AM"}, {"comment": "If you have any experience as a software developer this is a very easy course for you. Another way to look at it: you will not get a lot out of this course. Lectures are very light and superficial, there were 7 assignments doable in a rather short time, an individual project and a group project. There was no exam. Grading is generous (but not curved). The average median over all projects was 95.The group project can be time consuming depending on your team. Teams get assigned based on availability and experience (you fill out a google form for that) - you can't choose your team members.Overall: most of the time I felt like I was wasting my time. Exception: the group project where I was working day and night.", "rating": "Neutral", "workload": "5 hours/week", "author": "Z5jBJCSQfrhf8wHAnvdjQpPGu8z2", "difficulty": "Very Easy", "semester": "Spring 2018", "time": "5/11/18, 6:49 AM"}, {"comment": "This class is just about worthless if you're already working as a software engineer. To make matters worse, you are very dependent on the group that you are placed in for the group project, which is by far the largest assignment. If you wind up carrying the burden of the development work, it can really suck. Also, the group project doesn't carry nearly enough percentage of the grade to justify the time investment. I think the class could benefit from having a more general Java development project rather than something so Android-specific (with next to no Android background being given). The rest of the class is easy peasy. Pretty much a waste of time. From the get-go, the professor and TAs have an antagonistic relationship toward the class, not budging an inch on the Friday due dates. There is no purpose to the fact that they don't release assignments more than a week ahead of time.", "rating": "Strongly Disliked", "workload": "10 hours/week", "author": "facebook:101533731139153567/", "difficulty": "Easy", "semester": "Spring 2018", "time": "11/18, 10:59 PM"}, {"comment": "This class is effectively mandatory, so take it, get it out of the way, and don't look back. Some useful concepts are taught in the testing area. In practical terms, that's the most beneficial part of the class. As a veteran programmer, I found the scope of the class project appropriate. But God help you if you get on a bad team. I put down an average of 12 hours/week for the course, but that includes 2 weeks of 40+ hours of class project work making up for the lack of participation of 2 people on a 4-person team. My other teammate was incredible, thankfully, and we pulled it out. Overall I would avoid this course if possible as there's not much to learn here if you have an undergrad in IT or engineering. Annoyingly, the instructor is very old-school when it comes to assignment release dates and downright fascist about requiring assignments to be turned in Saturday morning instead of Sunday evening/Monday morning like any rational person would.", "rating": "Neutral", "workload": "12 hours/week", "author": "xwNa7JhJF8S78tDEDvc3o6tleCB3", "difficulty": "Easy", "semester": "Spring 2018", "time": "7/31/18, 11:40 PM"}, {"comment": "Good course, but not all it was cracked up to be based on the reviews I read.Be sure to pay attention to every word of the instructions because they are quite nit-picky about grading sometimes.Overall, I enjoyed this class as I learned/refreshed a lot of software engineering practices. A good first class to get started in the program.", "rating": "Liked", "workload": "4 hours/week", "author": "aISgmIzxKogZWcp8QbIfSzTehKr1", "difficulty": "Easy", "semester": "Spring 2018", "time": "8/1/18, 8:37 PM"}, {"comment": "If you have previous education in CS this is a very easy course. That was my case, so this course was more like an update than learning new things. There is a few projects to do so the workload is a little on the heavy side but not complicated at all.", "rating": "Liked", "workload": "20 hours/week", "author": "c92fab32-20e0-48d2-9408-0850", "difficulty": "Easy", "semester": "Spring 2018", "time": "a20ed6c58/16/18, 11:04 AM"}, {"comment": "Really easy class, good for pairing with a second class. No tests, weekly projects were easy to quickly knockout.", "rating": "Liked", "workload": "5 hours/week", "author": "v09v8SzC6sbVx1rMwzQoua0aWgB2", "difficulty": "Easy", "semester": "Spring 2018", "time": "10/26/18, 10:06 AM"}, {"comment": "This should everyone's first course in OMSCS.It's a survey of software development and working in teams. You learn about unit testing, Java, IDE, and UI basics, git and github, and UML design.If you have an undergrad in computer science this course is easy but still managed to teach me a few things, like how to create an android app.Homework is frequent, one every week, but because they are so frequent the work is easy. If you know unit testing, android programming, UML, or whatever, you will get the homework done in a few hours. No massive time sink projects like most every other class.The TAs are responsive, Piazza is helpful, the projects are easy yet interesting - A must-take class for everyone.Cons:I am surprised anyone could dislike this class. All the complaints I am seeing on omscentral are minor.Grading is slow but that's Every class.Some of the assignments are open-ended but that's exactly how it will be in the real world. The github assignment was very nit-picky (I lost points for not capitalizing 'Assignment'), but I appreciate a challenge. People seemed upset that certain scenarios were not covered and the TA always answered the same way, basically, 'its up to you', which I thought was great. You get to actually learn, not just codemonkey paper to code.A significant number of people whined how assignments were due friday, not the usual sunday/monday, but frankly I don't get that. It forces you to start work immediately, and that's a good thing. What does it matter what day you run into problems on? The TAs are less likely to answer questions on a saturday/sunday so I was very happy they were always available on a thursday night.Some were upset by the class being too easy - to those people I say: Go take Computer Vision, or Compilers, then come back and complain about things being easy.", "rating": "Liked", "workload": "6 hours/week", "author": "ictLNWl1qxOOb7s4ZsN7LT3kkws2", "difficulty": "Very Easy", "semester": "Spring 2018", "time": "12/14/18, 6:33 PM"}, {"comment": "Recommended as a first course especially if one doesn't currently work in the industry. Most of the assignments were straight forward and in Java. The worst part about the class was, yep you guess it, the group project.Two of our group mates spoke broken English and pretty much went missing in action for the duration of the project until the last week. They tried to help with app documentation, but they had no idea what was going on. At this point it was better off that they didn't help at all. This course taught me how to hate group projects where the course randomly picks your teammates. I had a great time in IHI and EdTech, but SDP was truly one of the worst group projects I have been in.The group project should have taken 7-10 hours a week but my teammate and I ended up doing about 20 hours to carry our other 2 groupmates.", "rating": "Neutral", "workload": "7 hours/week", "author": "NIeO2yom7bhrtBKnq80tTCJflIw2", "difficulty": "Very Easy", "semester": "Spring 2018", "time": "12/30/18, 9:03 PM"}, {"comment": "Great first class. It gets you up and running with github if you hadn't experienced that before and exposes you to app development in android studio. Very helpful as an entry-level course into this program.", "rating": "Liked", "workload": "10 hours/week", "author": "oNbijfbBN4VZyehDS6H4L4X7jq83", "difficulty": "Easy", "semester": "Spring 2018", "time": "3/7/19, 11:21 AM"}, {"comment": "The instructors are not available to answer questions. They claim that they cannot guarantee a response in 24-48 hours. The course is more about following the process. There are assignments every week, which kind of make it hard. For me, with a baby arriving in September and full time job, the weekly assignments made my life a hell. I was constantly chasing a target. The assignments are very ambiguous and requires the help of other students to understand what is asked. Assignments submitted are not graded even after 2 months of submission. In all, I would say avoid this subject if possible. There are many other good subjects and good TAs around there.", "rating": "Strongly Disliked", "workload": "15 hours/week", "author": "VrBFCR2KM1e0vWqA0D9pbeUb4ef2", "difficulty": "Medium", "semester": "Fall 2017", "time": "11/8/17, 4:07 PM"}, {"comment": "Like some others have posted, I am not sure how is it that there are students giving 5 stars for this course. I do not necessarily blame the professor, rather, the TA's. These are the worst TA's I have ever had. At this moment, we have been waiting for answers for questions for the assignment due this week (November 8, 2017), and it is 3 days and we haven't received answers. But guess what! Yes, when it comes to grade the assignments do not expect the best results, these TA's are like in the Olympus, untouchable. They use this autograde system that will never grade as a human does. Even if you are not very good developing, their comments or feedback will push down, making you feel like you are not worthy of becoming a developer, or something else, because we have to be honest, this master program isn't to make 'software developers', it is for anybody in the area of computer science: IT engineers, developers, architects, etc. The name of this course sounds interesting, but the content to me is awful. I don't know the reason we have to be doing like more than 50% in software testing if there is already a course called 'Software Analysis and Testing'.By the way, get ready to be part of an experiment, when it comes to use this tool called 'TSLGenerator'. There is no valuable information on the internet for this, nor videos, etc. Nothing! The little you can learn you get from the Udacity lectures. So, the only reason I am taking it is because it is one of the options as requirements. The other course is 'Computability, Algorithms, and Complexity', thus, either you take SDP or you take CAC.The schedule for assignments due? The worst! They are due every Friday night; Saturday morning for some people. I wonder why they do that, when other courses assignments are due on Sundays. It looks like the people leading this course do not have a sense of humanity. They do not care if you have a family or if you are in another course: assignments are due every week on Friday!", "rating": "Strongly Disliked", "workload": "15 hours/week", "author": "LoYvGiFRHMNvd8Y1FPviDuD4mXG2", "difficulty": "Medium", "semester": "Fall 2017", "time": "11/8/17, 5:36 PM"}, {"comment": "First, the good: Professor Orso is a good lecturer and is passionate about the material. There are some interesting individual and group projects. I particularly liked the ones on Android and White-Box Testing. I plan on using what we learned about Extended TSL for automating test cases at work.The bad:Holy hell, the TAs are awful. I'm more than half-way done with my OMSCS degree, so this isn't my first rodeo - this has been without a doubt my worst course experience. The co-head TAs (Will and Erin) are defensive, easy to anger, slow to answer threads, and almost purposefully ambiguous in their replies to simple yes or no questions (e. g. \"is X a requirement?\" or \"Should the behavior be X or Y?\"). I'm a pretty agreeable person, but I feel like I need to get my blood pressure examined after each interaction with them on Piazza.The assignment docs are poorly proof-read, contain errors, and are often ambiguous.There is an assignment due every Friday night (or early Saturday depending on your time-zone). Assignments are released the previous Saturday morning. This wouldn't be so bad if the TAs were responsive - but posts routinely take 2-3 days to get a response. Usually the responses are ambiguous, defensive, and over-all unhelpful. All in all, this makes for a stressful weekly experience. SUGGESTION TO THE PROFESSOR: Please consider releasing assignments 1-2 days early (Thursday instead of Saturday). Or work with your TAs to get better response times. Or have the TAs do a better job at proof-reading the assignments beforehand.Feedback is non-existent. It's November 10th, and we're still waiting for grades on assignments that were submitted back in September. The feedback we have gotten has been one or two poorly worded sentences. A silver lining is that the TAs grade easy; but I'm here to learn and feedback is crucial to that process. Other OMSCS classes do a really good job at feedback, so it's definitely possible with a class this size.", "rating": "Strongly Disliked", "workload": "10 hours/week", "author": "c1yar9dHAcflP4Vk3KG9nxHFc8j2", "difficulty": "Easy", "semester": "Fall 2017", "time": "11/10/17, 2:35 PM"}, {"comment": "The name of this course should be Ambiguous Software Test instead of Software Development Process. There are 5 formal assignments besides Survey and Github usage, and 3 of the 5 are tests. And the whole individual project focuses on testing. Assignment 6 uses a tool named 'TSLGenerator' invented in 1989! I think lots of students are younger than it. Deliverable 3 of the project asks to write test cases to cover 100% of the classes which are invisible to us. It made me like a robot when I spent several hours on trying all the combinations to achieve the goal. What is worse, the whole course is ambiguous. The descriptions of assignments are ambiguous. Most of topics in piazza are discussing the meaning of assignments. The TA (if not a forum mediator)'s answers are ambiguous. For example, a student's test cases cover 98% of the main class and he/she wants to know the weight of the other 2%. \"You can get partial score\". Do you think this kind of answer helpful? The comments of assignments are always ambiguous. I got one line comment for most of assignments even I lost lots of points. I have to say this is the worst course I have taken from this program.", "rating": "Strongly Disliked", "workload": "8 hours/week", "author": "StB0p6QDfSTFShiSGGV8qTt5kXs1", "difficulty": "Easy", "semester": "Fall 2017", "time": ""}, {"comment": "Overall, this course was a very good intro to the OMSCS program for me, and provided an overview of software development techniques I had always wanted to learn. The Udacity lectures were informative with easy-to-grasp concepts, and Professor Orso has inspiring enthusiasm for the subject matter. This being my first course I can't compare to other GT classes, but this is easily the best online course I have ever taken. I appreciated the weekly YouTube office hours and was not required to post a mindless forum thread on a weekly basis, in contrast to my undergrad experience. The weekly workload is entirely doable if you read the instructions CAREFULLY and IGNORE your classmates' forum posts until you've absolutely hit a wall and need an answer to something in particular. Using this strategy, even while working 50 hour weeks I devoted about 4 days out of the week to schoolwork (this 1 class) and managed to get no less than a 94% on each assignment, I consider myself a software developer newbie with average intelligence. My favorite part of the course was the group project which we split up equally on documentation and coding, and I could not have asked for a better team. Having said all that, the TAs do take their sweet time on grading assignments, apparently especially if you choose to contest a grade (I did not), and I rarely saw any interaction by other TAs on the forum besides the two heads (perhaps they were grading?). There are some concepts that I would have liked to go deeper on, such as Agile, and the lectures could be updated with lessons on the currently used software. These did not manage to spoil my enjoyment of the course.", "rating": "Liked", "workload": "7.5 hours/week", "author": "QeYWbWRrbFVofK0jLnPMzB4xtbl1", "difficulty": "Medium", "semester": "Fall 2017", "time": "12/6/17, 9:30 PM"}, {"comment": "DISCLAIMERS: This was my first course in the program, so I spent a fair amount of time early in the semester learning basic OMSCS infrastructure (Udacity, Piazza, T-Square, slack). Related, although I have experience as a software engineer, my current job is entirely different. So I also spent a good chuck of time creating a workable setup on my machine (Cygwin, .bashrc aliases, git). Finally, although Java is clearly stated as a prerequisite, my closest experience is C++ from 15 years ago. So coming up to speed there was nontrivial.PROS: Professor Orso is a ton of fun! The lectures are great and the office hours are helpful. I enjoyed the material and appreciated the weekly assignment cadence. This course has been refined over many iterations, and the instructors are very clear that the decision to make each assignment due on Saturday morning is a deliberate one. Initially I was unhappy about this, but came to rather enjoy it by using some weekend time to get ahead on the homework rather than scrambling to meet the deadline. We were exposed to several technologies and tools (git, IntelliJ IDEA, Android Studio, Java, JUnit, markdown, XML). The Android Studio group project was a lot of fun. Groups were assigned based on mutually available meeting times and complementary Java experience, which worked out great!CONS: Assignment grades were consistently very late. I literally had no idea how I was doing in the course for the first half of the semester. (As a new student, this was particularly unsettling!) The instructors take grading very seriously, and go to lengths to ensure fairness by making sure grade distribution from TA to TA isn't skewed, releasing all grades simultaneously, and so on. I do prefer a fair grade over a fast grade, so I appreciated this. However, I think it's also reasonable to expect timely qualitative feedback, perhaps with a delayed quantitative grade. (Otherwise, there's no difference between OMSCS and watching Lynda videos!) I felt the lack of timely feedback hampered my learning and caused unnecessary anxiety.", "rating": "Loved!", "workload": "15 hours/week", "author": "31NeUIiJT2fQ6qrcPatENzkj8DF2", "difficulty": "Medium", "semester": "Fall 2017", "time": "12/7/17, 4:08 PM"}, {"comment": "Good intro course to software development, Android and JUnit testing. The group project and Individual project were interesting, but focus on testing is a lot in individual project. I learnt Java and Android development while doing the course so anyone with good software background will find the course easy. The bad part is all the submissions have Friday deadline, which makes it a very stressful week especially if you are working.", "rating": "Liked", "workload": "10 hours/week", "author": "VhhJ8Igrw7fVrlGc8obBP2kFGyz1", "difficulty": "Medium", "semester": "Fall 2017", "time": "12/8/17, 11:23 AM"}, {"comment": "Useless class.As an experienced developer, I have a lot of problems with this course and completely regret taking it. The professor read a bunch of papers in the early 90s and decided to make a class based on his naive understanding of software development. It is easy to get an A if you follow instructions closely and prioritize what the professor and TAs think is important.Also, very much a TAs vs. students environment; I never felt like they were trying to teach us, but instead using us to make their lives easier (even though they still took 8+ weeks to grade a single homework on some occasions). I think this is because there wasn't really anything to teach.Waste of my time and waste of money.", "rating": "Disliked", "workload": "6 hours/week", "author": "C8C74sAHGBhIIrR6oep90NanUe22", "difficulty": "Easy", "semester": "Fall 2017", "time": "12/19/17, 6:29 PM"}, {"comment": "I think if you already have considerable experience in software developing, this class would both be easy and useless for you. The class covers a wide range of content but doesn't go enough in depth with any of them. The weekly programming assignments also seem to lag the readings a bit (you'll be doing an assignment in Lesson 6 when the reading schedule indicates Lesson 7 or 8).I don't even consider myself an experienced software developer and there was only a few things I got out of this class that I felt I could apply in the real world. I didn't get enough hands on experience with Android development to be confident enough to enter that field. I got SOME useful experience with black and white box testing which I liked. Other than that I got some Java experience and that's about it. There's an opportunity to get a little bit of project management experience if you volunteer to be the leader for the group project but the curriculum doesn't go into software project management. I do wish the group project was shaped to focus on a particular software development strategy (e.g Agile, Waterfall, etc). I also wish there was a project on refactoring as the lesson material covered that but the projects didn't.", "rating": "Neutral", "workload": "10 hours/week", "author": "ExecoHAjrrc7QflEsAyZqfSdQMj1", "difficulty": "Medium", "semester": "Fall 2017", "time": "12/20/17, 10:21 AM"}, {"comment": "While this class is very broad in covering content and the lecture videos were excellent, the assignments were almost always monotonous and there were huge logistics issues. The assignments were almost always returned about a month later so it took forever to know how well you were doing, the group project (at least in my case) had 4 students in 3 different continents and it was hard collaborating discussions as the meetings for me were always either 1 am or 9 am (not sure if this was just bad luck for me.. or?). The projects themselves were quite interesting but I thought some topics were rushed too much while others had too much time spent on focusing a minute detail that doesn't really matter in the software engineering world.Overall, the course content was pretty decent and a great learning experience, but the logistics of the class itself has turned me away from the class.", "rating": "Disliked", "workload": "10 hours/week", "author": "ZpWlMPdYevZfautAiRRFbwKIMov2", "difficulty": "Easy", "semester": "Fall 2017", "time": "12/21/17, 2:21 AM"}, {"comment": "This is a very good course for JAVA or Android starter. This is a good course for the introduction of software engineering. It may not be useful for those who have much experience from industry.", "rating": "Loved!", "workload": "10 hours/week", "author": "sFJtQhV5MWY09168df4KjfonHg33", "difficulty": "Medium", "semester": "Fall 2017", "time": "12/30/17, 2:28 AM"}, {"comment": "I enjoyed a lot of the material and thought it was a good course for people who have not been working in a software company that primarily uses object oriented programing. I have mainly been in silicon and embedded systems development (C heavy) so found the material quite good as a survey of understanding potential processes outside of that environment. The weekly assignments differed greatly in difficultly and completeness of instructions, the TAs would help clarify - but if they thought it was clear enough they would stop.I really disliked the Friday due date of assignments - the only way to make this work with the curriculum is to stay one week ahead of the published schedule otherwise the weekend is wasted as you don't have the background needed to make progress. This made the course interfere with work much more than it should have, particularly for the bigger assignments.Grading was always really late - especially annoying for assignments that built on one another (and it turned out the multi-phase assignments only got one grade at the end.)", "rating": "Liked", "workload": "15 hours/week", "author": "9uYUzPabrLcvtHvnKlzS6EFOybt2", "difficulty": "Medium", "semester": "Fall 2017", "time": "1/5/18, 7:12 PM"}, {"comment": "This was my first class in the program and I thought it was quite well done. The class eases students into development the first few weeks by giving several introductory individual assignments at the beginning including a review of github, Java and Java testing. These will be a breeze for anyone who works as a software engineer already, but gives a nice review and catch up time to those who aren't. Thus, if you aren't a software developer you have a few weeks to ramp up. The group project was perhaps the most time consuming part of the class and also my lowest grade in the class. Overall, the group assignment was not so difficult technically, but the struggle of my group was procrastination by 2 members such that I didn't have time to review and fix what they worked on. The white box/black box testing assignments near the end of the term were interesting, though highly academic and theoretical. Overall, this is a great first class for the OMSCS program, especially if you are already a software developer. The class will also keep you on track with set deadlines and assignments coming out at manageable intervals.", "rating": "Liked", "workload": "12 hours/week", "author": "tAodAYP2i6WPUalSLOTZHXMKDM13", "difficulty": "Medium", "semester": "Fall 2017", "time": "4/9/18, 4:38 PM"}, {"comment": "BackgroundI have Java (10+ years) and Android experience( 2+ years), so the review might be a little biased.Course ContentVideos were a bit too long and if you have been developing software development in any capacity following a lifecycle, should be really simple.Udacity QuizzesThe udacity quizzes can be taken as many times as required with no penalty, but make sure your last submission is correct as they are counted against the grade.AssignmentsThe assignments attempt to build on top of each other with the second half being a group project. Be brutally honest about your skillsets to be matched correctly. There were few teams who had lot of trouble leading to disparaging discussions in Piazza.If you have Junits and/or Java development experience, the assignments itself should be a breeze. The only problem would be a black-box testing assignment with no clue about what bugs you are looking for. I would recommend living with whatever is possible as at the end of the day, it accounts only for a small part of your final grade.In the group project, attempt to identify an integration lead, ideally with Android experience. It would make all team mates lives simpler with each building one or more components and the lead integrating them together.I was the lead and all my other team mates either had paired this with other courses or were either getting a baby or moving, so getting the right team and responsibilities is crucial. There are 3 deliverables as a group and getting the dynamics is important to get them delivered.Exams/TestsThere are no exams and all grading is done via AssignmentsOffice hoursThis is the only 1 course out of the 3 that i have taken where the professor actually does a live office hours.Parting wordsIf you have Java experience, this is a simple no-brainer class which can be clubbed together with another course. If you have no Java experience or haven't worked in a group, i would tread a bit light and look for an alternative if possible. The learnings are not that really extraordinary nor the effort worth the merit.", "rating": "Neutral", "workload": "8 hours/week", "author": "oCERnU12iCh9HmPLAoJFNSAKkA52", "difficulty": "Easy", "semester": "Fall 2017", "time": "4/30/18, 1:09 PM"}, {"comment": "This is a good introductory course. You will get familiar with Java and create an Android application from designing it to actually coding it and testing it. It is important to have a good group and they try to pair the groups so that each team has someone with prior development experience.", "rating": "Liked", "workload": "10 hours/week", "author": "NHUjH7byy7RW2bLTSGQYSpW64ru2", "difficulty": "Hard", "semester": "Fall 2017", "time": "5/1/18, 4:35 PM"}, {"comment": "The course is a typical software engineering course walking through most aspects of software engineering. Professor Orso is a nice guy and great to interact with during office hours. I finished with a really close borderline grade and was upset by the support from the head TA. The individual is frustrating to work with and I feel my grades suffered from the interactions-- penalties threatened for requesting clarification on grades. If the TA moves on I highly recommend it and if you are in the II specialization it is all but required. Let us hope the individual finally finds a job and moves on.", "rating": "Neutral", "workload": "15 hours/week", "author": "G01WjfED4nUzWXPJYytTarXtrMm2", "difficulty": "Medium", "semester": "Fall 2017", "time": "8/19/18, 11:05 AM"}, {"comment": "This is a good first class for the OMSCS program. No tests, 7 assignments of low difficulty, one of which is a group project that spans across multiple weeks with deliverables at weekly intervals. The amount of time necessary for this class depends on your previous experience with the technology stack. The assignments are completed in Java, the projects are based on creating Android Apps, and you use Git. I had never used Java, built an Android App, or used Git so it took me considerably more time than most because I had to learn those concepts as a went, but I would still say it's low difficulty. Don't waste time with the group projects trying to delegate work; figure out who will work on what and start.", "rating": "Liked", "workload": "7 hours/week", "author": "wQ4i20zy2WbPsSsHWVqxnB9Bjhf1", "difficulty": "Easy", "semester": "Fall 2017", "time": "10/27/18, 1:50 PM"}, {"comment": "Good class. They've changed the structure from previous summer's. We had both an individual and a group project. I think the change really made the class a bit too hectic on weeks we had assignments and individual deliverables in the same week. Also, the TA's weren't able to keep up returning grades and feedback in time for projects that were dependent on prior assignments. I still really liked the class but expected with the class being offered every term since our program was started to be well oiled machine by this iteration.", "rating": "Liked", "workload": "15 hours/week", "author": "ldATjYsuXOSONQFQo4ktvRmJwhk2", "difficulty": "Medium", "semester": "Summer 2017", "time": "7/31/17, 4:19 PM"}, {"comment": "The other reviews for this course are accurate. There is a lot of work (and some of it people think is monotonous), but the summer is shorter than the fall and spring semesters, so the amount of work per week is probably higher.To prepare for the class, I recommend brushing up on Java and Android development. There are some good classes on Lynda for this purpose.", "rating": "Liked", "workload": "12 hours/week", "author": "nIX69biIhLWXgjTWGYtITdAcbnr1", "difficulty": "Medium", "semester": "Summer 2017", "time": "8/2/17, 3:35 PM"}, {"comment": "The lecture videos were very well presented and were professionally produced. The professor and TAs were active online and responsive to student questions. These aspects should serve as the gold standard for the class materials and instructor involvement in all OMSCS class offerings.Much of the class will be a review if you have worked in the software development industry, but it never hurts to review and there's always a thing or two left to learn. The projects were sufficiently entertaining and educational. Some prior OO and GUI programming experience will go a long way to eliminating any frustrations with this class.The group project experience depends largely on the project partners who are assigned to you. I worked with excellent individuals, and the 4 of us just automagically dove into our imagined roles and pounded out a project with a good score. Though there is a mechanism to adjust scoring should there be inequities in contribution from the other group partners (or so I've heard).Based on conversations with others, there were additional projects that are now in place where they weren't present previously in prior summer semesters. The final projects (both group & individual) were running somewhat in parallel and can make things busy.", "rating": "Liked", "workload": "4 hours/week", "author": "kEUKFU3QJTdgl9kl08AFkq2esZH3", "difficulty": "Easy", "semester": "Summer 2017", "time": "8/7/17, 6:37 PM"}, {"comment": "Basically an \"intro to industry\" course. This course is a broad survey of topics relating to how the real world does software development. Includes a group and individual project. The group project can be either very easy or very hard depending on your group - in my case, it wound up being incredibly time consuming (>40 hours one week because I had two absentee group members). I wouldn't recommend taking this course in the summer for just that reason - I don't think they scale the project back for the accelerated schedule, and one bad week of coordination can tank your schedule.The lectures are informative and well-done. The professor and TAs are very involved with the class, and I'd take another course from Orso in a heartbeat.If it's been a while since you've worked as a software engineer in a modern environment, this is a great course. If you're like me, and have been one for more than half a decade, it's probably less valuable.", "rating": "Liked", "workload": "15 hours/week", "author": "FeGHQ866qNbhY2WPpcV2WkbgI4T2", "difficulty": "Easy", "semester": "Summer 2017", "time": "8/10/17, 10:33 AM"}, {"comment": "If you're a programmer and you want to brush up on the best practices in development, this course is for you. I had long forgotten about best practices and processes. A good course to be reminded of them. The TAs and Prof are very active on Piazza. I took it in the summer so there was one assignment every week, which can be a little frustrating. The team projects needs collaboration. I had an awesome team. The tip, respect other people's opinion, its ok to give in sometimes and keep it simple... and do not take anything personal.. its all about the grade. There is one individual project.. follow up on piazza to get through it.. I got it working due to posts on piazza..Good luck.", "rating": "Liked", "workload": "6 hours/week", "author": "ORodtp3R0jbJuAM9K5Iwxxra4px1", "difficulty": "Easy", "semester": "Summer 2017", "time": "8/10/17, 2:44 PM"}, {"comment": "With a good group around me, I found the Android project really edifying about Android, but not really about software development as a process. You write a lot of docs, code the project, then backfill your docs with what really happened. You create one really useful diagram that makes you think, and a ton of expository writing that just fills pages. So, a lot like any highly regulated domain. This presumably forms the core of the class.However, in summer, you get the thrill of concurrent group and individual assignments. The individual assignments contain a lot of \"aha!\" moments that can take hours or days to find. But you don't have hours or days - you spent those on Android. I bet these individual assignments carry meaning in a longer term. In summer, they stand in the way. The course lectures don't have the information or the presentation quality to pull off \"aha\" assignments. Most of what you need, you find googling. And you don't share what you find because you never know how close you walk the line of distributing unfair information.I would have felt much happier ignoring the lectures and spending that time on the individual assignments. Really, they do not help.Last point (completely serious): The instructors do not believe in the western tradition of starting things on Monday. They live in an alternate calendar. Get ready to fight it out with your bosses and spouses. This course has no respect for your school/work/life balance, and throws many obstacles in your way. Much harder courses strike the balance, why can't this?", "rating": "Neutral", "workload": "7 hours/week", "author": "google:114588245870326197003", "difficulty": "Medium", "semester": "Summer 2017", "time": "8/20/17, 1:05 PM"}, {"comment": "I would recommend this course if you have no prior software engineering background, though I would skip it if you have had an undergrad SE class or SE work experience. There is no major challenge to the projects themselves, as they aren't designed to test you on your ability to solve problems, just how well you follow process and complete documentation (which isn't a complaint, that's the point of the class!). Unfortunately, there wasn't much engagement in the process beyond wrote tasks and standard documentation. Since the projects are fairly trivial, it seems silly to spend so much time on design and discussion, so hopefully in the future they use projects that are a bit more complex, or maybe having to deal with changing requirements or incomplete requirements. That being said, if you don't have any experience in software development or process, this is probably a good introduction to it.If I were to give advice to those taking the class, I would say two things:Be careful with your time, the Summer section was quite fast-paced, and it is easy to fall behind. The instructors insist on making things due on Friday, and make things very awkward for those who work. You can get some of the projects done on the weekend they open, but Piazza comments and project errata will appear during the week, so you still have to work around your weekday schedule unfortunately!Check your work over until you feel paranoid about it. The instructors are not very compassionate nor understanding when it comes to simple mistakes. I personally was only affected by this once at the very beginning of the course, but two of my teammates lost a full letter grade due to this. If something isn't compatible with the auto-grader, or there was a simple typo in a commit hash, function name, etc., then expect to receive zero points for that portion of the assignment, with no real wiggle room!", "rating": "Strongly Disliked", "workload": "8 hours/week", "author": "Sdq0fsqxXIgTfxEVZ1SagUW4rcj2", "difficulty": "Very Easy", "semester": "Summer 2017", "time": "9/27/17, 3:19 PM"}, {"comment": "Very Good software development foundation course, taught passionately by Dr. Orso and TA Team. Office Hours were conducted diligently and all clarification questions were addressed nicely. Very good Piazza Participation. Only downside was having team project and individual assignments going on in parallel during the summer time, making it very tight. The fall and spring semesters may not encounter this issue.", "rating": "Loved!", "workload": "15 hours/week", "author": "ObnEUH0rk6NDsV5I45dMg1GQPB02", "difficulty": "Medium", "semester": "Summer 2017", "time": "11/3/17, 3:47 PM"}, {"comment": "This course feels like the easiest I've taken in the program, but this may be due to the fact that it is very well organized, clearly structured and not ambiguous. There are individual assignments with enough time to complete and a group project that is a small Android app. The lectures are fabulous in their flow and design and quite interesting, even if a lot of it might be familiar to someone working in software development. It was still helpful to have the material laid out in such a fun way. Getting an introduction to Android was also great.Considering the ambiguous nature of the rest of the classes I've taken, SDP is now engraved in my mind as a sweet memory. I wish more classes were like this - I feel that many other classes try to cram an inappropriate amount of material, which causes them to be kind of all over the place.", "rating": "Loved!", "workload": "10 hours/week", "author": "sumEvEaIHgMgdjG9yh9Dozrq4wx2", "difficulty": "Easy", "semester": "Summer 2017", "time": "4/5/18, 10:26 PM"}, {"comment": "Third class I've taken, and I absolutely do not understand the positive reviews for this class. If you have programmed in an OO language before, this class is a huge waste of your time. Several of the projects are tedious and are of limited value to programming In Real Life.Example: In one project the assignment asks you to write 30 black-box test cases for \"test-driven development\" - when you have the source code (that you wrote) right in front of you. Actual worthwhile tests that you might write in industry are frowned upon. The standard \"red-green-refactor\" is barely mentioned in one lecture, and never really asked for in any assignment.Grading is unbelievably slow. Assignment feedback (when you get it) is random and worthless. If you want an easy foundational class, go for it. If you want to learn something useful, avoid. This class made me seriously consider dropping out of the OMSCS program.I should say something positive. If you've never written an Android app, you'll get that opportunity. The group project is also somewhat enjoyable if you find yourself in a good group (which I did).", "rating": "Strongly Disliked", "workload": "5 hours/week", "author": "wyTi1J0eFgaMnelWzwKTuymhqmK2", "difficulty": "Easy", "semester": "Spring 2017", "time": "4/4/17, 12:18 AM"}, {"comment": "In three words: tedious and tiresome. The material is not difficult at all. I actually enjoyed the lecture videos. However, the mind numbing, useless and extremely tedious assignments and projects makes this course almost unbearable. If that wasn't enough, your assignments are all due at 8 am on Saturday. Therefore, you can almost guarantee that this class will ruin every Friday the entire semester.The assignments are intended to help you master a certain topic, however most of them are extremely unnecessary, vague and time consuming. I've never wondered in the desert before but I\"m pretty sure this is what it feels like. Constantly wondering how you got into this situation, if you will ever see an end to the drought, wondering if you're just walking in circles and elation when you're finally done.Do yourself a favor and avoid this class.", "rating": "Strongly Disliked", "workload": "10 hours/week", "author": "hmkpc4oCrHYGXvrsEWjfiD820n92", "difficulty": "Medium", "semester": "Spring 2017", "time": "12/6/17, 1:55 PM"}, {"comment": "This was one of the two courses I took my first semester in OMSCS. I come from a non-CS background and do not code for a living (Im actually in recruiting - ie.. sales). I have never written Java, never been exposed to unit testing, heard of UML but never messed with it. I do have a lot of procedural based coding experience, as well as have developed a CRM using MySql back end in VBA. I have done some PhP/MySql too, but not much.I couldn't recommend a course more highly, especially for a new student in the program. Dr. Orso was a joy in class, was involved weekly, always available, active on Piazza, and the weekly office hours were fantastic. More importantly for me, the projects made me think. I always (once released) said - oh, this wont take long. Once I got into it - I realized that the assignments were a little more involved and thought provoking than I first thought. The only assignment that I really wish were reviewed was the Category-Partition testing assignment. We had lectures on the subject, we used the application; however, I totally see the value in the tool, but not sure I really understand the best way to choose and assign categories and parameters.As for the group Android project, I hit the mother-load with group members! All 4 of us put in a ton of effort on the project, and our grade reflected the work we did. We started early on the assignments, followed the instructions, completed the writing / required documentation, and by meeting multiple times during the week all assignments were submitted and complied with requirements.If I had one recommendation, to me, the group project (15% weigh) should have been weighted higher. I certainly worked much more on that than I did on the individual project (which had 20% weight), it consumed more weeks in the course, and was a much more comprehensive effort than the individual project.TA's were Great and active daily. This class totally flipped how I approach software development!", "rating": "Loved!", "workload": "15 hours/week", "author": "TuTgp9SqPDT8DB276XOQzP06zFW2", "difficulty": "Easy", "semester": "Spring 2017", "time": "4/27/17, 10:37 AM"}, {"comment": "This class stays true to its mission, which--as the name suggests--is to build up the 'process' parts of the skill set as opposed to the programming or theory skills you'll get in other classes. This means that it may not be the best option for those that already have experience as a developer, but for those that don't, you'll get useful practice with Git, unit testing, UML, white-box testing, and black-box testing, among others. The assignments and individual project account for over 70% of the final grade, the group project accounts for another 25% (split 15% for the actual project and 10% for your teammates' assessment of your collaboration), with a a few remaining free points from Udadcity tracking whether you watched the lectures and did the quizzes. As long as you follow instructions, the grading isn't very strict. This class pairs well with other classes, though be aware that the workload during the month or so of the group project can be higher than for typical weeks. Professor Orso and the TAs were very involved and helpful. My main complaint was that the pace of grading was pretty slow.", "rating": "Liked", "workload": "10 hours/week", "author": "qoBqrhI1GJdgmj7CgYs6KZmbbMJ2", "difficulty": "Easy", "semester": "Spring 2017", "time": "5/10/17, 3:21 AM"}, {"comment": "This is a great class to start the OMCS program off with! Gave me a good opportunity bang off some rust programming with Java and I got to learn some new stuff with android development. This class is project driven, which I really liked and I felt the projects were generally challenging/interesting.", "rating": "Loved!", "workload": "12 hours/week", "author": "Gfu4WciFvQg0FXvzG2ZdMwaYGi03", "difficulty": "Medium", "semester": "Spring 2017", "time": "6/20/17, 5:24 PM"}], "difficulty": 2.361, "enrolled": 1093.0, "id": "CS6300"}, {"rating": 3.432, "workload": 13.616, "withdrew": 237.0, "comments": [{"comment": "This one I decided to withdraw as I just didn't see any value in taking it. The first assignment was only to have a class diagram of the idea presented on the assignment and assignment 2 to implement it in java. By that time I realized they had nothing to offer.Waste of time, do it for the the credits or save yourself the money .", "rating": "Strongly Disliked", "workload": "10 hours/week", "author": "MFI4TofAycVpImoOCLYtE1Kyoyq2", "difficulty": "Easy", "semester": "Spring 2019", "time": "3/2/19, 11:28 AM"}, {"comment": "This course progresses slow. TA grades extremely slow - before withdraw deadline, only 2 assignments had been graded (Notice the total number of projects is about 8). Instructor never responded my query. All he cares is just office hour, but individual's questions are under attention. Assignment of grading for TA is by students' last name and your regrading is by the same TA, who will be responsible for ALL YOUR ASSIGNMENTS. Your fate is highly ruled by luck (TAs' mood), since several assignments are short answers and depending on TA's subjective judgement. If you are not lucky enough, you will be wasting your money feeding those who give you unreasonable low score, want you to withdraw and retake, with little respect of student's hard work, appealing, and asking for help. \"Regrading\" doesn't work at all for such TA. My program passed all the tests, but for the writing part reasoning about my design I got < 60%. Can you believe this is not deliberate at all? He may add 1 point to fool you looking to your regrade, which is SICK. I don't know how OMSCS can hire this kind of person. You can not complain about this, otherwise your TA may treat you harder. It is horrible. You will feel being cheated of money here. And yet they feel you didn't pay enough, so it is none of their business to treat you fairly.", "rating": "Strongly Disliked", "workload": "16 hours/week", "author": "3zqYkcImjkNVdg85jesuRkuliGE3", "difficulty": "Medium", "semester": "Spring 2019", "time": "3/11/19, 5:54 PM"}, {"comment": "This class will force you to review some software programming concepts that are quite dry but probably good for you at the end of the day.A few takeaways after having completed this class:No, you probably don't need formal UML diagrams for work. But is it a good idea to draw a few out at least once, taking this one time to think carefully about how your software system is structured? Probably yes.Have you been writing lots of small code snippets for online courses, but don't know exactly how you'd be able to work with other software engineers to build a larger software system? This course is for you.At what other point in your life would you be forced to write about the merits (or demerits) of different programming paradigms?Disclaimer: I haven't taken SDP so I'm not sure how the content of this class differs in scope and usefulness.", "rating": "Liked", "workload": "5 hours/week", "author": "XPNqHSZzCjW0DnBMnqW2ZmrRQNt1", "difficulty": "Very Easy", "semester": "Fall 2018", "time": "12/5/18, 9:31 PM"}, {"comment": "I don't think this course is run very well, and most of my issues come from the TAs/instructor and the group project.If you have experience reading/writing Java, you're fine. 3-4 of the assignments are text based (reading and writing). 2 of the projects are designing UML documents. 2 of the projects (the individual project halfway through and the group project at the end) are coding projects (Java). As I mentioned, any experience in Java (especially with writing multi-class OO apps) will be fine.The TAs and instructor didn't answer questions often, instead referring to minute marks in the office hours. I understand why you'd encourage students to watch office hours, but a lot of us just want to see the answer we're looking for instead of sitting through 1-2 hours a week of office hours, or scrubbing a video. It just seemed somewhat passive aggressive. The readings are useless. They assign them and hold \"reading hours\", but they aren't necessary at all. The only benefits from the lectures are to take the quizzes for the participation points. Aside from that, you can Google/learn as you go the UML concepts you need.The group project is a typical group project. I didn't particularly care for it, as my group wasn't great (had a major imbalance in ability and workload). The individual project isn't too tough, I am moderately experienced with Java and it took me about 7-8 hours total over a week or so. The text-based projects (including an essay) are boring and didn't seem to actually grow knowledge in the subject.Overall, I don't think this course is the standard of what I'd expect in OMSCS. Most of the assignments feel like busy work. I also personally don't care for software dev concepts (such as UML design), but that's on me. I'd say SDP is a much superior course. If you're looking for an elective or a course in the computing systems track, try one of the others before this one. However, this course was fairly trivial over the course of the semester, so if you just need a \"filler\" class, then this is fine.", "rating": "Disliked", "workload": "7 hours/week", "author": "g4f0CHMh6DVOBQpL1Gd2bAJSGTc2", "difficulty": "Easy", "semester": "Fall 2018", "time": "12/13/18, 1:01 PM"}, {"comment": "This course teaches useful UML and design patterns. Although if you've taken 6300, you probably won't learn much here (especially, as there are no tests, you don't even need to watch all the course material)The course material is not hard, the management somehow makes the course very hard.For example, in the major individual coding assignment, the advisor noticed there are errors (more like inconsistency, the VM uses one printout format, the PDF uses another) in the examples one month before the deadline, this is what they did to notify the studentsreplied in a piazza post, which is either pinned or highlighted and by the time it's approaching the deadline (approximately a month from the post), it is already deeply buried by other postsPost an announcement titled \"New Prototypes and Test Solutions Available\"- Looks like the instructor is posting new tests, right? in the body the instructors say \"There was an error with the testing prototypes: they displayed the correct values on the screen.\" I skipped the content after skimming the title andThe PDF requirement asks the students to use the VM to test their code (which intended as the VM environment, not the wrong tests in VM). There were no red bold reminders or corrections in PDF, nothing.The error was founded one month before the deadline, and the error was not corrected.I met 3 other students in the later group project, who I didn't personally know before the group formation. And 3 out of 4 of us used the VM test cases as the standard and lost 40-50% points.This is very sad and frustrating for us as a student", "rating": "Disliked", "workload": "8 hours/week", "author": "nc8nD1EVozcbnodO0BIscycubFy1", "difficulty": "Easy", "semester": "Fall 2018", "time": "12/17/18, 2:27 PM"}, {"comment": "It is an easy course if you are a software developer. Assignments and Video lectures do not match. I got a good understanding of Design from this course. It would be a good course to take alongside a difficult course.", "rating": "Neutral", "workload": "5 hours/week", "author": "gfGBVpZNEketAojUoBUoulmNmL12", "difficulty": "Very Easy", "semester": "Fall 2018", "time": "12/18/18, 12:32 AM"}, {"comment": "I really am struggling to write a review for this course. I think CS 6310 is more of an extension to CS 6300. I found the course rather boring, with endless amounts of (frankly useless) theory in the Udacity videos. Other than the group assignment, the class only has one real programming assignment (assignment #5), which wasn't that bad. I found that Professor Moss was a good instructor, but his assignments really had nothing to do with the Udacity lectures. Frankly, I din't know what I learned in this class, but it reaffirms the potential power of UML.If you have the time, I'd take this class, but don't expect to learn much.", "rating": "Neutral", "workload": "15 hours/week", "author": "s9ABDIzNFkMKsb1onBYzIaJhdyW2", "difficulty": "Very Easy", "semester": "Fall 2018", "time": "12/21/18, 2:57 PM"}, {"comment": "Class moved at a snails pace. Moves so slow you might forget you are taking it if you are not interested in the reading discussion. Most weeks I put 0 hours into this course, but on the rare occasion there is a project, I put a decent amount of time in.No tests in the course, so if you have some knowledge of the material, the lectures are not necessary to watch, and they are much longer than other course lectures, but they are very thorough.Be prepared to have time to work on the group project. Everything moves slowly throughout the semester, but then you have about 2 weeks at the end to collaborate with your group on the final project (made worse by thanksgiving holiday in the fall).Easy class if you have a background in Java. Good class to pair with a more difficult one. Wouldn't recommend as a first course due to it being poorly run IMO.", "rating": "Disliked", "workload": "2 hours/week", "author": "aISgmIzxKogZWcp8QbIfSzTehKr1", "difficulty": "Very Easy", "semester": "Fall 2018", "time": "1/2/19, 1:32 PM"}, {"comment": "There is a great opportunity to use Java in designing an object-oriented system such as \"Mass Transit System\" for both individual and group project. Depending on the group, you may also learn different front-end design techniques(Java Swing, Fx, etc.) to display the output.Pros:Fairly easy courseNo test1% or 2% Extra Credit, if 70% or 85% students complete CIOS review. We received 1% Extra Credit as 76% of students completed the survey. There was also an additional 0.5% Extra Credit for Individual coding project(Assignment-5) as there were additional test scenarios by mistake.1 individual coding assignment1 group project including both coding and UML diagramsCons:There is not much correlation between assignments and lectures after UMLMost of the assignments will be graded by one grader. If you are unlucky you may end up with one who does not pay attention to grading requirements such as essay length or provide feedback too late.Only 2/10 assignments are coding related. Other assignments(70% of the grade) are UML diagrams, essays or feedbacks.UML diagrams are heavily graded.There were conflicting instructions as of when an assignment is due. One Instructor Piazza post said assignment 5 and 6 were due on the same day, though Canvas had different dates. The Piazza post was never updated. Students only need to follow Canvas due dates and announcements as it will supersede any Piazza/Office hour posts.Office hours are great but can be lengthy and confusing. As a result, there are ~100 posts/updates just to clarify the \"rewind\" feature of the \"Mass Transit System\"There are only 3 weeks for the group project which includes knowing your group members, analyzing each other's projects(5 and 6) to be used as the basis for the group project and deliver the final project, video presentation and working VM(Virtual Machine). This is especially difficult in Fall as members may be unavailable during Thanksgiving.If you're unlucky, you may end up with group members who do not care to contribute or communicate and think they have already contributed by doing previous projects! You could easily see your time spent per week rise dramatically (~40hr/week) in the 1-2 weeks before the project deadline.50% of the grades (Assignment 7-10) were not released until 2-3 days before the official grades were due.Just choosing a group member based on location is not a great way to form a group. For group-project, make sure you have someone with FrontEnd experience.Also, remember to submit all files for an assignment every time. There were many students who only submitted all required files the first time, but then only resubmitted an updated file and not the other one. For instance, if you have 2 files to submit, resubmit both every time even if only one of them is updated. As a result, Canvas only had some of the required files.Though it is an easier course, it may take more time than you think.", "rating": "Neutral", "workload": "10 hours/week", "author": "0ndAt2GBZHaD7dsq6uyruaKQXSt1", "difficulty": "Medium", "semester": "Fall 2018", "time": "3/9/19, 3:20 PM"}, {"comment": "The prof and TA were very active in Piazza. I think my TA's grading was pretty generous but it was too slow compared to other courses.Udacity lectures are not necessary for completing assignments but you need it for little participation grade.You must watch the weekly office hour videos for your assignments since the description is often unclear. They usually have to answer a lot of questions.You must know Java for programming assignment and group assignment. Front-end skill is required so make sure you learn it or get in a group that has a member with front-end experience.Honestly, you are not going to learn a lot from this course if you already have taken CS 6300 or undergrad software engineering course but you will get an A guaranteed.", "rating": "Disliked", "workload": "4 hours/week", "author": "ydQSB8tJKWRJmUfliQK7q97yujk1", "difficulty": "Easy", "semester": "Fall 2018", "time": "1/4/19, 2:30 PM"}, {"comment": "Overall, easy course. Enjoyed the projects and learned a good amount about UML. Some of the work was tedious but not overly difficult. Final group project was pretty fun although it's always hard to find a good group that works together. Ideally come into the course with a group already in mind.Not a hard class. Instructor is really involved having discussions about reading once every 2 weeks and office hours on bluejeans once a week.", "rating": "Liked", "workload": "10 hours/week", "author": "JjQxRdhFjRcEAwof97ntpoozCvo1", "difficulty": "Easy", "semester": "Summer 2018", "time": "8/6/18, 6:16 PM"}, {"comment": "Took this as the 5th course in summer 2018 semester. I found a disjoint between the course work and the lesson videos. Infact didn't need to use the videos for any of the projects. A smile read up online on the uml design information was enough to do well in the course.Personally, there wasn't much value add from this course.", "rating": "Disliked", "workload": "5 hours/week", "author": "2DZdkeLXKuSNSWOFQAP8E493xyy1", "difficulty": "Easy", "semester": "Summer 2018", "time": "8/18/18, 9:15 AM"}, {"comment": "If you've worked professionally as a software developer for a few years, this course is likely going to be a great deal of busywork and a complete waste of time. Dr. Moss inherited this course from a retiring professor. Dr. Moss is great and extremely responsive, but he didn't create the video series or the curriculum. This course goes into excruciating detail on topics that are unimportant and not widely used in industry. The curriculum needs to be re-balanced and these courses re-filmed. This is the first OMSCS course where I didn't finish all of the videos. In fact, you don't even need to watch the videos to successfully complete all of the assignments.There are some great courses in OMSCS. Until this one is reworked, it isn't one of them. I highly recommend that you take something else.", "rating": "Disliked", "workload": "4 hours/week", "author": "7a2acc4a-ac14-46fd-8252-0013", "difficulty": "Easy", "semester": "Summer 2018", "time": "fb02cb798/20/18, 8:45 PM"}, {"comment": "This was my second course in the OMSCS program. I had taken IOS(CS6300) in Spring2018 prior this class. Coming from such a great class IOS was, this class was terrible. It is easy to get an A but I did not get very much learning out of it, which is why I am doing this program in the first place. On weeks when assignment was due, you can cram it out and on other weeks that don't have anything due, there would be almost no work except watch some videos. There was a lot of cramming in the end for the final project. Here is the break down:Pros:Easy to get an ANo exams so don't need to stress over material of the lecturesCan kind of BS your way through since design is very subjective and there is never a \"right\" answerCons:TA's are not very helpful AT ALL, rarely answers piazza posts clearly or even at all. There is no slack channel for concept discussion and questions.Assignments take a LONG time trade. Since it takes forever for you to get your assignment back, and even when you do get it back, you don't get any feedback so you don't know if what you did was actually correct or not, even though you got a decent grade. Because of that, I went through the entire course not knowing what things I did right or wrong. Up to this point I still do not know what I did for my assignments were correct or not, it was all \"my best guess, and what made sense for me\", but it would be very helpful to see other ways of doing the assignments, what to do and what not to do.Final project was just kind of thrown at you and he tells you to just go do it. There is no progression or guide in how to do the project so it is overwhelming at first, especially if you don't have very experienced team members. Also absolutely no feedback for our final project. We spent 85% of our time doing the database which was worth 15 points and we ended up getting 0/15 for some unknown reason. We message the TA and professor and we get no response. It is just so unprofessional.Lecture materials apparently are very important concepts but videos do not go over many examples or go in depth to explain anything, how to implement concepts, how the concept compares to another solution. The professor presents the material and thats it. If someone like me has never heard or ever seen what the professor is talking about, I do no learning.Tips:Try to meet up with local students and discuss over topics in lectures and homework requirements (of course following the collaboration policy). This is because design is very subjective. There is never a \"right\" way to design something. That is what makes the course content difficult to learn.", "rating": "Strongly Disliked", "workload": "6 hours/week", "author": "0kwOdzeEedPH3uucYl14k2uxXNE3", "difficulty": "Easy", "semester": "Summer 2018", "time": "8/21/18, 6:46 PM"}, {"comment": "pros:professor was very active: weekly office hours, biweekly reading discussions, answering questions on piazzainteresting readings (IMO)project was interesting and realisticgood course to take over the summer (pretty manageable workload, no exams)cons:videos weren't really necessary for the projects (they were made by another professor who has since retired)TAs were pretty unorganized (not the worst I've seen, but not the best either)", "rating": "Liked", "workload": "30 hours/week", "author": "7OXexWMRhQh9wboLIdTV3MyL8br2", "difficulty": "Easy", "semester": "Summer 2018", "time": "10/25/18, 7:24 PM"}, {"comment": "The good part of this course, it tells you the basic concept of UML and software design process. It's good to take it if you don't have any idea of software design. However, the content is shallow and not worth to take it if you already know these concepts.Video content: I will say not helpful for the assignments and project at all.Assignments: Some of the assignments are just funny, like discuss some statements from a book. While the design and individual implementation of the final project earn some credits for this course. Not hard but feels like you did a software product from scratch.", "rating": "Neutral", "workload": "5 hours/week", "author": "nJFqpYT4lMaS65mrxtz7MztzkHI3", "difficulty": "Very Easy", "semester": "Summer 2018", "time": "12/20/18, 7:19 PM"}, {"comment": "spring 2019grade slow, regrade slow.They don't give you regrade result before withdraw ddl.You score depends on your luck about which TA is assigned to you. One of my HW got extremely low score <50%. I listed all the reasons for regrading. Two weeks passed, the TA and instructor chose not to give even an simple reply.requiremens of assignment are never clear in the instruction. Without attending office hour or looking through many question posts about requirement in piazza, it's impossible to get a high score. I got almost 95% in all other assignments/quizs, including the code implementation. However, the mean TA used some subjective questions to deduct your score. You did it\uff01 I withdrew 6310 and even start thinking whether I should quit OMSCS. I rather spend my time on writing more LC than wasting my time on such course and mean people.", "rating": "Strongly Disliked", "workload": "10 hours/week", "author": "FdBnH7Vb8Mh7uh9plk3yInlT27V2", "difficulty": "Medium", "semester": "Summer 2018", "time": "3/12/19, 10:07 AM"}, {"comment": "Not bad -- just not super interesting. I do designs at work frequently and the details in this course I definitely learned but felt that I would never need to dive this deep 95% of the time. Would skip this course if did it again", "rating": "Neutral", "workload": "6 hours/week", "author": "h8let8CIgyeA4ExecweIgQ7cYic2", "difficulty": "Medium", "semester": "Spring 2018", "time": "4/3/18, 6:37 PM"}, {"comment": "I liked as a first course, not too many hours per week. I ended up spending more time since I had to review the course content more than once partly due to work. However its easy and with the timelines you could make it. Important is the 200 point project, if your team is good you're good. Make sure you spend sometime learning the UML concepts, they will be used throughout.", "rating": "Loved!", "workload": "13 hours/week", "author": "5JVeIPG3F1MgHf0pjCrfrCRtzAf2", "difficulty": "Medium", "semester": "Spring 2018", "time": "4/30/18, 11:02 AM"}, {"comment": "The subject matter of this course is not difficult at all if you are a java software engineer. That said, the workload of this course can be deceptive. There are some assignments that don't take much time but there are others that do if you want to get top marks. If your goal is to get the highest grade possible then be prepared to put some time into this course but if all you want to do is pass then this course probably won't require too much. This is grad school so at the end of the day you get out what you put in.", "rating": "Liked", "workload": "10 hours/week", "author": "Hw4fFnIhisg20OJ17pcHuF1tcil2", "difficulty": "Medium", "semester": "Spring 2018", "time": "5/4/18, 1:50 PM"}, {"comment": "Some of the grading seemed arbitrary, but it's a great overview of the topic. Disconnect between the older lectures and the newer approach in the readings and office hours/discussion. Group project was really good, and a good way to get to know others in the program well.", "rating": "Liked", "workload": "15 hours/week", "author": "9nURtxBwQmQcirh7ZvK4bBvyQn22", "difficulty": "Medium", "semester": "Spring 2018", "time": "5/7/18, 9:29 AM"}, {"comment": "Big disconnect between video lessons, reading discussions and assignments. Probably, in part, due to the fact the professor changed from the the time the video content was created. I thought a disproportional emphasis was put into UML versus SW architecture and design topics. Group project towards the end of the semester is interesting, but if you find yourself in a bad team you may be in trouble as the team project accounts for 20% of your entire grade. Also on grading, it took the teaching body a long time to grade assignments, which can be a problem as, since some of the assignments sort of build on each other, if you make mistakes on an early assignment, you may get penalized for the same mistake on a later assignment. However, grading seemed very reasonable and methodical overall. It was my first course on the program, and one I thought to be a good intro to it after the fact. Probably worth taking it, but don't expect much learning if you work as a SW engineer on your day job; however, as others already alluded to, it is a Graduate course and you get what you put in.", "rating": "Neutral", "workload": "10 hours/week", "author": "BOrATJWJeSeQORFh9FS5BQKEYol1", "difficulty": "Medium", "semester": "Spring 2018", "time": "5/7/18, 6:23 PM"}, {"comment": "This is a good course for someone from a non-CS background or has little experience in architecture and design. The UML coverage overlaps a little with SDP 6300, but expands beyond that. The early assignments were good. The professor held ~weekly \"reading discussions\" to discuss research papers, which I found very helpful. Most of the reading assignments were very interesting also. The group project felt like just another group project. It had some design aspects, but little to reinforce the architecture component of the course.", "rating": "Liked", "workload": "6 hours/week", "author": "NdmtvmLYbNQ8vD2VlgpuiiCyHgh2", "difficulty": "Medium", "semester": "Spring 2018", "time": "5/8/18, 9:43 AM"}, {"comment": "I took CS-6310 in Spring, 2018 with Dr. Mark Moss. This was my first OMSCS course. I felt like the course was a good first course. It was not too difficult, but it did require me to put in about 10 hours per week on average. Dr. Moss and the a couple TAs were very involved in the course and I feel like they communicated very well compared to what I've heard about in other courses. The course was organized and well-run.There were no tests, just assignments, which included a group project in the final 3-4 weeks. The main assignments were 2 design documents using UML, an approx. 6-7 page (double-spaced) research paper, and and the final group project. There were of course the Udacity videos and some required readings, but the readings did not count as part of a grade. The content was fairly interesting, but I felt like a little too much emphasis was put on UML and not enough on architectural styles. You can't really work ahead on the assignments as they are released at specified times.", "rating": "Liked", "workload": "10 hours/week", "author": "se0k7bFAdfM8EpTPnnAuhtJEUxx1", "difficulty": "Easy", "semester": "Spring 2018", "time": "5/9/18, 10:11 AM"}, {"comment": "This is a good course to take as the first one in the program. It is easy to understand and the assignments and projects are well balanced. Mr Moss is an excellent lecturer and the classes are good. There is one group project, but it is not a big deal if the group is responsible.", "rating": "Liked", "workload": "6 hours/week", "author": "140Zo5mxmjQ4VnRkEy9yIMYQO5w1", "difficulty": "Easy", "semester": "Spring 2018", "time": "5/10/18, 11:00 AM"}, {"comment": "One of the easiest courses in OMSCS. Projects are easy but time consuming. The last project which is worth 20% of the grade was a code based implementation group project which needs to be tightly managed as team members are all over the world and have different experiences.", "rating": "Neutral", "workload": "7 hours/week", "author": "pheTmma9sAd862NJHNSaJ6yZriE2", "difficulty": "Easy", "semester": "Spring 2018", "time": "5/21/18, 10:52 AM"}, {"comment": "This class was ok. I took this as my first course in the program because I didn't want to start out with something extremely difficult, but this was almost the opposite problem for me. I took what turns out to be an almost identical class in my undergrad, so this class was really boring for me and I had a tough time giving it my attention. The work load is pretty light, I wish I would have taken another class at the same time, but again, I didn't want to do too much in my first semester. The information is not bad and the group project was not hard.", "rating": "Neutral", "workload": "5 hours/week", "author": "v08w5uhKKAfJhVgglJ0drItjTQG2", "difficulty": "Easy", "semester": "Spring 2018", "time": "6/7/18, 4:10 PM"}, {"comment": "This class was super boring to me, but it was easy to grasp the concepts.", "rating": "Neutral", "workload": "10 hours/week", "author": "2WwmSTdDh9VwC5mUfvHgrYJq03E2", "difficulty": "Easy", "semester": "Spring 2018", "time": "8/3/18, 8:24 AM"}, {"comment": "I really like the course, the course focus on the \"system design\" and encourage students to discuss a lot of high level ideas. Then after discussing with other students and teammates, you can try to implement the design from scratch (full stack project), it is interesting and a good way to review all the knowledges and skills.", "rating": "Loved!", "workload": "10 hours/week", "author": "8udVaCgcPBPbNQ6AU7BciHxh2iq1", "difficulty": "Easy", "semester": "Spring 2018", "time": "8/3/18, 3:48 PM"}, {"comment": "Some of the requirements were a bit nebulous, and as a group we left a ton till the end, but this class is doable if you learn to love Java and great UML diagrams.", "rating": "Neutral", "workload": "20 hours/week", "author": "jRLSzWDHVNYH1UZGWddP9gsUoQD3", "difficulty": "Easy", "semester": "Spring 2018", "time": "8/3/18, 11:40 PM"}, {"comment": "Lots of concents which i thought i know earlier, but surprised me when taking this course. Group project was fun one and great.Too hard to get responses back from TAs to conclude fast.Udacity video you will see more presenter's face all time than the text we needed, may be old format. New classes i see more text contents rather speakers face.", "rating": "Liked", "workload": "10 hours/week", "author": "8kW5P6zOvSW4Pdrb7hyvmiUYxnV2", "difficulty": "Very Easy", "semester": "Spring 2018", "time": "1/9/19, 7:27 PM"}, {"comment": "Great to consolidate existing Software Architecture and Design knowledge.Included several papers which give a full understanding of Software Architecture and Design across several years.Does not cover latest technologies in the industry as well as new architectural patterns. The assignments does not encourage their usage or implementation. All programming assignments are done in Java.Helps to understand how to balance between high-level and low-level software design.", "rating": "Neutral", "workload": "12 hours/week", "author": "wJX5QGfpU0OxQtAXTmOVXbZMwG82", "difficulty": "Medium", "semester": "Spring 2018", "time": "12/27/18, 7:21 PM"}, {"comment": "This is a great class, if this is your only class you will have fun and do very well. do NOT pair this with a harder class, you will rob yourself of a great experience as you will neglect this class and both grades will suffer. no tests, group project is actually fun (but I may have gotten lucky with a solid team).", "rating": "Liked", "workload": "15 hours/week", "author": "kS5ppur1S1glqenSgKEp42MdYk82", "difficulty": "Medium", "semester": "Spring 2018", "time": "4/3/19, 2:25 PM"}, {"comment": "SAD is a good course and gives an overall basic knowledge of software architecture and design aspects and principles. If you are new to architecture and design it's a good learning and if you have already worked in the software development and design for few years this will be a refresher course.", "rating": "Liked", "workload": "12 hours/week", "author": "TUKptWvFmKQ92Y9hyCTC5OpQmki2", "difficulty": "Medium", "semester": "Fall 2017", "time": "12/31/17, 2:34 AM"}, {"comment": "", "rating": "Easy", "workload": "Neutral", "author": "yEiM0K1GzaaGHEKbkCuVNNpRz4t1", "difficulty": "Fall 2017", "semester": "I really wasn't a fan of this course. The readings in the class were good, and I was fine with most of the lectures, but the quizzes didn't help reinforce any of the concepts in my opinion. Also the TAs were slow graders, and took quite awhile sometimes to respond on piazza. A ton of the topics are pretty much stuck in the 80s/90s of SAD, so a lot of it isn't really relevant to today. The class is pretty easy if you have some programming knowledge, especially since there are no exams.", "time": "12/9/17, 2:02 PM"}, {"comment": "The course had really good TAs, they were active on Piazza. One thing that got me was the first java assignment, they were very finicky about your program's output matching the expected answers. Make sure you match the expected answers 100% (keep running diff commands). Make sure you familiarize yourself with UML diagrams, state charts and OOP design patterns and you'll get an A. The grades come back kind of slowly, but as long as you break the problem down and model it correctly you won't have any issues. The video lectures are good, actually pretty funny because of the professor's interactions with the udacity person. This is for sure a first course to get you in the swing of the program.Use lucidchart for your diagrams, it's ezpz.", "rating": "Liked", "workload": "10 hours/week", "author": "1yf6GsNPKweQpJ96fi4D4kup5CB2", "difficulty": "Easy", "semester": "Fall 2017", "time": "12/19/17, 10:01 AM"}, {"comment": "Assignments were numerous but doable as long as you stay on top of them. Project success was largely dictated by who you chose in your group and whether or not any of them had significant application-building experience.", "rating": "Liked", "workload": "5 hours/week", "author": "jeRxXBM23oMecW4Yn5btqXa0CQX2", "difficulty": "Easy", "semester": "Fall 2017", "time": "12/29/17, 10:07 PM"}, {"comment": "Very good course with a lot of material to learn. It can easily be thought as two consecutive courses in order to spend adequate time on all topics. I loved the videos and the reading materials. Most emphasis is on UML class diagrams and state charts. The design patterns are covered but it deserves more emphasis as it seems to be a hot topic these days. You need to know Java to do the projects.", "rating": "Liked", "workload": "20 hours/week", "author": "bBbu0oZg8fU19il18Za4j8qehDl1", "difficulty": "Medium", "semester": "Fall 2017", "time": "1/14/18, 8:25 PM"}, {"comment": "This class is probably a good first class or one to save to take with another class. No tests, and most of the work towards the end. I wrote 5 hours/week here but I am not sure how much it actually was, since I basically just completed every assignment the weekend (day) before it was due. The group project was the only thing that required scheduling, but if you have a good group like I did then it's not a problem; plus it was an obscenely small % of the total grade. The periodic assignments, class participation, and peer feedback was a large percentage, and they were very manageable.This class went through the motions hitting all the key beats, but focusing mostly on UML class diagrams and state charts. It then touched on and required us to generate behavior diagrams and a deployment diagram. There were periodic assignments requiring various diagrams to be generated for various designs, and then there was a group project. The group project was based on a scenario described in a prior assignment, so the initial work consisted of reviewing the group members' class diagrams and code and combining all the best parts (or picking someone's who got a good grade). All of that was fine.Then there was a surprisingly large amount of coding. It was my first time having to write Java in 10 years or so, and I was surprised, considering design can 100% be done without writing code. Either way, as you can see from my rating, it was pretty easy overall, but I would just be warned that there is significant coding required. Also the videos were weird; I didn't think they were bad at the time, but having taken a couple more classes since I can see they weren't great. Also, they didn't always have anything to do with what we were actually generating for the assignments and the project, but the state chart ones were OK.", "rating": "Neutral", "workload": "5 hours/week", "author": "ABHKLchrifQ6GClEYiMgG3nNRQ13", "difficulty": "Easy", "semester": "Fall 2017", "time": "4/5/18, 1:12 AM"}, {"comment": "This was my first class, and it was a good introduction to the program. Not too difficult, some projects to help get you into the flow of school again (for those of us who last attended school ages ago). The group project was the hardest part, mainly because of getting everyone on the same page and being able to do the requirements on time (there was a lot of wasted time on our part organizing and scheduling). I highly recommend when you get a new project to start right away as the projects always seemed to take longer then one would expect.", "rating": "Liked", "workload": "9 hours/week", "author": "3ujo5fcHXJhVG4yjNShDPdU6Kmb2", "difficulty": "Medium", "semester": "Fall 2017", "time": "7/30/18, 5:04 PM"}, {"comment": "Very good course - If you want to know about UML, Design Patterns, State machines, this is the course to take.", "rating": "Loved!", "workload": "20 hours/week", "author": "bBbu0oZg8fU19il18Za4j8qehDl1", "difficulty": "Medium", "semester": "Fall 2017", "time": "8/18/18, 9:26 PM"}, {"comment": "Everyone likes to bad-mouth this class for the time spent on UML, and I don't disagree that this is a useless skill. That said, having some way to organize your design graphically turns out to be very useful, and it's all the more so if it's a system that's consistent enough to be easily gradable. But the real reason to take this class is the dive into design patterns. You won't have to, necessarily. I think you only have to compare and contrast 4 for the final paper, but having an environment where you have time set aside to really explore different ways of solving problems (and people standing by to answer your questions) turns out to be pretty valuable in the long run.", "rating": "Liked", "workload": "10 hours/week", "author": "DH8uzIKaclWKUDzx4ddvo2wz2RV2", "difficulty": "Very Easy", "semester": "Fall 2017", "time": "8/20/18, 1:34 PM"}, {"comment": "The course was the first course i took in OMSCS. The course videos are pretty dry and boring, but the assignments can be interesting depending on you proficiency with UML. I found the assignment on state diagram interesting. The project relies on ones knowledge in Java, so if that is your strength, then the course will be a breeze.", "rating": "Neutral", "workload": "7 hours/week", "author": "7hXGYilpq8XAr8UtncPpH32zmmk1", "difficulty": "Medium", "semester": "Fall 2017", "time": "12/14/18, 9:17 PM"}, {"comment": "Overall the course wasn't terrible but in some ways misses the mark. You work through building out an application from the requirements stage -> initial individual implementation -> expansion of requirements -> expanded group implementation. This process is incredibly helpful as it presents things that you do in the real world.What I didn't like was the weight put on sticking to OOP principles throughout the process. While the instructors have to pick some sort of way of evaluating code, picking specific programming paradigms/features cause problems as it is outside the stated goals of project architecture/documentation/design/implementation. That said, if you have any sort of OOP background you should be OK in this course (another important piece of info is this course is very much a \"do your assignments in Java\" course).I got the feeling that this course is somewhat evolving and some of the lecture material isn't useful for the full implementation of the projects. Hoping that GaTech addresses this disparity going forward to make sure the assignments and lectures converge a bit better.", "rating": "Neutral", "workload": "10 hours/week", "author": "9ND4YwrgwXhfUjBI0H64Oakl3ct2", "difficulty": "Medium", "semester": "Summer 2017", "time": "8/11/17, 2:43 PM"}, {"comment": "In general, it was a good course. It was much better organized and prepared than a few other OMSCS courses, and office hours were regular and informative. I'd think that both professor and TA's could have participated much more actively in Piazza, as it was usually necessary to wait till office hours to get responses to some of most straightforward questions, even questions about logistics and organization. The unpleasant surprise, however, was that the group project, which was supposed to be most highly weighted in the overall grade, was never actually scored (or perhaps it was scored, but score was not disclosed to the students?). Eventually, I of course did get the overall grade for the course at the required deadline, so I thought the project grade is just a little bit delayed, but up to this moment I still see neither grader comments, nor the score for the main project. Don't know if I just missed it somehow. Perhaps other folks could chime in if that is indeed the case.", "rating": "Liked", "workload": "15 hours/week", "author": "3JIxnpk76DMF9z7HiL7hw4n9XjX2", "difficulty": "Medium", "semester": "Summer 2017", "time": "8/23/17, 6:34 PM"}, {"comment": "The lectures were really boring; one guy reads off a teleprompter; I watched most of them at 2-3x speedup; I would have preferred a book. I would have rated the course \"disliked\", but my work does not require all the ML courses I've been enjoying so much, but does require architecture and therefore the class was actually useful to me even though the class itself was not enjoyable.", "rating": "Neutral", "workload": "8 hours/week", "author": "hyalFX76RMbUD3BKhhS3CNB3Gxo2", "difficulty": "Very Easy", "semester": "Summer 2017", "time": "7/26/18, 4:40 AM"}, {"comment": "If you have a background in designing or architecting a system, this course should be a good refresher course. The topic presented is broad and the professor presented it thoroughly. That being said, some of the lectures only provide brief discussion and then it is up to your curiosity. The amount of knowledge you learn, hence, depends on your initiatives.I found the assignment was quite okay and the grading is fair. Piazza forums was active and the TA were really engaged in answering the questions. This helps a lot in the assignment because the feedback for your submission might not be delivered on time for you to work on the next task (and most of the assignments are basically refinement of previous assignment).Something that I think might be improved is to include modern architecture like microservices or SOA and more examples on the popular frameworks/tools for the implementation. It might be good since most of the students are working professional in the industry.", "rating": "Liked", "workload": "11 hours/week", "author": "W2TeB8JEVxNho75HW6GNpC29snw1", "difficulty": "Medium", "semester": "Spring 2017", "time": "4/28/17, 11:43 PM"}, {"comment": "The course title describes the course exactly. The Udacity videos are very long but thorough. The most tedious part of the course is the UML diagrams, but once everyone found out we can access LucidChart for free with our @gatech. edu emails, it made the process much easier. At the end of the course, there is a final group project that involves creating a user application for a course registration simulation. If your group is responsive and you're willing to put in the work, your results and grade will reflect that.", "rating": "Liked", "workload": "10 hours/week", "author": "dUn1x6vYjFTdGjFO4avFwmwUzPf2", "difficulty": "Medium", "semester": "Spring 2017", "time": "5/17/17, 8:42 PM"}, {"comment": "A nice course to take as a first class. You will implement something in Java as a group project and there are some individual assignments. Nothing too harrowing. Compared to other courses I've taken, this one was clear in its requirements and reasonable about the workload. Maybe not very interesting at times, but someone actually asked me recently in an interview about design patterns, so I guess this material is still alive and well.", "rating": "Liked", "workload": "10 hours/week", "author": "sumEvEaIHgMgdjG9yh9Dozrq4wx2", "difficulty": "Easy", "semester": "Spring 2017", "time": "9/13/18, 5:07 AM"}, {"comment": "This class was okay. Not sure I learned a whole lot. Seemed like a repeat of 6300 honestly. The lectures are long and pretty boring. The assignments are mostly UML diagrams with the exception of the one coding project you do throughout the semester. Grading is suppppper slow and pretty careless. I constantly had to ask for it to be reviewed. No tests. All Java, cmd line stuff.", "rating": "Neutral", "workload": "7 hours/week", "author": "7KODmuYF1FU4LQfCvsLrGRHkFPG2", "difficulty": "Medium", "semester": "Fall 2016", "time": "8/13/17, 1:54 PM"}, {"comment": "There were 6 assignments (4 individual and 2 group). Your overall grade is based on these assignments and class participation (completing all quizzes and actively on piazza). I took a Software Design course during my undergrad and as expected this went more in depth than my undergrad but not as much as one would think. The videos were well put together but after the initial assignments did not have relevance to the course. I liked the idea of the assignments taking you through a realistic software design and implementation case. Each assignment built off of the previous one as far as requirement modifications by the client with the final assignment ending with the product that you slowly designed throughout the semester.I rated this class low because I think the class was harder than it needed to be. There were 3 issues I had throughout the semester:Feedback (aka grades) was delayed throughout the semester. The assignments were ordered as design1 --> implementation1 --> design2 --> implementation2 --> finaldesign3 --> finalimplementation3. The issue is we turned in design2 and implementation2 without feed back from the 1st assignments. This was an ongoing issue. HOWEVER, i will be FAIR and say that instructors were very active on Piazza.Grading was vague and seemed to vary alot between TAs. The instructors manually graded the 1st assignments but then used an autograder for assignment2 implementation. However, they did not provide us the test suite they used for the grading until afterwards. This seemed unfair and led to much controversy in the class.I found that most of my time was spent coding rather than focusing on the best design. In fact, UML design patterns were not emphasized at all in this course and due to the feedback we were not sure whether our design was okay until late in the semester. I do appreciate the instructor giving us the opportunity to code a little more but it was almost too much for a course that should be about design.", "rating": "Disliked", "workload": "14 hours/week", "author": "hmkpc4oCrHYGXvrsEWjfiD820n92", "difficulty": "Hard", "semester": "Fall 2016", "time": "12/8/16, 4:07 PM"}, {"comment": "The concepts were not that hard to learn, but were time consuming to implement, especially as a team.", "rating": "Neutral", "workload": "18 hours/week", "author": "xgo46axWrgUFoWFHAmBZHrxPCUy1", "difficulty": "Hard", "semester": "Fall 2016", "time": "12/15/16, 12:34 PM"}, {"comment": "The material was pretty straightforward, especially if you've had any experience working for a large organization. Some of the stuff was a little tedious to implement. Additionally, the workload increased dramatically toward the end of the semester with implementation stages and team projects.", "rating": "Liked", "workload": "15 hours/week", "author": "aKrx72V4kqewOjLRoyMiUUcQFjj2", "difficulty": "Hard", "semester": "Fall 2016", "time": "12/15/16, 8:38 PM"}, {"comment": "Enjoyed the course. Loved how the assignments built off the prior assignments.Not sure if videos should be refreshed however towards the end the videos were not very helpful.Instructor and TAs were very responsive.", "rating": "Liked", "workload": "7 hours/week", "author": "utWRfQtbjgTP6Q1dgIftWlGTqQS2", "difficulty": "Medium", "semester": "Fall 2016", "time": "12/16/16, 9:40 AM"}, {"comment": "I was hoping to get a glimpse into modern software architecture and design techniques, but instead, I got UML. In my own experience as a software engineer, it has been sufficient to simply be on the same page as business partners and make sure you understand their requirements. Regular code reviews with senior team members and architects would help to ensure proper code design and quality. I have never once had the need to \"translate\" requirements into any kind of UML diagram. The assignments had a lot of \"busy work\" around this UML and in one case there was even an essay portion to discuss the pros and cons of various architectural styles. I actually found that useful despite it being a bit tedious.Having coded in Java for many years between school and work, I found the coding assignments to be a breeze. Having the last two assignments be group projects really didn't help matters. I went all out on the last assignment to make sure the team would get high marks, even though I didn't need them. The last assignment was valued at only 100 points (10% of grade) but I feel like it should have been a lot more given the amount of effort that was required to complete it.The lectures weren't particularly engaging and there was a requirement to complete all the quizzes in them to get full participation marks. After the first few lectures that introduce the student to UML and OCL, I didn't feel like I needed the knowledge provided in them to complete the assignments. Indeed, I watched the first two and a half parts, then never watched them again until I had completed all the assignments (only to get the participation points). In the end, it was a very average course for me. Not particularly bad, but not great either.", "rating": "Neutral", "workload": "10 hours/week", "author": "AMCzEvdehsZypPlskORPPQIVVmH2", "difficulty": "Easy", "semester": "Fall 2016", "time": "12/19/16, 8:17 PM"}], "difficulty": 2.982, "enrolled": 579.0, "id": "CS6310"}, {"rating": 3.253, "workload": 12.696, "withdrew": 112.0, "comments": [{"comment": "I highly recommend this class. It is well run and difficult but for all the right reasons.Class structure is 7 labs 6 of which are kept (10% each), a midterm and final (19% each). If you do not know C++ and Java well, you will have to get up to speed quickly. This was my situation and I got by with an A, but definitely had to put in extra effort. It is heavier on the analysis than the testing. You don't cover unit testing or anything basic. The lectures rely a good bit on formal logic and outlining theory, but the labs have a direct implementation of each. The midterm/final were tough but fair questions.You will walk away from the course with a number of different automated analysis techniques well explored. The course staff really worked hard to make sure students had everything they need to do the work without completely holding their hand.", "rating": "Liked", "workload": "16 hours/week", "author": "4B4VBW0jAOQ8t4Fy3emCLI2ckFi1", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/14/18, 5:46 PM"}, {"comment": "This was my third class and I didn't like it as much the other ones. The labs are not a lot of work but it takes a lot of time figuring out. There are a couple of labs that take a lot of time just trying to figure out. Each lab is independent so you might do good in some and not so good in other. I ended up not doing one just because it was a lot of work (6 out of 7 count). Start early and try to do the labs that last a week as they are the easier ones. TAs during office hours were not really helpful, I found more help from fellow students. I did find the videos for each lab helpful. I failed my final but the midterm was way easier so ended up with a B. Maybe I just didn't have enough time to study. Definitely study the practice tests and ask questions during office hours for both tests. I don't find anything really useful out of this class besides KLEE ...if you use C. Also, this class is very intense for C if you haven't used it in a while..I didn't so it took me a while to ramp up.", "rating": "Disliked", "workload": "15 hours/week", "author": "Z9zZOyyRqTZFURVVJoFymHhGj7t2", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/15/18, 8:57 PM"}, {"comment": "I started out not liking this course but it started to grow on me more into the semester. It is NOT just writing unit tests, it is more tied to the analysis of code in general and touches on some interesting topics around testing. I enjoyed doing the labs, they can be challenging(the Datalog one was particularly cool IMO). The exams are hard, and worth 19% each - but fair. If you make a good study guide, understand the concepts, and watch the TA video before you should do fine. They take the best 6 of 7 labs which worked well for me because I totally forgot about an early lab. Ended up with an A and I wouldn't say it was the most time intensive course.", "rating": "Liked", "workload": "8 hours/week", "author": "y8S90orUfWS2AXYFig77yOOAGe73", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/18/18, 9:15 AM"}, {"comment": "Extremely well organised.The course focussed more on the analysis side than on the testing side.Involved many programming languages: C, C++, Java, Datalog. It might be challenging if you don't know most of them.All the assignments required a lot of thinking and analysis, but once finding out the solution, they were easy to complete (few lines of code).The topic itself is very interesting. Even if you don't want to work specifically in analysis, it will help you to be a better programmer.Instructor and TAs provided excellent support.", "rating": "Loved!", "workload": "15 hours/week", "author": "wJX5QGfpU0OxQtAXTmOVXbZMwG82", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/27/18, 7:28 PM"}, {"comment": "Course videos/resources did not align with assignments/tests, which made the course challenging. If you are familiar with C and scripting the course may be a good one for you.", "rating": "Disliked", "workload": "15 hours/week", "author": "utWRfQtbjgTP6Q1dgIftWlGTqQS2", "difficulty": "Hard", "semester": "Fall 2018", "time": "1/3/19, 10:01 AM"}, {"comment": "This class was a ton fun, really interesting, and very well run. It is not about unit testing. Seriously, y'all need to stop with the \"I dunno why SDP covers so much testing since there's already a class just for testing.\" Different testing. Also, the old reviews of SAT complaining about broken or outdated this or that are no longer applicable. Woohoo!I took this with AI and got a solid A in both. So, you can as well. I previously completed AI4R, CV, ML4T, IIS, and RL. I would probably put this as the second easiest class I've taken, behind IIS.This semester we had 7 projects and 2 proctored exams. The projects are likely to change, but we had:FuzzingRandoopDataflow analysisDatalogCooperative bug isolationDelta debuggingKLEEThe midterm and final were both proctored through ProctorTrack and both allowed one page of your own notes in addition to the instructor-provided notes for each lesson. Make no mistake, you absolutely should still study. I found the midterm to be relatively difficult and I thought the final (non-cumulative) was a lot easier. Not because of format changes or anything like that. I think I just found the material in the second half of the course easier and more enjoyable.Check out rightingcode.org if you want more info about this class. All lectures are available there and are easier to access than on Udacity.There was no required textbook and there were no required readings in general, but there were a lot of recommended supplemental items.Instructional staff was very supportive, including the professor, which was unexpected since he's technically a full-timer at a different university now, if I remember correctly.Overall this class was a lot of fun and something very different for me. I'm glad I took it and I strongly recommend it. It's good to pair if you have the right background.Speaking of background, check out the prerequisites at the link I gave above. Take them seriously. If you have a CS undergrad degree you should be fine. If not, it's not too difficult to get the additional background you need, and it's something you should do anyway if you want to survive a grad-level CS program.", "rating": "Loved!", "workload": "10 hours/week", "author": "qnAaiyrvyBN3lH75njavIsxcwOI3", "difficulty": "Easy", "semester": "Fall 2018", "time": "1/3/19, 10:34 AM"}, {"comment": "A lot of the work is doable but a lot of it is not. This course used C, Java, Prolog, bytecode in a Linux env. work for labs is auto-graded so if you are 99% finished and turn your stuff in the grader will give you 0% for your grade on that assignment. If you do not know all the tech used very well you will spend tons of time learning it. This is not a good first class to take. No Extra credit is given.", "rating": "Neutral", "workload": "35 hours/week", "author": "Slurer9ohLhYsAE48b2qKTZ2mp52", "difficulty": "Hard", "semester": "Fall 2018", "time": "1/4/19, 8:01 PM"}, {"comment": "Background: Mechanical engineering undergrad, not too much depth in different programming languages, but work as software engineer.I have taken 2 classes before this. Paired this class with CS6300 SDP. I would suggest pairing this with a medium difficulty class (maybe something a little harder than SDP, but nonetheless it is a good class to pair with). I didn't like this class as much because the material was pretty dry. The class assignments have many different programming languages (Java, C++, C, Datalog, etc.) You won't need to be super good at any one language, but just know how to code and figure it out. What's nice is they have a VM set up for you so you don't need to worry about all that. Lab videos and TA's are super helpful. I encourage having a classmate to talk to and discuss topics because it just helps understanding, and makes the class more enjoyable.Exams aren't TOO hard if you pay attention to the lectures and review courses. Doing the practice exams will prepare you well. Exams are curved as well. Got 90+ on all of the assignments which shouldn't be too hard if you did them correctly. 92 on midterm (curved and somehow lucked out) which was above average, and a 69 on final which was slightly below average. That gave me an A.What I didn't like about this class was that it was mainly about figuring things out... they will introduce new things frameworks and API's that you've never seen before but you need to know how to read documentation and learn quick. I guess this is the skill a Software Engineer needs to have because wherever you work its going to be different so the skill of knowing how to figure new things out quickly is good. It was a lot more \"figuring out/analysis\" than coding. Sometimes the assignment is just a few lines of code.... literally like 5 lines of code, but knowing how to write those few lines will take a long time to figure out; that's what makes it a little frustrating.I am sure that the things you learn in this class can be applicable and important, but IMO it is also the boring side of software.", "rating": "Disliked", "workload": "10 hours/week", "author": "0kwOdzeEedPH3uucYl14k2uxXNE3", "difficulty": "Medium", "semester": "Fall 2018", "time": "1/8/19, 12:18 PM"}, {"comment": "The algorithm and techniques thought in this class is used in industry if you work in compilers, javascript engines or security teams. So its useful if you target one of those.TAs help would have been better if they are available over slack most of the time rather a office hours. Office hours close to assignment dates were kept with long gaps. They provided sample questions and prof. goes over them for both the exams.The assignments are few lines of code but too complex to derive due to syntax and understanding on the algorithm taught here. I put very little effort compared to my previous 2 classes and did good. C & C++ & Java used but never needed to write a lot of code but few difficult lines.", "rating": "Liked", "workload": "6 hours/week", "author": "8kW5P6zOvSW4Pdrb7hyvmiUYxnV2", "difficulty": "Very Easy", "semester": "Fall 2018", "time": "1/9/19, 7:24 PM"}, {"comment": "I thought that the course we well organized, I got a lot out of doing the homework/projects. They can be a bit difficult to approach, but thought that the lessons and the videos that go with each project were helpful to get started (definitely watch the office hour videos that go with each assignment). However, the aspect of the course that I did not like were the exams. I thought that there was a big disconnect between the material from the lectures and the exams. I felt like the exams were something out of left field. And the only way to prepare for it is by taking a mock exam. Most of the questions are similar, and so it's a must to go over the exam, study the type of question being asked and understand the answers. But I felt that there were not enough examples to help reinforce the concepts. There were one to a few questions per concept, but it didn't help much in the end. I wouldn't recommend this class for first timers.", "rating": "Neutral", "workload": "20 hours/week", "author": "mMz4o2NzBcP3kKWao2jNFn7zGGj1", "difficulty": "Hard", "semester": "Fall 2018", "time": "2/16/19, 5:33 PM"}, {"comment": "Learned a few things that would be useful for work, like using datalog to analyze java code and a few analysis and testing techniques. THIS IS NOT A COURSE ABOUT TESTING LIKE WE DO AT WORK (unit/e2e/smoke/etc.)Disliked having to parse recursive algorithms manually during test via proctortrack , with over 20 droddown list to fill without the use of any paper. That was just ridiculous", "rating": "Disliked", "workload": "25 hours/week", "author": "MFI4TofAycVpImoOCLYtE1Kyoyq2", "difficulty": "Hard", "semester": "Fall 2018", "time": "3/2/19, 11:25 AM"}, {"comment": "This course was not what I was originally expecting...but turned out to be very interesting and informative nonetheless. I was expected an emphasis on test techniques, but the course was more focused on the \"analysis\" than the \"test\". However, the analysis has some important foundations that are used for testing (as well as compilers and IDEs), so all in all a good course.Most of the projects were fairly straight-forward, though some difficult to tell \"when you're done\". Only one was difficult, but that largely due to an unfamiliar language (Datalog). A few of them had reports, but were fairly straight-forward.The TAs were great, especially Chris. The projects often came with videos to get you started. The VM environment for the project(s) were stable and only had 1 minor missing component on one of the later projects. Thankfully, only 1 VM required for all the projects.My only negative on the course were the exams. While sample questions/solutions were provided, the exams didn't reflect them very closely. The exams did expect deep understanding of the topics. In some cases, I felt the exams were more complex than the lectures or the labs.All in all, glad I took the course...learned a lot I likely wouldn't have picked up anywhere else, and have already been able to use some of the concepts in \"the real world\".", "rating": "Liked", "workload": "12 hours/week", "author": "0O5yjHYV2bZayhkLlTSVhlGdfaD3", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/3/18, 8:44 PM"}, {"comment": "I've been working as a software developer for 25 years, and I was expecting the class to be about the software testing process, and it was. However, to my pleasant surprise, it was a course on newer technologies (what? things have changed since I got my degree 25 years ago?) and how to leverage those technologies to effectively test and track down issues in software. The lectures (on Udacity) were well done for the most part. The quizzes (in Udacity to test your knowledge) could have been clearer, but I took them a few times to get a better understanding. No textbook. All the materials are through Udacity, though there are PDF and Powerpoint equivalents for you to study offline. There were 7 projects and for each one, a video intro is provided as well as a PDF providing detailed instructions on how to implement the project. The instructors provide a VirtualBox VM to use for all of the projects and I found it well put-together. Instructors (professor + TAs) were readily available and supportive. Knowledge of C or C++ comes in handy for a couple of the projects (pointer arithmetic). Projects require minimal coding in either C, Java, or scripting, along with one project using datalog. Lots of support through Piazza forum + slack channel. Office Hours were done using Google hangouts and if you missed it, you could play it back.When it came to the midterm and final, while a practice midterm and practice final were available, I felt they weren't representative to the exam itself. The midterm practice exam was actually harder than the actual exam (that's ideal, I'm overprepared), while the final preparation left me feeling overconfident since the final was much harder than the practice final exam.Overall, I enjoyed the course and have many new skills that I'm looking forward to putting to use on future development projects.", "rating": "Liked", "workload": "14 hours/week", "author": "nvLSxSVMKRf8Fr22tkUZueq5ayZ2", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/7/18, 9:06 AM"}, {"comment": "I completed SA&T the summer of 2018 as my fourth course in OMSCS and will say it was the most well-directed, organized, and supported course I have taken in the program so far. The instructor and TAs had great attitudes about the class and material and were active and helpful on Piazza and Slack. The lectures were understandable, interesting, and directly related to the labs and exams. The labs were prepared very well with an almost flawless VM. Preparing each lab's file structure on the VM and collecting the deliverables was not painful but not seamless either. The exams were fair but challenging.The course material has a heavy emphasis on Software Analysis vice Test. While the majority of the material is still interesting and was mostly in line with my expectations, I was hoping for more material on best practices of testing in the industry. The third and fourth lab (Dataflow and Datalog) were quite challenging, and full understanding is needed for a good grade on the exams as well. Dataflow and Datalog are worthwhile topics, but I would have benefited from more complex examples or references of these topics.Overall I would highly recommend taking this course. Being familiar but not fully proficient with C, C++, Java and bash scripting was enough background that I felt comfortable with the course prerequisite knowledge. I ended up with a B because I put the hours in for the labs and did just well enough on the exams. I would have rather taken it in Spring or Fall to get more time to digest the material and have had a chance at an A.", "rating": "Liked", "workload": "15 hours/week", "author": "pZKf9jBBvUehSjdHvZJKaYjh6hq2", "difficulty": "Hard", "semester": "Summer 2018", "time": "8/7/18, 6:41 PM"}, {"comment": "This is a much different and better course than the previous semesters may indicate. The projects are interesting and engaging with some much harder than others, and you learn useful tools (depending on the languages you work with--most tools apply to C, C++ or Java. The new project intro videos help you to quickly get acclimated for each project. Chris Pouch is co-professor and he is excellent. I found him tremendously helpful in office hours (Slack), on Piazza and in the Q&A sessions he hosted. I got stuck on several projects and his hints were instrumental in me doing well on (and completing) the projects. As long as Chris is part of this course, I recommend taking it, but you really need to be familiar with C/C++--at a minimum, I recommend taking IOS (CS6200) as a prerequisite (also an excellent course with an excellent professor); in addition, go through the Essential C/C++ course on Lynda.com. The TAs, for the most part, were helpful as well, although they weren't always sure how much they could help. In the interest of full disclosure, I got an A (but barely).Note that this course should really be called Software Analysis; there was only one project that concentrated on testing--this is -NOT- a course about writing unit tests.Unfortunately, this course continues what I consider a disturbing trend in OMSCS: students are hyper-cautious/paranoid about helping each other due to potential honor code violations. Some courses (IOS when I took the first run of it in Spring 2015) are a little looser when applying the honor code, but most courses are so strict with it that it makes public Piazza and Slack help request/question posts pretty much pointless. The result is that the only replies worth anything are from the professor and/or TAs.", "rating": "Liked", "workload": "18 hours/week", "author": "w4YkBzZTZtOYIsozvIWPuqAfrCi2", "difficulty": "Hard", "semester": "Summer 2018", "time": "8/16/18, 2:26 AM"}, {"comment": "Overall, an excellent course. I had taken Compilers the semester preceding this class, and found this had a lot of overlap, but was a lot less work. (It could be used to prepare for some sections of Compilers, if desired.) This is a good class to pair with another light-workload class, or with a heavy-workload class; I only had to spend 0-4 hours/week on this, and was often ahead in this class.All lectures and labs/projects became available at the start of the class. We were free to move through the material at our own pace (and people did move ahead faster than the syllabus). The lectures were helpful and informative, and covered a wide range of topics in software analysis. The projects were very related to the lectures and were very manageable - the staff put in lots of effort to ensure that the administrivia go smoothly and we can focus on the concept we're trying to learn. I finished some of the labs in 2-3 hours, while the longest one took ~10 hours.I didn't do as well as I'd have liked on the midterm and final, but the projects were enough to offset that; and we were allowed to drop our lowest project grade.Personally, I would have liked to cover type systems in more depth, and devote a project to them. I'm told that such a project is being developed, so maybe you'll get to do it instead. :)", "rating": "Liked", "workload": "3 hours/week", "author": "M9tOKm39FWSq4bE9Nj3fVzMgWVH2", "difficulty": "Very Easy", "semester": "Summer 2018", "time": "8/22/18, 10:50 PM"}, {"comment": "Uses a variety of programming languages but you only need to know the basics of Java and C. Interesting material on fuzzers but complex topics. Tests are really difficult but the projects do help you learn, although they don't always relate to the lectures. The lab on datalog is extremely difficult, so spend some extra time there.", "rating": "Neutral", "workload": "12 hours/week", "author": "wQ4i20zy2WbPsSsHWVqxnB9Bjhf1", "difficulty": "Hard", "semester": "Summer 2018", "time": "11/5/18, 11:26 PM"}, {"comment": "I hated this course with my whole heart. But that might be because I am not that into Testing/Analysis. I registered in this course as I was not able to get into any other course due to huge WL but regretted the decision whole semester. I did my labs really well but to get A you need to perform really well in exams (which contribute to 40% of the grade). So getting an A is really hard. Each lab is a new one, so may have to spend lot of time understanding the lab first and then work on it. Few labs are very easy if you are in right path otherwise even the easiest ones may become real hard. I hated the fact that even after scoring labs well >98% in all of them I ended up narrowly missing A because exams were really hard. First of all they are pretty long (3 hrs), I hate doing that at this point of my life. I mean if we are already investing so much time in labs, they must be rewarded well. The no scratch paper policy for exams was irritating. Also I didn't like the fact that all the labs were given equal weightage. I mean there are couple of really hard labs and couple of very easy ones. It's not fair to give them equal weightage. Overall I felt like I was in high school again where practical knowledge (Labs) is less important than theoretical knowledge (Exams). This is the only course I got a B, so I regret taking this course. Take this only if you are really into Analysis & Testing. You will need C and C++ knowledge to succeed this course. On a plus side, the course was very well organized. The past Head TA now promoted Prof Chris is really good and always replies to student queries really fast. Although there are very few Piazza posts compared to my other courses since most students engage in private discussion with TA's on Slack. But Both the TA's, Professors and many students seems to be really involved in the course.", "rating": "Strongly Disliked", "workload": "25 hours/week", "author": "bpyT5ePB5zQduzO8J4vvFi5NEuW2", "difficulty": "Hard", "semester": "Summer 2018", "time": "1/6/19, 3:56 AM"}, {"comment": "Every week is basically a completely new material, and a lot of it is good (ie, practically unknown, but very interesting and potentially useful). Labs can be mundane to sadistic.Quality of lectures leaves a lot to be desired - they are basically handwaving and expect a deep theoretical understanding in the exams. I frequently had to refer to lecture notes from other univs CS courses to get an understanding.eg the exams (quite tough IMO) go very deep into soundness and completeness, bu the lectures do not explain them in any depth.", "rating": "Neutral", "workload": "15 hours/week", "author": "p1cOrMVL0caAYHY729sDF0e3FG22", "difficulty": "Medium", "semester": "Summer 2018", "time": "1/7/19, 11:41 AM"}, {"comment": "one of the worst course I have ever taken. Both professor and TAs were disinclined to help students with very less participation and clarification. I doubt if I will ever use topics learnt in this course in my professional career. regret taking this course after putting so much of effort and time.", "rating": "Strongly Disliked", "workload": "20 hours/week", "author": "2kXJeGr0NIX9aM95Z1tl34AnYHe2", "difficulty": "Very Hard", "semester": "Spring 2018", "time": "5/13/18, 10:50 AM"}], "difficulty": 3.443, "enrolled": 296.0, "id": "CS6340"}, {"rating": 3.186, "workload": 10.396, "withdrew": 93.0, "comments": [{"comment": "The course itself seems ok but the amount of redtape and policies for everything from room scans to reviewing exam policies often feels like I'm reading the fine print on a credit card application. It's stifling.I think they could invest some time trying to be more succinct then just inundating students in the attempts to put the blame back on students for not reading the 2nd page of some poorly written policy.Only half way through so I'll update when I'm further along.", "rating": "Neutral", "workload": "15 hours/week", "author": "rbotfsDawtRHDPtup461gYgtmom2", "difficulty": "Medium", "semester": "Spring 2019", "time": "2/25/19, 12:09 AM"}, {"comment": "I felt that a lot of the material was impractical and that the project was poorly planned and designed. I was expected a much deeper dive into the sql concepts but this class instead is aimed at people that don't know what a database is, which in my opinion should not be a graduate level class. If you have never taken a database class or used them then this class is for you, but if you have any real world experience I would not bother.", "rating": "Strongly Disliked", "workload": "6 hours/week", "author": "IaEeVULL3YfOa9GXCAce8gbwICX2", "difficulty": "Easy", "semester": "Fall 2018", "time": "11/3/17, 11:30 AM"}, {"comment": "Overall, liked the course. Learned a lot from our group project about Node JS and had an awesome team to work with. If you have a lot of SQL/DB experience, you're likely not to get much from this course in terms of SQL/DB learning. It was a good first class for me, and the group project learnings was completely worth it.", "rating": "Liked", "workload": "10 hours/week", "author": "Kh2g46hhh8hWh09wDpMTN3nv4nO2", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/4/18, 9:12 AM"}, {"comment": "This course is almost exclusively focused on database management systems (i.e. database setup, sql, relations). The spine of the course is a set of Group projects that take one on the entire journey from database design to implementation. These projects alternate with exams that test a broader body of knowledge. No one project or exam is all that hard but collectively, you have to stay diligent to do well. Expect to study 20 hours for each exam and do 10 hours of work on each project assignment. That 10 hours can go up quickly if you have a bad team, so invest on forming a good team at the start (they have a process for facilitating this during the course).In terms of quality: the lectures make an otherwise dry subject interesting. The TAs are proactive and helpful. The professor knows his stuff and has a good sense of how to teach the material and test it fairly.The 3rd phase of the project requires you to build a full-stack app. So knowledge of some front end (e.g. HTML + javascript), middle (PHP or Python) plus back (SQL) is helpful. The hardest part being, not working on any one of those but in stitching those pieces together WHILE working with a distributed team. Make sure you know Git.", "rating": "Liked", "workload": "12 hours/week", "author": "XE4BA5iSbadmPqc0pYLVwMKpvET2", "difficulty": "Easy", "semester": "Fall 2018", "time": "12/8/18, 9:51 PM"}, {"comment": "This was by far the worst class I have taken. I covered more material in my undergrad database course than was covered in this course. It is not a graduate level database course, it is an undergraduate level course and not a good one at that. The course highlights are EERD documents you'll never use in real life, studies in how outdated HDD drives work, and an emphasis on SQL rules not implemented in most real-life RDBMS systems. The first half of the course is entirely focused on theoretical database stuff that is far removed from the reality of databases in reality. Some people may be interested in the theory, but it is unlikely to be helpful in any way unless you develop relational databases. The 3rd quarter finally focuses on some SQL but only the very basics and provides very little practice. If you want to learn SQL, do a 3 hours lesson codecademy and you'll learn more. The last quarter of the class focuses on database file arrangement, HDD workings, and indexes. The last quarter is most definitely the most (possibly only) helpful section of the class.There is a 3-phase group project that has some potential. The first 2/3 of the assignment are doing pointless diagrams and documents that you will almost entirely throw away when you reach phase 3 (just like you do with the first 1/2 of the class). The final 1/3 of the group project is to write an entire pinterest clone application. There is a ton of work that goes into this section and is the only part of the class where you will actually perform a legit SQL query in any meaningful way. Ultimately you will receive no feedback on your queries or your implemented database in any way whatsoever, and can only hope that you learned something.The 4 tests are all terrible. The teachers believe the information they are teaching you is a gift from the gods and should be guarded and enshrined. Rather than focusing on students' learning of the material and the usefulness of the class material, they focus on how right the teachers are and how wrong the students are. The teachers will simultaneously claim they do not write \"trick\" questions while saying some of the questions are \"tricky.\" The truth is, they write questions that are pointlessly devious and mostly pull tiny detail facts that are either not true in reality or don't matter in any way.I think the class should be completely revamped and suggest no one take this class. If you took a database class at any point in your life, DEFINITELY do not take this class. The class is not hard per se, but the teachers make getting an A in the class an extreme uphill struggle no matter how many hours you choose to put into the class.", "rating": "Strongly Disliked", "workload": "8 hours/week", "author": "SIiAtDBRlDgkiWswU69GFCc5ZrB3", "difficulty": "Easy", "semester": "Fall 2018", "time": "12/9/18, 11:33 PM"}, {"comment": "Overview: theoretical introduction to databases. Light workload but getting an A is challenging because of the exams. Practical knowledge will almost entirely come from your project teammates who have work experience.The most important part of this class happens in the first week: team formation. Make sure you have a group that aligns on a common stack and includes members with both front end and back end experience. The teaching staff don't give many details in that regard until late in the course, so be proactive in communicating with your classmates or you'll be hurting in the last five weeks when you actually build the application. The only thing related to the actual implementation that gets taught in this course is the SQL (at a basic level), so make sure your team collectively has full-stack expertise already.On the plus side, the lectures are decently organized and mildly entertaining. On the down side, the exams are way harder than what's presented in the lectures and lean heavily theoretical. The exams are pretty standard academia, challenging in ways that aren't going to directly benefit you. The professor says there are no tricky questions, just precise ones. Whether you consider this to be academically rigorous or pedantic is up to you. If you're new to databases and want to become a DBA or really master the subject this might be a good course for you, but anyone interested in just using databases effectively may find the theory to be more trouble than it's worth. There's no advanced practical topics like locking, NoSQL, or anything of that nature.", "rating": "Neutral", "workload": "8 hours/week", "author": "zrlgTCYjyoYqhDn8oXFipmhhtJt2", "difficulty": "Easy", "semester": "Fall 2018", "time": "12/11/18, 7:58 PM"}, {"comment": "Nice course and specifically liked the way Leo Mark explains the topics. You will definitely walk away from this class well prepared. Although after more than 10 years in the industry I would rarely use the practices.The class covers deeper understanding of the relational algebra, EER, etc. Do not expect concepts of NoSQL, Big Data. Even the indexing is limited to traditional disks. The book has limited use, but definitely recommended if you want to solve/practice similar problems.There was a group project, you can choose to create your own groups of 3-4 students. There is a group formation duration, if you are still not in a group you will be assigned one. The project will evaluate your work based on the principles Leo explains in the lectures, so pay attention to those. You can choose any stack to implement, the DB has to be a relational one though (MySQL, SQL Server, Oracle, PostgreSQL). We chose to go with PHP, since rarely anyone of us worked on PHP. Was another learning and we kind of fared well.Exams were the most stressful part, mostly due to ProctorTrack. I didn't have any issues while exam, but have heard from other students that there are hiccups. Exams themselves tested on the learning from the lecture. Good class, could have been better. Leo is great, shame that OMS doesn't have any other class he teaches.", "rating": "Liked", "workload": "10 hours/week", "author": "5JVeIPG3F1MgHf0pjCrfrCRtzAf2", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/16/18, 1:57 AM"}, {"comment": "I would suggest avoiding CS6400 unless you are really interested in relational databases. The content is an introductory/standard dive into relational database theory, but this particular course can be somewhat frustrating.The course is set up as 4 exams and 3 group project phases. You will want to consider how tolerant you are of group projects as you may end up doing way more work overall due to low performing group members and the overhead costs of team coordination. People who rate this class highly probably didn't do their share of the group project or only had to pull their own weight as intended. The 4 exams (each 12.5% of total grade) consist of only ~25 multiple-choice questions, but always contain a few obscure corner cases that might not be covered clearly in lectures or book. Thus, it is hard to score really well on the exams. Compounding this is that grading of the exams is asymmetrical such that a multiple select answer easily results in zero points because each checkbox is not graded as a separate choice; thus, exam grades skew low relative to more common grading schemes. Replies specific to course content are usually quickly answered by one designated TA. However, the professor takes a really long time to respond to inquiries about test questions/grading so Piazza gets filled with complaints/negativity. The grade cutoffs are hard at 70/80/90, but points for a few poorly chosen test questions were given back to those on the cusp of the next letter grade. It seems like this class has been run with the same structure for many semesters. Although it is one of the lowest rated OMSCS classes, I suspect that student feedback for revamping the course focus will not be applied anytime soon.The 4 exams cover these topics:Database Fundamentals + (Extended) Entity-Relationship Model. Mean: 82%EER Relational Mapping. Relational Query Languages (Algebra and Calculus). Mean: 74%SQL. Mean: 86%Normalization, Efficiency + Indexing. Mean: 70%The 3 phases of group project:The group project is an exercise in designing a database and implementing a website. For Fall 2018, the specification was a simple Pinterest clone. No rubrics are given for grading and seem to depend on TAs, but grade averages are very high for the project compared to exams.Analysis and Specification. This phase was a bit ambiguous in parts. Expectations on what was required around some of the task decomposition and database locks were not clear. Likewise, no direction is given on how to write the abstract code so it is hard to coordinate team members and produce a consistent report. I did enjoy making the information flow, EER (and later EER to Relation) diagrams since this type of visual language/diagramming was new to me and explained clearly in the course materials (unlike the aforementioned topics); however, I don\u2019t anticipate it being directly useful to me in the future.Abstract Code, SQL and EER to Relation Mapping. This phase was very rushed. You had to learn the majority of the course material in a few weeks in order to complete this phase (and also had to learn relational algebra/calculus for the exam concurrently with this project phase). I felt this phase was the most stressful since there was so much material to learn in only 3 weeks. I did not know much SQL before the course and did come out with a fairly deep understanding/practical experience writing queries due to phase 2.Implementation. This is the phase where I did not do anything related to this class for 4-5 weeks aside from taking the 3rd exam. I had already learned SQL in order to complete the prior phase and this part was just implementing a website (suggested to use PHP and sample stack). I had not used PHP before, but was able to code the majority of the website to full spec in 2-3 days before the deadline. This phase also made the least sense to me from a content perspective. It is all work completely unrelated to databases aside from the fact that you happened to be using raw SQL queries, which were already written in phase 2. I still can\u2019t believe over a month of this class is dedicated to making a basic website when so many important database topics (NoSQL, etc.) were left completely uncovered.The final week of the course was left to study the practice exam and discuss material for Exam 4, which covered the topics of Normalization, Efficiency and Indexing. These topics were not covered in the project.I would guess that a smaller percentage of students finished with >90% A compared to other classes I've taken, though the breakdowns have not been released. Update: Checked on grade distributions and looks like only 27% got an A which is quite low for this program.", "rating": "Disliked", "workload": "10 hours/week", "author": "tAodAYP2i6WPUalSLOTZHXMKDM13", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/21/18, 3:21 PM"}, {"comment": "I didn't have a lot of database experience before this class, so I learned a lot and enjoyed the group project. If you read the textbook and watch the lectures, then it is not hard to get an A.", "rating": "Liked", "workload": "8 hours/week", "author": "5bReLfZ3RIRWukvohIRG6uUzIsJ2", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/18/18, 2:00 PM"}, {"comment": "I think the reviews do a really good job at describing what this class has to offer. I thought it was an ok introductory class to the program, and if you don't have database experience, allows you to work through a project to gain a better understanding of how databases work.My biggest issue with the class is the textbook. No one has the solutions to the answers to the back of the book. So it feels useless to even go through the information in the required readings. For a school that prides itself on being a top 10 CS degree, you would think the class would have its own version of SQLZoo or something of that nature.", "rating": "Neutral", "workload": "10 hours/week", "author": "AEBZ1NPe5me0uhqQB0aeb9qw71t2", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/27/18, 12:46 PM"}, {"comment": "Don\u2019t bother with this course, it\u2019s not worth your time. The professor is insistent on proving himself right in the weird corner cases he throws on exams (half of which were NEVER covered in any lecture or the textbook) and is somehow convinced that using checkboxes instead of radio buttons on exams is a good idea (while in reality it just generates a ton of stress for students without measuring any more understanding). If you have any issues with the group project they\u2019ll ignore you, so be super careful when picking your team or the last 5 weeks will be awful.", "rating": "Strongly Disliked", "workload": "12 hours/week", "author": "EkL1Rlay8EUPgJXSNQcYkj0RKih2", "difficulty": "Easy", "semester": "Fall 2018", "time": "12/29/18, 12:52 AM"}, {"comment": "Good things first - the last project was great and actually the best part of this course. We had a great team that collaborated to the project.I though disliked: a) the forced surveys on team formation and so on that are actually graded and b) the questions in the tests, which are a bit tricky and focused on outdated subject matter.I fell short of A (by couple of points) despite scoring full score on my projects. So focus on your tests and respond to surveys on time if you want to secure A.", "rating": "Neutral", "workload": "10 hours/week", "author": "k62CkAVoYjSeNr4iyepEif4RmZJ2", "difficulty": "Medium", "semester": "Fall 2018", "time": "2/24/19, 7:34 PM"}, {"comment": "This was my first course in the program. The video lectures were just average. The tests for the course were all proctored. All the tests were pretty difficult with questions to confuse you ( I would say, if the course was on arithmetic, the lectures taught you easy addition, while the tests were all divisions). Had fun working with my team on the project though. Lot can be improved on the course videos - the font & color of the material was not good (not readable at times) /did not follow standards.", "rating": "Neutral", "workload": "5 hours/week", "author": "4f61F6zB68TthrEENwBUACC9RWA3", "difficulty": "Medium", "semester": "Fall 2018", "time": "3/13/19, 7:48 PM"}, {"comment": "Course is artificially difficult. Very little, if any, of the course material will feel new to anyone who's worked with a database before at all. And yet the exams are challenging because they test on esoteric and abstruse parts of the material.I had assumed that I would learn about important ideas related to locking, concurrency, and NoSQL. None of these critical concepts were really even mentioned, although I expect that I will at least use the textbook to self-study some of these ideas in the future.Group project that's a big part of the course is silly. It would be easier to complete it as a single person than as a group, because it's difficult to align on a stack that everyone knows and it can be a bit difficult to split up the work appropriately.", "rating": "Disliked", "workload": "6 hours/week", "author": "66VRqANhSwTJxvS1sl0WDCu9kAw2", "difficulty": "Easy", "semester": "Summer 2018", "time": "7/23/18, 1:53 AM"}, {"comment": "TO succeed in this class: form a team with SQL guys and front-end experts.", "rating": "Neutral", "workload": "6 hours/week", "author": "7WWNSc5paLf9EpPps5NNaYwN62C2", "difficulty": "Medium", "semester": "Summer 2018", "time": "7/25/18, 12:59 PM"}, {"comment": "I learned a lot in this course! Before the class I had very limited experience working with databases, mostly making small modifications to an existing design or modifying existing SQL queries. So I really appreciated the thorough coverage of definitions and concepts. With that said, I also thoroughly enjoyed the group project where we applied the theory learned through the lectures (and measured via exams).This was my first experience with OMSCS exams, administered via ProctorTrack. The spring and fall terms usually have 4 exams, and in summer sessions two are combined for a total of 3 exams.", "rating": "Liked", "workload": "10 hours/week", "author": "31NeUIiJT2fQ6qrcPatENzkj8DF2", "difficulty": "Medium", "semester": "Summer 2018", "time": "7/27/18, 3:52 PM"}, {"comment": "This course focuses heavily on the high-level data structure \"schema\" of relational databases. I learned a lot about how to take a high-level spec's and decompose them into the set of tables that best serve the application.However, the course feels incomplete. Efficiency and performance are quickly touched on as an after thought in the closing weeks of the course, and there is no hands-on work with significantly large scale data sets (as such, any performance aspects of the toy data sets are trivial). There is also no substantial coverage of concurrency and locking, or NOSQL systems.The project was a good illustration of how to integrate a front-end web application with a database management system backed web server application. If you have never worked any web programming, the learning curve is pretty steep. I would recommend working through some online tutorials on database backed web application programming sooner, rather than later, if you do not have experience in this area. I worked many extra hours for a couple weeks because I did not have any experience in that area. We ended up using Flask and MySQL, which is probably a good fit for most OMSA students as we all have to know at least Python for the program.Please also note this was summer term, so my hours are likely higher than during a fall/winter term due to the compressed schedule.Summer 2018MediumLiked15 hours/weekOMSAAuthor: jRLSzWDHVNYH1UZGWddP9gsUoQD38/3/18, 11:41 PMWe bit off a bit more than we could handle at the end trying to implement a containerized app, (when we really only probably needed a PHP site,) but I got a lot of hands on SQL experience.", "rating": "Neutral", "workload": "15 hours/week", "author": "G9U6TrT94bRDBhvkYLpsaaXBz472", "difficulty": "Easy", "semester": "Summer 2018", "time": "7/30/18, 11:26 AM"}, {"comment": "We bit off a bit more than we could handle at the end trying to implement a containerized app, (when we really only probably needed a PHP site,) but I got a lot of hands on SQL experience.", "rating": "Neutral", "workload": "15 hours/week", "author": "jRLSzWDHVNYH1UZGWddP9gsUoQD3", "difficulty": "Easy", "semester": "Summer 2018", "time": "8/3/18, 11:41 PM"}, {"comment": "I took CA-6400 as my first course in the OMSCS program. I found the course to be rather hard (but not unsurmountable). The hardest part was Exam 2 as there is a lot of questions on extended relations. Also there are a lot of questions. However, I was impressed at how fair the instructors were in responding to ambiguous questions. The instructors gave us an extra 2 points for questions that were unclear (or not covered in class).Pros:Extensive theory on the different types of normal forms. You will get a very strong understanding of 1-3NF and BCNF.Professor Leo Mark is hilarious too. His telephone book explanation of searches is friggin awesome!Cons:No prep time for learning PHP.No mention of non-relationship databases (No-SQL). Example: MongoDB, or MapR, etc.Overall a good class, but not trivial. The group project near the end can be taxing. It is easy to make light of PHP. It takes time to understand how it works if you are not familiar with it. Make sure to give Phase 3 of the project enough time. Rely on your group mates. They will save you :)", "rating": "Neutral", "workload": "18 hours/week", "author": "s9ABDIzNFkMKsb1onBYzIaJhdyW2", "difficulty": "Hard", "semester": "Summer 2018", "time": "12/21/18, 3:00 PM"}, {"comment": "I'd avoid this course. If you've used an RDBMS for anything other than simple selects, you won't learn much of anything. The TA's make this class madening as they treat any question to them as wasting their time.Grading is inconsistent and dependent on the TA. We had incidents like being told to label some field with datatypes \"such as integer, string, Boolean, and float\" then deducted points for labeling a field as a float instead of a decimal. Regrade requests are handled by the TA that originally gave the grade, so if you draw the short straw and get a bad TA as a grader there is no hope in appealing.If you really want to take the course you will have 1 giant group project split into three phases with deliverable in each phase. The last phase will be a finished application as well as demo that will be performed in front of a TA and recorded. There are three exams, each was open book/notes but not \"open internet.\" The way that policy was interpreted was ANYTHING you downloaded before the exam started was fair game. However once the exam started you couldn't access anything that wasn't on your local hard drive, (so go crazy with screen shot-ing and downloading articles/lectures before the exam starts). Only exception to this policy was that exam 2 forbid the use of any RDBMS or similar software, as it was the exam on SQL. Exam was proctored via ProctorTrack, and consisted of multiple choice (both select 1 and select N) as well as open numerical answers (No short answer or essay questions).Succeeding in this course is not hard, though it can be maddening. Stay on top of your teammates and don't wait til the last minute to start work. Be VERY picky and comb over the project requirements with a fine tooth comb. If given UI mockups in the project reqs, match your UI to that mock up. Your goal is to get 85+ on the three phases of the projects, then a 90+ on the exams. Do that and you'll get the A. The key is to get lucky with group mates and what TA is grading your project.Lastly, run any sample calculations in the lectures on your on-screen calculator you'd use for a test. You may find that you need functions that are not present. Figure out a work-around BEFORE the test starts. (Excel is a great at this....)", "rating": "Strongly Disliked", "workload": "10 hours/week", "author": "36e8nE3doPNc5PU2U8rnJhNKMEU2", "difficulty": "Very Easy", "semester": "Summer 2018", "time": "8/6/18, 8:20 PM"}, {"comment": "You will learn a lot of the theory behind databases - which I liked. This is not an easy A, it will require some effort both on the project and studying for exams. But it is relatively easy to get a B. You'll need to read a lot of the required text and understand it - the tests basically cover the text and lectures so no real 'gotchas' but the questions can be challenging.We did our demo part of the project in python/flask. We found it easy to divide parts of the project among group mates; it flowed pretty well. Make sure you get teammates that are either good at SQL, or python or both (if you choose to do it in flask)", "rating": "Liked", "workload": "12 hours/week", "author": "GGP2lCTIYOQ6j8eThdz4B9OKOgn1", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/7/18, 9:04 AM"}, {"comment": "This is my second class and it was better organized than my first one (CS6262 Security). The workload depends on how you want to study. If you read the book, which I recommend to succeed in the three exams, you will spend about 8h per week. Mostly because reading and watching the lecture will take you that amount. Then you will have at least 6h per week on the assignment if you already know database and frontend development. This is where it gets bad. Why is there so much work requiring developing a whole website? It is not related to database and sinks hours that could have been invested into the development of SQL.The TAs were military strict: answers were dry and rough (at least the one that was leading the pack). There were many exams questions that were not well written which was subject to interpretations. More preparation should be done and people with experience on how to write question should be involved in the process.Overall, it is a-okay course but I saw some people struggling because they did not know database which was not my case. I was able to get a final grade of 'A' but I had to work more than expected. As I mentioned, I have been working with SQL for many years and still, I had to spend many hours per week. Also, nothing about new database technologies. Nothing about cloud, scalability, cluster, NoSQL, etc. The course seems to be written in early 2000.I had the change to be with 3 other teammates that wanted to work and succeed which was pleasant. This course could have been a nightmare otherwise and I might have had to spend more than 14h/week. If you are with lazy or bad teammates you can easily spend 20h/week.Pros:More organized than the first course I took from GTAssignments are clearTA Active on PiazzaCons:Old techToo much emphasis on the web (UI)1 or 2 examples maximum per topic. You must rely on the book and on the InternetTAs are not friendly at allPiazza is used by people to fight for a better grade, I stop going on Piazza after few weeks, it was negative and depressing.The instructor is absent from the classYoutube TAs weekly presentations are not clear. I was able to see only one, every other time the link was saying \"not available\" and never could be \"live\" because of the time zone.", "rating": "Liked", "workload": "14 hours/week", "author": "7BA2RA80xMU3ttzcuGrF8O88qgP2", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/7/18, 11:55 AM"}, {"comment": "The material itself was not too difficult especially if you have years of database experience. That said, the exams were artificially difficult because of gotcha questions and ambiguity. I don't feel like the exams did a particularly good job of testing your knowledge. What they really tested was how good of a test taker you are and how good you were at paying attention to details in a proctored environment. An example of this was a question that asked for the answers that were NOT applicable to the prompt instead of which ones were. If you misread the question after just spending 5 minutes or so writing out functional dependencies on notebook paper then your grade suffered tremendously because the tests only had about 25 questions. This is a course where you can know 95% of the material really well but do poorly on the exams because of the way the questions are written. Additionally, the course would have been more more effective if there was a greater focus put on NoSql databases and overall database performance techniques. I left this class feeling like I had A level knowledge but my grade didn't reflect that. The one good thing about the course was the final group project. The TA's did a good job of setting forth clear requirements that dovetailed with what was taught in the course", "rating": "Disliked", "workload": "10 hours/week", "author": "Hw4fFnIhisg20OJ17pcHuF1tcil2", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/7/18, 8:37 PM"}, {"comment": "I found much of this course to be knowledge that I will not be using again and not very helpful. Some test questions were vague which caused the TAs to regrade everyones tests near the end of the course. This was a summer semester so it was a little more fast paced, I assume it would be a leisurely pace during fall/spring. If you don't know anything about DB I would suggest you read some of the book as the exams are not based solely on what is taught in the lectures. One group project, First 2 phases of the project are design based so sort of tedious, Last phase is implementation and thus more engaging. You will create a simple website interface (teach yourself this as the project is very open ended) to work with your created DB. Overall, I enjoyed creating the DB and web interface at the end but did not enjoy much else in the course.", "rating": "Disliked", "workload": "10 hours/week", "author": "XmuCnudrgxdCEXnvKWZovtpKq4e2", "difficulty": "Easy", "semester": "Summer 2018", "time": "8/8/18, 4:01 PM"}, {"comment": "Easy course, but there were some issues with the exams because of the wording of some questions was not clear. This caused that after each exam there were some complaints and the professor and TAs had to make a decision on each one. The only aspect to improve in the course are the exams for the reason mentioned above.", "rating": "Neutral", "workload": "10 hours/week", "author": "c92fab32-20e0-48d2-9408-0850", "difficulty": "Easy", "semester": "Summer 2018", "time": "a20ed6c58/16/18, 11:06 AM"}, {"comment": "Tests had poorly formulated questions, which instructors returned points for over the course. Very satisfied with grade. Contrary to other reviews, front end skills are not required as project was open ended.", "rating": "Neutral", "workload": "4 hours/week", "author": "dJlqGCfNdxQQ0PS4StSzjwDdIPm1", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/20/18, 3:27 AM"}, {"comment": "Solid course for the fundamentals of database. The textbook is great and the course design is also good. I like the project design since you can apply for the knowledge into practical application. But summer semester is short so I didn't have enough time to study PHP. Our team had some communication problem which caused the bad results. Make sure you have a good team that everyone will put their efforts into it instead of waiting for the last moment. I would say your team is crucial for your final results.", "rating": "Liked", "workload": "10 hours/week", "author": "hVFwTgAuRPV7F9Yigea3IzVGRj02", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/19/18, 3:38 AM"}, {"comment": "This was my course #6 and I have had a great OMSCS experience but struggled in this class with the exams. The exams had vague questions that could be interpreted multiple ways, tricky questions and questions that I believe had multiple answers. There were 3 exams counting for about 50% of the grade. The means for the exams I believe were low. There was talk of a different distribution for an A,B,C as in past years\u2026 but I don\u2019t believe we received anything different this year. The exams caused a lot of drama where students would challenge the answers, some were overturned but I felt there was a negative tone on piazza with a lot of bickering, limiting my comfort zone on asking questions. I enjoyed the project and team work, it has 3 phases and was progressive one phase building on the other. I had great teammates. I believe the class would be better if the exams are improved upon or the material on the exams is taught. I enjoyed Leo Mark's lectures on Udacity but was disappointed he wasn't involved in the class.", "rating": "Disliked", "workload": "10 hours/week", "author": "pcXILjMGFKfaGrw35X05rkEacHi1", "difficulty": "Very Hard", "semester": "Summer 2018", "time": "8/22/18, 7:48 AM"}, {"comment": "Great course! I knew nothing about databases coming into this course. This was my second course in the program.A few key notes:It really helps if you get on a good teamThey let you pick teams, though if no teams are picked you will be randomly assignedPrior knowledge of RDBMS certainly helps but is not requiredPrior knowledge of PHP helps (this was a part that bit me)Knowledge of UML helps for the first part of the courseTextbook is required (buy it off Amazon for $20, or just rent it)Only SQL databases are covered; NoSQL databases are covered in the book but not the courseThe tests can be tricky (even if they're explicitly telling you that they're not trying to trick you). Subtle wording makes all the difference.If you're going down the Computing Systems path or just have a general interest in databases", "rating": "Loved!", "workload": "18 hours/week", "author": "IMzmgWYfhGPtLfoinuUAEtkD8i03", "difficulty": "Medium", "semester": "Summer 2018", "time": "9/9/18, 12:54 PM"}, {"comment": "Instructor TurnoverIn the Summer of 2018, the original instructor (who had recorded the video lectures) had moved on, and a new instructor was just starting. This led to some minor discrepancies between the videos and the exams/project materials.The head TA was a bit defensive, which led to some Piazza drama, as well.Project TeamsThe most stressful aspect of the course, though, was the beginning, getting a project team together. The project was roughly a third of the course grade, and the anxiety about getting a high quality team was pretty high.Slack and email were more effective than the Piazza exchange for finding teammates. I ended up with an excellent team, and we all did good work, pulling our own weight.What I LearnedI learned a ton about relational databases, SQL, git, GitHub, and the Vue framework.Biggest GapThe course is 100% focused on the \"back end\" of database design and construction. The project, however, had a significant requirement to have a user interface. It was stated that the user interface could be minimal, but our team took it as an opportunity to learn about front end development, as well.What I'll Have to Look Up LaterAll of the different forms of normalization.What Students Complained About The Most\"Why isn't this a 'modern' database class?\" Answer: Because relational databases still run the world, and a solid foundation in RDBMS is an awesome place to start when understanding more 'modern' database concepts.\"Why aren't the project requirements...[fill in complaint here]?\" Answer: Because requirements definition is literally the most difficult part of creating a database. If anything, the students should have had an assignment where they write a requirement and another student has to implement, providing feedback on the requirement after the experience.\"The Piazza posts are insane\" Answer: Piazza got to upwards of 1000 posts, each with dozens of replies and counter-replies. It was truly unmanageable.What They Did WellThis instructor and TAs were lightning quick in Piazza responses, and honestly tried to address questions and complaints. They were willing to update items brought up in feedback.Summer 2018MediumLoved!15 hours/weekOMSAAuthor: TIDIuvCzh8hRK8eeLwHqM0h6mqB21/8/19, 9:46 AMLecturesLeo's lectures are pretty straight-forward and he does a good job of breaking them into easy to understand topics. Overall I found his lectures way more helpful for studying than the textbook.ExamsFour examples total and the exam questions are very similar to the practice exams and are open book. Minus the occasional oddball question I found the exams tough but fair. That being said, I was not a fan of the format of the exams where most of the questions had checkbox type answers.Exam Topics:Database Fundamental; Entity-Relationship Model (ER); Extended Entity-Relationship (EER) ModelRelational Algebra; Relational Calculus; EER Relational MappingSQLFunctional Dependencies; Normalization; File Organization; IndexingOpen book only includes physical notes, pdf/doc/text files that are stored downloaded beforehand, and downloaded lecture videos. NO ACCESSING THE INTERNET OUTSIDE OF THE EXAMProjectsThe semester project is broken into 3 phases:Creating an Information Flow Diagram and EER Diagram; writing Abstract Code and a Task Decomposition for each task (feature) in the project; and determining attributes, datatypes, and constraints for each relationUpdating your EER Diagram from Phase 1; mapping the updated EER to Relationships; writing SQL statements to create tables; writing abstract code with relevant SQL queries for each task described in Phase 1. This phase can be pretty time consuming and should definitely be started early if you/your teammates aren't familiar with SQLStart this early, you are expected to fully implement Phase 1 and 2 as an application with a working GUI. You have full control over the tech stack your team uses but no data manipulation can be done in the front or backend, all data must come from calls to your database. It helps to pick a tech stack your team is comfortable with, we chose to go with Angular/Python/PostgreSQL because that's the stack the majority of our team was comfortable with. Judging off comments from the rest of the class it looks like most groups went with PHP/MySQLOverallThe class was manageable and straightforward. but I wasn't the biggest fan of it. If the course title is 'Database Systems, Concepts, & Designs' I would have expected to learn more about both SQL and NoSQL database systems, especially given the growing popularity of the later.If you have zero experience with SQL this course could be helpful", "rating": "Neutral", "workload": "10 hours/week", "author": "Kf14jNg65zYcQbQVhZHI0pfqvhj2", "difficulty": "Medium", "semester": "Summer 2018", "time": "12/7/18, 9:53 AM"}, {"comment": "LecturesLeo's lectures are pretty straight-forward and he does a good job of breaking them into easy to understand topics. Overall I found his lectures way more helpful for studying than the textbook.ExamsFour examples total and the exam questions are very similar to the practice exams and are open book. Minus the occasional oddball question I found the exams tough but fair. That being said, I was not a fan of the format of the exams where most of the questions had checkbox type answers.Exam Topics:Database Fundamental; Entity-Relationship Model (ER); Extended Entity-Relationship (EER) ModelRelational Algebra; Relational Calculus; EER Relational MappingSQLFunctional Dependencies; Normalization; File Organization; IndexingOpen book only includes physical notes, pdf/doc/text files that are stored downloaded beforehand, and downloaded lecture videos. NO ACCESSING THE INTERNET OUTSIDE OF THE EXAMProjectsThe semester project is broken into 3 phases:Creating an Information Flow Diagram and EER Diagram; writing Abstract Code and a Task Decomposition for each task (feature) in the project; and determining attributes, datatypes, and constraints for each relationUpdating your EER Diagram from Phase 1; mapping the updated EER to Relationships; writing SQL statements to create tables; writing abstract code with relevant SQL queries for each task described in Phase 1. This phase can be pretty time consuming and should definitely be started early if you/your teammates aren't familiar with SQLStart this early, you are expected to fully implement Phase 1 and 2 as an application with a working GUI. You have full control over the tech stack your team uses but no data manipulation can be done in the front or backend, all data must come from calls to your database. It helps to pick a tech stack your team is comfortable with, we chose to go with Angular/Python/PostgreSQL because that's the stack the majority of our team was comfortable with. Judging off comments from the rest of the class it looks like most groups went with PHP/MySQLOverallThe class was manageable and straightforward. but I wasn't the biggest fan of it. If the course title is 'Database Systems, Concepts, & Designs' I would have expected to learn more about both SQL and NoSQL database systems, especially given the growing popularity of the later.If you have zero experience with SQL this course could be helpful", "rating": "Neutral", "workload": "10 hours/week", "author": "TIDIuvCzh8hRK8eeLwHqM0h6mqB2", "difficulty": "Medium", "semester": "Summer 2018", "time": "1/8/19, 9:46 AM"}, {"comment": "This review is for Fall'18 ( as the drop down lists only upto Summer '18 - nothing the term here). This is one of the classes that is well run, in the way that everything is timely, well planned, follows the schedule and syllabus. I didn't hate the subject but I hated the attitude of the head TAs and the professor. It was like being in armed forces rather than being in a graduate class. They came across as quite adamant for very silly things and during after the exam ( especially exam2) there was a rebellion in the class that the instructor team had to face from the students. Finally the professor gave in and accepted the oddity. Such issues should never come up during exams especially when a course is exam-heavy. One of the worst ways in which a student came be penalized is because some of the questions are not worded correctly, not because the student lacks the knowledge. (then they have to watch out for warnings to watch out for sent out a couple of days before the exams about these oddities) Especially when you are juggling multiple courses, these can be the major pitfalls. Project was Ok. It was a group project. If someone doesn't have any background in DB, probably such persons may be able to get something out of it I guess. Otherwise it is a waste of time and just to add to the list of courses completed if you are in a race to complete the program. Essentially real world knowledge gained is almost nil as it focuses more on ERR (phase1 of the project) which is never even touched in any industry project anymore.", "rating": "Strongly Disliked", "workload": "10 hours/week", "author": "jqtuJr1aiOXcsQmRpEVvJX9mp7a2", "difficulty": "Easy", "semester": "Summer 2018", "time": "1/11/19, 6:12 PM"}, {"comment": "This course is too basic for a graduate level course. To be fair, it did cover everything that the syllabus mentions, and I have a few years of application development experience. But still, I expected it to be a much deeper course. We did not even cover the basics of locking and transactions. I was expecting a deeper understanding of these concepts, as well as may be query optimization which are extremely relevant in today's world of distributed computing. Instead, the course spends inordinate amount of time on ER diagrams and ER modeling, which are outdated tools. Nobody uses them in the industry for any real world project. Piazza posts/questions tended to be left unanswered for a long time, or left with student answers with no instructor endorsement.I had a great team, so the project execution was fun and painless. But I can see that if you mess up in picking the team (wide range of tie zones, wide range of capabilities etc.), then you might struggle a bit with projects. However, the project itself isn't too hard. Even a single person can do it. The struggle would be with coordinating between team mates, if you end up with a bad team.The reason I say you cannot Front load the work is only because the team project will only move at the team's pace. Rest of the content can be learned quickly.Very lightweight course. I feel I wasted a course as I did not learn anything new. It is a foundational course though, so that's good. This is basically an easy version of undergrad DBMS course. Your mileage will vary. I'd suggest keeping it for when you need an easy credit.", "rating": "Disliked", "workload": "1 hour/week", "author": "9U4RL0wsN9NdNVuBezuHDLndHHU2", "difficulty": "Very Easy", "semester": "Spring 2018", "time": "4/21/18, 12:57 AM"}, {"comment": "This was a class that started out not tame, but really ramped up towards the end. Phase 3 is a huge amount of work, and the final test 2 weeks later is the hardest of the semester. You'll spend hours upon hours on Phase 3 and that final exam. The whole class is structured around designing and building a database-backed application (like many websites you might have used). It is a lot of fun to work on Phase 3, since it's all about implementing something using MySQL+PHP, Python, etc that you've been designing all semester. But the graders are rather tough about the first two phases having the diagrams and pseudocode being perfect, when in reality a lot of the pseudocode gets changed when actual implementation occurs (at least in my case).All in all it's a good class, and the workload you have really depends on your group. But it's more than you think, and I don't recommend taking a second class with this. The workload isn't much at first, but watch out at the end of the semester since a ton of work hits you all at once even with the revised schedule in Spring 2018.", "rating": "Liked", "workload": "20 hours/week", "author": "bzs0NGuQz5g8geSHm8H1YN7EKOJ2", "difficulty": "Medium", "semester": "Spring 2018", "time": "4/29/18, 4:36 PM"}, {"comment": "If you are coming to this course with very little experience in databases, as I did, expect to learn a LOT but be prepared to put in the effort. Compared to my previous OMSCS course (6300), I would say I averaged twice as many hours reading through the (often dense) textbook and studying for exams. The real gem was the project, where we learned everything from designing databases with diagrams and understanding DB concepts (EER, IFD, relations), to implementing them using languages and tools I'd never programmed in before (MySQL, Php, HTML, MAMP). It provided me with not only a working prototype of a database in action, but also with a great experience working with teammates who I plan to keep in contact with. By comparison, the four exams only nominally helped to prepare us for each phase of the project, and seemed much more difficult than initial self-study and sample exams would indicate. I think that pacing in the course could be improved; the beginning felt very rushed to complete everything, whereas by the end it felt like there wasn't enough to keep us busy. It was up to us to plan our learning material consumption, but the deadlines with exams and project phases did not always give ideal time lengths to prepare. Professor Mark and the TAs are knowledgeable and approachable, though if you really want questions answered be prepared to ask during office hours. Overall, it was a challenging course and I liked certain parts more than others, but I definitely learned a lot.", "rating": "Liked", "workload": "15 hours/week", "author": "QeYWbWRrbFVofK0jLnPMzB4xtbl1", "difficulty": "Hard", "semester": "Spring 2018", "time": "4/30/18, 2:08 PM"}, {"comment": "There's 4 exams and a group project with 3 phases. Basically watch 20 minutes of videos and read a couple chapters every 3 weeks for the exams. And the group project has some videos of how to do each stage. Overall about 5-10 hours of studying for each exam and about 10-20 hours of work for each stage of the project. Main criticism is the professors and TAs love \"gotcha\" questions and grading for the exams and project. If you aren't good with study and work at your own pace you can fall behind as well.Spring 2018HardLiked8 hours/weekOMSAAuthor: LnJcKn5pJpf7wFw5nXQQyYgOd4J25/8/18, 3:54 PMI was having lot of expectation from this course but I felt it is not organized properly plus the concepts were not explained that much in detail. My hope after taking the course was to write more complex queries but I don't feel that I gained anything in that area. Even some more light can be thrown towards database performance and storage. Though I enjoyed the ER concept taught in this class. But to me this class is for entry level, I would not suggest to take this class if you have idea about database and expecting much from it though you can go for this one if you want to complete electives. Best of luck :)", "rating": "Disliked", "workload": "5 hours/week", "author": "K4S6fROL7HXZY7mUnuWPKHbVUVu1", "difficulty": "Easy", "semester": "Spring 2018", "time": "5/1/18, 8:42 AM"}, {"comment": "I was having lot of expectation from this course but I felt it is not organized properly plus the concepts were not explained that much in detail. My hope after taking the course was to write more complex queries but I don't feel that I gained anything in that area. Even some more light can be thrown towards database performance and storage. Though I enjoyed the ER concept taught in this class. But to me this class is for entry level, I would not suggest to take this class if you have idea about database and expecting much from it though you can go for this one if you want to complete electives. Best of luck :)", "rating": "Disliked", "workload": "5 hours/week", "author": "LnJcKn5pJpf7wFw5nXQQyYgOd4J2", "difficulty": "Easy", "semester": "Spring 2018", "time": "5/8/18, 3:54 PM"}, {"comment": "This is a pretty solid course on dB design. It focused a great deal on theory. Lectures were very well prepared- although I personally prefer 1-2 longer videos edited together instead of having to click through 6-8 short clips. Lectures alone did not prepare nearly enough for exams. You HAVE to have the textbook in order to fully understand the content. The course project was the best part of the course, but (at least my team) spent way more time on the application development than the dB design. I enjoyed this course and working on the project, but be warned- there is very little hands on database design and practical examples.. and quite a bit entity design and diagramming.Spring 2018MediumLiked5 hours/weekOMSAAuthor: 85qjx7gpB3a8O6LPf3nA92BUDBm17/30/18, 4:51 PMThis is one of those courses which can fall into both easy and hard category. Easy to complete the course with Grade B, but will need some work to get Grade A because of proctored exams. Especially last exam was very tricky and was intended to make you lose marks (and grade). Course structure wise, the project (ebay like project) itself is not so much related to course or at least it was far from what I was expecting from the course. I agree with so many other reviews this course is not at par with other Georgia tech offerings and is definitely not worth risking grade. I think this is the only course where Grade B% is more than Grade A%. Overall, if you want easy B then go for it. But knowledge wise you will not gain much from project. I already forgot most of the theory I learnt for exams so nothing much to gain there too. Although the professor and TA's themselves were great in helping students throughout and they are very knowledgeable too but just the course was not great.", "rating": "Strongly Disliked", "workload": "10 hours/week", "author": "b8DPytU1tegtPujUCz6I9iphGtX2", "difficulty": "Easy", "semester": "Spring 2018", "time": "5/14/18, 9:01 AM"}, {"comment": "This is one of those courses which can fall into both easy and hard category. Easy to complete the course with Grade B, but will need some work to get Grade A because of proctored exams. Especially last exam was very tricky and was intended to make you lose marks (and grade). Course structure wise, the project (ebay like project) itself is not so much related to course or at least it was far from what I was expecting from the course. I agree with so many other reviews this course is not at par with other Georgia tech offerings and is definitely not worth risking grade. I think this is the only course where Grade B% is more than Grade A%. Overall, if you want easy B then go for it. But knowledge wise you will not gain much from project. I already forgot most of the theory I learnt for exams so nothing much to gain there too. Although the professor and TA's themselves were great in helping students throughout and they are very knowledgeable too but just the course was not great.", "rating": "Strongly Disliked", "workload": "10 hours/week", "author": "85qjx7gpB3a8O6LPf3nA92BUDBm1", "difficulty": "Easy", "semester": "Spring 2018", "time": "7/30/18, 4:51 PM"}, {"comment": "Fun project if you get a good group. Lots of flexibility in application stack.Tests are not too difficult and open book.", "rating": "Liked", "workload": "5 hours/week", "author": "aISgmIzxKogZWcp8QbIfSzTehKr1", "difficulty": "Medium", "semester": "Spring 2018", "time": "8/1/18, 8:41 PM"}, {"comment": "Its a good introductory course and one can get good marks in it very easily if they go through the lectures only. You dont need to read much else apart from that to get the course completed, but it is recommended to do so. There is a group project which is highly dependent on who are the partners in your group. I will recommend to choose the tech stack with proper care as not just backend but front end work is also there in this project and your tech stack can either help you or delay you based on your level of expertise in that. TAs are helpful and proactive and so is the prof. You wont find any issue which is not addressed properly in the piazza post.", "rating": "Liked", "workload": "10 hours/week", "author": "QBo7T9W4nMRGrRtTEXRA0e2sA653", "difficulty": "Easy", "semester": "Spring 2018", "time": "10/9/18, 3:05 AM"}, {"comment": "Mostly group-based projects, more documentation and design than implementation, but an interesting course.", "rating": "Liked", "workload": "8 hours/week", "author": "wQ4i20zy2WbPsSsHWVqxnB9Bjhf1", "difficulty": "Easy", "semester": "Spring 2018", "time": "11/5/18, 11:21 PM"}, {"comment": "The course is relatively simple. However the subject matter can be dry. The tests and exams are mostly theory and open book which make it quite simple.", "rating": "Neutral", "workload": "4 hours/week", "author": "hejC02up7lNR6B87s9WrBgIX8In1", "difficulty": "Medium", "semester": "Spring 2018", "time": "11/6/18, 9:49 PM"}, {"comment": "Be careful who you choose for the group project. I ended up doing 100% of the database-related work for my team and could only get a whole-hearted response from them once project deadlines were right on top of us.The course's scope is actually smaller than my undergraduate databases class, but the group project would have made up for it if it wasn't dumped on me alone.", "rating": "Neutral", "workload": "15 hours/week", "author": "2XWRCMgcpsNlavSSiqaGn8XjW4I2", "difficulty": "Medium", "semester": "Spring 2018", "time": "11/7/18, 12:07 PM"}, {"comment": "This wasn't a hard class, and it wasn't necessarily an easy class. There are two big problems from this semester. First, the project and the exams are completely disparate. There is one set of lecture videos for the exams and another for the projects. It makes budgeting time a little weird, especially since the project is groupwork, so you also have to work around other's schedules.The other issue is that the project was not well defined. After the first part of the project was completed, it was clear that the requirements were vague and the desired app had a lot of holes. No feedback came for part 1 until a week before part 2 was due. And then 3 was released with a truncated set of requirements.Ultimately, this course is good if you are looking to learn about databases at a very basic level, and how database development should fit into application development processes.", "rating": "Liked", "workload": "10 hours/week", "author": "ccXnCeIxKHXMVU7rJt6eWq3hJHq2", "difficulty": "Medium", "semester": "Fall 2017", "time": "11/7/17, 3:45 PM"}, {"comment": "I haven't taken any database course before, and this course is very friendly to those students without a good cs background. Exams are easy and open-book. Projects are a little tricky. Group corporations are very important for projects. I definitely learned a lot about SQL, Html5, CSS, PHP, Javascript and Jquery in this course.", "rating": "Loved!", "workload": "20 hours/week", "author": "CnzLpXdnZGXbeQQAmujuq3gvp2G3", "difficulty": "Easy", "semester": "Fall 2017", "time": "12/17/17, 8:34 PM"}, {"comment": "I have database work experience and learn very little from this class. Although textbook has been updated to include new technology such as NoSQL, it is not covered in the lecture. The class project focused too much on web development as opposed to the database. There are a lot of ambivalent requirements which generated tons of questions in Piazza, which led to lengthy discussions that turns into bad feeling and snarky arguments. There is no helpfulness or positive encouragement provided in learning. Lots of negative responses and sarcasm. First, you need to search and read through all piazza posts before asking your question (to avoid annoying the TAs). Second, you didn't get a straight answer most of the time, so might as well do the research yourself. My take on group project: there will always be someone who doesn't do any work. With that in mind, always focused on your own learning and not worry with what other people do or don't. If you're lucky to find good people, it's a bonus! if not, that's okay too. The exams are open book and open note, total 4 exams. They are difficult and tricky. The project is painful and lots of UI work (such as dynamic drop-down parameters). Use PHP to create the project because there will be examples provided. I would avoid this class.", "rating": "Disliked", "workload": "15 hours/week", "author": "dQzeNVQxqoX5fFW1810gFOnAPHm2", "difficulty": "Medium", "semester": "Fall 2017", "time": "12/18/17, 1:41 AM"}, {"comment": "", "rating": "Fall 2017", "workload": "Medium", "author": "HIWKDZ8Td5Zkg5MW97MSgQqHAa43", "difficulty": "Spends 75% of the course on basic concepts you should know if you know anything about databases. The other 25% is a shitty overview of database performance. The project is a mess. The requirements document is a garbled word vomit of ideas and requirements which really hurt the head. It is really 75% web development project and 25% database, which is a mistake by whichever idiot thought up the project. Done properly the project should take 200 hours to complete, which is an inappropriate amount of time a project in an ms program should take. Overall this class was terribly executed. Unfortunately the guy executing it makes nearly 300K per year, go figure.", "semester": "Author: HIWKDZ8Td5Zkg5MW97MSgQqHAa4312/18/17, 9:02 AM", "time": "12/18/17, 9:02 AM"}, {"comment": "Course content itself is easy and covers basic concepts. If you've worked with ORMs and know basic SQL, you won't learn much. The EER diagrams, schema design, and normalization content is useful. Read a book and don't take the course if that's what you're looking to learn. If you haven't done web development, you will learn a lot from the final project which is a web application. The database component is a decent component to the project, but there's a lot of unnecessary UI requirements. Many requirements are arbitrary and not relevant to the database (i.e. drop downs, radio buttons, printable pages, unit conversion).Project was terrible. It wasn't reviewed for accuracy or the actual technical requirements that students were supposed to get from it. It was refined over the semester, and felt like the instructional team was making it up along the way, which led to a lot of questions on Piazza. No rubrics were provided for the three project phase submissions. Grading is inconsistent. I had a great group, which made it bearable. Choose your group wisely and try to find others that can complement your skills for the project. There's a team formation period so use that time wisely to find others who are motivated and engaged.Exams were fair for the most part. The last exam was pretty tough as some of the questions, especially calculation questions on indexes, efficiency, and performance weren't like those found in the book or sample exam. Still possible to do well if you think through it carefully. Be prepared for 1-2 questions that don't cover the content assigned in the syllabus. Be prepared for 1-2 tricky questions per exam that assess small details that aren't relevant or core to the course material.Instructors were not responsive. The head TA was pretty defensive in some initial threads which didn't create a welcoming or positive learning environment on Piazza. Many Piazza threads were never answered, including exam questions and project requirements. The instructor asked for feedback in the middle of the course (which many students appreciated including myself) after some students communicated about the negativity on the forums and the somewhat artful deception of the few exam questions I mentioned before. Most of those threads went unanswered even after the instructor said he'd follow up with individual responses.Hope positive changes actual take place in future offerings. I'd recommend the class for those uninitiated with web and SQL. A lot of people already familiar with databases tend to not like the course.", "rating": "Disliked", "workload": "15 hours/week", "author": "ttgsHfEZI9PvRCNqT300KNobIS52", "difficulty": "Medium", "semester": "Fall 2017", "time": "4/11/18, 8:02 PM"}, {"comment": "A great database class! Ignore those whiners.", "rating": "Loved!", "workload": "5 hours/week", "author": "mgWnLt0tUHfJvu0Jnt0wwUdm21t1", "difficulty": "Easy", "semester": "Fall 2017", "time": "12/24/17, 12:05 PM"}, {"comment": "This course is awesome, I really love it. The exams are a little tricky, but reasonable. The project is well designed if you do not hate to code for a web.", "rating": "Loved!", "workload": "15 hours/week", "author": "bjfcOp8nZ0hSfHKSnckQ79XgAYB3", "difficulty": "Medium", "semester": "Fall 2017", "time": "12/29/17, 4:29 PM"}, {"comment": "Overall for somebody who does not have a formal CS background, I'm happy I took this as my first OMSCS course. Although it is a database course, it broadly covers/requires other CS topics like web development, disk management, AMP setup and admin, PHP or Python scripting. I would only recommend the course for students without much database development experience.I am not a fan of the book. You should get it for the course as a reference and for the exams but don't plan on keeping it.The exams are not difficult but are not easy to get an A.I like the concept of the project because it demonstrates \"putting it all together,\" but the Fall 2017 semester version was not well executed. I think the TAs and instructors are taking feedback appropriately to improve it in future semesters.", "rating": "Liked", "workload": "10 hours/week", "author": "pZKf9jBBvUehSjdHvZJKaYjh6hq2", "difficulty": "Easy", "semester": "Fall 2017", "time": "4/27/18, 3:05 PM"}, {"comment": "Overall I like this class, but I wished the professor and the TAs are more organized (they sometime argue with each other on the requirements for the project on office hour). Also I feel like I spent more time on designing and developing the UI instead of working on the database/sql.", "rating": "Neutral", "workload": "6 hours/week", "author": "H87WwYujZVb9kywuTDmNZLmlszC3", "difficulty": "Easy", "semester": "Fall 2017", "time": "4/4/18, 11:34 AM"}, {"comment": "I think this is a very useful course. Project bit can be a bit hard for people new to database but it is well worth the effort.Fall 2017MediumLoved!10 hours/weekOMSAAuthor: pheTmma9sAd862NJHNSaJ6yZriE25/21/18, 10:58 AMCourse material is a little out-dated as it doesn't address NoSQL databases. There's one project, which is a group project, in this class that consists of 3 phases: requirement gathering, documentation and implementation. There are also 10 non-proctored quizzes, each worth 2% with no limit on the number of retries. 4 proctored, but open book, open notes (no internet access) tests.", "rating": "Liked", "workload": "6 hours/week", "author": "W0fI5Oc2lNay4eAnujEOKtWNK1W2", "difficulty": "Easy", "semester": "Fall 2017", "time": "5/5/18, 9:14 AM"}, {"comment": "Course material is a little out-dated as it doesn't address NoSQL databases. There's one project, which is a group project, in this class that consists of 3 phases: requirement gathering, documentation and implementation. There are also 10 non-proctored quizzes, each worth 2% with no limit on the number of retries. 4 proctored, but open book, open notes (no internet access) tests.", "rating": "Liked", "workload": "6 hours/week", "author": "pheTmma9sAd862NJHNSaJ6yZriE2", "difficulty": "Easy", "semester": "Fall 2017", "time": "5/21/18, 10:58 AM"}], "difficulty": 2.579, "enrolled": 604.0, "id": "CS6400"}, {"rating": 3.206, "workload": 6.044, "withdrew": 45.0, "comments": [{"comment": "Nice GPA booster course, not a very fulfilling one.This course was easier than most of my undergraduate courses. The course was structured as follows:7 or 8 quizzes5 or so homeworks1 group project\"stretch assignments\" for extra creditPersonally don't think I learned much about anything, besides that the healthcare industry needs some serious tech overhaul. The assignments are not released up front so you cannot front-load the work, and need to go with the slow pace for the lackluster material.Pros: probably the most helpful TAs I've experienced in OMSCS; course site was extremely informative and kept up to date; TAs posted weekly threads of what was due that week which helped keep pace appropriately.", "rating": "Disliked", "workload": "2 hours/week", "author": "6alMpAmy2Scqtz0FtUfW7gNTyu03", "difficulty": "Very Easy", "semester": "Fall 2018", "time": "12/28/18, 11:54 AM"}, {"comment": "Well, this is most certainly an easy course but definitely not an unimportant one. Despite being a course where the amount of content covered is typically only half as much as you would cover in any other course the course has its strong points. This is probably the best introductory course for Java language, and also a very good introductory course for a number of industry level projects particularly those that deal with interoperability of legacy systems and legacy data and standards. The course covers some finer aspects of how to approach interoperability something which other areas of computer science can readily make use of and that is one important outcome of the course.", "rating": "Liked", "workload": "10 hours/week", "author": "8efaad7c-8808-4e5f-9f8d-31f5", "difficulty": "Easy", "semester": "Fall 2018", "time": "87561a991/7/19, 9:03 AM"}, {"comment": "Overall good course, what can make it difficult or easy is the group project.", "rating": "Liked", "workload": "10 hours/week", "author": "gH87JzmpyFgW8wWqQmum2QDLdPf2", "difficulty": "Medium", "semester": "Fall 2018", "time": "2/7/19, 8:51 PM"}, {"comment": "This is what they call a real useless course. If you're \"over it\" when it comes to the program, and just want a low-effort course for an easy A, this is for you!People in my project group were stressing for no reason; we created a crappy website and got over 100% on the project.Practically every homework or quiz can be done over multiple times; with the auto-grading there is no excuse for not getting close to 100% on practically everything.The quality of lectures is the lowest in the program, and I'm told that they were redone recently? Every quiz was a regurgitation of inconsequential facts. Even as somebody who has worked in health informatics, I would say this course was pretty useless.", "rating": "Strongly Disliked", "workload": "2 hours/week", "author": "facebook:101533731139153562/", "difficulty": "Very Easy", "semester": "Fall 2018", "time": "26/19, 1:33 AM"}, {"comment": "Pros:*This class should pair well with almost any course if you're determined to take more than one class. It was nice to not have to worry about exams.*You're exposed to a wide range of different health informatics applications.*You get to work with real industry mentors on the group project.Cons:*The lectures and homework have very little depth. You won't leave the class with any new skills you can apply.*The group project topics were pretty varied in terms of depth and skills required. It's hard to tell what (if anything) you'll get out of the experience. The project seemed overly focused on the process and checking rubric boxes rather than applying course material Personally I would have preferred a more consistent experience focused on applying FHIR in depth.*There were several times on the homework assignments where the autograder for the assignments had bugs or the intended answers to the questions required guessing on which specific word or phrase was the answer. You'll definitely need to use multiple submissions to make pointless tweaks to get to the acceptable answers. The TAs seemed to know this from the beginning of the course and would announce that they would be making manual grade adjustments for these items. Clearly, these were recurring items from previous semesters, but fixes were never made. On a more fundamental level, the assignments just weren't designed well to increase or assess knowledge.*Grade release was pretty slow for the auto-graded assignments, especially considering that there were relatively few students in the course.*When the group project was going on, the course could be a bit of a time-suck depending on your external mentor, teammates, and topic.", "rating": "Neutral", "workload": "6 hours/week", "author": "qoBqrhI1GJdgmj7CgYs6KZmbbMJ2", "difficulty": "Easy", "semester": "Fall 2018", "time": "3/30/19, 1:48 AM"}, {"comment": "Pros: Interesting material! Since it's a domain-specific course (focused on healthcare), we're constantly exposed to real-world applications of the technology. This includes current and historical challenges, and new opportunities. The course incorporates a fun group project working with an external mentor (from the healthcare industry) to create a FHIR app that might actually turn into something. (I cringe at all the throwaway code I write for an OMSCS course, so this was a refreshing change.) The TAs are super responsive and I was delighted how fast the assignment grades came back!Cons: This semester the course has been significantly reworked. The lectures are new and autograded activities have been created from scratch. There were a few hiccups with the activities, but the TAs were always quite responsive and graded generously in these situations.Misc.: Students are expected to write numerous short-form essays (200-400 words), citing sources using APA format. This was new to most of us, and the TAs were helpful in getting us familiar with it. The autograded activities required Java code written to interface with a FHIR server. If you're learning Java while also learning the FHIR API, expect a few weeks of pain.", "rating": "Liked", "workload": "7 hours/week", "author": "31NeUIiJT2fQ6qrcPatENzkj8DF2", "difficulty": "Easy", "semester": "Spring 2018", "time": "4/3/18, 3:14 PM"}, {"comment": "One of the worst courses in this program even after the complete remake in Spring 2018. I would say the course is over ambitious in terms of scope. It attempts to cover many subjects within the area or US health system and standardization for interoperability. It feels like fitting 20 pounds of stuff into a 5 pounds bag. In the end, I did not get much out of it. In addition, the course lectures include many interview videos which are often lengthy but do not provide much academic values to the topic. The only reason I took it is because it is mandatory for the II specialization. Instructors may re-evaluate their choice of using HL7 v3 standard for the FHIR activity because there are limited examples available online.", "rating": "Disliked", "workload": "5 hours/week", "author": "654bc59c-e520-4b1d-b578-b138", "difficulty": "Very Easy", "semester": "Spring 2018", "time": "8b4a649a4/29/18, 4:05 PM"}, {"comment": "The Health Technology background is useful, the class has minimal technology training, the real-world project is the saving grace that made the class worth taking.The lecture videos are the worst of any OMSCS class I've taken. They are mostly the instructor speaking with no use of visual aids or poorly edited interviews with people in the health field. The class was very disorganized with many poorly communicated corrections and changes through the semester. There is almost no teaching on the actual technology beyond basic concepts and logical architecture of FHIR. The activities are rudimentary and don't provide much benefit other than following directions and using trial and error to get things working. The essays focused more on references than content.The workload week to week was very inconsistent. One week would be 10+ hours and the next might be 3.The real-world group project for the class was rewarding and I learned a lot from that. I would have preferred to start it much earlier and remove a lot of the extra unneeded lectures / interviews.", "rating": "Neutral", "workload": "8 hours/week", "author": "dbmwtISlpzbtwmI1PKYpXh0yoEi1", "difficulty": "Easy", "semester": "Spring 2018", "time": "4/30/18, 7:55 AM"}, {"comment": "This is one of my first courses. I really liked the course. The professor was so full of energy in the videos. The essays were fun to write. I spent a lot of time reading, and rereading, and reading the external material. Spend the time to watch the videos and write well-crafted essays. TA's will reward you with extra credit. I think they read so many essays, they can tell the difference between those who spent the time learning the stuff and who's just bs-ing their way through. I highly recommend the course!", "rating": "Loved!", "workload": "10 hours/week", "author": "t5AVIqFXxibViDcJmSsgTpc2twc2", "difficulty": "Medium", "semester": "Spring 2018", "time": "5/3/18, 1:58 AM"}, {"comment": "Pros: Overall well run. I work in Healthcare IT and found class useful. Easy workload, makes a good candidate to pair up with another class. Cons: Subject matter is very boring and videos are dry.", "rating": "Neutral", "workload": "6 hours/week", "author": "xML484vh6kUN6YI60TJP5CsO4s62", "difficulty": "Easy", "semester": "Spring 2018", "time": "5/7/18, 4:37 PM"}, {"comment": "I learned a great deal about health informatics. The course had a few challenging moments, however, it was a pretty easy course. There was 1 group project and I feel the team I was on made the assignment very simple.", "rating": "Loved!", "workload": "12 hours/week", "author": "utWRfQtbjgTP6Q1dgIftWlGTqQS2", "difficulty": "Easy", "semester": "Spring 2018", "time": "7/29/18, 6:46 PM"}, {"comment": "Really interesting material, the lectures have been revamped. I really feel like the material covered is up-to-date, although alot of subjects werecovered throughout the course of the semester. The professor does a good job of explaining the content pretty clearly. Most of the grade will come form one group project(35%) and individual assignments(40%). Topics that are taught: FHIR API, Overall healthcare system and how technology fits in, SNOWMED, Data Standards, LOINC code etc...", "rating": "Liked", "workload": "5 hours/week", "author": "Yro8QPufxKV1gHolT0PsOW7AkWX2", "difficulty": "Medium", "semester": "Spring 2018", "time": "8/8/18, 11:57 AM"}, {"comment": "This was a very easy course. We were taught various industry standards for health informatics and worked on a group project building something that utilized the standards we learned about. The class was useful as an overview of the tools and current state of the industry. The project was also well structured and gave everyone the chance to contribute.", "rating": "Liked", "workload": "4 hours/week", "author": "96efe08e-a4cc-4882-aab6-fe90", "difficulty": "Very Easy", "semester": "Spring 2018", "time": "eae488868/8/18, 12:47 PM"}, {"comment": "Course was well done in terms of assignments, lectures, etc., I just didn't really like the topic much. It's very specific to health care standards and APIs and not really at all about analysis, which was what I was hoping for. If you are interested in health care standards, it's a great choice though. There is a group project and we got to form our own teams which was good. We had a mentor from the CDC and she was awesome, meeting with us weekly and providing input on our project.", "rating": "Neutral", "workload": "8 hours/week", "author": "cD6iL559nTUMJPFJIXqrmoozAAx1", "difficulty": "Easy", "semester": "Spring 2018", "time": "12/13/18, 9:20 AM"}, {"comment": "Boring class, but I was not at all interested in searching through health databases; I thought we were going to use NLP algos and do something fun. Nothing fun in this class but easy(at least when I took it) class to pair with a harder one.My only real complaint as far as difficulty was the Java assignment: it came out of nowhere and it was 20% of the grade. Very sneaky way of getting students to drop out of fear. They gave us a chance to re work on it after but we didn't know that initially; I almost lost my entire group after that assignment as some students freaked out.", "rating": "Disliked", "workload": "10 hours/week", "author": "BduviuiuCuT2adjvkCVOWytYkfX2", "difficulty": "Medium", "semester": "Spring 2018", "time": "1/16/19, 5:09 AM"}], "difficulty": 1.982, "enrolled": 463.0, "id": "CS6440"}, {"rating": 4.254, "workload": 13.71, "withdrew": 22.0, "comments": [{"comment": "This is the worst class I have ever taken in my life. I take this course because I want to satisfy the requirement of II Specialization. The course is strongly controlled by the teaching assistant, the homework/project is boring and time consuming. You can not learn any thing from this course but waste your money. The grading criteria is not consistent between different TA and some of them are abusively using their power since the grading is totally subjective. They even disabled you to see the grade distribution in canvas! Some students posted complaints on piazza and the complaints were deleted immediately(there is no dirty words, just complaining their TA is unfair). I strongly recommend the professor check the TA's quality before letting students to take this class.", "rating": "Strongly Disliked", "workload": "15 hours/week", "author": "A7urUhNq7QdfufoaH6ossnIf5Ht2", "difficulty": "Medium", "semester": "Spring 2019", "time": "2/24/19, 12:23 PM"}, {"comment": "Simply put. Awesome class, awesome professor, awesome TAs. And definitely awesome students.This is not your average or regular class. It tries to build your focus on Educational Technology and then prepare you for your related project. All the while Dr Joyner and the TAs make it worthwhile. Piazza interactions are regular and there are different optional weekly activities where you can touch upon various strides in Educational Technology, all the while keeping up with the course.You can take up a project which can be either research, content, or development of a tool. Its worthwhile to mention if you have something in mind already you are better prepared and can utilize the beginning weeks to hone it further. There will be a mentor for each student, do make use of consulting and clarifying in need.Overall course was fun and I enjoyed it.", "rating": "Loved!", "workload": "9 hours/week", "author": "5JVeIPG3F1MgHf0pjCrfrCRtzAf2", "difficulty": "Easy", "semester": "Fall 2018", "time": "12/16/18, 2:05 AM"}, {"comment": "This course is great for self-starters and creative thinkers. I recommend taking the course with an educational project in mind. By taking your research, development and participation seriously, you can get a lot out of this course. Invest some time and effort. Don\u2019t rely on handholding, although there is help if you really need it.", "rating": "Liked", "workload": "20 hours/week", "author": "qjWvcu0oPVcbL1VK8falSgJxzJv2", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/17/18, 12:48 PM"}, {"comment": "This course is the best I've taken so far. I loved the format (less lecture more research and writing), but I love writing. This is what Graduate courses should be like. Dr. Joyner's passion for EdTech and drive to make online learning the best it can be is very obvious. He was very active on Piazza. I have never met any professor who solicited more feedback and wanted other's ideas than Dr. Joyner.TA's do a lot of work in this course due to the projects and amount of writing. I doubt that grading is consistent across TAs - it will depend on your fit with your TA's communication style and the TA's prior experience (more experience = higher expectations). I felt a bit lost on the project proposal, then as I learned more I could not change the way-too-large scope of my project. I wish I had asked more questions before project proposal and was less ambitious!Overall, great course that will help you polish your writing skills to a respectable level to submit to a journal or conference.", "rating": "Liked", "workload": "15 hours/week", "author": "FWfqs50lxmhvcwP1skQjb8mNfVn2", "difficulty": "Medium", "semester": "Fall 2018", "time": "1/2/19, 8:53 PM"}, {"comment": "Totally a trash. TA doesnt know a thing and you will receive a random score depending on TA's mood. Format, format, format. It is basically the only important thing for this class", "rating": "Strongly Disliked", "workload": "10 hours/week", "author": "E8KKkCA8vBPnSpIVHwptbDV8eXm2", "difficulty": "Very Easy", "semester": "Fall 2018", "time": "2/5/19, 9:03 PM"}, {"comment": "I would say this course is the worst course in OMSCS program, maybe the worst cs course in the world. The course is useless if you want to pursue a career in CS, the homework is all about writing and just waste your time. I would suggest OMSCS terminate any course designed by David Joyner, since it will have a negative effect on the reputation of cs program.", "rating": "Strongly Disliked", "workload": "15 hours/week", "author": "RxQOnxqsRpW42xdhMi60byWBRFL2", "difficulty": "Medium", "semester": "Fall 2018", "time": "2/6/19, 3:01 AM"}, {"comment": "Would you risk letting a younger, less experienced fellow student grade you, give you advice on a topic in which you are an expert, and potentially fail you? That's what you are risking when you sign up for Ed. Tech.In this class you pick a research project and spend the entire semester working on it. There is a written assignment every week. The assignments are all similar: write about a topic, use about 30 formal references. Week one you write about previous class's topics. Week two, a general topic. Week three, a more specific topic. Week four, a problem in your topic. Week five, your topic. Week six, your project. Etc, etc. You get a lot of formal writing practice.There is no textbook, no lectures, no office hours, no tests, and no required readings. There is also no rubric or instruction. One person does all your grading. Your grade is entirely based on whether you 'meet her expectations'. In my case, my grader had expectations that she could never explain. Fail.My references were 'not current', 'not relevant', 'oddly narrow', 'too vague'. Fail. When I labeled a reference as 'background information' or 'good quotes'. She said that didn't count. Fail. Why? How? I still don't know. I asked repeatedly. She never explained. I just failed.The list goes on and on. She was uncommunicative, unsupportive, and at times just plain insulting. There is no recourse. I contacted Prof. Joyner and he stood by her, insults and all, and even accused me of 'not wanting to learn'.I love to learn, but didn't learn in this course. It's just writing practice. I'm an excellent writer, published author, and a straight A student. I've never strongly disliked a course before this one.This is the second highest rated OMSCS course, because it can be a lot of fun to work on something you love with a supportive, helpful mentor. But if you get a mentor who disagrees with you, has poor teaching skills, or is just plain overworked, this class is a depressing hazing ritual.", "rating": "Strongly Disliked", "workload": "30 hours/week", "author": "ictLNWl1qxOOb7s4ZsN7LT3kkws2", "difficulty": "Medium", "semester": "Fall 2018", "time": "2/16/19, 5:00 PM"}, {"comment": "It is up to you how much you will work here. I chose a relatively big project, and I did it alone. It was a nice experience, but a lot of work.", "rating": "Liked", "workload": "30 hours/week", "author": "JMElogm9q1QbXXKbihkojMTsEL63", "difficulty": "Hard", "semester": "Fall 2018", "time": "3/26/19, 4:14 PM"}, {"comment": "The course was good, but not great. This is a good first course. The students can choose any project they want, which was very good. There are no exams, quizzes. At the end of the course I guarantee that you'd come out with a solid understanding of how to write academic papers and the steps involved in getting a PhD. However technologically I doubt if you will learn something.The only problem that I had was that my TA was a bit ... uninterested in what I was doing. They were excellent in giving me guidance when I'm stuck but the advice always seemed shallow. It was as if the TA wasn't really reading my papers/submissions in detail and giving me feedback by skimming through my content. Definately nothing against the TA but the course should hire more TA's to get stuff done.Overall, it was a good experience and I'd definately recommend this course.", "rating": "Liked", "workload": "5 hours/week", "author": "pghkQQvWd5Rw3lFv8SAnKLG9x3V2", "difficulty": "Medium", "semester": "Summer 2018", "time": "7/30/18, 3:49 PM"}, {"comment": "This class was an interesting experience that diverts from the usual OMSCS course. I won't re-iterate what was said in the previous reviews (its an overall good class), but I will offer some ways I think the class could improve. I think this class should have two tracks - one for people that aren't sure what they want to do coming in, and those that are. I feel like I did one or two too many papers, and it was a bit of a stretch sometimes trying to lead the papers towards the project I already had in my mind since the beginning of the semester. Another small thing is that a lot of people are taking OMSCS while working full time (or more). It is necessary to grade participation for peer feedback and surveys because they're central to the course, but grading participation in a forum (piazza) when you maybe only have an hour outside of work for free time is a bit of a downer. Some people can't check this stuff constantly (and when checked, most topics already have good answers). It feels like they're taking points away for something I can't help. Piazza participation will happen naturally, there's no need to force it on the students. Another thing is that a lot of these projects varied incredibly greatly in quality. There were some very impressive projects, and others seemed like way less than 100 hours was spent on it (particularly the research track projects). Maybe you could rework those. Some of the papers I peer reviewed were poor quality as well- maybe this was handled in the grading as a matter of course. Sometimes it was a little frustrating to put a lot of effort into my papers and then read papers that seemed like they weren't up to Georgia Tech's quality bar. Finally, the way the grading is done on the final projects for the development track encourages students to take a safe project (not a lot of effort) so that they have time to make a really polished presentation. It may discourage ambitious projects. This might not be what you're going for.", "rating": "Liked", "workload": "20 hours/week", "author": "aSfBOTkpUPPD1ZfVGGTRZ4ODrwT2", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/3/18, 10:03 AM"}, {"comment": "As expected from a Dr. Joyner course, student and instructor engagement set the standard for OMSCS courses. Dr. Joyner is active and thought-provoking and the weekly updates help steer you through the course.Bottom-line: The course is about using academic research to advance the field of EdTech. If you want to do a research project and feel comfortable reading / writing and coming up with your own project, take this class. I used this course to learn about some front-end development and used some product management methodologies (survey, user research, and rapid prototyping) I learned from HCI. What I liked about this class is that I learned how to use academic research and how to integrate those ideas into a solution. Lastly, this class, more than others, depends on how much you put into it.", "rating": "Loved!", "workload": "8 hours/week", "author": "rbotfsDawtRHDPtup461gYgtmom2", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/3/18, 10:48 AM"}, {"comment": "This class is a must-take in this program. It's the only class when you come up with a project yourself (there is a process that helps you do that) and then work on it for the remainder of the semester.One very important tip: do not focus on the points in this class. Forget about them. Focus on creating something great. Be ambitious. Make something that you will be proud of. You can even use this class to build a product for your future startup, to learn the technology that you always dreamed of learning, or to help a cause that you care about. You are the one that can define this class for you. You can make it an easy filler class without much substance or something extraordinary that can jump-start your future.Note that the workload that I indicated is quite larger, but only because I decided to work as much, to achieve the goals that I had for myself. I could have easily worked 5 hours a week and still got an A.", "rating": "Loved!", "workload": "28 hours/week", "author": "yMakwVt39xgjFL4Dj3eRoVal1jj2", "difficulty": "Easy", "semester": "Summer 2018", "time": "8/4/18, 6:51 AM"}, {"comment": "A largely self-directed semester, you propose your project, choose whether or not to acquire teammates, write your own deliverable schedule, then deliver it. You can produce a research paper, a software demo, or a short online course. Your focus can be any subfield of educational technology.I did a research track solo and would only recommend that for to-the-bone introverts. Since literally no one else in the class is doing (or paying attention to) your thing until the very end, it got surprisingly lonely.On the research track you'll learn a lot about source and reference management with software such as EndNote, how to make the web great again through the GT VPN & Library which unlock every academic database known to man, and how to make a great looking academic paper in LaTeX or even Word.", "rating": "Neutral", "workload": "10 hours/week", "author": "google:114588245870326197003", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/5/18, 11:34 AM"}, {"comment": "This is my second course with Dr. Joyner, and I strongly recommend it overall. You will need to keep track of your progress and the deadlines, but if you put in a good 16 hours a week, then you'll do fine.I chose the research path and very much enjoyed the worked that I did on virtual reality for learning. You'll pick your own topic and the path you want to go down. The options are Content Development, Build an application, or do research.In the end, I thought this was a great class and I would do it again if it were an option.", "rating": "Loved!", "workload": "12 hours/week", "author": "mCy1bHkxn6Xis2FiR5u6fw0Fz7s1", "difficulty": "Easy", "semester": "Summer 2018", "time": "8/5/18, 4:04 PM"}, {"comment": "This course should be mandatory for all OMSCS graduates, as you get to contribute back to the educational community at the end. It is extremely well ran, probably one of the best ran courses in this entire program. Dr. Joyner is a natural when it comes to education, the guy is simply an awesome professor. You have to do a lot of research and also write a lot throughout the course, but you get to pick the research and thus what you write about. You are able to work within a team or solo, and I decided to work solo, given that I had an educational project which I have wanted to work on for years now. You will learn how to read scientific papers in this course, and also how to write one, which is extremely valuable, especially if you plan to take courses such as Reinforcement Learning, which require you to read a ton of scientific papers. Educational Technology is structured as a mini Ph.D. course, so if you plan on doing a Ph.D., you should probably take this course.Note, the last four weeks are the most time consuming, as this is when you will be working on your final project, which easily exceeds 100 hours.", "rating": "Loved!", "workload": "12 hours/week", "author": "mdbNol35vRh7LVGpeOGncBIPgSN2", "difficulty": "Easy", "semester": "Summer 2018", "time": "1/19/19, 9:24 PM"}, {"comment": "If you are the type of person that needs instructions week in week out then this course would probably not be a good fit. I think individuals are also more likely to achieve more out of this class if you had a broad idea of what you wanted to work on coming into the course. From the get go you are pretty much working on the initial stages of your final project up until submission at the end of the semester.", "rating": "Neutral", "workload": "10 hours/week", "author": "hEdoemyQvwUm73U3ixGCzSizZQ02", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/6/18, 9:24 AM"}, {"comment": "I have taken this class in Summer 2018 and, I must say, I'm unimpressed. I had read it was fabulous, but I didn't really enjoy the course, and I seem to have wasted an enormous amount of time in apparently not-useful tasks.This course requires you to absolutely know what you'd like to do and HOW to do it BEFOREHAND. It's quite hard to learn how to do something (e.g. some advanced development, or the research process, or creating content) WHILE during the course. My mentor was absolutely useless in the process, I was left on my own but I didn't understand what the target was. Actually, I don't know whether my issue was with the class itself, or with my mentor.Additionally, the Summer term is too short for this course, doesn't let you digest the information you need in a calm fashion.Some people in the class obviously leverage the class to create some interesting project that they would do anyway, either for their jobs or for their leisure, but the amount of time they pour into such projects is enormous and you simply can't afford to stay in the same league as theirs.I think the class has a lot of potential, but it's a source of dismay and frustration for whoever is not already \"in tune\" with it. Clearer objectives and expectations would be nicer.Summarizing: 1) this class is mentor based. If your mentor is not great, or doesn't like you, it can give you a though time. 2) Do what you ALREADY know how to do if you want to succeed. Don't do research if you've never done research. Don't do content if you've never created a course. Don't do development if you can't code.", "rating": "Neutral", "workload": "22 hours/week", "author": "BENvBvI1GPMkmgrY6x3AXbZJEir2", "difficulty": "Hard", "semester": "Summer 2018", "time": "8/6/18, 11:07 AM"}, {"comment": "This was a very unique course. It's basically a PhD condensed into a single semester. I learned a lot about the process of doing research towards a PhD but not much about actual education technology. The course format and general set up is cool and it's useful tof work on a project that you can get regular feedback on.", "rating": "Liked", "workload": "10 hours/week", "author": "96efe08e-a4cc-4882-aab6-fe90", "difficulty": "Easy", "semester": "Summer 2018", "time": "eae488868/8/18, 12:44 PM"}, {"comment": "If you feel comfortable reading / writing and coming up with your own project, you will do well and enjoy this class. This class, more than others, depends on how much you put into it. I would've loved to put more into it but I'm overall satisfied with what I learned, and the project I ended up doing research on.", "rating": "Liked", "workload": "10 hours/week", "author": "NRPKDhMy4ehrIbp9KHJVbsFEgtO2", "difficulty": "Easy", "semester": "Summer 2018", "time": "11/18/18, 3:45 PM"}, {"comment": "Fall 2018Great course. It introduced me to Google Scholar and digging into research papers", "rating": "Loved!", "workload": "15 hours/week", "author": "9ICMop7CAeXLxqhHpo4HMjpHuej2", "difficulty": "Medium", "semester": "Summer 2018", "time": "12/11/18, 3:56 PM"}, {"comment": "I took it fall/2018. This course is a research track course, so we need to find ideas of what you want to contribute in educational field. I took a development track in my research, so I had to develop small prototype. If you choose development track, it is good to setup the framework beforehand. Overall this course has a lot of reading and the writing, which is consumable. I personally loved class, because this was only class where I can apply my creativity.", "rating": "Loved!", "workload": "9 hours/week", "author": "v4mJSyfW6NbruhsjjTDdEbAETx73", "difficulty": "Medium", "semester": "Summer 2018", "time": "12/27/18, 1:18 AM"}, {"comment": "This course was my introduction to the OMSCS program and I felt it was a good transition from professional life back into school life. The course is very much what you make of it and most of you will enjoy the freedom granted in the final project. The first half is very heavy in writing where you are exploring a topic of interest then you get into your project. You can choose to either work individually or work with a group. The freedom in project allows you to create something meaningful; I will continue the work that I started this semester after the conclusion of the semester because I believe in the value of what I got started.I highly recommend this course!", "rating": "Loved!", "workload": "10 hours/week", "author": "OEIz4cGkJ1fewMAlxWmDr4YiljO2", "difficulty": "Medium", "semester": "Spring 2018", "time": "4/29/18, 10:55 AM"}, {"comment": "This is probably the most interesting class I've taken in the program. it requires either a resource, content or development of educational technology. I didn't know what I wanted to do prior to taking this classes, but as I started doing research, I got a great sense of what to do. This is a work at your own pace, but keep up class. It does require somewhere between 12 and 15 hours per work a week. There several large papers and smaller papers. If you pick an interesting topic you end up loving this class. I want to continue to develop my idea and maybe leverage it back to OMS or other educational programs. It's a truly great experience and I highly recommend this class.", "rating": "Loved!", "workload": "15 hours/week", "author": "nolpnDASmPenKisB8ZqXhWTpE6P2", "difficulty": "Medium", "semester": "Spring 2018", "time": "5/2/18, 6:08 PM"}, {"comment": "I don't like this class. This class is more like a writing class. Some student may conduct the personal project in the class. but I feel that I did learn something new. The whole class is to finish a project. The project can be almost anything that related to online education. you can build an APP, website, or analyze some data, or even do some literature survey about online education. If you are new to OMSCS, you can use this class to get familiar with OMSCS.", "rating": "Disliked", "workload": "5 hours/week", "author": "obDAa2oAfiTJHpgqK1r5IjuUnjk2", "difficulty": "Easy", "semester": "Spring 2018", "time": "7/30/18, 5:20 PM"}, {"comment": "As always, Dr Joyner is awesome. All of his courses are very well organized. He did a very great job creating a mini PhD-like course. The idea of the course is for you to get a feeling of how would it be to pursue a PhD, to get a feeling of the researching activity.I enjoyed the course and got what I expected in terms of research experience.It has consumed more time than I expected in the project, but this is totally up to you, it is possible to spend as many hours as you want.The only downside I can mention is about my TA. Although he was answering and participating, I felt he was always shallow and not very helpful, he did not provided many insightful advices.", "rating": "Liked", "workload": "10 hours/week", "author": "af4WR8ajjOe1nIAAbL0Z3mwBkOD2", "difficulty": "Medium", "semester": "Spring 2018", "time": "8/15/18, 10:14 AM"}, {"comment": "This course is tough especially if you do not have an idea of the project you are going to work beforehand. This was my case, so I took the first three weeks to decide what was going to be my project so I was in a little disadvantage. Once you know the project is very straightforward. It is not difficult at all just a very heavy workload.", "rating": "Liked", "workload": "30 hours/week", "author": "c92fab32-20e0-48d2-9408-0850", "difficulty": "Hard", "semester": "Spring 2018", "time": "a20ed6c58/16/18, 11:01 AM"}, {"comment": "I really loved this class, but I had a project I wanted to make 2 years ago, so it was the perfect excuse. I spent much more than 20 hours a week, but that was my own obsession with the project. 10 hours or so is enough for most if you do not have a passion project. I've taken 4 courses so far, this was the most well run and fairly graded(essays are allowed to be rewritten and the TAs are very responsive).I would only take this course when you know exactly what you want to do; otherwise you will be rather lost and it would be a shame; 2 semesters later I am still working on this project and this year I will make it public. I wish most courses on OMSCS were like this one; but non of them are so leave the happiness for the end, I cannot stop comparing this course to the others ones now :(", "rating": "Loved!", "workload": "20 hours/week", "author": "BduviuiuCuT2adjvkCVOWytYkfX2", "difficulty": "Medium", "semester": "Spring 2018", "time": "1/16/19, 5:05 AM"}, {"comment": "", "rating": "Medium", "workload": "Loved!", "author": "pcXILjMGFKfaGrw35X05rkEacHi1", "difficulty": "Fall 2017", "semester": "This class is unique. It is great to learn how to do research and construct a research thesis. I learned a lot of project management skills also that I feel will be great in the work field. All the deliverables are stated and guide you through it. If you have an idea for a project or a business this will force you to follow it through and a mentor will guide you. I had no ed tech experience and I learned so much since at the beginning I had no idea for a topic so I researched many fields prior to narrowing in on a project idea. The class is definitely what you make of it. Great for independent learners.", "time": "12/16/17, 11:30 AM"}, {"comment": "A self-driven class where you get out of the class what you put in. You explore areas of educational technology at the start of the class and then propose a project you would like to do. Communication is excellent throughout the course. The mentors are helpful, and everyone encourages you as you explore, define, and create your mini PhD project.I wish I would have had more time to explore other project proposals to join a group. There's some opportunity to do that by looking through the library and peer-reviewing projects, but you need to make time for it. Really recommend doing that if you take the course because you might find something you hadn't thought about or that captures your interest more.I'd recommend taking this course towards the end of OMSCS as you might have acquired some new skills that you'd like to apply to an EdTech development project. Such a great class either way! Kudos to David Joyner and the awesome mentors in the class.", "rating": "Loved!", "workload": "10 hours/week", "author": "ttgsHfEZI9PvRCNqT300KNobIS52", "difficulty": "Medium", "semester": "Fall 2017", "time": "1/9/19, 7:05 PM"}, {"comment": "Rating: This is wonderful class that I was skeptical about but ended up loving. The course is compared to a PHD in structure, not necessarily rigor, and I learned a lot about the academic development process. The strongest aspect is this class is the organization and communication which is led by Dr. Joyner. His planning makes it very easy to focus on the content of the course and if you do have questions, answers are swift and sincere. The format is unique in that you are assigned a mentor who guides you through the process of deciding on a project and fulfilling the requirements. There aren't any strong negatives in the course but I suppose the initial project dive is a little rough. There is just so much data to sort through and it is a little hard to pick the problem you want to solve. Fortunately, if you come in to the program with a problem in mind this is a non-issue!Difficulty: This class is what you make of it. You could pick an really easy problem or a really hard problem, the only person you're hurting or helping is yourself.The first few assignments are almost entirely reading academic articles so get good at reading those efficiently. The writing is not that hard as long as you stay on point and have a purpose. My initial project idea was too ambitious but I was able to massage it into something that could be completed in about 100 hours which is the goal.Workload: I spent a lot of time reading throughout the entire course so that never really goes away. The last 4 weeks was my big dev cycle and I ended up pouring about 25/hrs in the last week or so. My measured average is about 10 and if I had not been taking a second class, I probably would not have had the huge uptick in hours during the last week.", "rating": "Loved!", "workload": "10 hours/week", "author": "sdM0Sx0c0eZ1xaWDJvYFkk3aZI32", "difficulty": "Medium", "semester": "Fall 2017", "time": "12/19/17, 6:31 PM"}, {"comment": "This course is one of the best courses i've ever taken, online or offline. There are a lot of learning moments for each individual, from reading papers, to gathering peer feedback to building, designing, and scaling up or down the project based on your own abilities. I think at the end of it, not only did I learn about education technology, but I also learned about how I learned and how I analyzed and tackle projects.Great class and honestly, the workload is what you put in it. If you want to learn more and deep dive, feel free, but if you want to do the bare minimum, that's ok too.", "rating": "Loved!", "workload": "15 hours/week", "author": "ZpWlMPdYevZfautAiRRFbwKIMov2", "difficulty": "Medium", "semester": "Fall 2017", "time": "12/21/17, 2:11 AM"}, {"comment": "This is a very easy class. It's self-paced so if you are able to manage your own self and capable of coming up with stuff to do and do those things you come up with, then you will do well in the class. I think I got 100% on everything. It requires a lot of writing and checking in every week with your TA to let them know how you are progressing. I would recommend this class to only those who are interested in starting a business after they are done with the masters or to those who may be interested in doing PhD after the masters. The reason why is because if you want to start a business, you can get the ground work done in this class - have an app you want to build or software for something related to education (and education is really being used light here) this is the class for you. Have a cool research idea you want to research and maybe do a PhD on, this is the class for you to learn how to go about doing that in the next level and also get some serious research done.", "rating": "Liked", "workload": "5 hours/week", "author": "gXuY1Y5RVFYGCfAPRbsklTb1vTn1", "difficulty": "Very Easy", "semester": "Fall 2017", "time": "12/22/17, 12:57 AM"}], "difficulty": 2.841, "enrolled": 355.0, "id": "CS6460"}, {"rating": 0.0, "workload": 0.0, "withdrew": 0.0, "difficulty": 0.0, "enrolled": 0.0, "id": "CS6465"}, {"rating": 3.954, "workload": 12.337, "withdrew": 90.0, "comments": [{"comment": "Pros: Interesting information. Video lectures are good. Assignments help reinforce the information well.Cons: Class is run by TAs with no presence from the professor. Trick questions in the quiz and tests that focus less on validating understanding than outwitting the student.TAs provided minimal assistance during the class, so understand you will have to figure most everything out by yourself or with class-mate help. Additionally, the guidance on what is a good final project was vague, leading people to lose points on the final because it wasn't hard enough or the right type of project. Proposals for final projects were submitted, but no feedback was ever given on those.", "rating": "Neutral", "workload": "20 hours/week", "author": "dbmwtISlpzbtwmI1PKYpXh0yoEi1", "difficulty": "Very Hard", "semester": "Fall 2018", "time": "12/12/18, 7:50 AM"}, {"comment": "Great for first course. Good python exercise. Easy and less time consuming. Bit more load on midterm project and Final project but assignments and quiz would not take much time. (I start learning python with this course. C/Java experience in the past.)", "rating": "Liked", "workload": "10 hours/week", "author": "m1zybuNAYTQ9PW2z8vMh03MUOMH3", "difficulty": "Easy", "semester": "Fall 2018", "time": "12/19/18, 8:04 AM"}, {"comment": "I found the class very frustrating. Assignments require reading abundant walls of text to avoid missing grading details and grades are deducted for things like upload size being too big (it sure would be nice if Canvas at least had this feature to warn you). The subjective grading overall is my biggest complaint with the course. I wish they would overhaul their approach and make it more rigorous.", "rating": "Disliked", "workload": "10 hours/week", "author": "7gzHaVsYg3YFvSfabEefhDZF1vR2", "difficulty": "Medium", "semester": "Fall 2018", "time": "2/22/19, 12:50 AM"}, {"comment": "(Reviewing for Fall 2018 which isn't available as an option).This was my first course in the program. I came in with a decent knowledge of Python but little formal education in CS. This course was great in helping me get really fluent with NumPy/OpenCV and concepts like convolutions and matrix operations as applied in CS generally.The content is a good intro to image and video analysis and manipulation, but you have to be interested in the subject for it to feel really rewarding. The regular assignments are capped at 90% with the remaining 10% being discretionary \"above and beyond\" points for doing extra work related to the assignment. These assignments vary from interesting to feeling like busy work unrelated to CS at times; there's a lot of text you have to write interpreting your results, and often you have to take your own photos for full \"above and beyond\" points. The 15 hours I listed are more accurate if you aim for all of the above and beyond points, less so if you do not.The midterm and final together make up a significant portion of your grade. The midterm requires you replicate a paper without much guidance; I personally loved it and wished more of the class was like this, but lots of classmates found it both too open-ended and much harder than the regular assignments, so YMMV.The final exam was really bad in some places. It's multiple choice and open book, not using ProctorTrack, so overall it wasn't hard but whoever designed some of the questions is really doing this program a massive disservice. Some of the questions required you interpret the question as \"Does this sentence exist word for word, literally, in the source material?\" rather than \"Is this assertion true?\" So if a source paper says \"cats are felines\" and somewhere else in the paper they say \"felines are mammals\", selecting \"cats are mammals\" as a statement that is true would be marked false and docked points because that exact sentence does not appear in the source text verbatim.Note that Professor Essa isn't involved in the day-to-day at all. There are some courses in this program where the professor participates on Piazza, hosts office hours, and actively works to provide opportunities to students in this program. This isn't one of them and you'll be working with TAs the entire time.Overall I liked it given my personal interests and learned a lot, but I would take this course either as a gentle intro to the program or if you are actually interested in these topic areas, with the above considerations in mind.", "rating": "Liked", "workload": "15 hours/week", "author": "cXDvtbmBXiSPK6kaKfx7437brfw1", "difficulty": "Easy", "semester": "Summer 2018", "time": "2/3/19, 11:31 AM"}, {"comment": "Interesting material and projects. Professor is too focused on grading, you have to work extra hard to get an A and its hard to get.", "rating": "Neutral", "workload": "20 hours/week", "author": "mwFnHPfadaZTNWCx6zAWK0C2aIw1", "difficulty": "Hard", "semester": "Summer 2018", "time": "3/21/19, 10:26 AM"}, {"comment": "This is a good intro class to CP and CV concepts. It can be a bit tedious, with a lot of reports to do, but overall it is alright.", "rating": "Neutral", "workload": "10 hours/week", "author": "8FCBcDgSfQQstEgmliKEkeCHysD3", "difficulty": "Medium", "semester": "Summer 2018", "time": "4/3/19, 3:32 PM"}, {"comment": "Class is all about TAs, no professor interaction. Not an issue, but set expectations accordingly.Good to have some idea of linear algebra and calculus. Not a must, but helpful. Also, Python programming experience, particularly with numpy, will give you big head start. If you are not comfortable with those the optional programming work leading up to your first quiz is a good way to ramp on the Python & numpy piece.In terms of difficulty, my understanding is this class became more difficult starting Fall 2017. As a consequence, instead of being a likely A with relatively low effort it's a likely B. I expect an A, but have done a lot of work to secure as explained next.Of the course's 7 assignments, 6 are setup that you can reach a maximum of 90% following directions. The remaining 10% - referred to as Above & Beyond (A&B) - requires that you do something else of your own invention related to the assignment. TAs will give suggestions or hints, but this is where you can easily spend 90% of your time and learn the most. Meanwhile keep in mind it's only worth 10% of the assignment grade.Midterm was difficult and saw 10-15% of the class drop. Implement a selected research paper. Took me more than ~ 60/hrs to do it. Very interesting work however, the sort of thing you'll probably want to share with prospective employers for instance. Mean average was a high C and counts for 12% of your overall grade. Final Project is expected to be of a similar level of difficultly - excepting you choose your research paper to implement for better or worse.Final exam is a pain. You get two attempts, 2.5 hours per, and will need all of it. And Notebook quizzes are hard. I expect the Notebook quizzes to improve next semester. The Final Exam however is something that's been used for several semesters running so prepare for aggravation there.The Slack channel for the class is very active and was by far the best part of the class. Piazza meanwhile got very noisy with repeat questions.Finally, get a tripod for your phone or camera if you don't have one. You can get a cheap one for ~ $20. Makes a big difference on several of the assignments.", "rating": "Liked", "workload": "15 hours/week", "author": "IyXiVZbU00TI100dEGFikX1Ax6K2", "difficulty": "Hard", "semester": "Spring 2018", "time": "5/1/18, 12:48 AM"}, {"comment": "Interesting material but it's full on, you can't catch a break", "rating": "Neutral", "workload": "15 hours/week", "author": "vm6kQe5kNscw3A9uGufGwgKZoSa2", "difficulty": "Medium", "semester": "Spring 2018", "time": "4/29/18, 9:23 AM"}, {"comment": "This was my first class in the OMSCS program, and I would recommend it to other students as a first class. TA involvement was high throughout the class, and assignments / feedback was given quickly and with clarity. A few elements felt shaky (peer reviews) due to growing pains with switching to Canvas.The grading scheme for most of the glass was to allow between 10-20 'easy' points, and 10-20 'hard' points per assignment. Most of the homework was subject to an Above and Beyond rule limiting the grade to a 90 without extra effort. The best approach to get full credit was to find a research paper related to the assignment and implement. The grading scheme makes a B average fairly straight forward to obtain, but requires significant extra effort throughout the semester for an A. The final exam was full of 'trick' questions and no curve, so it was important to go in with a high average if shooting for an A.", "rating": "Loved!", "workload": "20 hours/week", "author": "Nozafls6WcO7JKbkHsfcql97yWs1", "difficulty": "Medium", "semester": "Spring 2018", "time": "4/29/18, 6:28 PM"}, {"comment": "The class is what you make of it - if you do the bare minimum on each assignment you can get out without too much difficulty, but there is a lot of opportunity to dive deeper into the topics and engage with your classmates and instructors. I liked it a lot.", "rating": "Loved!", "workload": "5 hours/week", "author": "pdQpZcnRPxO2YTfYt9FsKNUPgWe2", "difficulty": "Medium", "semester": "Spring 2018", "time": "4/29/18, 7:48 PM"}, {"comment": "This was my first class in OMSCS and overall I enjoyed it! I am a hobby photographer myself so it was really cool being able to see how photography techniques were implemented on the backend, like panoramas and HDR.Technically, the class was medium difficulty. There were assignments every few weeks, along with a midterm project and final project. There were also a few quizzes and a final test. You'll notice in a lot of the other reviews they mention the \"above and beyond\" aspect of a lot of assignments. The vast majority of assignments were \"above and beyond\", meaning that if you fulfilled all the requirements, the highest grade you could get was a 90%, and the rest of the 10% comes from going above and beyond the original requirements. Getting all of this 10% was pretty tricky. Some assignments, like the midterm and final projects, were not subject to this rule.Because of the A&B rule, it was relatively straight forward to get a B in the class, but difficult to get an A.The class is done mainly using Python and Numpy - would recommend getting familiar with those tools to have an easier time in the class", "rating": "Liked", "workload": "7 hours/week", "author": "yuvHmd3Xp3a3AJFQPXiiy8fwYE82", "difficulty": "Medium", "semester": "Spring 2018", "time": "4/30/18, 9:30 AM"}, {"comment": "I took this course during Spring 2018 and paired it with HCI. This was my first semester in OMSCS. Overall, the course was good. As many mentioned, you can only make a 90% for most assignments without doing Above and Beyond work. This work isn't impossible, but even then you most likely won't get higher than a 95.If you aren't an amazing programmer, I would highly suggest you start on the projects well before they are due. Don't procrastinate. The TA's will not help on the projects in any way. You will run into issues. Start early on everything. Before the midterm project, there is only one assignment that requires any coding at all, so the difficulty jump here is terrible. You need to brush up on your python and numpy skills well before you get to this point.The notebook quizzes are terrible. There is no other way to describe them. They are only worth a tiny portion of your grade, though, so not too big of a problem.The assignments are pretty fun, but you don't code until about 1/3 of the way in as I mentioned before.The final project is student choice. I didn't find this project as hard, but I had also gotten used to Numpy by this time.The final exam is hard, but you get two chances. Study and you will get a good grade.The slack channel is your friend. Seriously. Bookmark this channel. It is incredibly active and is probably the easiest way to get your questions answered. One of the TA's is involved there and he is incredibly helpful. You can also get great ideas for Above and Beyond in this channel.Overall, I liked this course a lot. I definitely recommend it and can easily be paired with a second course if you have the time. Just make sure to get ahead on that midterm.", "rating": "Liked", "workload": "12 hours/week", "author": "q1QF8AWl4QTmx6DdWPkikK687tT2", "difficulty": "Medium", "semester": "Spring 2018", "time": "4/30/18, 10:52 AM"}, {"comment": "This was my first class in the program and a great introduction. The material wasn't particularly difficult, but there is room to go as deep as you like with the above and beyond portion of the assignments. I would recommend getting practice with Numpy if you are not familiar with it. A cheap tripod was very useful for some of the assignments and I borrowed a DSLR for the camera obscura, which would have been much more difficult with a smartphone camera. It was well organized and the assignments were fun. I would recommend taking this course if you have any interest in photography or working with images.", "rating": "Loved!", "workload": "20 hours/week", "author": "43q5GhceopUh1qT0JaHlA2zI0Em1", "difficulty": "Medium", "semester": "Spring 2018", "time": "4/30/18, 5:24 PM"}, {"comment": "This is an interesting elective course that uses primarily Python and OpenCV. There are relevant and cool topics you learn about in the lectures related to how computations/programming have enhanced the photography process. It isn't too math heavy or difficult programming. A good well balance course. Just wish the instructor was more active in Piazza.", "rating": "Liked", "workload": "10 hours/week", "author": "NHUjH7byy7RW2bLTSGQYSpW64ru2", "difficulty": "Medium", "semester": "Spring 2018", "time": "5/1/18, 4:32 PM"}, {"comment": "This class starts slow at first not quite feeling like a CS class, but by the end you're replicating research from the mid 2000's. The final project was choose your own adventure...", "rating": "Liked", "workload": "5 hours/week", "author": "0KfI5r38P3dD4n8Ol138vEtki1F3", "difficulty": "Medium", "semester": "Spring 2018", "time": "5/2/18, 2:04 PM"}, {"comment": "I took this course after Computer Vision. It is not as well organized as CV, and the videos are more annoying than educational, but it's a good course to take if you're interested in photography and manipulating images.The mid-term project could potentially be very difficult if you go in without python & numpy experience. In my case, CV provided the background to make CP only medium difficulty.Tips to get an A:Always try for A&B: The above and beyond grading scheme on the assignments is a strange beast. On one hand, you have absolutely no clue how to get that final 10% of your grade. On the other hand, it encourages you to just try something - just use your wild imagination and creativity - and you are rewarded by the fair and generous grading.The assignments, projects and exams get progressively harder and trickier towards the end of the course, so work hard at the beginning and don't procrastinate.You're generally graded on the quality of the report and not the code, so have fun coding and all, but to get full marks, make sure you answer all the questions and follow all the guidelines in the report. In fact, if your code fails or you run out of time, you can still get a good grade by describing what you did and didn't do.", "rating": "Liked", "workload": "24 hours/week", "author": "6rNkxWOoU0ccahI56nwCtMVkZK22", "difficulty": "Medium", "semester": "Spring 2018", "time": "5/5/18, 12:00 PM"}, {"comment": "A few disclaimers: first, I took this class concurrently with KBAI, and this was my first semester in the OMSCS program so my view on the class has very little reference to other classes in the program; second, I did receive an 'A' in the course, so I'll try to not let that color my opinion of it; finally, reading past reviews indicates to me that this class has undergone a fairly large transformation in the past two semesters, be careful making expectations about the course from older reviews.Now for the review: Overall, the course was interesting and fun, and I feel I learned quite a bit. However, there were a few things that bothered me while I was taking the course, and I wanted to wait until it was 100% over to write them up to give others a fair warning about these aspects of the course:First, the open-note final exam did not feel like a good test of the things I had learned watching the lectures and doing the assignments throughout the semester. Another reviewer mentioned it felt like \"finding a needle in a haystack\", but I wanted to expand on this further. Some of the material on the exam did not come from any of the class material. Most of the exam required finding keywords in PDFs, or a specific sentence mentioned in a lecture. Many of the questions relied on wordplay to attempt to fool the test taker (similar to the lab notebooks).Second, the midterm, which I believe was indeed a fair assessment, should have included the grading rubric when it was released. A number of students wasted a lot of time on a portion of it that ultimately was worth much less than the other portions of the exam. Ultimately I believe this contributed to that assessment being the lowest grade overall for the class project-wise.Third, it appears reviews of the Above and Beyond portion of the assignments were mixed. You really need to attempt to do all of these if you want an 'A' in the course. Personally, I was not really a fan. I thought that while the Above and Beyond sections could produce very excellent work, grading of the sections was too subjective. These Above and Beyond sections count for about 4% of your overall grade, and getting more than half of these points seemed almost unfeasible sometimes. I understand the intention to make the course more fun and produce original pieces of work, but I think more guidelines need to be set for both the students and the graders about what qualifies as an appropriate Above and Beyond.I do not mean to dissuade others from taking this class. I really did enjoy it (doing the final project and seeing others' results was AMAZING, and all of the assignments were very well-made and fun to do). The TA's were extremely knowledgeable, active and helpful. And I've never felt so much pride in the work I've done for a class. Mostly, I just wanted to make the above writeup as a refresher to the reviews from previous semesters.P.S. Buy a tripod for your phone, and start the midterm early.", "rating": "Liked", "workload": "15 hours/week", "author": "bjFWOW0L9mcF5u2qOHZSSn3kpdD3", "difficulty": "Medium", "semester": "Spring 2018", "time": "5/7/18, 1:57 PM"}, {"comment": "Projects take a significant amount of time in comparison to homeworks. Homeworks are \"fine\" and generally don't take too long. Final exam was a bit hard in my opinion, but wasn't weighted heavily enough to matter too much.", "rating": "Liked", "workload": "13 hours/week", "author": "dVJy8yAYI6b5RJ8zT8KzLvI1TG02", "difficulty": "Medium", "semester": "Spring 2018", "time": "5/17/18, 4:00 PM"}, {"comment": "a&b is painfinal exam is trickygrading is subjectivebut the projects are really cool", "rating": "Liked", "workload": "15 hours/week", "author": "BlUwNyJnKhYuRkae25AOq2hqZbo1", "difficulty": "Hard", "semester": "Spring 2018", "time": "5/31/18, 11:23 AM"}, {"comment": "This is my first course in the program. I have some programming experience and I love photography.The course was hard for me. I had to try hard to wrap my head around before producing a code in assignments. I also had to invest a lot of time into it. Nevertheless I loved the experience. It makes you head smoke, but you get a lot of satisfaction when you finally submit at least partially completed assignment. I almost never had time to complete Above and Beyond, hence not hoping for a high grade. I am actually not sure if I even get B in the end.The midterm was brutal. I hardly got 57. Make sure you set aside a lots of time for that. I expect final and exams to be even harder.I liked the fact that we were given two weeks for assignments. It gave at least some breathing room.The course was very well organized. TAs were very helpful and responsive. I love that the course makes me think and create, overcome challenges and grow.", "rating": "Loved!", "workload": "15 hours/week", "author": "zRtjqEnPRcZc4IJrekV2WvCM9se2", "difficulty": "Hard", "semester": "Fall 2017", "time": "11/7/17, 4:01 PM"}, {"comment": "This is my 3rd course in the program and by far the most organized. We didn't hear much at all from the Professor in Piazza or other forums but the TA's had everything under control. I was very impressed by the level of organization. The auto-grader (affectionately known as \"Bonnie\") helped to provide some feedback that was useful with the coding assignment. I think this course was considered one of the easier or less-difficult courses in the past but they adapted the course this Fall term. I'm not sure how difficult it was earlier but I personally feel this course is no joke. Some of the assignments in the middle of the semester caught me off guard and I found myself pulling all-nighters in some cases to get the project done. For me the Blending assignment, while very interesting, was the most difficult. The first two assignments were really good at getting the introductions to the material but about the 3rd project it got real, really fast. If you have some Python experience, an interest in photography, some level of Linear Algebra I would highly recommend this course. As a prerequisite recommendation, I would suggest getting accustomed to Numpy, you'll be using this in nearly every coding project. Also check out some OpenCV tutorials. Otherwise, enjoy computing with pictures. I rated the workload as 20 hours per week largely because of the Above and Beyond portions of the projects. This is a really good approach for a graduate level course, it allows you to dive as deep as you want on the material and there are so many cool things to explore here. I also appreciated how we had 2 weeks per project to enable getting into the material more (than having a single week for a project). Honestly some might be able to get by with 10 or 15 hours per week but if you want to learn this stuff, be prepared to set aside the time.", "rating": "Loved!", "workload": "20 hours/week", "author": "vHtJyFVoXNgJ6aWIyUzmZhXhCkG3", "difficulty": "Hard", "semester": "Fall 2017", "time": "11/7/17, 11:02 PM"}, {"comment": "Subject is interesting with lots of real world usages but teaching methods were the main reason for disliking it. Course videos are pretty average. Assignments ask for too much write up in detail, this led me to lose the interest. There is \"Above and Beyond\" rule for all the assignments and its an irritating one. (If you are an TA reading this, please use challenge question method used in CV and remove this A&B). Mid term project and final project are interesting. Exams are too tricky with words not with knowledge or logic.", "rating": "Disliked", "workload": "20 hours/week", "author": "egBnz4BXYnZ9NnsKjRzk9jKlUnA2", "difficulty": "Medium", "semester": "Fall 2017", "time": "12/13/17, 6:05 AM"}, {"comment": "Overall, I did not have a good experience with this course. While I found the lecture material interesting, I think there is far too much focus on the photography aspect of the course. While the camera obscurra is a neat project, I don't think it has any place here.Professor: While very clearly passionate and knowledgeable about the material, it seems that his involvement ends with the lectures. TAs: Overall seemed dismissive with questions, especially with the midterm research project. They're given the task of teaching the course Grading: The 90% Above and Beyond is the stupidest grading rubric I've ever come across. Projects: While interesting, I don't believe they'll ever benefit me. Test: The test is open book and there are two attempts; this sounds great...but like another reviewer put it, \"turns into a digital scavenger hunt.\" I also found it to be marred by difficult/tricky wording (most likely by someone whose first language is not english) with a majority of the questions being of the delightful format, \"Select all that apply/are correct\". I did not feel that the final exam tested my knowledge of anything that you might take away from the course. Also covers quite a few papers that aren't really discussed during lectures. Time commitment: If I'm combining the time spent working on assignments with the time to watch lectures, then it's about 20 hours, if not counting the lectures it's a bit less than that.Overall: I was thinking about the perception specialization, but this course turned me off to that completely. If this were the first course I've taken in the program, I'd likely question why I was bothering at all. I regret taking this course, and in the future I hope to avoid all those involved in its creation.", "rating": "Strongly Disliked", "workload": "20 hours/week", "author": "ZpnybMKuegPeGIMe5TeMy7kXQuF3", "difficulty": "Hard", "semester": "Fall 2017", "time": "12/13/17, 9:08 AM"}, {"comment": "This is my first course, and i loved it. the lectures were very clear and precise and give you the understanding of material easily. the assignments were not that tough as the initial template code gives you lot of hints to complete the assignment(which i think should not be the case, as it takes away lot of learning). there is amble of time to complete the assignments and for most we had two weeks to complete, we had totally 6 assignments this semester, be warned that, only 40 - 50% mark for coding and the other 40 - 50% is for report in which you have to answer lot of questions and contemplate on your understanding and your work on that assignment. Assignments also had a concept called Above & Beyond, i never tried A&B, you have to do something extract other than required on that assignment topic to receive A&B which counts for 10 mark. we also had a mid term project which is the replication of an published paper, this was the most difficult assignment of all to me, but if you spend enough time it will be an easy A. we had two attempts at the exam, and exam is easy one but really tricky one, as there are multiple choice questions, if wrong answer selected negative marking is given. choose your final project when you reach mid term itself and start working on it, as much as possible choose an easy topic as you have the liberty to choose the topic.Over All this class is very good class.", "rating": "Liked", "workload": "10 hours/week", "author": "4kgRTfcf86YHj6G70F4t67ABaQs1", "difficulty": "Medium", "semester": "Fall 2017", "time": "12/14/17, 3:21 AM"}, {"comment": "This class is not terribly hard mathematically/conceptually, but the assignments can be very time consuming and are not always well-designed. Still, I overall found the course to be well-taught and a solid introduction to computational image processing with OpenCV.", "rating": "Liked", "workload": "15 hours/week", "author": "zrbRklzp74ZdjXXqi32cYaP8ik22", "difficulty": "Medium", "semester": "Fall 2017", "time": "12/14/17, 11:20 PM"}, {"comment": "This semester saw a reworking of the course projects, with a reduction in the amount from something like 11 down to 7, with an added new midterm project. The first run of this midterm project I feel did not provide sufficient time or feedback, which will hopefully be improved on in the future. Make sure you get started on it as soon as it is released. There is an 'artsy' component to this class, where you have to deal with taking good pictures and then talking about how you took them well in the reports. Personally, I didn't like the subjectivity of it. The most disheartening aspect of this course is that you must make up something to get more than 90% on any given assignment. What must you make up, you ask? That's a good question, as I am done with the course and still haven't figured it out. The final exam was open book with two attempts, however it doesn't test that you actually know something. It's more of a needle in haystack search where you have to 'select all correct choices'. TAs were quite helpful throughout. Video lectures were pretty high level and didn't get into the meat of the algorithms, which made them relatively poor in my opinion. If you are doing the Computational Perception specialization, you have no choice but to take this. If you have decided on any other specialization, just take Computer Vision and you would have covered a large majority of this course, with a much greater depth of understanding of the math and algorithms as well. You will learn more in depth, you won't have to make up things to get a solid A on any given assignment, and you can avoid the subjective artsy experience if that's not your thing.", "rating": "Disliked", "workload": "15 hours/week", "author": "Ye7BJ6bo4yZMDWpfHD1hejlmnOz2", "difficulty": "Medium", "semester": "Fall 2017", "time": "12/15/17, 2:29 PM"}, {"comment": "This was my 6th class. I was somewhat prepared to take this class. I took this class purely out of my interest and for fun. Experience in KBAI from last summer helped me wee little. Looking back, I should have taken CP class before KBAI. exam. My only criticism, is this class seems to bite more than we can chew at times, lectures are over-packed and at times. Video lectures sometimes become too much \"illustrative\", and some of the useful details seem to get left out, when the lectures say this is just for the illustrative purposes. And because of this, you might understand how something works, but might not always understand why something works. I loved the idea of Above and Beyond (A&B) in the assignment, it did seem to align well with the spirits of the masters' degree. If you are planning to go with CP&R specialization, definitely take CP before CV. I am coming from 6+ yrs of professional C# and .NET experience, but regardless, I definitely would recommend some good practice with Python, NumPy and OpenCV, bring down your workload. The assignments are not that hard, but they might seem challenging at times. I found the midterm project (Seam Carving) challenging. The class let's you pick your own final project, so you can truly make the most out of this class. Final exam was neither too hard nor too easy. Do read the question twice, in the final test. I expect them to lower the velocity. I did not always appreciate when the videos ignore some of the necessary details. Overall, stay consistent, do the the exercises, spend time reading the white papers. Take the time to read the white papers. there are a TON OF WHITE PAPERS TO READ, which might seem overwhelming, but do not forget you are a graduate student, at Georgia Tech. Fun fact: in the Udacity video lectures, the processor utters the word \"of course\" 1395 times.", "rating": "Loved!", "workload": "18 hours/week", "author": "2qaalelWkQdFWjoE1x5uUiGkzv52", "difficulty": "Medium", "semester": "Fall 2017", "time": "12/15/17, 7:57 PM"}, {"comment": "Good course. Interesting topic. Cover a lot of material. Assignments ramp up pretty quick, but lots of online resources to help get through them. Midterm project was replicating a research paper and took considerable amount of time. Final project is open-ended and up to the student, which was cool. The final exam wasn't necessarily hard (open note and can take two times) but some of the questions are tricky and poorly worded. Overall I would recommend the course (especially if you are interested in photography/computer vision), but encourage students to not let themselves fall behind.", "rating": "Liked", "workload": "10 hours/week", "author": "T5dY5wNKSwYSnfsW6t0DHjZEnVC2", "difficulty": "Hard", "semester": "Fall 2017", "time": "5/4/18, 9:09 AM"}, {"comment": "This class had a great mix of coding, application of theory/concepts, and hands on work such as taking your own pictures to use for the assignments. One of the best projects was related to seam carving, where we were simply given a paper and asked to replicated several of the images within it. Used python/numpy/opencv. Not as hard as CV.", "rating": "Liked", "workload": "15 hours/week", "author": "mfln3ZRwSRVDeTjy49AA3Ombe3i1", "difficulty": "Medium", "semester": "Fall 2017", "time": "8/6/18, 2:27 PM"}, {"comment": "Have fun computing with photographs! The projects are neat, you basically create your own photoshop lite over the course of the semester. I'd recommend spending some time getting to know numpy and vectorization before taking.", "rating": "Loved!", "workload": "15 hours/week", "author": "KCfFLF4MYXOiFUgBw96q5ZoP6Ew1", "difficulty": "Medium", "semester": "Fall 2017", "time": "11/29/18, 11:34 PM"}, {"comment": "The contents of this class are really fun and mind blowing. Assignments are organized and most recently seems to push students to write code and reports well. Be aware that this is not an easy class at all! Reviews seem to be outliers from past semesters. One thing that makes it hard is the pace the assignments are released / delivered throughout the course, every week. With the A&B concept it makes really hard to get 100%. I myself went A&B a few times only. Not easy to get an A and with a lot of work I got a B.", "rating": "Liked", "workload": "25 hours/week", "author": "google:115573878119130158296", "difficulty": "Hard", "semester": "Spring 2017", "time": "5/2/17, 12:01 PM"}, {"comment": "In general, I really liked this course. The content was interesting, and the homework assignments were a lot of fun.Unfortunately, it was certainly not perfect. Each homework assignment focused on a different computation technique or aspect of photography, and the coding/interactive portions were a blast. However, along with each assignment, we had to complete a lengthy PowerPoint report. The report templates contained many relevant questions and topics to respond to, but there were also numerous \"busy-work\" questions as well, and we had to go into great detail for each question in order to get full points.On the topic of \"full points, \" the grading policy was the worst part of the course. By completing all requirements in a single homework assignment, the max possible score was a 90/100. In order to get any portion of the last 10%, we had to go \"above and beyond. \" The requirement for this was extremely subjective, so maybe this was a decent idea in theory, but it didn't work very well in my experience with the class. In addition to this, the grading/late policy just generally had no flexibility, and it punished all students equally, regardless of whether they were truly lazy/incompetent or just busy with another work/life issue, which is likely more common with OMSCS students compared to on-campus students. Perhaps it was fair in a way - it just seemed overly harsh to me.ALL that being said, the course was a ton of fun, and it was a great way to brush up on Python/numpy skills. It was somewhat more time-consuming than I anticipated due to the long reports required for each assignment, but it was generally easy overall, in my opinion.If you're at all interested in photography or image computation/manipulation, give this course a shot. Hopefully the grading policy will get an overhaul at some point, but it's definitely manageable if you put in some extra effort. I imagine it will provide a good head start for the CV course, but I have not taken that... yet!", "rating": "Liked", "workload": "10 hours/week", "author": "vfBawONILeYqh4y4Hr8hSSIPq722", "difficulty": "Easy", "semester": "Spring 2017", "time": "5/2/17, 1:54 PM"}, {"comment": "Course is easy and fun.I took CV before so it may be slightly biased from me to think the course was fairly easy. Really, only the HDR assignment proved to be any challenge. Some of the assignments I did learn a bit from, including the previous mentioned HDR assignment, panoramas, and implementing my own Canny Edge detector.Buyer beware though, many of the assignments during the course I felt were useless and a waste of time (1 / 5 / 10). These assignments were almost like high school science experiments (set up a dark room in your house and take a picture! comment on a picture you took! run a piece of software which does everything for you to make a point cloud!). I'm glad they are taking the summer off to redo the course content. It has a lot of potential as long as it gets rid of the wasteful assignments.Also, pacing in the course is way too fast. Most assignments are a week only where two weeks is more of the OMSCS norm.", "rating": "Liked", "workload": "10 hours/week", "author": "j1x4pX8V1RPnwhXSekorSKpl75d2", "difficulty": "Easy", "semester": "Spring 2017", "time": "5/8/17, 2:50 AM"}, {"comment": "A really fun course. I personally learned a lot and thought the assignments were very enjoyable. The class was also really well organized (the TAs are very responsive both to questions and to feedback, I found very few issues in the assignments, grading wasn't exceptionally fast but still a lot better than in the other class I was taking etc. ).Note that most of the assignments require taking your own pictures, which some people might find a waste of time if they're only interested in the \"computational\" aspect of CP. Personally I thought that on the contrary learning about photography is obviously an essential part of mastering Computational Photography, which is also why I enjoyed the \"Camera Obscura\" homework that some people have criticized below.The \"mandatory\" part of the assignments is pretty easy (I recommend learning about advanced indexing in numpy, which makes most of the coding trivial), but it only counts for 90% of your grade on the assignment. The remaining 10% is \"Above & Beyond\", which I find very motivating in terms of expanding your learning, and it can be pretty hard to get a full 100% on an assignment. Because that was what I aimed for, my workload was fairly high and the course was of Medium difficulty for me instead of Easy. If you just do the bare minimum, the course might qualify as Easy, but your odds of getting an A will be much lower.I haven't taken CV but it is clear that there is some overlap, so if you've taken CV you will probably have an easier time in CP.", "rating": "Loved!", "workload": "25 hours/week", "author": "S04P65QidHbnrvaC3qST5HpRjxh1", "difficulty": "Medium", "semester": "Spring 2017", "time": "5/9/17, 10:31 AM"}, {"comment": "Interesting course but hard to absorb all the material in a meaningful way given the pace. There is an assignment due almost every week and the lectures take a long time to watch and understand. Very good notes on the lectures are needed to do well on the final which had a lot of ambiguity and almost trick questions.", "rating": "Liked", "workload": "12 hours/week", "author": "1Bs0pIKYSqXs4djrboFBY9ZEzPX2", "difficulty": "Medium", "semester": "Spring 2017", "time": "5/12/17, 2:59 PM"}, {"comment": "This is a very time consuming course contrary to what previous semester reviews say. Course material is taught clearly by the professors so understanding the material is not a challenge. You will want to review the material thoroughly as the final really gets into the details from lecture. There are a tremendous amount of interesting topics to learn even if you don't take photographs often.You should expect to spend significant hours on the class if you want to master the assignments. I was not able to do all of the readings even spending 30 hours. If you only want to pass the class with a C or B then the 10 hour estimates are correct. First two weeks of class is only about 5 hours but it ramps up quickly.If you are aiming for an A the majority of your time will be spent on above and beyond (independent research) and writeups. Expect about 2-3 hours a week on lecture (take notes while watching!), 5 hours on coding for complex base parts of assignments, 3-5 hours on writeup for base assignment, and the remaining time on independent research (both coding and writeups). Also a variable amount of time on taking your own photographs depending on the project.The course will be undergoing a revision this fall so hopefully the workload comes down. Also a more flexible grading rubric (or more points allotted to overall quality of explanations) could further differentiate students who put effort into the assignments vs those who did not. I really enjoyed the class and highly recommend it.", "rating": "Loved!", "workload": "25 hours/week", "author": "dI2xZ5pYZzePqM5FYOPZqEK21CH3", "difficulty": "Medium", "semester": "Spring 2017", "time": "5/12/17, 11:02 PM"}, {"comment": "This is the type of course that I like to call an easy B but a hard A. If you're coming in with some knowledge of Python and Linear Algebra, then I would say you can put it in 10 hours per week, get most of the knowledge out of the class, and walk away with a solid B. But if you're really going for an A, then you'll find the class taking up a lot more time. The grading structure is designed such that each homework assignment has an \"Above and Beyond\" section that counts for 10%, so to get anything higher than a 90, you'll need to develop something beyond the basic requirements of the assignment. Personally I enjoyed this a lot, but it's clear that a lot of others didn't.This class is being redesigned over the Summer, so I don't know if any of this will hold true in the Fall though. Overall I had a great time, but for the future I hope the instructors make the writeups shorter and the coding more challenging.Edit: Also definitely do the readings! They are absolutely fascinating! But don't worry about fully understanding all of the math for each reading - you just need to get the gist of them.", "rating": "Liked", "workload": "20 hours/week", "author": "wG43JPzFdOZVA8cTOHYtLYy5AcF2", "difficulty": "Medium", "semester": "Spring 2017", "time": "5/13/17, 11:07 AM"}, {"comment": "This class covers a ton of material. The pace is such that an assignment was due every week, which was grueling at times. For me, this also meant that I was unable to fully absorb lots of the concepts. The lectures are just \"ok\" in my opinion. In many sections the math is glossed over, which was a bit disappointing.The \"Above and Beyond\" portion of the grading seemed rather arbitrary and subjective to me. For one assignment, I didn't even attempt the extra 10% and inexplicably got a 94 on the assignment. On the other hand, there were other assignments that I put 8-10 extra hours in and only received 1 or 2 points. Overall the process was extremely variable. Lots of it seemed like it depended on the TA you got and what mood he or she was in that day.My biggest beef with this class was the final exam. This was unproctored and open-everything. This sounds great, but in practice it meant a bunch of questions with tricky wording. Even that wouldn't have been bad, but tricky questions were combined with poorly worded questions, making it hard to determine a question's intent. The final basically devolved into a digital scavenger hunt. I don't think it measured my knowledge of the material at all-- just how well I could use Ctrl+F.Overall this was a decent course. The homework is interesting and can be time consuming, so possibly try to take it on it's own.", "rating": "Neutral", "workload": "20 hours/week", "author": "google:115362308586859076259", "difficulty": "Medium", "semester": "Spring 2017", "time": "5/14/17, 9:07 PM"}, {"comment": "This was a very interesting class with responsive and fair TAs. There was a project every week which included a Python coding portion and PowerPoint presentation that you submit as a PDF. At the end of the course was a final exam and final project which were both time consuming but rewarding. The only thing I didn't like about this course was building the Camera Obscura. The quality of your results depended on how crafty you were, but it was still interesting to turn a room into a camera. If you are interested in computer vision or photography and enjoy applying computation to art, I would definitely recommend this class.", "rating": "Loved!", "workload": "12 hours/week", "author": "dUn1x6vYjFTdGjFO4avFwmwUzPf2", "difficulty": "Medium", "semester": "Spring 2017", "time": "5/17/17, 8:37 PM"}], "difficulty": 2.895, "enrolled": 493.0, "id": "CS6475"}, {"rating": 4.419, "workload": 20.598, "withdrew": 147.0, "comments": [{"comment": "TLDR: Great class where you\u2019ll learn a lot, but you\u2019ll be putting in a LOT of time too. Helps to walk into the class as a numpy ninja (in python) with a good grasp of linear algebra.The number of lectures alone are pretty significant, but they\u2019re not all necessary for completing the problem sets. A lot of the theory will probably sink in better with a good understanding of linear algebra, so preparing with Khan Academy or some other source might be beneficial if you have the time before the course starts.For perspective, my undergrad was Electrical Engineering five years ago, I had no exposure to numpy, little exposure to python, never messed with docker, and never did an undergrad class exclusively on linear algebra. This was my fourth class and was far more challenging than the prior 3. Having said all that, this class is still doable. I struggled, but got a B. If you are a recent CS undergrad with good knowledge of python, numpy, docker, and linear algebra, then you\u2019ll probably have an easier time. Taking this course after Computational Photography also seems to be a good sequence. I didn't do that myself, but people in the class who did already seemed familiar with a decent number of the concepts we covered.Problem sets comprise the majority of the grade and can take a significant amount of time too. Each one is 15% and there are 5 total (6 if you count the 5% starter one). The pace for the Fall semester was a relentless pattern of two weeks for each problem set. Prior to the real problem sets starting you\u2019ll do one that counts for 5% and basically just ensures your environment works and you have some familiarity with basic concepts. Ideally work out all of your environment issues during this low-threat problem set. Last thing you want is to be stressing about your environment when you want to be focusing on problem set problems. This semester used a docker environment, so getting some familiarity with docker in advance would probably be beneficial. Alternatively you\u2019ll probably have classmates familiar with docker who will be helpful on piazza. Python and Numpy are used extensively in the problem sets, so doing some kind of tutorials on numpy usage in python in advance would be beneficial.Final project and final exam are each 15%. You choose one of 5 possible projects. I did the one that intersected with convolutional neural networks. I knew nothing about CNN\u2019s going into it, but learned a lot along the way. If you are interested in doing a machine learning heavy project then I\u2019d recommend becoming familiar with libraries like tensorflow as well as cloud environments like AWS, Google Cloud, and/or Floydhub. The projects are fairly open ended, so they\u2019ll force you to learn a lot about a more cutting edge Computer Vision research area. After 5 problem sets you\u2019ll be used to allocating a lot of time to this class, so just expect the time commitments to this class to stay constant or increase when you start the project. For the test, this is where you will probably need to go back and gain some familiarity with the lectures you may have missed. Still, it is in a fairly forgiving format, so it is a lower threat gauge of your familiarity with the topics. You can get a B without knowing all the topics inside out.Overall I would recommend taking this class because you will learn a lot about this interesting topic, but be prepared to commit a lot of time to it.", "rating": "Liked", "workload": "25 hours/week", "author": "H4GMuXJuDiTQ5Kj35lb1MS4nzRJ3", "difficulty": "Very Hard", "semester": "Fall 2018", "time": "12/13/18, 7:50 PM"}, {"comment": "This was my first OMSCS class. It was overwhelming at the beginning. But you gradually start getting used to it. It was an extremely fun class. The assignments were well structured. It helped gettings concepts clear. The project was time-consuming but depends on the one that you select. Do not combine this with other class if you have a very tight schedule. It normally demands around 20 hours per week.", "rating": "Loved!", "workload": "22 hours/week", "author": "ZYP441Xf8VfBS6U99hvawqLySDI2", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/14/18, 9:33 PM"}, {"comment": "Recommend familiarity with Python and numpy. Computational Photography is a good precursor to this class including some project work that is almost identical between the two for one of the assignments. A good class if you find imaging at all interesting. Touches upon several machine learning areas as well.", "rating": "Liked", "workload": "20 hours/week", "author": "IyXiVZbU00TI100dEGFikX1Ax6K2", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/18/18, 4:06 PM"}, {"comment": "The projects were great and a lot of fun. Be prepared to do a lot of work, but not coding work mind you-- tuning work. You are told from the beginning that the algorithms are not all that great at solving the problem and you'll have to abuse your knowledge of the problem domain to tweak every parameter just right to get any kind of satisfactory results at all. It can be annoying, but you'll wind up with a tremendous sense of accomplishment when you're done.As an EE major, the lectures were too hand-wavy. It would have been nice to get into the nitty gritty detail of the math behind the algorithms, but I suppose there's only so much information you can pack into lectures and still cover all the material. As others have said here, the slack group is mandatory, since piazza is kind of a wasteland of pointless questions. Regardless, the slack group was ever present to answer questions almost any time day or night.Bottom line: You will have to invest a lot of time and it ain't a cakewalk by any stretch. You will however learn a great deal and you'll be happy you took the course.", "rating": "Loved!", "workload": "25 hours/week", "author": "jJvLgDtSDGbZYKSbAkcJLDmLKmk1", "difficulty": "Hard", "semester": "Fall 2018", "time": "1/30/19, 6:18 PM"}, {"comment": "This is one of the toughest courses in OMSCS, but very rewarding. But you are at GaTech, so it's not going to be a stroll in the park!This course gives a good taste of the toughness that you're going to expect in some of the other courses (at least in the ML specialization). Not to scare folks, but towards the end of the course, it was literally soul-wrenching for me as remarked by one of my fellow students in the Slack channel.If you want to have a life when taking this course:Go through all the udacity lectures beforehand if possibleRefreshen up your probability, linear algebra, calculus (really important)Get some idea of deep learning (TF/PyTorch/Keras) if you plan to do CNN based image detection for the final project.Start the projects first and then try to chip in time to finish the lectures. If you haven't accomplished the first point, don't plan to complete all the lectures before you start the projects. You'll be in trouble.The fellow students are the actual drivers of the class. The instructor for this class as mentioned on Buzzport was almost never around on Piazza, but frankly, that was not a dampener for me as we had a very active Piazza and Slack group. TAs managed the class well.As also mentioned in some of the other reviews, this class is more about classical CV and not the new DL based technologies that are prevalent these days. This fact should not be a hindrance to opt for this class. There are certain things that classical CV can still do better than the new DL approaches. Having a good introduction in classical CV would, in fact, be a plus when you start working with new DL based approaches.The projects were interesting and a good learning experience. Be warned that your solutions may not work in your first implementation itself. You would be required to do a lot of fine tuning to get your solutions working perfectly.I fared poorly in one of the projects. In addition to that, having no prior experience in CNN I opted for it in my final project. It was a struggle towards the end and I thought I would be getting a C. However, the final project grading seemed to be lenient and that saved my day. I managed to get a mid B.It was all worth it in the end.", "rating": "Liked", "workload": "40 hours/week", "author": "imX0E0Z9LjOu8srTd47cwwPFf9A2", "difficulty": "Very Hard", "semester": "Fall 2018", "time": "3/26/19, 11:40 PM"}, {"comment": "This is for Fall 2018. I'll update it when the dropdown works. :)This class is a fast burn and doesn't let up. It's worthwhile in the breadth of topics it tries to convey, but there isn't enough time spent to get a good understanding beyond -- ok, it's implemented and now I have to twiddle a bunch of dials to get the project working and... oof, on to the next one.Lots of projects, lots of topics.The lectures are really good. The math is important and applied well (Linear Algebra, some Taylor Series, some Fourier Series, some Probability).Definitely a graduate-scope class.The final was a little disappointing (m/c) and the automated code grader was a little restrictive, but it was definitely a full plate or two from the gamut of the CV buffet from 5-10 years ago. Necessary if you want to do any image processing or CV work or modern machine learning. Still not the state-of-the-art.", "rating": "Liked", "workload": "24 hours/week", "author": "9nURtxBwQmQcirh7ZvK4bBvyQn22", "difficulty": "Very Hard", "semester": "Summer 2018", "time": "12/11/18, 4:42 PM"}, {"comment": "Took this as my first course in OMS. I had almost zero experience in CV, but had a lot of experience in python and numpy. There are a LOT of lectures. LOT of content to cover. The lectures were done by Prof. Bobick (who is no longer with GaTech), he makes the content interesting it by explaining concepts clearly and breaking difficult concepts into small, simple and easily digestible chunks of information.There are 6 assignments, 1 final project and 1 exam (worth 15% of your grade). The assignments do a good job of covering all the important and interesting concepts of the course. Some assignments are difficult in the sense that - you can get it \"working\" relatively well, but to get the output they expect you'd have spend A LOT (extra emphasis on lot) of time parameter tuning. The exam was open-book, but don't let that fool you! you still need to have a good grasp of a pretty much the entire syllabus to do well in the exam!The final project requirements are not straightforward. There is a lot of emphases was placed on your report - you had to read papers and follow strict requirements for each project topic.The TAs were helpful in Piazza in the beginning, but the activity kinda fell off after the first few assignments IMHO. Prof did not interact with the class via Piazza during my term. The Slack group was a godsend. Discussions on slack with other students was what helped me through the assignments.Overall, it's an interesting course. CV is a very widely-applicable subject and I suggest if you are planning on having a career or doing research in ML or similar fields, do take this subject!", "rating": "Liked", "workload": "25 hours/week", "author": "AuPkmUYH5oZimXMWRqoZOibVeoh1", "difficulty": "Hard", "semester": "Spring 2018", "time": "4/30/18, 4:23 PM"}, {"comment": "This course was terrible, please just take a course on Coursera instead.Pros:Valuable hands on experience with Numpy and OpenCV.The lack of TA support meant I met a lot of cool people via Slack.The course material has been refined over many semesters.You get to choose between several topics for the massive final projectCons:Prof Irfan is a joke (i.e. no interaction from the professor at all).The projects are absurdly difficult; the TAs are useless and do not answer questions.There are 40 hours of lecture videos. They could easily have condensed the content to 10 hours. There is so much irrelevant content that they waste your time with.The rubrics for each project are HIDDEN from you; you will be graded by that rubric and lose points.At the end of the day, the topics you get from this course are not very useful. Just buy a book on CV and read it.", "rating": "Strongly Disliked", "workload": "20 hours/week", "author": "MgirjMhS5SYLw73NHeMqufPAhrN2", "difficulty": "Hard", "semester": "Spring 2018", "time": "5/6/18, 10:23 PM"}, {"comment": "This was a challenging course, and a time-consuming one. I still generally liked it, however, since I ended up learning a lot.DislikesLots of lectures, not all are really great. They could have better explanations.Some homework felt like parameter-tuning busywork.Usual gripes with unengaged professor and hit-or-miss TAs. YMMV on the TAs.Final project is potentially HARD, depending on what you choose. Over this period of time I spent around 120 hours on it over 2.5 weeks, on top of working full time, and still did not end up with a product I was very proud of.LikesConcepts were really fun. Useful for applications from robotics to search to AR, etc...We did learn a lot.Final project option included convolutional neural networks, which are close to the state of the art in the field. Most grad classes start with \"historically important\" primitive concepts that are then built up into larger, better systems, and never get to the true state of the art in the field. It was awesome to have the option to learn about these a bit.Bottom Line Hard class, big time commitment, learned a lot, would still take again.", "rating": "Liked", "workload": "20 hours/week", "author": "IIUsjzHHXOPp97SAuYPEXDLUpMo2", "difficulty": "Hard", "semester": "Spring 2018", "time": "5/7/18, 9:55 AM"}, {"comment": "Challenging & fun course. Great material. Course management: not great but not terrible.OverallThis was my first semester in OMSCS. And my first college course in 20 or so years. I found the lectures pretty engaging overall. I had no experience with CV, no linear algebra since HS, limited experience with Python, numpy, Tensorflow, and Keras, so I learned a lot in this course. The problem sets were challenging. The specifications could have been clearer. I really struggled with the second problem set and wondered if I was cut out for the class. Then I discovered the Slack channel. Saved my life. Seeing how others approached the problem sets (and how they interpreted the sometimes vague, sometimes incorrect assignments) helped me not get too far into the weeds.Problem setsA lot of the problem sets, at the heart of it, were translating formulas (and occasional algorithm flowcharts) to Python. Sometimes I understood the fundamentals, sometimes it was straight up transcription.Course Management & PiazzaPiazza was pretty much a dumpster fire. Hard to believe anyone would choose it as a tool. TAs were occasionally helpful, often terse. Lots of questions went unanswered. Trying to navigate Piazza made it not worth trying to get help. Prof. Essa was in absentia until the very end when people got upset. He was also disingenuous by suggesting he told TAs not to reply so students would help each other out. I'd have believed that if it wasn't offered as a post-hoc excuse.Final projectThe final project (I chose the CNN one) was very challenging. I learned a crap ton, even though my results were pretty much worthless. I thought I might have tanked it but ended up getting 100%. Probably because I documented it well in the paper. And because I did a lot of research up front and tried to base my approach on current research.ExamExam was challenging but not terrible. Open book. Which was helpful. I spent a good half-day reviewing the lecture transcripts (helpfully put together by a fellow Slacker) and the lecture slides. Lots of ctrl-f of course. Managed to eke out a B on the final and a high B for the course. That included slacking for a week of vacation and getting a 61% on one of the problem sets.AdviceMake sure your linear algebra and calculus fundamentals are strong. It will help you truly understand the material.Make sure you have a pretty solid basis for numpy, especially how slicing and reshaping and such works. Lean on numpy vs. for loops.Spend a few hours at the start of the course getting a high level view of the history and current topics in CV.note: my workload is based on actual measurements. I spent 171 hours on this course total including administrative work like registration, watching lectures, reading research papers, problem sets, peer review, final project, exam, time on Slack", "rating": "Liked", "workload": "11 hours/week", "author": "1HjSVuIAosW0lag6joExCL5cRas1", "difficulty": "Hard", "semester": "Spring 2018", "time": "5/7/18, 10:12 AM"}], "difficulty": 4.039, "enrolled": 456.0, "id": "CS6476"}, {"rating": 2.977, "workload": 22.571, "withdrew": 415.0, "comments": [{"comment": "This is CS, not programming, which means it's taught like a math course. If you've ever taken a math class at the undergraduate level (something above calculus/any rigorous, proof-based course past middle-school geometry), you'll be fine. Get familiar with asymptotic notation and pseudocode syntax, and you'll be just fine.I have no formal CS background. I took one programming class in college, didn't like it, and majored in math. Later, I learned VBA for consulting, picked up some Java, and got myself a Dev position. And this is my first OMSCS class. But because I've taken math courses before, I've averaged 14/15 on the first four exams.For those unfamiliar with how math classes are taught in universities, here's how they go: Claim: If [conditions], then [result] Proof: Suppose [blah]. Then [... ]. Therefore, the claim is true. Moving on, New Claim: [Stuff] Proof: [Other stuff] etc. You'll get few examples per big concept, which means one or two per lecture. Expect to do most of the puzzling through the implications on your own, though the (ungraded) homeworks help put you in the right mindset and give you practice.If you've never taken a math class at the university level, you're going to start out at a loss. Prep. Learn the difference between an intuitive argument (It works for these three examples, so I'm pretty sure it should always work. Besides, it just makes sense, you know?) and a rigorous one (For all objects in this category, equipped with these attributes and arrows, the following holds: [Stuff]. Therefore, in all cases, [other stuff]). Learn induction, contradiction, infinite summation, and whatever else strikes your fancy.Yes, the administrative decisions are capricious and inscrutable, the lectures have flaws, and the Piazza will be devoted to commiseration and scarce on productive advice. There are problems here. But with a little preparation, you'll be just fine.", "rating": "Loved!", "workload": "13 hours/week", "author": "DH8uzIKaclWKUDzx4ddvo2wz2RV2", "difficulty": "Medium", "semester": "Spring 2017", "time": "8/8/17, 1:57 PM"}, {"comment": "This class was one of the most challenging, yet rewarding classes I\u2019ve ever taken. I took an automata & complexity class in undergrad, but taking this class gave me a much greater appreciation for algorithms and the theory of computing. Despite its storied history and monstrous reputation, this class seems to have improved to the point of being one of the best classes in the program (I\u2019ve taken 9 so far), so it\u2019s a shame that it\u2019s being replaced \u2013 hopefully Graduate Algorithms will be just as successful as this has been the past couple of semesters. This class was divided into three sections: algorithms (9 weeks, 3 exams), computability (3 weeks, 1 exam), complexity (3 weeks, 1 exam)Some of the bad things were still there: the Udacity videos were largely useless; I dreaded having to watch these, and was thankful for the weeks that the instructor posted new videos on YouTube that aligned more with GA. I was also able to understand material much better by just reading Sipser and CLRS and watching MIT\u2019s OpenCourseware and UC Davis\u2019 equivalents of the material. Having problem sets assigned solely as preparation for the five exams (each worth 20%) was great. We could propose solutions on Piazza and have TA\u2019s or the instructor Chris Pryby (who were fantastic, btw) respond and give us hints and feedback. Tests were difficult, but fair, and there were opportunities to make up for some lost points on previous exams. No doubt the material is hard and might take some students a few semesters to get an A or B (particularly ones that have never seen the material before), but this is one class that I would recommend to anyone seeking a Master\u2019s degree in this program.", "rating": "Loved!", "workload": "17 hours/week", "author": "github:89236565/3/17, 5:37 P", "difficulty": "Very Hard", "semester": "Spring 2017", "time": "M"}, {"comment": "A rich course. The instructor Chris Prypy cares about the students, which makes all the differences. The best way to prepare the exams is to study the problem sets.", "rating": "Loved!", "workload": "5 hours/week", "author": "M4ursXToYMXd0Q9VPZNHaKHVhGM2", "difficulty": "Very Hard", "semester": "Spring 2017", "time": "5/9/17, 5:39 PM"}, {"comment": "You will be on fire and in hell unless you have studied it before. But at the end, it is the most rewarding course of this program, for me.Grades statistics for spring 2017: A: 25% B: 60% C: 11% D: 1% F: 3%Don't know how many dropped before midterm, but might be a lot as before.", "rating": "Loved!", "workload": "50 hours/week", "author": "pJ83AckGM3WpM69vjYxyC9Huufv1", "difficulty": "Very Hard", "semester": "Spring 2017", "time": "5/10/17, 3:02 PM"}, {"comment": "", "rating": "Strongly Disliked", "workload": "20 hours/week", "author": "fzyYqwGaqqO7BOKQnOUhptx8yZj1", "difficulty": "Very Hard", "semester": "Spring 2017", "time": "5/10/17, 10:41 PM"}, {"comment": "This was my first attempt at 6505. I actually signed up for the new Graduate Algorithm course which did not start. I have passed with a B and feel proud of myself for having made it through. It was by far the toughest course among the 6 courses in my last 4 semesters. I would not say it was Maths heavy but it does require brushing up some basics and keeping them handy for proofs/calculations throughout the course. Prof. Pryby's youtube video lectures helped a lot during the initial part of the course. Video lectures on Udacity were dreadful. As the course progressed, I got a hang of things. Like others have stated, working on problem sets helped prepare for the exams. No matter how hard I prepared for all the 5 exams, I never felt confident before, after and during the exam, infact I always felt like I was going to fail. I somehow maintained 9s and 10s out of 15 throughout, which got me a B towards the end. It took me 4 tests to finally get a 5/5 on a question. I have to say that there were several moments where I felt like giving up, but I held on. I remember looking at the sample problem sets and exam questions before the course started; absolutely nothing made any sense. Just like everyone else, I too have learned a lot but at the same time I feel like there is so much I still don't know :)", "rating": "Liked", "workload": "40 hours/week", "author": "GahfwmhB5iXo5AEPCMmw8wFIWgL2", "difficulty": "Very Hard", "semester": "Spring 2017", "time": "5/15/17, 12:14 PM"}, {"comment": "Fun class. Exams can be a bit tricky. Teaching staff was very involved and helpful. I learned a lot.", "rating": "Liked", "workload": "15 hours/week", "author": "0382db7e-8d63-4513-ac6e-e457", "difficulty": "Hard", "semester": "Spring 2017", "time": "3428de8e5/16/17, 4:14 AM"}, {"comment": "This class was fun! I had a LOT of fun learning things, doing the problems, and reading through the materials. I learnt quite a bit, too. It's a shame that this class is discontinued.", "rating": "Loved!", "workload": "10 hours/week", "author": "TVHhCQlM6NcTBTUKYV5mDriYyna2", "difficulty": "Medium", "semester": "Spring 2017", "time": "10/6/17, 10:58 PM"}, {"comment": "5 exams. 3 questions per exam. 5 points per question. 60 points between you and graduation.A: > 80% B: > 60% C: > 40% D: > 20%These cutoffs utilize a \"strictly greater than\" policy. That is, to be awarded a B, one must average strictly greater than 3 points per problem.There have been several changes since the previous time I took this course in Spring 2015:Starts with algorithms instead of decidability/complexity.New and better videos.More active TAs with higher quality office hours.No graded homework assignments.More exams each with fewer questions.While there are no graded homework assignments, a problem set consisting of 5-8 questions is made available every week. Practice exams are also provided.The exams themselves have matched the content and difficulty of the problem sets and practice exams, though one could argue the problem sets and practice exams are more challenging. This appears to be intentional.I'm glad to see the program is responding to student feedback, even if little by little.Lastly, the topics covered in this course, especially in algorithms, are invaluable. While your day-to-day as a fill-in-the-blank may not require asymptotic analysis, amortized analysis, dynamic programming, or the like, the critical and analytical thinking skills that this course forces one to develop are well worth the pain.", "rating": "Neutral", "workload": "20 hours/week", "author": "google:115398662116989618541", "difficulty": "Very Hard", "semester": "Fall 2016", "time": "2/28/17, 1:40 PM"}, {"comment": "Several changes were introduced this semester to address many of the concerns raised by students in previous semesters.There were no graded homework assignments. Instead, there were problem sets which students were free to discuss on Piazza.The absence of graded homework assignments was compensated by more exams. Instead of 2 exams, there were 5 exams! However, each exam covered only three weeks of material at a time, so it was manageable.There were several supplementary YouTube videos that helped clarify concepts that were inadequately addressed in the Udacity lectures.There were several office hours and, unlike in the past, these were available for viewing on YouTube at later times.In my opinion the above changes were a big improvement over the previous formats and this was clearly manifested in the smaller withdrawal rate and improved overall grade distribution. The final grade distribution was:A 101 32. 0% B 115 36. 4% C 10 3. 2% D 3 0. 9% F 0 0. 0% W 87 27. 5%This does not mean that the course has been compromised and watered down. Rather, by streamlining the content and redesigning the grading criteria, the learning process has become less burdensome and unnecessary restrictions and time sinks have been eliminated. The course content is still the same, so students still have to put in several hours of work.Personally, for me, this course was a great learning experience. I took this course by itself so I was able to manage without too much stress. Since my undergrad was not in CS (I have a masters and PhD in Aerospace engineering), I prepared for this course by:Reading \"How to Prove it\" by Daniel J. Velleman.Watching the Harry Porter videos series (based on Sipser).Reading up on the basics of graph theory and related algorithmsEventually, despite not having a math or CS undergrad, I was able to score 97. 33% at the end of 5 exams. So with the right kind of preparation, anyone do well in this course.", "rating": "Liked", "workload": "25 hours/week", "author": "ea3d294e-5f61-4340-a482-9e3e", "difficulty": "Hard", "semester": "Fall 2016", "time": "7126e89d1/5/17, 11:51 AM"}, {"comment": "Background: I majored in CS and Math as an undergrad. My undergrad work was heavily theory based. I can't imagine taking this course without that sort of background. I would heavily suggest self teaching some of the material beforehand.There was a homework assigned each week, but not collected. Try your best on each problem and then look up the student answer on Piazza. This is probably the best approach to learning how to do these kind of problems.There was an exam every 3 weeks (5 exams total) and these exams only covered the past three weeks of material plus we got a \"retry\" question from the previous exam. So each exam had one question for each week of material plus one optional retry question which covered a topic students did poorly on for the previous exam. I never did the retry question so that I could have more time to work on the required 3 problems for the exam. You have 2 hours for the exam, you also were allowed a one page handwritten note sheet for the exams.You will need the famous CLRS textbook as well as the Intro to the Theory of Computation book by Sipser. Both books are pretty good.Professor Pryby made some very helpful supplemental videos and office hours videos to go with the legacy Udacity videos from the previous course professor (I think his name was Charlie).Overall I prefer \"code slinging\" over theory, but this class was a good change of pace (6th OMSCS course for me).", "rating": "Liked", "workload": "17 hours/week", "author": "9e43bbbb-0ec3-4b34-a206-936f", "difficulty": "Very Hard", "semester": "Fall 2016", "time": "ba603a1a12/24/16, 9:56 AM"}, {"comment": "I took this course on Fall 2016 where the passing rate was much higher. The class was definitely time consuming but you will be able to get an A or B if you invest sufficient time. Here are some tips:Get a good pencil and practice writing. We had 5 times exams. The exams were to be hand written, scanned and uploaded. There are some suggestions on the slack group.Start working on the problem sets as early as you can. The problem sets were much harder than what showed up on the actual tests.Make sure you are able to solve all the problem sets. Many times, the exam questions tended to be very similar to some of the problem set questions.Don't feel bad if you are not able to solve the pre-requisite questions. I spent a lot of time preparing for the course, but was not able to solve most of the pre-requisite questions. However, I ended up doing quite well in the course.5 tests actually made it easier as each week, we just had to master 3 different topics. There was no cumulative final.Join the slack group. You don't need to be active, but do keep an eye out on the discussions. You will learn a lot here.Listen to all the office hours (good or bad).There are lot of external resources which are much better than the Udacity videos. Check the slack group for links (e. g. Harry Porter's videos, MIT algo course, Stamford's Roughgarden's etc). You can go through the topics as they come up each week.", "rating": "Liked", "workload": "25 hours/week", "author": "google:115350059256851896416", "difficulty": "Hard", "semester": "Fall 2016", "time": "1/5/17, 4:22 PM"}, {"comment": "Don't kid yourself or think that you're better than those who have gone before.... the average horror about this class is true, so don't take it unless you are well prepared (recently) and have sufficient time to work on it. For me, it was basically every waking/free moment I could carve out... staying engaged with fellow students on the topics to help test and further reinforce my understanding was key. Don't think that simply reading the text and watching the lecture will do it for you... treat everything like a project and don't stop until you've mastered everything inside and out.The new structure introduced in Fall '16 did help:The professor gave some good and pertinent lectures toward the beginning of the courseThe professor and TAs offered some helpful office hours to help with understanding the problems (ask ?'s so you don't merely get a regurgitation of the text or the essence of the problem).The professor allowed/encouraged communication with fellow students on the topics (working problem sets was key)Outside resources were allowed for reference and to help build intuition when the lectures & text failed.\"Re-take\" questions were often offered on exams to try to improve on previous scores.This is a tough, but rewarding class in that you get to graduate if you are among the hard-working group that get's to pass it. I did on this second time through (prev' spring '16). There are skills that I have definitely used since taking the course and this should also help in coding interviews for future job searches!Don't underestimate any topic until AFTER the exam! Just think: bootcamp that never seems to end!", "rating": "Neutral", "workload": "50 hours/week", "author": "7a83c83e-b098-4169-9aea-d20c", "difficulty": "Very Hard", "semester": "Fall 2016", "time": "0b151c371/9/17, 1:05 PM"}, {"comment": "This class was very challenging, and also my first class in the OMSCS program. In the end, I found it to be very rewarding and I learned a lot that I am currently finding useful in my class this semester.It took me some time to find the best strategy to learn and do well in this class, and here are some methods I found to be the most useful:Following Piazza discussions about the problem setsUsing VisuAlgo to help me understand graph theory: https://visualgo. netReading outside resources (online) to get another perspective when I didn\u2019t understand somethingDirectly applying similar concepts/routines from the practice problems on the exams, rather than trying to solve the exam questions from scratch", "rating": "Liked", "workload": "30 hours/week", "author": "vgeOWxefisOq9dnUBjAxIBLU05H2", "difficulty": "Very Hard", "semester": "Fall 2016", "time": "2/2/17, 6:12 PM"}, {"comment": "I prepared for this course in Summer 2016 and took the course in Fall 2016. I was caught off-guard as the topics were rearranged, and the first lessons were not what I had prepared for. I am also not very good at exams (hate time pressure!), and the term I took it the grade depended solely on exams. So this class really tested my limits. I got intimidated and lost confidence early on.I planned to drop this class, and dropping deadline period then coincides with Exam 3. I thought I'd just give it one more push, study well and take Exam 3, then drop the course. Unfortunately (or fortunately?), I got too busy studying I did not notice the drop deadline has passed. :'( My grades for Exams 1 to 3 are really depressing, I thought I'd get a D.My results for Exams 4 and 5 though are really good, almost looks like a different person took it. :p It was mainly because Exams 4 and 5 are within the scope I had prepared for during Summer, and that I did not attempt to answer the recovery questions giving me more time for the actual exam questions. That being said, yeah, preparations make a (huge!) difference.I am a slow problem solver and it really takes me sometime for some concepts to make sense, so if you are like me, prepare before you actually enroll. And while taking the class, solve as many problems as you can so you can gain speed for the exams. 30 minutes per question is really not enough for me.To give you a little bit of hope, I ended with a B (yey!).", "rating": "Neutral", "workload": "30 hours/week", "author": "google:100542095025772670385", "difficulty": "Very Hard", "semester": "Fall 2016", "time": "2/28/17, 4:02 AM"}, {"comment": "Theoretical class that gives a good overview of the most important algorithms. However it sometimes goes too far and we end up learning very unusefull things... It was not hard for me as I have a mathematical background", "rating": "Liked", "workload": "15 hours/week", "author": "HhSOZRd1LOZ4T0PHHNyymkpKR8H2", "difficulty": "Medium", "semester": "Fall 2016", "time": "4/7/17, 8:53 AM"}, {"comment": "", "rating": "Very Hard", "workload": "30 hours/week", "author": "google:115677996769398071701", "difficulty": "Spring 2016", "semester": "I was not impressed with the over all pedagogy of this class. Yes the material can be difficult to understand, but the majority of the hardship of this class stems from a severely lacking online education strategy. The lectures and assigned text are not adequate and need to be updated to reflect the heavier math and proof focus of the course. There is wide variation in the grading and a simple mistake followed by a completely correct proof can land you with a huge penalty. I decided to drop the course before the first exam because I wasn't getting enough out of the course to continue to go through the extremely draining process of keeping up with their pacing and assignments for another 10 weeks. Will get more learning the material at my own pace. Instructor interaction with students is good - best so far in the program, but still not adequate for the level of mastery they expect of students. Need more modeling and scaffolding. Not too much to expect in an intro grad course.", "time": "2/24/16, 9:56 PM"}, {"comment": "I am not a formal math person, and if you aren't either, then this is going to be rough", "rating": "Strongly Disliked", "workload": "20 hours/week", "author": "google:101641942938017424398", "difficulty": "Very Hard", "semester": "Spring 2016", "time": "4/9/16, 10:34 AM"}, {"comment": "I am not finished yet, but it is hard to put into words how awful an experience this class has been. I have never watched so many lectures from other schools in any course, because the gatech ones are so bad. There is little interaction between students because of the draconian plagiarism policy. No teaching. Just threats, dictates, and grades. I am riding it out mostly as an experiment and will not re-take it when I flunk. I am so glad this is not my first OMSCS class, because I would absolutely quit the program if it were. Treat this as a certification exam on your PhD level understanding of discrete math symbology and language, proofs (which many have not been bothered with since the 9th grade), and 1800 pages of at least 2 if not 5 incredibly dense textbooks. Know it up front, because you won't learn it from the class. A Computer Science class where you can't use a computer or calculator is just ironic and tragic. If you really want to learn this stuff you need to take this on-campus and choose your professor carefully. I see minimal value in the knowledge required to get an A in this class unless you are going into academia or just want to sit around with mathematicians and argue about P vs NP theory (I assure you the professional STEM world has better things to do).It sounds like the course in Spring 2016 is MUCH different from previous semesters, so beware. In my opinion they are phoning it in now.", "rating": "Strongly Disliked", "workload": "40 hours/week", "author": "google:106345892943455895240", "difficulty": "Very Hard", "semester": "Spring 2016", "time": "4/30/16, 3:31 PM"}, {"comment": "This course is very challenging, however I think some people struggle with it more than others. If you have recently taken something similar to CCA in your undergrad then the material in this course is not that hard. If you have been a programmer professionally for years and forgotten most of your undergrad then this course will be extremely difficult. The grading in Spring of 2016 was also very opaque and led to some unnecessary challenges. My advice for this class would be:Take this class alone. I am a single guy with no family and I would not want to have taken any other classes with this one. If you have any family I would highly recommend you take this class by itself.Do not ignore the pre-reqs. Make sure you satisfy all of them before you come in.This class is very mathy and proof based so be ready for that. I personally really like math and think it has its place inside a Computer Science degree from a research institution, but if you're expecting to be programming a lot you may get caught off guard.Do not take this class alone, make sure you are on a chat group with other students or very active on Piazza.Use all of the additional text books, especially if Sipser's is the main text book. I really like Algorithms by DasguptaThis course is required for almost all of the specializations right now so you basically have to take it, but do not take it lightly. This course was harder for me than taking two courses in previous semesters and I have a strong math background and took a similar course in my undergrad.", "rating": "Disliked", "workload": "20 hours/week", "author": "google:105807866004259239319", "difficulty": "Very Hard", "semester": "Spring 2016", "time": "5/4/16, 10:18 AM"}, {"comment": "This class is not like any other class in the program (as of today). Most of the comments already here describe the experience well, so I'll concentrate on advice. 1) Study the prereqs specified for the course, but don't expect for a moment that will get you by. Read the assigned textbook for the course (Sipser) and try, try, try to understand it before you attempt the course (yes, all of it). If you don't, you will not likely do well in this course. Use the Internet to help your understanding of the material (watch the Harry Porter Theory of Computation video series). 2) The teaching/videos in the class are terrible. Sadly, most of the stuff I found on the Internet presents the material in the exact same way. Your best bet? Find a group to work with to help you try and understand the material. And really try to understand it, because you will need to turn in homework that is based on your own thoughts. Additionally, your group will not be there to help you on the exams. 3) Your grade is based on you and you alone. You will not get a good grade just because you did better than a certain percentage of the class. If that what you need to succeed, this class is not for you. 4) Don't expect to ever know how you truly stand in the class. Grading (under the current grading style) is very vague and inconsistent. If the thought of this drives you crazy, stay far away. 5) If you feel you are doing poorly in 1st half of the class, don't assume you will do better in the 2nd half. It is possible that you will. It is likely that you won't. Past [student] performance is no indication of your success [or failure]. 6) Conversely to #5, feeling you are doing great in the 1st half is no indication of how you will do in the 2nd half. Persevere. 7) Try out the class. It is a good experience. But don't be afraid to drop the class if you are doing poorly. There is no shame in not completing this class or switching to a specialization that doesn't require it.", "rating": "Liked", "workload": "35 hours/week", "author": "google:103129337002087229526", "difficulty": "Very Hard", "semester": "Spring 2016", "time": "5/4/16, 4:52 PM"}, {"comment": "Update: YOU CAN PASS THIS! There is quite a lot of negative going on in the reviews. You will spend way more time than you think in order to pass. You will be stressed out. But you will learn a ton of math. Just be ready to work a lot. No other courses, no large commitments. Good luck!I spent 20+ hours every week of the semester on this class. 8 hours in an online study group, the rest by myself working the homework problems or the problem set. I learned a lot about LaTeX.This is a math course. It's probably better off without the python. But you also probably don't know enough about writing in Math yet, so this is really difficult. From set theory and countability of infinite sets to graph theory and vertex covers and maximum matchings. There is a lot of math. The programs you will discuss are programs that will always output the reverse of the program given as an input, or a program that when run will output a program that when run that will output.... (etc. ) There is a lot of Logic.The professor and TAs are working to make the course delivery better. Ideas have already paid off and they have more. They know it's tough and a lot to learn. The real problem, though, is that it's really two 3 credit courses given in the time of one. So this course is about as fun as drinking from a firehose. And I didn't even want to learn this much math. SOME math, sure. But this is a ton.Advice: Work all the problem set problems. A few of them showed up exactly from the problem set on the test. Others illustrate how to push boundaries of the section's ideas. Also read Sipser. Generally avoid the udacity lectures, which seem rushed and not very instructive.", "rating": "Strongly Disliked", "workload": "25 hours/week", "author": "google:106105612010868281072", "difficulty": "Very Hard", "semester": "Spring 2016", "time": "6/21/16, 11:50 PM"}], "difficulty": 4.667, "enrolled": 610.0, "id": "CS6505"}, {"rating": 4.263, "workload": 23.158, "withdrew": 182.0, "comments": [{"comment": "Not an introductory class if you are unfamiliar with python and AI subjects. The 6 assignments/projects are due biweekly, and you have to spend a lot of time on it. Each assignment takes more than 40 hours.As full-time employed, it would be hard to join TA session and working on the assignments. It requires a lot of time consumption, self-discipline, and hard work. Be a wise time manager.", "rating": "Liked", "workload": "40 hours/week", "author": "qmiIDT03p3ZEEly0ztGNCXmCz022", "difficulty": "Very Hard", "semester": "Spring 2019", "time": "2/27/19, 4:47 PM"}, {"comment": "Good news is midterm and final are only 80 pages of problems, so aka you'll have time to get in at least a shower or two during the course of the semester (and even better, with all the hair you lost, you won't even need to shampoo so you can save time). If you're a smarty pants, maybe you'll see the sun and if you're extra lucky, maybe you won't get PTSD, high blood pressure, and arthritis.Bad news is since this course trivially skims through topics, all you'll come out with is some artificial intelligence and not real intelligence", "rating": "Strongly Disliked", "workload": "30 hours/week", "author": "hL2I5LpLcxRE1pMMTN21jIRMMac2", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/22/18, 1:43 AM"}, {"comment": "Survival tips:Take KBAI (Python track) and ML4T before this course.Take a few days off work for the midterm and finalTake your time deeply understanding the book and supplemental readings - all of themWatch all lectures and do the Udacity quizzes solely for gentle introductions to concepts.Stay active on Slack or Piazza because you'll get through this together.Expect lots of \"clarifications\" on exam questions to roll in throughout the week.Do all the projects, don't let that \"best 5 of 6\" thing get to your head.Commentary:This gave me a wonderful view of the world through Bayesian probability, a lot of confidence choosing/implementing AI/ML methods, and my first gray hairs. I turned in the midterm and final not knowing if I scored a 10 or an 80. Both fell way closer to the 80. You will see whole cloth new material on the tests, but if you stuck it out in the projects, you'll have the right intuition to do well. Trust it.", "rating": "Loved!", "workload": "25 hours/week", "author": "google:114588245870326197003", "difficulty": "Very Hard", "semester": "Fall 2018", "time": "12/16/18, 12:24 PM"}, {"comment": "Fun class, not too difficult.", "rating": "Liked", "workload": "8 hours/week", "author": "pdQpZcnRPxO2YTfYt9FsKNUPgWe2", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/11/18, 11:51 PM"}, {"comment": "Unnecessarily tedious take home exams, but other than that class is interesting and not too hard. Homeworks are autograded so once you're done you're done.", "rating": "Loved!", "workload": "5 hours/week", "author": "pdQpZcnRPxO2YTfYt9FsKNUPgWe2", "difficulty": "Easy", "semester": "Fall 2018", "time": "12/11/18, 11:53 PM"}, {"comment": "The class covered a ton of material in a very short amount of time. This was my first class, but was really unimpressed by the depth of content covered in lectures. The midterm and final were week-long take home tests, and they took basically all week. The questions did not really cover knowledge, but rather just ability to do complex math and run algorithms by hand. The assignments were presented well, and the requirements were clear, but the testing strategy was poor - the local tests did not evaluate the assignment appropriately, and submissions were limited to actually test it. most of the time i made a small mistake that would pass local tests but fail the submission and had no observability. Overall, the material was really interesting and I felt i learned a lot, but put in way more work than i expected.", "rating": "Neutral", "workload": "16 hours/week", "author": "y4qjlh1ys2MJbfGhiW1MI2wTYwI3", "difficulty": "Very Hard", "semester": "Fall 2018", "time": "12/12/18, 10:44 AM"}, {"comment": "I just finished this course and found the reviews on here to be pretty accurate. It's really hard and a lot of work, but it's a very well done class. I went into it with very little knowledge/background in AI or ML, and came out of it with a really strong understanding of the key concepts and algorithms and am excited to keep going with it.For me, the workload hrs/wk was probably higher than most due to my being new to the subject. I would guess if you took some other AI or ML courses in the program before this one (maybe ML4T?), it would help you get through the assignments more quickly.I probably spent 30 hrs/wk most most weeks, around 40 hrs for the week of the midterm, and honestly probably 50 hrs on the final. I actually decided to take 2 days off from work (Thurs and Fri) the week of the final just to make sure I had enough time to work on it, and I'm really glad I did.The weeklong open book/open notes nature of the exams means that they really make you dig deep and earn every point. I actually found that I learned the most during the exams themselves because I'd look everything up in the textbook or lecture notes.All in all, it's a very good course. Professor Starner and the TA's are great. Just make sure you're able to dedicate a lot of time to it.", "rating": "Liked", "workload": "40 hours/week", "author": "TJGP23MWaJYVU7fXykeumdpg4202", "difficulty": "Very Hard", "semester": "Fall 2018", "time": "12/12/18, 1:53 PM"}, {"comment": "This was an awesome class! It provides an overview of the vast field of artificial intelligence and teaches some popular algorithms from different areas of AI. Since there is so much material and only 16 weeks to learn them, the course does not go into depth on any of the topics. The class is curved with the a final score above the median being an A and on std below the median a B. The grade consists of assignments, midterm exam and a final exam. The class takes plagiarism very seriously and you are not allowed to look at pseudo code from anywhere other than class resources.Assignments: These were the best part of the class. There are 6 assignments and the best 5 are counted towards the grade. You have to implement some popular AI algorithms from scratch. Working on these was a lot of fun and I learned a lot from them.Lectures: The udacity lectures were not that great. I watched the lectures from MIT on youtube and learned more from those. This was very much a self taught class for me. I learned a decent amount from the book as well but some of the material was quite dense.Exams: Oh boy! This is where things get interesting. The midterm was 34 pages long and you are given a week to complete it. You are only allowed to refer to the book and lectures. I love this format of exam taking as you get to learn as you go and I found I learned a lot more this way than the traditional format. The problem was that these questions take a massive amount of work to complete and you have to perform some tedious calculations to get your answers where some small mistake can cause a cascade of errors. I felt a little burned out after the midterm but I performed well on it so I was confident and expected to do well on the final. Well I was wrong. The final was like the midterm on steroids. It covered every thing you learned in the whole class along with some questions that were only lightly covered and appeared to come out of nowhere. I did not do that well on the final but still had my overall score above 90 so I am expecting an A.Overall I felt that this was a hard class but not as hard as some of the earlier reviews made it seems. The hardest part was the final and midterm. The the rest of the semester was not that bad.Prereqs: Make sure you understand bayesian probability well. Knowledge of numpy and some basic knowledge of ML via a course such as ML4T would also be beneficial.Overall I recommend this course to anyone interested in AI/ML.", "rating": "Loved!", "workload": "18 hours/week", "author": "gbWBLxTBR3ajgkp1CRvi1myuteB3", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/12/18, 5:57 PM"}, {"comment": "Exceptionally valid course and a wonderful textbook. But amount of topics covered is enormous and everything must be understood to the last detail, otherwise it's impossible to do the assignments and the exams. Both Midterm and Final are a 30-50 pages PDF with open questions/exercises to do at home in a week. Only the final results go on the PDF so calculation errors will cost you the points.In conclusion is really a great course, but you must devote an immense amount of time and energy to it.", "rating": "Loved!", "workload": "25 hours/week", "author": "vryeJluSBaYnNW1xaWXpLqwy0653", "difficulty": "Very Hard", "semester": "Fall 2018", "time": "12/13/18, 5:05 PM"}, {"comment": "I was a big fan of this class. It wasn't perfect, but the material covered was broad and interesting. I didn't find it to be quite as difficult as the reviews indicate here, but it does require solid Python and Numpy skills. As such, I'd recommend taking some other courses first (KBAI, AI4R, CV are all great pre-reqs for this class). The projects were somewhat time-consuming but certainly doable in the allotted two weeks. The exams were harder - and much longer - than the projects, but I felt we were given ample time to complete them (open-note, take-home tests). Although, I could see the time commitment being difficult with a busy work schedule or another course being worked in parallel.My only complaint with the class was that the Bonnie test results for some of the projects did not provide helpful feedback after submitting assignments. Even after passing all of the local unit tests for a given assignment, there were times at which Bonnie tests would fail, and no information was returned about the reason for the failures. This led to some brute-force/blind debugging in some cases, which was a little frustrating.Overall, it's a good course if you have any interest in AI. Like many other courses, it covers a multitude of topics at a shallower depth, rather than covering fewer topics at a more advanced level. I would not pair this class with another unless you have plenty of time to spare. And I would not take this as a first course unless you are prepared for the workload required.", "rating": "Loved!", "workload": "12 hours/week", "author": "vfBawONILeYqh4y4Hr8hSSIPq722", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/14/18, 1:03 PM"}, {"comment": "Fantastic course. I took the course without much preparation and even though I did well in my mid-term and final (above median), I struggled with Numpy which costed me dearly in two of the assignments. This was my first course in AI and ML and did not know what to expect. As others mentioned the pace of the course is very fast and it covers alot of material (To excel at AI, one requires at least two or three semester to learn the topics that are covered in the text book and the lectures.). Prof Starner and the TAs are outstanding. If you are looking for an A, assuming you have not had any AI courses in the past and/or relevant experience, you should get higher than median for 5 out of 6 assignments and both exams (Not easy). median for the assignments is in the 90s so you should go for extra credit and bonus opportunities if you can. Definitely attend the TA office hours as needed. They are very knowledgeable and will help you immensely (I should have done more in this area). You need good planning skills to go through this fast paced course. No room to relax. If you miss a week, forget A, if you miss three weeks, consider dropping the course. The assignments are challenging and there are a number of extra credit opportunities that allow you to improve your grade. However, I feel that for most parts the students who have had prior AI/ML training will be better equipped to do the bonus and extra credit parts and raise the assignment median. In effect making it harder for those who are new to AI to compete and receive a higher grade. I liked the take home tests because due to the nature of this course and difficulty of the topic, it is impossible to do it any other way. You should view all the lectures and read all the relevant chapters in the text book to do well. It is hard to get partial credit as the final answer is what counts.", "rating": "Loved!", "workload": "30 hours/week", "author": "bBbu0oZg8fU19il18Za4j8qehDl1", "difficulty": "Very Hard", "semester": "Fall 2018", "time": "12/15/18, 3:19 PM"}, {"comment": "This course is the real deal for learning AI. You're reading the quintessential AI textbook \"Artificial Intelligence: A Modern Approach\" nearly cover to cover, co-authored by the former Google search algorithm director Peter Norvig, who is also a guest lecturer in the Udacity videos. Another guest lecturer is Sabastian Thrun, the creator of Udacity and founder of Google X and their self-driving car team. The professor himself, Dr. Starner, is an entrance examiner for the AI PhD progam and draws from industry experience at Google when structuring the assignments.Perhaps this is intended to justify the often overwhelming course workload, which is comprised of the work of two courses in a sense. At the time of this writing (Fall 2018), one of those courses would involve completing the six assignments that are each 2-3 weeks long, of which only five count towards your grade. The other course would involve keeping up with the extensive learning material, such as lecture videos, textbook readings, and supplemental journal articles in order to prepare for a midterm and comprehensive final exam (taking me 17 and 24 hours to complete, respectively) that are structured like puzzles and brain teasers loosely based on concepts from the material. My weekly effort spent on this course ranged from 20-60+ hours. There was always something that I should be working on throughout the semester and that was exhausting at times, to the point that I regrettably skipped the final assignment to catch up on learning materials to prepare for the final.For those of you who are limited on time to devote to the class as I was, my recommendation is to watch all of the lecture videos prior to the start of the semester, and then read and appropriately skim the textbook based on the provided list of topics for the midterm and final, which would provide a much more manageable workload. Also be sure to start the assignments as soon as possible. I'm definitely not knocking the challenging aspect of the assignments or of the unique format for the exams, both of which contributed greatly to my learning experience, but I would have preferred a more narrow approach to the ambitious syllabi than is currently offered. This will be my first B in a technical college-level course, but don\u2019t let that intimidate you - learn from my mistakes!A note about time management: I consider myself to be someone with a lot of time management experience who always keeps a lot on his plate. Having said that, this course nearly broke me. With a full-time job, married life, and the everyday stresses of maintaining health and sanity, this one course made me lose more hours of sleep than I was comfortable with and it was my only course this semester. If you plan to take this course, bare in mind that it will require you to keep a rigorous schedule for studying, which must also be flexible enough to postpone other priorities to allow for more study time.", "rating": "Liked", "workload": "30 hours/week", "author": "QeYWbWRrbFVofK0jLnPMzB4xtbl1", "difficulty": "Very Hard", "semester": "Fall 2018", "time": "12/15/18, 2:28 PM"}, {"comment": "The class covers a good range of algorithms. The book is really good. Recommendations:Brush up on probability before taking the class.Set aside time for exams if you're working so you can check your work. There are lots of calculations and ramp-up problems where future answers depend on previous answers.", "rating": "Liked", "workload": "23 hours/week", "author": "wG1zVOah5IhkggZnUORVAK6Vp0F2", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/19/18, 6:07 PM"}, {"comment": "I'm not sure this was a great first course, but it did require me to get right back into school mode. I also might have spent more time than other students as I was relatively new to Python. I'd imagine being able to concentrate on learning the concepts rather than learning Python too would be nice.You get to learn 6 concepts in depth through the programming assignments. However the lectures and readings cover numerous other subjects, and those are all fair game on the midterm and final. For example, there were a few videos on neural networks (~10 minutes) and no projects covering it. However, there was a 10/100 point question on the final on it. This (the breadth of topics covered and the details you must know on the topics) makes it difficult to know where to ask questions ahead of time as using most outside course material is not allowed.Overall, there are 10+ hours of lectures per week, ~100 pages from the text book per week, challenge questions every week to review on Piazza (not graded), and projects due every 2 weeks. It's a lot to keep up with.The TAs are very helpful/active on Piazza, and there the projects are all doable in 2 weeks- even for a Python novice like myself.The grading seemed to cause some stress, since it's based on the median and standard deviation, but rest assured that above a 90% is an A and above an 80% is at least a B.", "rating": "Liked", "workload": "24 hours/week", "author": "bBgxtFmDRdeQY4ZOLRSODSWw8oE2", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/28/18, 4:05 PM"}, {"comment": "I absolutely loved this class and I believe its difficulty has been overstated. I would rate it somewhere between medium and hard, so I \"rounded up\" to hard. My 20 hrs/week is an average. Some weeks I spent maybe around that (some projects), some weeks I did literally nothing (week after the midterm, the time between submitting the last project and getting the final), and some weeks I spent significantly more than that (the midterm and final).This was my 6th/7th class. I took it with CS 6340 (SAT, another great class, and is not about unit testing). I previously completed AI4R, CV, ML4T, IIS, and RL.I work full time and part time in addition to OMSCS. My FT job is very flexible, which helps, but my PT job is very much the opposite. Despite this, I was able to get a solid A in both classes this semester while also studying for and earning an Oracle OCP Java certification, picking up a ton of extra PT job shifts, and spending an entire weekend cleaning out my garage. I don't consider myself a stellar student by any means, so if I can do it then I believe you can as well. What seems to set me apart from many others (based on my Piazza experience) is my ability to read and follow directions, and my understanding that sometimes I will need to do more than just watch the lectures to fully understand how to do the projects. Seriously, why does everyone keep thinking a graduate-level CS program should have the same structure as a high school math class? Anyway, with that said, I didn't have to use the book a whole lot, but it definitely helped when I needed it and I'm glad I bought it.This class does have a lot of room for additional exploration and deeper diving into the topics, sometimes through extra credit, so there is that benefit if you take it by itself and limit your non-OMSCS activities. But it's not like we can't pursue these deeper dives independently later.I say it all the time, I've already hinted at it above, and it will always need to be said. You'll have a much better time in this class if you just read/understand/follow the directions. The support system from students on Slack and from the instructional staff on Piazza was insanely helpful. Prof's office hours were interesting and not just for the sake of getting help with assignments.Grading breakdown:6 autograded, individual projects worth 60% total, with the lowest project grade dropped1 plagiarism quiz worth 5% which was basically free points since they opened it up to unlimited attempts after significant whining1 take-home midterm worth 15% and somewhere around 35ish pages long1 take-home final worth 20% and somewhere around 45ish pages longThere were some extra credit opportunities offered on the projects and a small one on the finalThe projects:Minimax with and without alpha-beta pruning. A surprisingly difficult assignment for such a short algorithm.Searching algorithms - BFS, UFS, A*, etc. Also a very difficult assignmentBayesian networksDecision treesExpectation maximizationHidden Markov ModelsThe last 4 projects were much easier than the first 2. P4 and P5 both took me under 2 days. I saw people struggling on Piazza with them for almost the whole assignment period (generally 2 weeks). In many cases the questions they were asking were clear indications of \u2014 wait for it \u2014 not having read the instructions. I think every project but P3 had extra credit opportunities.The exams were a lot of fun and very challenging but I think the TAs were too ambitious when making them. There were literally dozens of clarifications made on Piazza (under a \"clarifications megathread\") for both the midterm and the final. I started the midterm early and immediately learned that was a mistake. I was kind of confused by people who started the final as soon as it was released and then complained about clarifications. Did they not remember the midterm just weeks before? As for topics, midterm topics were straight from the lectures. Most of the final topics were as well. Some really required the textbook to fully get but those were few and far between. Final was cumulative.Overall this was a great class with a lot of fun topics. I recommend taking it by itself if you suck at following directions and being a good student, or if you have minimal math and CS backgrounds, or if you just want to have time to deep dive into the topics while the class is still in session.Tips based on this semester's experience:It's all Python. Be comfortable with it. Knowing numpy in advance for will help for P5 and P6 but it's doable to pick it up on the fly.Supposedly the exam problems were \"designed to be done by hand,\" but seriously, do yourself a favor and do as much of it as you can in code. While the problems are doable by hand, some are very tedious and lengthy. Better yet, do it both ways to check yourself. Start early but not too early. Watch the clarification threads like a hawk.", "rating": "Loved!", "workload": "20 hours/week", "author": "qnAaiyrvyBN3lH75njavIsxcwOI3", "difficulty": "Hard", "semester": "Fall 2018", "time": "1/3/19, 10:12 AM"}, {"comment": "I enjoyed this class! The attitude of TAs , sense of humor of professor and TAs are very helpful. Really enjoyed, however it was very hard to combine this course with private life, work and family.", "rating": "Loved!", "workload": "25 hours/week", "author": "Er6sWbln7HSK3O6qI3oPd9MKCY63", "difficulty": "Very Hard", "semester": "Fall 2018", "time": "1/3/19, 11:06 AM"}, {"comment": "Overall, I feel this class was really well done. TAs and the instructor were always very responsive; you could tell they were very passionate about the course.Assignments take between 10-20 hours (assignments 1,2,5 were around 20 and assignments 3,4,6 were around 10 to 15) and you get about two weeks for each. The exams are open book, but are brutal. I'd say 20-30 hours for each and you get a week to do them.I don't really feel like an expert at anything after taking this course, but I do think it is a good general introduction to artificial intelligence topics. Be aware that this course does get into some theory (e.g. the last topic is first order logic). You shouldn't be intimidated by this (it can be a little dense but a vague understanding of the logic should be enough since the exams are open book), but just an FYI in case you are only interested in practical skills.There is a bit of nit picky in this course (especially the exams) so make sure to triple check if you have any uncertainty.This is my second class (first was Computer Networks). It could be a first class if you have some past theory-ish experience (e.g. big o notation, undergrad ai course, etc.) The only reason I might advise taking this course later is some students came in with machine learning class experience and that gave them a small advantage (e.g. neural nets and random forests).My enthusiasm for the class dipped a bit after the midterm (it is pretty draining, even if you do well), but the projects were interesting enough to keep me motivated.", "rating": "Loved!", "workload": "15 hours/week", "author": "5FeXsO1lS7Ruzy7mAgdDeKd9Zg52", "difficulty": "Medium", "semester": "Fall 2018", "time": "1/6/19, 11:59 PM"}], "difficulty": 4.3, "enrolled": 406.0, "id": "CS6601"}, {"rating": 4.435, "workload": 11.129, "withdrew": 29.0, "comments": [{"comment": "This is my 9th course and I can say that although this course is not extremely \"difficult\", it comes with a huge workload, so be prepared to spend a lot of time completing all of the assignments, projects, readings, peer feedback, peer survey, activity on piazza, tests, certification, watching lectures, etc. There is a lot to do in this course, probably too much if you plan to pair it with another course while also working full-time. It could feel as if you are drinking from a fire hose at times. Be prepared to type until your fingers are sore, because you will type well over 35k words worth of essays by the end of the semester. You will type until you can't type any longer. On the bright side, workload is much less during the last 5 weeks.", "rating": "Liked", "workload": "21 hours/week", "author": "mdbNol35vRh7LVGpeOGncBIPgSN2", "difficulty": "Medium", "semester": "Fall 2018", "time": "11/19/18, 10:01 PM"}, {"comment": "Coming from a UX/design background this course is more of a refresher to me. The course is well structured and topics are closely relevant to the industry unlike many other academic classes. The assignments are a bit feels like busy work and can takes quite a bit of time each week. The workload gets easier towards the end if you have a good team for the final project. Exams are open book so you don't really need to prepare for them.", "rating": "Liked", "workload": "8 hours/week", "author": "CsZkRTPoOQgKHgYpBpVIrfh3XqV2", "difficulty": "Easy", "semester": "Fall 2018", "time": "12/10/18, 9:50 AM"}, {"comment": "This was my first course in the program. For anyone who has been out of school for a while this a great introductory class to the program. It has heavy workload but as long as you watch the useful video lectures and more or less stay on top of piazza you should be able to succeed in understanding the concepts. Note the tests are hard and you need to review material beforehand. Otherwise Dr. Joyner and all TAs have gone the extra mile to make this course enjoyable and build a positive online community. Highly recommend.", "rating": "Loved!", "workload": "10 hours/week", "author": "CKADmcoS4cR9spAfnrlw7utqyAf1", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/10/18, 1:50 PM"}, {"comment": "Brilliant course to begin the program with. Had no coding but had to write a lot. I wrote about 100 pages of text combining all assignments and projects in the course. But I learnt a lot from the course on how to view things from a user's perspective. The course is very well run. All the TAs and the instructor is super helpful on Piazza.", "rating": "Loved!", "workload": "6 hours/week", "author": "GSsLWfIPCIRGsqQd84h4z9eDGLy2", "difficulty": "Easy", "semester": "Fall 2018", "time": "12/10/18, 3:35 PM"}, {"comment": "One of the best courses in OMS in my opinion. Dr.Joyner is probably the best teacher that I had. The lectures are very interesting and engaging and cover a lot of useful HCI topics effectively. Everything was well organized. This course requires a lot of writing as well as reading which can make it a bit tough if you are not used to that. I often faced frustration during the course due to writer's block and not coming up with ideas and examples for assignments. This class touches many general human related topics, specially through readings so it felt like \"real education\" and not just topic learning. If you put good amount of effort then you can easily get an A grade.", "rating": "Loved!", "workload": "18 hours/week", "author": "OGReDTH3KvgtlRgAB9POhSQ7Rmb2", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/13/18, 3:28 PM"}, {"comment": "This is not a traditional CS class. If you are hoping to write code, explore robotics, or study algorithms this is not the class for you. This class is basically writing papers and interacting with humans. Each week, expect to write between 8 and 10 pages. The tests are basically 150 true/false questions but the tests are open book/open notes so if you take notes on the lectures you should do pretty well. Dr Joyner, the main instructor is a great teacher, he's really kind, super geeky in a good way, and passionate about his field of study. The lectures are well made.My biggest problem with this class is the content is basically a week or two's worth of information spread out over an entire semester. The people who will enjoy this class enjoy writing papers, enjoy conducting surveys and analyzing qualitative data, and are not particularly passionate about writing code.", "rating": "Disliked", "workload": "10 hours/week", "author": "gHshxAFpLzRE5gFdw3u1ptLXwOd2", "difficulty": "Easy", "semester": "Fall 2018", "time": "12/14/18, 9:49 AM"}, {"comment": "This is a well organized and well run course. There is no coding involved, so it is a nice course to take after something like AI or ML if you need a break from the intense programming assignments. You are allowed to form your own group for the final project. Grading was fair and good feedback was given. Tests are open book/open note, challenging but doable if you keep up on the readings and lecture videos.This class felt like a bit too much work. Not necessarily busy work, there was value in each task, but there are a lot of moving parts. There is an 8 page assignment due each week for the first 12 weeks, which gets a bit overwhelming. There are 3-5 readings each week (required for the tests), and they can be 30+ pages each. On top of that you are peer reviewing other classmates' work and planning ahead for a personal project and group project. I would have liked to see the work consolidated a bit so that more focus could be given to each task.Definitely a front-loaded course, the last few weeks were much easier (however I did have an amazing group for the group project, so that helps). I'd say it's a good first course for OMSCS, but please don't think this is representative of other courses in the program. I'm not sure I would recommend pairing it with another class, with the weekly assignments there isn't much time in between for other work. Having said that, assignments are all released on day 1 so you can work ahead, with good time management two courses would be possible.", "rating": "Liked", "workload": "14 hours/week", "author": "FrbLruGLk3fd6fKMtBgsshzGliK2", "difficulty": "Easy", "semester": "Fall 2018", "time": "12/14/18, 11:10 AM"}, {"comment": "This is not a difficult course. The subject matter is interesting and practical. I learned a lot of practical things from the course and became very sensitive to design - both the good and the bad. If you have taken a course with Dr. Joyner, you know how enthusiastic he can be, and how active he is in the forums. HOWEVER, I think the workload - especially the weekly assignments - is just a bit too much. Especially if you are like me with tendency to procrastinate but would really like to submit quality work. If you are a prolific writer, this course is for you. For 10 straight weeks, you have to write and submit a paper. Then for the last 5 weeks, you work with two of your classmates on a group project, and also write a paper for each of those (you can skip one). You have to review the work of three of your peers every week. And to really understand what is being discussed, you have to read two to three papers every week, which by the way are not too technical. There is no programming required in this class. There is one group project at the end.Basis of grade:30% Homework (10 of them)30% Tests (2 open-book, open-notes, multiple choice proctored)30% Projects (1 Individual; 1 group [5-week effort])10% Participation (Piazza posts, peer reviews, surveys, etc.)Majority of the students get an 'A'. But definitely a lot of work, and not for procrastinators !!", "rating": "Liked", "workload": "20 hours/week", "author": "xjbKT35KIFMxjo1pWBVvJ2NIBMK2", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/15/18, 9:20 PM"}, {"comment": "There is a lot of weekly work, but it is not difficult. Feels like busy work to be honest, but not difficult. Each week you have to write an 8 page paper, read some articles, and do peer reviews. If you follow the prompts exactly for the papers, then you can easily get 100% on the papers. If you actually do the readings it will take you twice as long as the prof estimates for the readings, unless you are very familiar with the subject matter already. Because of this I stopped reading the articles after test 1 and just skimmed them before the last test. You have to earn 100 participation points by the end of the semester, but I earned mine all by week 5 by taking classmates' surveys. There are 2 tests, multiple choice, open notes/internet. Group project at the end was more hassle than it was worth to me because one of my group members was not participating and had no clue what was going on. Overall the HCI subject matter was really interesting but the busy work nature of the weekly tasks made me feel like I was just checking boxes rather than engaging with the material. If you don't mind checking boxes for 15 weeks, I'd say this was by far the easiest of the 4 classes I've taken thus far in the program. It was an easy A.", "rating": "Neutral", "workload": "15 hours/week", "author": "5CJd5IOx2mVAPAgySqAzB5U44GH2", "difficulty": "Very Easy", "semester": "Fall 2018", "time": "12/17/18, 8:33 AM"}, {"comment": "This was my first course at GATech. There is zero programming, so it is great for someone who is not strong in that area. There is a LOT of reading and an 8-page paper due each week. There are prompts for the papers, and other than deciding on the topic, the papers generally write themselves. Don't get fancy with the writing. Answer the questions they ask you to answer in the order they ask you to answer them.There are two tests. They are open book. They brought my average down, but not enough to make a difference. (I averaged over 99% on my writing/projects, but 85% on the tests, which are worth 30%.) A HUGE frustrating part of the course is that you never get to see the exams, so you have no idea what you got wrong. Also, the questions were very open to interpretation at times, but you can never see if you were right/wrong in your answer, so that is very very frustrating. I wish I could tell you why I struggled on the tests (I was too literal in the interpretation of the questions, or maybe not literal enough -- who knows???) Personally, I think this should not be allowed. There is no \"check\" on the system. You just have to take the professor's word on your grade. Not good.There are two projects. An individual 12-page paper and a 30-page group project. Not too bad because they follow from all the assignments that had been done up to that point.Don't let the low hours fool you. Some weeks I spent 20+ hours reading, writing, watching videos, doing peer reviews. There are literally 100-200 pages of reading to do each week, and 2-3 hours of video. Don't get behind on the reading/videos! The reading, while at times boring, really helps explain the ideas of the videos. It all matters on the exams!! Readings are 1/3 of the exams.Overall, great class. Great TAs. Great instructor. Very well-organized. Highly recommend it.", "rating": "Loved!", "workload": "20 hours/week", "author": "60FS1SpyZ0doB3afXBsZoxM7sjm1", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/20/18, 11:26 PM"}, {"comment": "Took Fall 2018, and it was a pretty good class. This was also my first class in the OMSCS program, and I would recommend this as a first course. That being said, I would still rate the class difficulty as \"Hard\" because I often spent around 20 hours each week working on the assignments.While the class does not involve any coding, it requires 8-page papers responding in-depth to 4 questions from the lectures every week. On top of that, each week you have readings and postings to make on Piazza. In general, the class requires a lot of work, but is not too difficult. Since the papers are peer reviewed, I noticed that a lot of other students did not really put in the same level of effort (with many being less than 8 pages, so your mileage may vary).There is 1 solo project (12 pages) and 1 group project (30 pages), as well as 2 open-note tests based on the lectures and readings. Neither test was too difficult, but they were timed (2 hours) and I definitely used all 2 hours. My only major complaint was that by the last week of the semester, I still only knew 50% of my grade (Test 2 and the group project were not graded yet), which was a bit unnerving.Overall though, I really enjoyed the class, and think Prof. Joyner did an amazing job both with the lectures and on Piazza - it can just get a bit exhausting near the end after writing so many papers.", "rating": "Liked", "workload": "20 hours/week", "author": "ha8gVlb6InhF7QdPiOFsWXTnlir2", "difficulty": "Hard", "semester": "Fall 2018", "time": "1/7/19, 10:30 AM"}, {"comment": "ProsProfessor is engaged and supportive. Seems like a good person.Course website clearly outlines what you need to do every week to stay on top of this class.Not difficult to get an A if you can follow directions and write well.Rubrics are not ambiguous.ConsReadings can be very boring. I started skipping them entirely midway through the class. The only readings I liked were the selections from The Design of Everyday Things.I did not get much value from giving or receiving reviews through the weekly mandatory peer review. It was mildly interesting to see the quality of others' work, but I would prefer it to be optional.No coding at all. Many thought experiments and surveys.", "rating": "Liked", "workload": "8 hours/week", "author": "Q23NRP1XGlaWhnFpeKtvW7rIBlw1", "difficulty": "Easy", "semester": "Fall 2018", "time": "1/6/19, 10:54 PM"}, {"comment": "This class is good if you are on top of everything and your only class to focus on but if you dont like writing and reading papers, thats basically what this class is.", "rating": "Neutral", "workload": "20 hours/week", "author": "gH87JzmpyFgW8wWqQmum2QDLdPf2", "difficulty": "Medium", "semester": "Fall 2018", "time": "1/9/19, 6:03 PM"}, {"comment": "As many have stated, this course and concept is not difficult, but the work required is pretty steep. The tests are also somewhat difficult despite being open book, open note, open internet, etc. They are designed to really check your understanding of the material and are fairly open ended. We had a 6-8 page single spaced paper due basically every week. There was one group project required with multiple check-ins toward the end of the class.This class is focused on human psychology and interaction with/through the physical world, specifically with computers. There was no programming required.As long as you stay on track with the homework and can keep up the pace through the semester, this shouldn't be too difficult of a class. It is really just about staying on top of all the content that is offered. I really did enjoy the class and the prompts for the homework were good and really made you think about the concepts covered in the reading and lectures. The syllabus is tweaked from semester to semester, but you can get an idea of what you are in for by checking out this site, http://omscs6750.gatech.edu.", "rating": "Liked", "workload": "15 hours/week", "author": "ILSKtjAYf8NrisWZpSraF8jeCr63", "difficulty": "Medium", "semester": "Fall 2018", "time": "2/24/19, 8:30 PM"}, {"comment": "Holy moley, this class has at least twice as much writing involved as any other class I've ever taken. I added up the number of pages I wrote over the course of the semester and it's around 100. Granted, a lot of this content writes itself to some extent. If you address everything in the assignment description, you'll get close to full marks. What's great is that all of the questions in the assignments actually trigger meaningful thought on topics related to user interface analysis and the psychology of HCI. I'm someone who loves writing and loved the free reign that some of these questions gave to allow you to come up with a creative answer. It was a hell of a lot of work, but I genuinely enjoyed writing some of these papers.I do think the amount is a bit excessive, though. If they cut it to about 2/3 of the writing, I don't think you would lose much of the value in this class. I also felt that the group project was just a once-over of everything learned before. Not much gained there.This was my favorite course in the program, and I've also taken the other Joyner classes KBAI and EdTech. This course takes top spot in my reckoning for the OMS program as a whole; this is coming from someone taking their last class.", "rating": "Loved!", "workload": "4 hours/week", "author": "facebook:101533731139153562/", "difficulty": "Medium", "semester": "Fall 2018", "time": "26/19, 1:40 AM"}, {"comment": "My third class, but my first summer class. While the course was not difficult, there was a lot of required reading and time spent watching videos. Part of this might have been due to the condensed nature of Summer schedule. Overall the course was fun, but would have enjoyed it more if I had taken it during the Fall or Spring.", "rating": "Liked", "workload": "15 hours/week", "author": "3ujo5fcHXJhVG4yjNShDPdU6Kmb2", "difficulty": "Medium", "semester": "Summer 2018", "time": "7/30/18, 5:09 PM"}, {"comment": "I loved this course. David Joyner is a great teacher who clearly cares a ton about the course. We had one solo project, 2 exams, and 10 homework assignments for the 12-week summer term. This is a little different from what is usual due to the compressed timeline. You can find a ton of information on the course website: http://omscs6750.gatech.edu/The most important thing to know about the course is that it is all writing and zero coding. I was a philosophy major as an undergrad and had no issue with the writing, but others seemed to struggle. We were expected to write on 3-5 topics per assignment, and usually had a ~1500 word limit per assignment overall. In total, the most you were supposed to write for the assignments was 14,000 words, with a recommended length of 10,000 words. The project was another 2,000 words recommended, and you were capped at 2,400. If the idea of writing 17,000 words scares you, don\u2019t take this class.The exams were quite reasonable. The median grade clocked in at around 85% for both exams, and David gives an obscene amount of statistics and analysis on the tests. It was really cool to see.Your grade is 35% homework, 20% project, 35% tests, and 10% participation. You can get participation in a bunch of ways, such as Piazza, peer feedback, and completing surveys.Over the course of the course, you follow an entire design cycle in the homeworks. I found this to be a really rewarding experience from which I learned a lot. I also really appreciated the readings, which were quite interesting and not particularly long.I would say the course was medium-to-easy. I struggled with some serious health problems during the course and was force to take an incomplete as I couldn\u2019t finish the project on time, but I found the assignments quite manageable and wouldn\u2019t have had an issue if not for the health problems. That said, I was a philosophy major and so was much more comfortable with the writing than many of my classmates.I spent about 12 hours a week on the course, of which 7 was spent on homework + projects, 2 on lectures, and 3 on partipation and auxillery things like skimming the papers. I didn\u2019t really read the papers until I was studying for the exam. There, I binge-read them all and then skimmed them during the tests (the tests were open notes).I get like it was a really good course to take over the summer, and it was a welcome break from Hardcore coding (I had taken GIOS the previous term). I would definitely recommend taking it if you\u2019re looking for a technically light course that will teach you interesting and somewhat off-beat things. There\u2019s a solid chance some CS people won\u2019t find all the psych stuff interesting, but if you\u2019re generally into learning or think psychology is cool there\u2019s a lot of nearby content to learn here.", "rating": "Loved!", "workload": "12 hours/week", "author": "UlA8nOt1mGf3z6mC7CaZv2fItJY2", "difficulty": "Medium", "semester": "Summer 2018", "time": "7/31/18, 12:07 AM"}, {"comment": "Although grades have not come out yet, I expect to make an A in this class. That does not mean I liked it, though. The class I thought I was taking would have dug into specific examples of good and bad human-computer interfaces, exploring the subtle wins of a good interface and picking apart bad interfaces and re-doing them to make them better. The class I actually took was a tedious slog of papers and terminology and grad. assistant research training. The one good thing I'll say about this course is that it ran like a Swiss watch: Everything was done timely, the materials were correct and made available well in advance. And being able to work ahead was very helpful with my demanding work schedule. Unfortunately, the content of the course was as dry as dust, which is disappointing considering the exciting advances being made in this area these days.", "rating": "Disliked", "workload": "10 hours/week", "author": "xwNa7JhJF8S78tDEDvc3o6tleCB3", "difficulty": "Medium", "semester": "Summer 2018", "time": "7/31/18, 11:29 PM"}, {"comment": "Pros:Incredibly well organized with plenty of documentation on the course website.You can work ahead - I finished all assignments and the project two weeks early because I had a vacation planned.Nice break from intense coding (I enjoy writing, but this may differ for others).Great class engagement and communication from Professor Joyner on Piazza.Gave me a new perspective on UX/UI design that benefits the work I do at my job.Cons:Emphasis on learning terminology.Overwhelming amount of reading assigned. I did not have time to read everything, and doubt many people in the class did. The exams are open book so I was able to look up what I needed and did well on both tests.Overall, I would highly recommend this class and believe it is applicable to nearly all areas of computer science.", "rating": "Loved!", "workload": "10 hours/week", "author": "Rq8gSjoThOObHRQMt6RTVKpL1h72", "difficulty": "Easy", "semester": "Summer 2018", "time": "8/2/18, 1:54 PM"}, {"comment": "Really did enjoy this class. I wouldn't recommend it to be paired with another class because the workload is kind of a lot. There are a lot of readings that are kind of boring, but the lecture materials are pretty interesting. 2 Open book tests and about 10 1600 word papers which sounds like a lot but you're given usually 4 or 5 prompts so you get to that word count rather quickly. Dr Joyner is really cool too and always active on Piazza.", "rating": "Loved!", "workload": "12 hours/week", "author": "NXwjubaYBxWS2VkecTYRJoKlP512", "difficulty": "Easy", "semester": "Summer 2018", "time": "8/3/18, 9:45 AM"}, {"comment": "I have not human factors background which increased my workload. Great material and I learned a huge amount from this class. Highly recommend it for anyone in software development. You build a project up through the semester and then have a final project that often during regular semesters include a group component that wasn't done over the summer class.", "rating": "Loved!", "workload": "15 hours/week", "author": "google:118317985782127465104", "difficulty": "Hard", "semester": "Summer 2018", "time": "8/3/18, 10:27 AM"}, {"comment": "Overall, Human\u2013Computer Interaction is a very good course that I highly recommend. It is cross\u2013listed as both a Computer Science course and a Psychology course, and they pair nicely. The course also helps develop two very important graduate\u2013level skills: research and academic writing. I believe both should be required for graduate\u2013level CS students. And if you have any intentions of pursuing a Ph.D. or writing an academic paper, this course will help you to develop the necessary skills.The course is challenging, but will not bring you to tears with mathematically complicated equations or difficult to comprehend algorithms. So, from that perspective, it\u2019s not difficult. But there is a LOT of writing and reading, and a lot of material and concepts to learn, digest, understand, and apply. You will read several academic papers and write reports weekly. If you are comfortable writing \u2013 especially academic papers \u2013 you won\u2019t have any trouble with this aspect of the course, outside of making sure you allot ample time for the work.In terms of projects; we had one individual project and did not have a group project in the Summer 2018 session. The project brings together everything learned throughout the course. It was very fun to pull together. Time\u2013consuming? Yes. Rewarding? Yes.Because we ended up writing 11 papers for this course, I now know that I can write about 150 polished words per hour. So, I have a personal metric. If I need to write a 1500\u2013word paper, I should expect to put in 10 hours of work. Add to this: 1) the time to watch the videos(1\u20132 hours), 2) read the papers(1\u20135 hours), 3) perform peer reviews(1\u20132 hours), and 4) work on your project (1\u20133 hours), I was easily at 20 hours per week. That said, when it comes to time estimates, it really is a case of \u201cyour mileage may vary\u201d and I know others who put in half the time I did and performed quite well.Grading this term was straightforward and effective. Nothing out of the ordinary, but I know our grading approach differed from prior semesters.Dr. Joyner (David) is a rock star! He was HEAVILY engaged and easily approachable on Piazza and on Slack, with replies measured in terms of hours (sometimes sooner). Although this is a MOOC\u2013style online course, his approach made us feel connected with him as an instructor. I highly recommend this course. And I\u2019m looking forward to taking other courses with Dr. Joyner, beginning with KBAI in the Fall.", "rating": "Loved!", "workload": "20 hours/week", "author": "wZ3bCuFS5XNalQZmqmY49KDKkMj2", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/3/18, 3:32 PM"}, {"comment": "I'll echo everyone else: well designed and operated course. Dr. Joyner was active except for when he was away for a conference. Too many readings made worse by a shorter schedule.I was initially very excited about the assignments but gradually became disillusioned. The grading made it feel like an exercise to hit all the questions without regard to actual content. There were assignments that I poured everything in and got disappointing grade because I missed some tiny details. On the other hands, some of my phone-it-in assignments got 20/20 and/or exemplary. shrugEven though my overall grade was very good, I didn't feel enlightened like I thought.", "rating": "Liked", "workload": "10 hours/week", "author": "uui3riNCFecfJh4IldluxvB0Ifu1", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/5/18, 11:51 PM"}], "difficulty": 2.553, "enrolled": 312.0, "id": "CS6750"}, {"rating": 0.0, "workload": 0.0, "withdrew": 0.0, "difficulty": 0.0, "enrolled": 0.0, "id": "CS7450"}, {"rating": 3.757, "workload": 13.251, "withdrew": 198.0, "comments": [{"comment": "Overall, an excellent course with a very engaged professor. I learned a lot and really enjoyed the projects. I learned a lot from the piazza interaction as well--a lot of great posts with related articles. There's also a great opportunity to think about the ethics of AI through the homework assignments, which I see as difficult but important.Easy to work ahead, which is a huge plus for me, although Exams must be taken during a given week.A significant amount of writing is involved in the course, which surprised me--this was my first course in OMSCS. 3x 10 page homeworks, 3x 10 page Project Reflections.I found that I wanted to continue working on the projects after they were turned in ... they're that fun.This was a great first course. I put in decent effort and received a solid A.", "rating": "Loved!", "workload": "10 hours/week", "author": "7sahxrcRKQWckSHip3XUcYMkdN33", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/7/18, 5:10 PM"}, {"comment": "Dr. Joyner and the TAs are very helpful and responsive, and it's clear that they care about the students' progress and learning. Course syllabus, grading and schedule are very clear and available at the start of the course. We had 3 homework assignments, 3 projects and 3 exams. The projects used Java or Python, and you can work ahead. Overall, an interesting course on AI, with lots of theory and also practical work in the projects. This semester, we had Raven's Progressive Matrices in the projects, but it looks like there will be some new projects in the upcoming semesters. It's not a very hard course, so it's suitable for students early in the program. Enjoyed it quite a lot and made me think both about AI and my own thinking.", "rating": "Liked", "workload": "10 hours/week", "author": "h9hGRWFkKxMACX1ktqs57XFxvr53", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/10/18, 9:13 PM"}, {"comment": "This was my first course in OMSCS and I really liked it. It would be a great first course for anyone. There is a lot of theory and no mathematics at all, there are 3 homework assignments, 3 projects and 3 tests. Tests are open book and simple, if you have watched lectures carefully, you will be able to get good marks on the exam. All the projects are connected to each other, there is an option to choose Verbal approach for first 2 projects but final project involves reading images and processing on it. I would recommend to start on visual approach from first project itself. Prof. Goel no longer teaches this course and Prof. Joyer is no less, he is actively involved in the Piazza discussions so as all other TAs. If you have any questions rest assured it will be answered very quickly on Piazza. There is a lot of writing involved in this course. Apart from homework assignments which are expected to be 10 pages long, each project has to have a reflection report which is again 10 pages long, so be ready to write up to 60 pages throughout the course. The good news - There is no team project !. The bad news - The experimental project of NLP was not offered in this semester.", "rating": "Liked", "workload": "12 hours/week", "author": "vee6XnNOGNUDb4uuWcIC1glpETy1", "difficulty": "Easy", "semester": "Fall 2018", "time": "12/11/18, 4:20 PM"}, {"comment": "KBAI was revamped for Fall 2018, so I think reviews are needed. You can see the syllabus for Fall 2018 term at http://lucylabs.gatech.edu/kbai/fall-2018/ .The class content is interesting but a bit theoretical; while it's grounded in AI, and you'll find examples of such topics when doing other AI classes, it's hard to really apply what is taught in the lessons to most of the things you'll do in the class.The course revolves around three homeworks, which are 10-page written essays about both class topics and other thems, three projects, which is actually the evolution of more or less the same task (creating an agent for solving Raven's progressive matrices, with harder and harder problems while going on), and three open-book, proctored one-hour exams.Homeworks are interesting; they invite you to actually reflect about various topics.The Raven's solver is interesting as well. You'll need to experiment with various techniques in order to solve the different kinds of problems around. I didn't especially like the \"implementation points\" section, but actually it seems that it's mostly free points for many people, so, it's not bad either. You must write a report along your implementation, and that report is 50% of your project score.Personally, I didn't like the exams. They felt more about wordplay and discerning ambiguities, rather than verifying if people understood or knew some content. But that doesn't mean they're overwhelming difficult.You can mostly frontload work, since the syllabus is complete from the beginning, but while you can implement your agent, you won't be able to test it his \"matching\" set from the beginning, so you may be forced to revisit it later on.All in all: a solid, well run, medium-difficulty, interesting class.", "rating": "Liked", "workload": "12 hours/week", "author": "BENvBvI1GPMkmgrY6x3AXbZJEir2", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/17/18, 4:23 AM"}, {"comment": "Very well thought out class. There are a total of 3 homeworks, each about 8-10 pages long, and 3 projects. I found the last project to be very time consuming, much more so than any of the other projects and homeworks. All the assignments are clear with almost no ambiguity and this class truly sets the standard for an online class. Overall, the material is interesting, the professor and TAs are very engaged on piazza and the class is manageable. Stay ahead of the lectures and projects.", "rating": "Liked", "workload": "15 hours/week", "author": "UFB2PrD13ShvuWoPKPYbzTbdnmy1", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/17/18, 12:21 PM"}, {"comment": "A very manageable first course. The lectures are good and the homework/exams draw from them in a way that never felt unreasonable. The projects rely on you either creating and implementing your own version of an algorithm that solves a complex series of visual analogies or doing the research to find approaches in papers and then implementing them yourself. Start the projects well in advance to allow for this and make sure you're comfortable with either Java or Python.", "rating": "Liked", "workload": "6 hours/week", "author": "mQwdw4tdLcciAM08PtTTnPhBOCj2", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/18/18, 1:50 PM"}, {"comment": "The concepts were interesting to me. I liked how learning was primarily via the lectures as opposed to a book. I didn't think the projects were super conducive to learning the concepts in the course. My investment in this course was very sporadic. Some weeks I wouldn't put any time into it and other weeks I'd be working on a project for the whole weekend. But the effort required is manageable, especially if begin working early, little by little. I highly recommend summarizing each lecture at the end (as they suggest) as it helps you solidify what you've learned and it is useful for reviewing the material before taking the test.Script for lectures: http://www.coursedocs.org/gatech/cs7637/index.html", "rating": "Liked", "workload": "5 hours/week", "author": "ibDnzSlG0xhZgRh0olkmxyM0rxC2", "difficulty": "Medium", "semester": "Fall 2018", "time": "1/7/19, 8:04 PM"}, {"comment": "KBAI was my third subject in the program, previous 2 being CV and DVA. I could not appreciate the subject matter enough. The paper does a good job at introducing you to the AI world, but it barely even scratched the surface - I found the complexity of the video lectures, the programming assignments(3), the non-programming assignments(3), and the exams unfitting for a graduate paper in a top grade CS program.Barring that, make no mistake that the paper was extremely well-run - the instructor (Prof Joyner) was very active and responsive on both piazza and slack; the TAs were extremely committed and helpful and there was nothing to complain about on the administrative side of things either.Overall, I recommend this course more as a filler course if you want an easy one to club with a difficult paper, but from a learning standpoint, I feel disappointed.", "rating": "Disliked", "workload": "6 hours/week", "author": "Y4uMNUApZaeNbqpqarUl8phjAy02", "difficulty": "Very Easy", "semester": "Fall 2018", "time": "12/27/18, 8:28 AM"}, {"comment": "Best professor of the program (Dr. Joyner) for sure. The one who cares the most about the learning process itself and the students. This reflects on the TAs' behavior and the overall quality of the course. There is a lot of writing involved, which it was a plus for me as I love it. But it is something to consider if you don't like writing that much. There is simply no way around it as all homeworks and projects require a 10-page essay. The course was taken on Fall 2018, and some changes were introduced to the course in relation to past semesters. For example, the projects used to have a curve and be graded solely on the performance of the AI agent submitted. For this semester, that component was reduced to be 30% of the grade, with another 20% coming from the improvement progress presented and the other 50% from the essay about the submitted agent. I hear the professor is considering some other changes that, if implemented, in my opinion, will improve the course even more for future semesters.This is one of those courses that one gets back what ones puts in. On my case, I ended up putting over 30 hours/week, not by necessity for the A, but simply because it is a subject that interests me a lot. But I can see people still getting the A with maybe 12-16 hours/week. Especially if you come with a solid Python background. Not a difficult course for an A, supper interesting topic, engaged students and great professor. Can't go wrong with that combo!", "rating": "Loved!", "workload": "30 hours/week", "author": "BOrATJWJeSeQORFh9FS5BQKEYol1", "difficulty": "Hard", "semester": "Summer 2018", "time": "12/22/18, 12:46 PM"}, {"comment": "Instruction The course content was interesting. The lectures are some of the best in OMSCS. There's plenty of supporting content and recommended texts if you want to learn more about a particular topic. TAs are awesome. Joyner is awesome. Piazza is active.Homework 3 writing assignments that cover a mix of concepts, applying the concepts, and ethics in AI/ML. Can work ahead and knock these out early which is nice.Exams 3 exams which cover concept definitions, applied examples, and details about specific concepts. Very much a Joyner exam if you've taken one of his courses before. Open everything with a 1 hour time limit. No curve.Projects You build an AI agent that can solve Raven's matrices problems (intelligence test problems). The project is broken into three phases, and you submit your agent along with a reflection/write up through the semester. The project was interesting, but I didn't change my agent's strategy after the first submission. I recommended taking the visual approach from the start. It's a little more work up front, but you have to use the visual approach on the third phase of the project.Future iterations might have a different project focused on NLP. Would love to see that.Pre-reqs You don't need a ton of background to do well in the course. Some experience programming in Python or Java will help. If using Python, you'll make extensive use of the PIL library for processing and working with images if the Raven's project stays as the core project in the course.", "rating": "Loved!", "workload": "12 hours/week", "author": "ttgsHfEZI9PvRCNqT300KNobIS52", "difficulty": "Medium", "semester": "Summer 2018", "time": "12/28/18, 6:40 PM"}, {"comment": "I love this course, well-constructed. Peer feedback is useful. A lot of writing like other reviewers said. All 3 assignments, midterm and final are writings but need to have good understanding of the course materials. projects are not quite related to course materials, requires some work.", "rating": "Loved!", "workload": "14 hours/week", "author": "1xw5CgvQVhbplzEGGzEjFidrwJb2", "difficulty": "Hard", "semester": "Spring 2018", "time": "3/27/18, 2:06 PM"}, {"comment": "This was my first class in OMSCS, so my review is also affected by how difficult I found balancing full-time work and personal life with this course. I found the class to be difficult. I thought the lectures in the first half of the semester were fantastic. I started liking them less later in the semester, but there were still some that I really enjoyed. I really like how Professor Goel made the classes interactive.What I found difficult about the course was the projects. The projects build on each other, which is cool if you feel you have a good grasp on the project and a good way to solve it, but if you don't have a good approach at first, you could potentially need to do a lot of refactoring. I have no experience with visual processing and am overwhelmed by the third project as a result.There are a lot of writing assignments, but personally I did not find them so difficult. However, you have a word limit and I think a lot of detail is expected.", "rating": "Neutral", "workload": "15 hours/week", "author": "Tgz2CI7ZmvYkDlPUJdSM2r8Mdzv2", "difficulty": "Hard", "semester": "Spring 2018", "time": "4/7/18, 10:22 PM"}, {"comment": "Projects: This was my first class in the program, so I chose to stick with the regular Raven's Progressive Matrices (RPM) projects. Prior to this class, I had no experience in Python or visual processing so I chose to implement the verbal method for Project 1. However, I regret going this route and wish I would've jumped into the visual method right away. I found that when I switched to the visual method, I was able to finish coding my project in < 10 hours whereas I spent well over 3x that amount of time trying to account for all the edge cases in the verbal method.Lectures: The lectures were very interesting in the beginning! However, towards the end, the topics seemed to overlap quite a bit so I started to lose interest in them.Assignments: The writing assignments were definitely interesting and allowed you to be creative in developing solutions for real-world AI problems. However, a common complaint among the class is that there was a larger focus on well-made diagrams as opposed to technical writing ability.Exams: The exams also required a large amount of writing (2k words for midterm, 3k words for final) and had ambiguous rubrics, which was frustrating because our responses were largely up to our interpretation of the problems presented.Teaching Staff: The teaching staff was great! Professor Goel is pretty active on Piazza, and the head TA (Yan) was generally quick to respond to any questions we had. Grades were consistently returned 2 weeks after submission, with the exception of Project 2 and 3. This was because they included opportunities for \"recovery credit\" in the regular project and also normalized the grades for alternate project with the regular project to keep the class average fair.", "rating": "Liked", "workload": "15 hours/week", "author": "EB4VFRhI9GVgNn8ZttQzY7ivJlZ2", "difficulty": "Medium", "semester": "Spring 2018", "time": "4/26/18, 8:26 AM"}, {"comment": "Pros:course are well organised and contents are understandableTAs and Profs are very responsiveCons:The concepts taught here might be too generic, it feels like the same contents are being repeated again and again in different termsTons of writing involved in this class, think about taking this class twice if you are not good at writing essaysThe grading of writing assignments are largely based on the diagrams you draw. Yes, we do agree diagrams will help illustrate the ideas, but it shouldn't play such a large part in gradingThe Projects are about solving RPM problems by building an AI Agent, it sounds like a real AI project, however from my personal experience, it feels like a normal programming assignment, the Intelligence part is not that much...Final Exam Drama:So the prof posted final exam paper, which is a writing assignment. After three days when many people have finished the paper, they found out that the solution to one question (Q3) is available online. They took that question done and posted another version of final exam paper, many people's efforts in that question are now in void.The worst part occurred in grading Q2, Q2 is a perfect example to be solved using version space as per discussed in lecture videos, it could be solved using Incremental learning concept as well, they are largely interchangeable and there is no absolutely right or wrong. Students who use version spaces concept didn't get much credit, when being questioned, the prof's response is like belowBriefly, the original final examination contained a specific question on version spaces using the same data as for Q1 and Q2 in the current final exam. Given that we had a question on version spaces in the original final exam, it was clear that Q2 referred to Winston's method of incremental concept learning (and not version spaces).So the grading principle is, because the original problem Q3 is using version spaces, thus Q2 cannot use version spaces concept. That is indeed ridiculous as Q2 and Q3 are not related, and students taking the exam shouldn't guess which concept to use based on a question that has been deleted from the paper! Disappointed and cannot understand what they are thinking.", "rating": "Disliked", "workload": "9 hours/week", "author": "2j3wTbXyCfbVMJzsgYaQf6FqSOS2", "difficulty": "Medium", "semester": "Spring 2018", "time": "5/6/18, 3:35 AM"}, {"comment": "I feel KBAI is a great course to begin OMSCS. My background is in electrical engineering so my software development skills are limited compared to others working through their OMSCS degree. This course provides the option to utilize either Python or Java to work through the three projects that build on each other throughout the semester in order to develop an AI agent that is able to solve Raven's Progressive Matrices problems. I found the material extremely interesting. It is a bit of a jump for those with limited software development experience translating the theoretical course material and applying it to the projects, but extremely manageable after dedicating the expected amount of time. Three assignments must also be completed throughout the semester that are 1000-1500 word essays on various topics taught throughout the course. The midterm and final exams are both take home essays that must be completed within one week and the expected word counts are 2000 and 3000 words respectively. It is a very well run course and the TA's and professor are extremely active within Piazza.", "rating": "Loved!", "workload": "15 hours/week", "author": "iEAFhrFn3wfeg0cpyOcxwnkeWbC3", "difficulty": "Medium", "semester": "Spring 2018", "time": "5/7/18, 8:11 PM"}, {"comment": "This is a very well-structured class. The material is very interesting and presented very clearly, and all course material is available at the outset of the course. There are 3 assignments, a 3-stage class project, and peer-reviews for all assignments and project stages.Assignments:The 3 assignments are essentially essays that ask you to leverage class material to either a specific topic or a topic of your choosing (depending on the assignment). You often have a choice between which material you wish to discuss, so as long as you illustrate you understood those topics and provide a reasonable answer to solve the posed problem it's not too difficult. I would recommend using lots of figures, since the word limit can sometimes be tight, so flowcharts, pseudocode and illustrations in general are very helpful. Make sure to answer all rubric questions provided for each assignment.Projects:The class project is broken into 3 stages. The main overall class project is to develop an AI agent that can solve Ravens Progressive Matrices, a standardized test of intelligence. I say main project since they also allow you the option to complete an alternate project for projects 2 and 3, which involves developing an AI agent chatbot that can answer questions based on answers from an FAQ. At each stage, you deal with progressively harder requirements / problem sets, and you will need to also write a project reflection describing your approach, what you learned and how it connects to KBAI topics. Start projects early, so you don't feel overwhelmed trying to rush things last minute. Don't neglect the written reflection too, as it's normally 40-50% of each project, and make sure to again follow the project rubric to make sure you answer all questions on each rubric.Exams:There are 2 take-home examinations, which aren't too difficult. They are essay-based, much like the rest of the course aside from project implementations, and you have a week to complete each exam.Peer Review:You will also need to complete peer review for all assignments, all 3 project reflections, and the mid-term and final exams. They don't want single sentence sort of peer reviews, so you will have to put a bit of effort into leaving some good feedback here.TAs: TAs and the prof were all very active on Piazza. There were a few grading hiccups towards the end of this semester, but they were rapid in addressing these issues and correcting mistakes where necessary. I believe the prof, Dr. Goel, is stepping down and there will be a new prof so I'm not so sure if the exact structure of the course will be as described above, so take these notes with a grain of salt.Prep: This is a good first class, but if you aren't comfortable with Python or Java then you should get brush up on one of these prior to starting the class. Most people use Python, and if you want to complete the alternate Chatbot project, it is only Python. Prepare for a lot of writing, as in total I wrote about 11-13k words across all assignments, project reflections, and exams.", "rating": "Loved!", "workload": "16.5 hours/week", "author": "WI6Lt9NmqYZAO9vyNJKFRgf8JQ32", "difficulty": "Medium", "semester": "Spring 2018", "time": "5/10/18, 4:26 PM"}, {"comment": "One of the courses with the most genuinely involved instructors. They are actually around all the time and are still experimenting with and improving the course even though this is one of the oldest courses in the program. Professor Goel is going to stop teaching this course starting next semester, but it will still be taught by Professor Joyner (and Bobbie Eicher), so you can still expect a lot of instructor involvement. The course does open book exams without proctortrack, which is personally my favorite mode of doing exams since proctortrack is so constraining. Decent amount of freedom to explore and experiment in the assignments if that's what you want to do.My main issue (and it is a big one) is that the material itself feels pretty dated: knowledge-based AI isn't really in fashion in our age of ML and deep learning, so I took this course to see if there was still interesting techniques in that domain, and frankly I don't think I've been convinced: there is a lot of material in this course, but much of it seems obvious, brittle, or excessively vague. Also there seems to be a lot of repetition in the material, where techniques that are extremely similar get presented separately due to what I think are very minor differences.In summary: this is a well-taught course. It does require you to write a lot but you don't need to be a genius to get an A, just do your work consistently. However, don't expect your mind to be blown by the material, and be aware that you are learning about an area of AI that is now fairly outdated.", "rating": "Neutral", "workload": "6 hours/week", "author": "S04P65QidHbnrvaC3qST5HpRjxh1", "difficulty": "Medium", "semester": "Spring 2018", "time": "5/10/18, 10:15 PM"}, {"comment": "I took KBAI as my first course in OMSCS and was very impressed with the organization and quality of the course. The interaction with TAs, Professor and fellow students on Piazza was one of the highlights. Much of the course centers around 3 projects that implement an AI agent to solve Raven's Progressive Matrices. This semester there was an alternate project offered for projects 2 and 3 for a select number of students that implemented a chatbot. In hindsight I wish I had taken the opportunity. I believe the chatbot project will be offered to more students in future semesters. My only gripe is that we didn't have more project based work that allowed us to implement techniques learned later in the course. The Raven's projects really only implemented techniques learned in the first few weeks. Be prepared for a lot of writing. Also, you can put as much time as you want into this course so it is a little dangerous. The homeworks and projects are very open ended.", "rating": "Liked", "workload": "15 hours/week", "author": "du7bZzS1MJVOAK5FCEpDPLzmrsu2", "difficulty": "Medium", "semester": "Spring 2018", "time": "5/22/18, 1:41 PM"}, {"comment": "Well organized with great communication between instructors and students. I would have appreciated more direction in the projects and more practical examples in the lectures. I felt the alternate chatbot projects were harder, more interesting, and more applicable to the course material.There is a non-trivial amount of writing in the course. Three assignments, two exams, and peer feedback were entirely writing. The three projects have a coding component and a writing component.This was Dr. Goel's last semester teaching this course.", "rating": "Liked", "workload": "12 hours/week", "author": "BakReqMupDdj25PaVeQ4KHWcPYs2", "difficulty": "Hard", "semester": "Spring 2018", "time": "6/1/18, 2:41 PM"}, {"comment": "KBAI is like a good game: You can have a lot of fun on the main quest (get raw points re-implementing the CV-focused known path), or a lot of fun on side quests (implement something else entirely and loosely tie it back to lecture content), and there's no way to lose.", "rating": "Loved!", "workload": "15 hours/week", "author": "google:114588245870326197003", "difficulty": "Hard", "semester": "Spring 2018", "time": "8/3/18, 10:00 AM"}, {"comment": "Definitely not a course I would have taken if I could have helped it. The lecture material is wholly unhelpful for the project and you're graded based on the performance of your project compared to your peers, which varies wildly based on the KBAI techniques that you use. I scraped by with an A from being ahead of the curve in the early stages.", "rating": "Disliked", "workload": "20 hours/week", "author": "2XWRCMgcpsNlavSSiqaGn8XjW4I2", "difficulty": "Hard", "semester": "Spring 2018", "time": "11/7/18, 12:02 PM"}, {"comment": "This used to be an easier class, but like everything on omscentral the Professors are using this site as a way to gauge what courses to make more difficult each semester. I took the Fall 2018 course but the menu is not letting me select that semester as an option. The course is very informative and well run, but you will do a lot of writing and you are not allowed to rewrite anything, and the tests are designed to trick you so studying is rather pointless; just guess and pray.I will have to retake the entire semester because one of my essays was not well written as I was so busy with another very hard class, I dropped the other class but it was already too late. Just take one class at a time at GAtech, even courses like this one that are not initially hard will be revamped until you start bleeding. I really liked the material but the grading has nothing to do with how much you have learned.No curve(anymore), no regrades(anymore) and the extra credit required you to have the top results in class, so unless you're already a python wiz you won't get that either. I am so burnt out and cannot wait to finish this degree, but it's my fault I was really trying to learn and grow before I took this class. Not at GAtech, just pass the autograder; like in highschool that's all that matters is a grade. Do your research and real learning elsewhere.", "rating": "Liked", "workload": "20 hours/week", "author": "BduviuiuCuT2adjvkCVOWytYkfX2", "difficulty": "Hard", "semester": "Spring 2018", "time": "1/16/19, 4:58 AM"}, {"comment": "I'm writing this almost a year later.I've several years of experience with Java but had no prior experience with Python or AI/ML/NLP.This was my first OMSCS course and it was nothing short of an amazing learning experience. Professor Goyal was amazing and very engaged as an instructor.KBAI is more of a classical view of AI, unlike the AI that is heavily reliant on humungous amounts of data. The projects involved solving Raven's Progressive Matrices increasing in difficulty. There was also peer-peer evaluation of the assignments (only the report parts) which gave a chance to view others approach towards the same assignments.There was an option to opt for an NLP based alternate project instead of continuing with the RPM project. It was about implementing a chatbot agent that could answer course related queries. I had opted for this. The course officially did not cover NLP in the lectures and we had to do our own research on it.Another really interesting aspect of this class: few of the TAs were actually chatbot agents! The class itself was also an ongoing research on AI by Dr. Goyal. For more on this see https://www.youtube.com/watch?v=WbCguICyfTAThe grading was curved and I ended up with a low A.TAs did a commendable job. Overall this was a very well managed class.", "rating": "Loved!", "workload": "15 hours/week", "author": "imX0E0Z9LjOu8srTd47cwwPFf9A2", "difficulty": "Medium", "semester": "Spring 2018", "time": "3/24/19, 2:48 AM"}, {"comment": "This is hard for people weak or not so strong programming background in Python or Java. For software ninja's this will be medium to easy. I end up dropping it because I graduated a Python CS class, been coding for 3 years and still was not able to use PILLOW library and create a program that compares graphics and selects a pattern. You need to have your data structures, data patterns, problem solving skills in check for this subject and probably to a lot of OMSCS subjects", "rating": "Liked", "workload": "10 hours/week", "author": "M2gksAHzPRUVUG1Elagqygmaf8B2", "difficulty": "Hard", "semester": "Spring 2018", "time": "4/3/19, 6:05 PM"}, {"comment": "The class has 3 assignments, 3 projects, and a midterm and final.The assignments, midterm and final have no coding at all.It's good to know going into it that this class is heavy on writing. In total I wrote 48 pages for this class across 8 papers.The projects have two parts: coding and writing a reflection paper. The code is focused on creating an agent that can solve the Raven's Progressive Matrices IQ test. Don't be afraid if your agent can't solve all the problems, getting 50-75% of the problems right is usually good enough to get an A. The reflections are about the agent's problem solving process, performance, and relation to human cognition.Grading is competitive. If you stay above the mean, you get an A. In my semester the mean was ~81%, so 84% was an A.", "rating": "Liked", "workload": "15 hours/week", "author": "ETTxueJHM9UMuP1legZ1Y3lh6Af1", "difficulty": "Hard", "semester": "Fall 2017", "time": "4/4/18, 10:56 AM"}, {"comment": "This is a very well run course. The TAs and the prof are always active on Piazza ready to help. We had regular office hours meet twice a week up until the last project. Even though there was a disconnect between the RPM projects and the course contents, the 3 RPM projects itself was very interesting and thought provoking. There is a Alt project after the first mandatory RPM project that deals with chat bot which I believe is more relevant than RPMs. Expect lots of writing in this class. I struggled with the writing assignments in the beginning but managed through later as I adjusted to the rhythm. In all there are 3 writing assignments, 3 projects with the project reflection associated with them, a mid term and a final exam. If you hate writing, this class may not be for you. Projects can use Python or Java. I would recommend brushing up your Python skills, especially Pillow and numpy for RPMs and NLTK for chat bot. This is a great first course to take and will set you up for the rest of your OMSCS journey. Good Luck!!!", "rating": "Loved!", "workload": "10 hours/week", "author": "LvqblwCSqFUIjBYwFtnyQ7S1hwd2", "difficulty": "Easy", "semester": "Fall 2017", "time": "12/8/17, 9:07 AM"}, {"comment": "This is one of those classes that seems to have a very divided opinion. I\u2019m in the class-is-a-gigantic-waste-of-time camp. I appreciate the enthusiasm of the professor. That\u2019s nice. But everything about the class felt like a joke to me. The content of the class is super hand-wavy and not really tied to anything useful (as far as I can tell). The projects were a little fun at first, but they only use the course content in a superficial way. For me, the writing was a terrible use of time and energy. The only thing I learned while writing for this class is how to write against the given rubric. If you enjoy learning interesting ideas/concepts/techniques and demonstrating your newfound knowledge by building cool things, I would look elsewhere.", "rating": "Disliked", "workload": "20 hours/week", "author": "zmKcBlwbvdWeUbDyKQ4IgsTti6y2", "difficulty": "Medium", "semester": "Fall 2017", "time": "12/9/17, 11:18 AM"}, {"comment": "This is a hard one to rate. If you're looking to learn about AI, this is probably not the class you expect it to be and almost feels more like a psychology class at times. You'll be doing a ton of writing. We had three 1500-word project reflections, three 1000-word assignments, a take-home 2000-word midterm, a take-home 3000-word final, and three Peer Feedbacks to complete for each of those. Coding is limited to your 3 projects, which for most will be focused on writing a program that can solve Raven's Progressive Matrices (Java or Python with Pillow/NumPy). A small group of students was allowed to pursue Alternative Projects 2 and 3 which focused on writing a FAQ-based chatbot (Python/NLTK). The lectures were well-made, but cover very high level topics. There really isn't anything that helps you synthesize the course concepts. The RPM project only vaguely relates, depending on your approach, and the assignments and exams make it easy to cherry-pick through the lectures to get your answers, which are often somewhat subjective anyway. The course is very generously curved with anything over the class mean being an A, so it's an easy course overall. The instructor/TA interaction on Piazza is great and I was glad to see Dr Goel engaging with students at least a few times each week, even while traveling. We had a nice community going on Slack, too, which helped build camaraderie and made it fun to participate. Peer Feedbacks were very hit and miss and probably should have been scrapped entirely for the Final Exam. Peer grading didn't affect anything, but led to morale drops when getting overly-negative feedback and a lot of confusion when asked to grade another student without knowing the correct answer. Overall, it's a fine class. It's front-loaded, smoothly-run, and generally fun, but you're not likely to come out of it with many new skills that can be directly applied to anything. As with most courses, though, it's what you make of it.", "rating": "Neutral", "workload": "10 hours/week", "author": "FXHiMYkeykR5gFPvejJHtlYaYLG2", "difficulty": "Easy", "semester": "Fall 2017", "time": "5/2/18, 4:10 PM"}, {"comment": "Like many have said, this course is a very high-level view of a broad set of AI concepts. Good writing skills (with diagrams) are key to achieving high scores, as all assignments, projects, and exams are in writing. The project is very interesting and challenging, and all assignments and projects are released at the beginning of the semester so it is possible to front-load the project and finish it early.", "rating": "Liked", "workload": "10 hours/week", "author": "CsZkRTPoOQgKHgYpBpVIrfh3XqV2", "difficulty": "Easy", "semester": "Fall 2017", "time": "1/28/18, 2:44 AM"}, {"comment": "This was my first semester, first course so I can't really compare KBAI to any other OMSCS class. That being said it felt like a well-run class. Professor and TAs are active on Piazza. Good, well-known and communicated structure. Good lectures. Interesting projects. Generous grading. Medium workload, not very difficult. I could not have wished for a better start into the program. I will say, however, that there is a lot of writing (in total we had to write 8 essays for a total of about 15.000 words) and reading for peer feedback (24 peer feedbacks in total, 3 for each essay) which means you will read and critique another 120.000 words.For me it was perfect to get my writing in shape, get familiar with python which I didn't know before, get familiar with Piazza, T-Square and Peer Feedback in a class that was busy at times but not too bad in total. I recommend taking it.", "rating": "Liked", "workload": "10 hours/week", "author": "Z5jBJCSQfrhf8wHAnvdjQpPGu8z2", "difficulty": "Medium", "semester": "Fall 2017", "time": "4/3/18, 3:32 AM"}], "difficulty": 3.22, "enrolled": 764.0, "id": "CS7637"}, {"rating": 4.008, "workload": 20.647, "withdrew": 504.0, "comments": [{"comment": "Profs Isbell and Littman are possibly two of the best teachers of material I've encountered, and I've taken a Loooot of classes at a lot of places. The course is challenging, but the challenge comes from the material itself, and not from, say, a terrible lack of clarity in expectations and instruction.I really had very little interest in ML prior to taking this class, and I ended up really enjoying the course because of the professors.", "rating": "Loved!", "workload": "25 hours/week", "author": "1Uh3qIUXFHVZwQIun8a0ijI7IYB3", "difficulty": "Hard", "semester": "Fall 2018", "time": "11/8/17, 5:26 PM"}, {"comment": "Background: Took this class by itself Fall18. First OMSCS class, with background in statistics/applied MLThis course delivers what it promises, a whirlwind tour of machine learning topics. Very rewarding experience, I enjoyed it thoroughly. Like with most things, you get what you put in.I enjoyed the lectures, Littman and Isbell build up the theory empirically which is great to build intuition however not as efficient when rushing through the lectures at the last minute studying for an exam. My thoughts are to watch these lectures early, take notes and use the notes/lecture transcripts as the main focus of study for exams. Re-watch lectures to reinforce certain topics.Having some background knowledge in ML is very beneficial, use Andrew Ng\u2019s Machine learning course on Coursera as complementary material.Start the assignments early! Don\u2019t wait until the last week. On paper it seems like you have a lot of time per assignment, but understanding the API/code, running the experiments, understanding and explaining results takes time. I enjoyed the open ended assignments as it provided more room to explore.Due to the structure of the assignments, consistency in grading can be an issue in the MOOC format, (Isbell does have a generous curve to help alleviate this). That being said, I really liked the report format of the assignments, writing them helped solidify concepts.Some TA\u2019s are very good and active on forums, others are lower energy but they do hold a group office hours every week and take questions. Do attend/watch these as they provide solid guidance for assignments.Do not stress too much about grades, put in the effort, do your due diligence and you will be fine. Its a tough course but looking back its been a lot of fun.", "rating": "Loved!", "workload": "25 hours/week", "author": "USqR8N1JUgSlLz7fIB7xX06aiGC2", "difficulty": "Hard", "semester": "Fall 2018", "time": "11/28/18, 10:44 PM"}, {"comment": "What a ride. The professor predicted at the beginning of the semester that we would look back on the semester with tears and eventually they would be tears of joy. He was right. As a survey course, we learned a little about a lot, but because of the intensity of the projects we also learned a lot about a little. I thought this course went perfectly with AI as many of the big ideas were similar and we investigated different parts of the similar ideas so it gave me a fuller picture.", "rating": "Loved!", "workload": "20 hours/week", "author": "KCfFLF4MYXOiFUgBw96q5ZoP6Ew1", "difficulty": "Very Hard", "semester": "Fall 2018", "time": "11/29/18, 11:25 PM"}, {"comment": "This course serves as a great introduction into the theory and actual practice of machine learning. I came into this course having no experience with ML whatsoever and was able to succeed with the course format. The majority of the work centers around four assignments on different ML fields. Students are given 5 weeks for the first topic and assignment to help learn the format with 3 weeks given for the remaining assignments. Each assignment gives you the freedom to choose your own data or problems. Then the student can cite and use any implementation of the four assignments to produce the results. These assignments will make you go through the painful learning process of cleaning data, balancing data, setting up pipelines, visualizing data, and analyzing the results. All of these steps are a part of actually using these techniques in research and business. Students are evaluated completely on their ability to understand and explain the results in a 10 to 12 page report with no points for implementation. I spent from 30-50 hours on each assignment to go from learning the technique to completing the report.The four topics are supervised learning, randomized optimization, unsupervised learning, and Markov decision processes. The lectures are great at building the foundation of the approach, biases, strengths, and weaknesses of the different techniques. The midterm and final then evaluate the student's ability to understand these traits of each approach to then decide which algorithm would be the most appropriate given a specific problem. Grading largely depends on being able to explain the \"why\" of your approach and implementation format and the \"why\" your learners performed the way they did. You will not receive points for simply using 12 pages to list the observations that you see on your graphs or tables, which also serves as a point of frustration for some students. Grades are significantly curved such that over 90% of students who do not drop receive a B or higher.All of the \"I don't care\" rants on this review board refer to Dr. Isbell having to repeatedly tell students that he does not care about what language or software you use to implement the ML techniques. This class has a lot of flexibility which tends to frustrate those students who have the expectation that every little detail needs to be outlined as the definition of \" a great learning experience.\" Dr. Isbell also loves sarcasm which some students cannot understand or do not like, which leads to a lot of the \"unprofessional\" comments on here.Overall, this course can teach you the practical and theoretical foundation for ML if you are willing to actually work for it.", "rating": "Loved!", "workload": "20 hours/week", "author": "AAhVG90JRcQCBBqwZwGK78TaucU2", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/4/18, 10:33 AM"}, {"comment": "Out of all the OMSCS classes, this felt the most like a traditional, in-person class, which also means that this was my least favorite class in the OMSCS program. It was nowhere near as difficult as people are making out to be due to the generous curve, which was a plus. However, I feel I learned very little for the amount of effort I put in. While the lectures had a friendly, fun vibe, I learned very little from them. There are much better resources available for free (for example, YouTube) that I had to use in order to gain an understanding of the material. I just think that since I'm paying to take this course, the lectures should be top-notch and not surpassed by free YouTube videos, which do a much better job at explaining the concepts.The homework assignments did little to increase my understanding of the topics, and the comments from the TAs were not very helpful, for the most part.In studying for the tests, I was having flashbacks to my undergrad days, wherein I'd cram in order to regurgitate the material on the test, only to forget it a few days later. Being that the OMSCS program is supposed to be the cutting edge in terms of educational content delivery, I think they could do a lot better. Why attempt to recreate the outdated and anachronistic in-person classroom experience when the medium allows for so much more (for example, making the course more interactive)?", "rating": "Strongly Disliked", "workload": "20 hours/week", "author": "1aDe0UDjZKMgV0DExDP444M4c423", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/10/18, 2:46 AM"}, {"comment": "TL;DR - Super time consuming; requires a lot of information synthesization; Lectures are fantastic but the professor is a bit of a jerk on Piazza (TAs are good though).All the course material (except exams) is released at the start of the semester. I highly, highly recommend getting ahead on the video material because the assignments are so time consuming. Video lectures are fantastic and informative, and the supplementary material is interesting, but definitely not required to do decently in the course.Assignments are practically academic papers, and are usually ~10 pages in length. They are very time consuming - they require programming (although the prof actively encourages stealing code from the internet), creating analytic charts, and then interpreting your results and comparing and contrasting different algorithms.Exams consist of 15-20 \"open response\" questions (a subset is T/F + justification). It tests your ability to synthesize information from the course, rather than your ability to program. You get 90 min for the midterm, 3 hours for the final (even though they're about the same number of questions).The TAs had helpful office hours, especially when it comes to what they're expecting to see in the assignments. Getting answers in Piazza is a little bit of a crapshoot; there's so many students and posts. I have to say by far the most disappointing part of the class was that the professor spent a significant amount of time on Piazza, but 95% of his responses were sarcastic, making fun of the student, and decidedly unhelpful (a la \"you know the answer to that\", \"look at the syllabus\", etc.). The TAs actually bothered to answer questions, though they didn't get around to answering everything (unless it was submitted to the office hours question set).There is a generous curve, most students end up with an A or B, despite exam averages around 55% (assignment averages were higher, but still not high).Fall 2018Very HardLiked16 hours/weekOMSAAuthor: JmiJ2fb8c8XtLhdki3sTYTvEZxC212/10/18, 11:18 PMI took RL before ML so this review reflects that.I enjoyed this course. I liked RL a bit more, but that is more due to taste than material per se. Same instructors (Isbell and Littman) who are great. They always keep the material engaging while at the same time you learn a lot. Isbell is no-nonsense in Piazza which I love. It is a big class but it is run very well by him and the TAs.4 projects with a midterm and a final. You can steal as much code as you want as long as you source it. The main idea is your write-ups. I stole very liberally but still learned a lot and did well. I think the TA you get assigned has a little bit of randomness to your grades but even when I did not do well the feedback was useful. The exams were challenging but fair. Highly recommend the course just be willing to put in the work and you will be rewarded!The last 1/4 of the class was relatively easy as it was a return to RL but it was nice for me to get a little break at the end and front load instead. Exams are at a specific time but you can (and probably should) work ahead on all the projects.", "rating": "Liked", "workload": "20 hours/week", "author": "9EQQI4lgYNh8xMJa8ziqbD9T8E53", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/10/18, 10:23 AM"}, {"comment": "I took RL before ML so this review reflects that.I enjoyed this course. I liked RL a bit more, but that is more due to taste than material per se. Same instructors (Isbell and Littman) who are great. They always keep the material engaging while at the same time you learn a lot. Isbell is no-nonsense in Piazza which I love. It is a big class but it is run very well by him and the TAs.4 projects with a midterm and a final. You can steal as much code as you want as long as you source it. The main idea is your write-ups. I stole very liberally but still learned a lot and did well. I think the TA you get assigned has a little bit of randomness to your grades but even when I did not do well the feedback was useful. The exams were challenging but fair. Highly recommend the course just be willing to put in the work and you will be rewarded!The last 1/4 of the class was relatively easy as it was a return to RL but it was nice for me to get a little break at the end and front load instead. Exams are at a specific time but you can (and probably should) work ahead on all the projects.", "rating": "Liked", "workload": "20 hours/week", "author": "JmiJ2fb8c8XtLhdki3sTYTvEZxC2", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/10/18, 11:18 PM"}, {"comment": "I signed up for the course with prior knowledge in ML (lots of MOOCs and project experience) - overall I did not learn anything \"new\" apart from the randomized optimization part which I've never read about.Most of the lectures are very superficial IMHO and the prof just says you have to go read the material to get a better understanding... and there are far better lectures on ML topics on YT than the ones you have in this course. For the RL part tho, Littman was excellent. It's hard to find decent lectures on RL (apart from the ones by Silver) and the ones by Littman are probably the best for intro to RL.The projects are where the majority of the learning happens. You are given a purposefully vague description of what you are supposed to do and write for the report - yes, you can rip code off the internet as all of the grading is done based on your report. These are also useful as part of a portfolio you are building if you want to be in a ML field eventually. The projects are not too hard to do. Once you setup a pipeline for experiences you can pretty much use the same pipeline for the almost all of the projects.There are 2 exams - the Midterm is the difficult of the 2. IMHO the tests did nothing to reinforce/test the knowledge I gained from doing the course. I liked RL's final exam a bit better.This course is going to take alot of time if you are not used to quickly doing a lot of experiments and are new to the ML subject. But you do have 1 month for each of the 4 projects and if you plan properly, you can do well without any of the last minute panicking which most students do.Overall, it's a decent course - I expected a bit more depth and bit more time spent on each algo - trying out how it works, internally and getting to know the basics inside out. Nevertheless, this course is a good intro to ML - don't expect to learn a lot/new stuff if you have already taken MOOCs and/or have prior experience in this field.", "rating": "Neutral", "workload": "15 hours/week", "author": "AuPkmUYH5oZimXMWRqoZOibVeoh1", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/13/18, 8:46 AM"}, {"comment": "This class achieves what it sets out to do: give you a foundation of core ML topics that you can then use to build on or explore deeper into topics of your interest. Overall, I found the lectures to be fairly interesting (sometimes the pacing was a bit slow though). However, I was not a huge fan of the 4 papers that make up over half the grade but I admit this is most likely cause I prefer to code over write papers. The tests were exceptionally challenging but fair, they were more focused on reasoning than just reciting definitions.This was definitely a class I hated while taking it but upon reflection I realized I learned quite a bit... Neat.", "rating": "Neutral", "workload": "15 hours/week", "author": "XGaU42aBN7Pn0jYEjzRb5aCcFDq2", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/12/18, 3:55 PM"}, {"comment": "Awesome course and great to interact with the professor, even if the interaction mostly consisted of trolling. I guess there's really no time for a professor to dole out actual detailed advice on a MOOC - once you start, you would never be able to stop. It would be good if you could receive more timely, detailed, and consistent feedback on assignments, but I think delivering on all three fronts simultaneously would add to the list of impossibility theorems - there's no free lunch, as professor likes to say. Homework and exams are well designed to make you think about and apply what you have learned; good grades are hard earned. But ... lack of transparency in the grading process leaves many wondering how to improve.Hard to say how many hours I averaged, the two weeks leading up to assignment due dates were possibly 50-60 hour weeks, and the couple of weeks I took as relative down time only made the following weeks worse.Despite any flaws this is engaging and a must-take course if you're at all interested in the data science / computational analytics, both for the criticality of the material and the quality of the learning.Don't spend so much time tinkering with data that you don't leave enough time to write a good report.Fall 2018Very HardLoved!30 hours/weekOMSAAuthor: zUf4UurbGcS3nfdXKY9oZ6fnbx1312/16/18, 8:06 PMTL;DR: Hand things in, get a B. Stay above the (low) mean, get an A. Learn to live with ambiguity.Well, what can be said that has not already been said? If you want to focus on ML you have to take this class. This class has not been updated in many years... including the exams. There is a lot of ambiguity to the assignments, so expect a grade of 50% to 100% on any given assignment with little certainty of which you will get. You won't have enough time for the midterm, and too much time for the final. You may similarly not feel like you know if you are answering the exam questions properly.For grading, the assignments are lenient and the exams less so. I managed to get 100/90/90/90 on the four assignments and at I was shocked at least one of those 90s was not 40. That's just how it goes.If you are ok with ambiguity you should make it through without much pain. Hand everything in, even if trash, and you get a B. Stay above the mean most (if not all) of the time and get an A. Improve over time in a noticeable way, as in you start with a 40% on the first assignemnt but finish with 100%, probably get an A. Keep in mind the mean might be 60-70% overall and as low as 50-60% for specific assignments and exams.I was torn on the rating to give here. I enjoyed much of the class content and Isbell's interactions on slack and piazza, but the mechanics of the class left much to be desired. I've taken classes like GIOS which were amazing in their execution. When I took DVA Joyner was running the class and it was a textbook example of how to run an online class (or any type of class). This is nothing like those, but you have to take it if you want to specialize in ML.", "rating": "Neutral", "workload": "15 hours/week", "author": "eNsHuIgCnqZbviEthvdfHVK6ZlA3", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/13/18, 3:50 AM"}, {"comment": "TL;DR: Hand things in, get a B. Stay above the (low) mean, get an A. Learn to live with ambiguity.Well, what can be said that has not already been said? If you want to focus on ML you have to take this class. This class has not been updated in many years... including the exams. There is a lot of ambiguity to the assignments, so expect a grade of 50% to 100% on any given assignment with little certainty of which you will get. You won't have enough time for the midterm, and too much time for the final. You may similarly not feel like you know if you are answering the exam questions properly.For grading, the assignments are lenient and the exams less so. I managed to get 100/90/90/90 on the four assignments and at I was shocked at least one of those 90s was not 40. That's just how it goes.If you are ok with ambiguity you should make it through without much pain. Hand everything in, even if trash, and you get a B. Stay above the mean most (if not all) of the time and get an A. Improve over time in a noticeable way, as in you start with a 40% on the first assignemnt but finish with 100%, probably get an A. Keep in mind the mean might be 60-70% overall and as low as 50-60% for specific assignments and exams.I was torn on the rating to give here. I enjoyed much of the class content and Isbell's interactions on slack and piazza, but the mechanics of the class left much to be desired. I've taken classes like GIOS which were amazing in their execution. When I took DVA Joyner was running the class and it was a textbook example of how to run an online class (or any type of class). This is nothing like those, but you have to take it if you want to specialize in ML.", "rating": "Neutral", "workload": "15 hours/week", "author": "zUf4UurbGcS3nfdXKY9oZ6fnbx13", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/16/18, 8:06 PM"}, {"comment": "This course is hard for all the wrong reason. 1) The lectures are a banter between two professors. It is difficult to follow and makes the lecture unnecessarily long. 2) The professor gives no credit for coding you need to do to complete the projects. This leads to a lot of confusion. Instead of professionally dealing with the confusion, the professor is very adversarial and humiliating. 3) I also don't understand why the coding required for the projects is not provided upfront. That way students can concentrate on the analysis which is the goal of the projects. That also takes away all the confusion which results. 4) I personally don't think the TAs are a problem. However they seem to take the cue from the professor and behave similarly. Some of the students also become very aggressive on Piazza and there is no one stopping them. 5) Given the number of students, grading is slow. There is no well defined rubric and no clear way to challenge your grading.Overall very bad experience. Coming from ML4T, this was hell and again all for the wrong reasons. I regret going for the Machine Learning specialization. I will never do another course where Dr. Isbell is involved.", "rating": "Strongly Disliked", "workload": "20 hours/week", "author": "5v1Tr8NyEZaH0XkFyx5FBTLwkIv2", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/17/18, 12:56 PM"}, {"comment": "Assignments are deciding factor between A and B. Its a good survey course on ML. The assignments are time-consuming and interesting. Prof Isbell and Prof Litmann did a great job in teaching and the lectures are funny. Start early on Assignments and they needed a good amount of time to run. The instructor doesn't care if we steal the code but I would suggest writing your own and it will be a good learning experience.", "rating": "Liked", "workload": "20 hours/week", "author": "gfGBVpZNEketAojUoBUoulmNmL12", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/18/18, 12:32 AM"}, {"comment": "I took this course in fall 2018 and found it interesting. But I feel this course need to upgrade the course content. No doubt Prof Isabel is covering the entire content but its overwhelming and for me watching the vedio's wasn't that helpful until I look for other Vedio series mostly Andrew Ng's one or read some blog. I feel lectures are more general, rather giving detail about the topic will just brief you. If anyone taking this course I would not recommend to rely on the lectures.TA are helpful, they try to answer the question but somehow I feel even they are not very confident while answering the questions. For me slack and piazza worked very well.From assignment point of view there are total 4 of them. For each of them you have to write min 10 pages covering your analysis along with graphs. That said one can copy entire code from the internet but need to tweak it to generate some nice graphs. I will recommend to cover whatever information you gather about the topic for which you are writing about. Sometime I don't feel TA are even reading the entire report as per the feedback they have commented on some point which was already there in the report. So its better to write about everything rather than shooting an arrow in the dark.Exam: there will be two closed book exam out of which mid term will be cumalative. Exams are really tough so one need to prepare really well for them and on top of that those are subjective. These are really good quality exam so be prepared before taking them.Grades: One can't figure out what grade are you gonna end up with. This class has big curve but if you are submitting all assignment and exam on time than there are very good chances of getting B.This class require lot of hours and commitment.", "rating": "Liked", "workload": "30 hours/week", "author": "LnJcKn5pJpf7wFw5nXQQyYgOd4J2", "difficulty": "Very Hard", "semester": "Fall 2018", "time": "12/18/18, 2:52 PM"}, {"comment": "This is really a good class and the open ended nature of assignments allows plenty of room to research and analyze different ML techniques. If someone expects that every thing expected in assignment report to be mentioned somewhere, they are in wrong class. ML is a subject which cannot be learned in 3-4 months completely but this class gives a good flavor for key techniques. I highly recommend this class and some preprep like Andrew Ng's Coursera course may help in some assignments. Recommended book seems to old and needs update.Exams need good preparation and are very good to test things learned.", "rating": "Liked", "workload": "25 hours/week", "author": "pEuhdC6wriMroDFM8VlTQJ1hTZk2", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/18/18, 3:16 PM"}, {"comment": "Background: Developer in big data, but not ML per se. With MS on a different CS/EE track. Took ML alone Fall 2018.OMS exp: Took DVA, AI, ML4Theard about the difficulty of this course so I took some introductory courses e.g. DVA and ML4T before trying this. Overall an OK course, not as great as I expected, but not too bad either. Assignment format is writing report with ~10 pages, which is less time consuming than coding. I usually spend an entire weekend to finish each report after finishing video watch and paper/book reading. For AI course, I needed an entire week to finish each coding project.Pros:Provided an umbrella-like coverage on various ML topics: supervised, unsupervised, reinforcement learning and game theory.4 reports/assignments help facilitate deeper understanding on different ML models and performances.Some very interesting topics that you can get deeper understanding here: randomized optimization, game theory, mdp.Cons:No coding at all. This is personal, as a developer, I'd prefer to write some code to understand how things work. This course is designed more for researchers I guess, that you need to worry more about metrics, performance measures, and model comparisons etc.Exams are hard, but curve are generous and there are extra points for each of the 2 exams too. Midterm gives very little time to complete so you need to fly though. Final is better but you still don't have time to re-check your answers.some exam questions are asking you to recite concepts/definition instead of checking your understanding. so you either know it or not.Report feedback is not that helpful. there's no clear cubic defined in terms of points deduction. Seems random and it's very normal that you see comments like \"you need to include xxx in your report\", but it was never stated anywhere that you should.Discourage of re-grading, despite of seemingly-random points deduction/assignment.Tips: get familiar with some ML library e.g. sklearn, this will save you a lot of time on writing report than if you learn from scratch.Overall a good course, but don't expect to get too much from it if you're already familiar with most of ML field or if you just wanted to get your hands dirty writing code. Stay above average in most of the exams/assignments will almost guarantee your an A, exams are taking 50% of the final grade so need to pay more attention to.", "rating": "Liked", "workload": "10 hours/week", "author": "KtVcW3gDdYRNbGUHS5GHFpj6BRu2", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/18/18, 6:01 PM"}, {"comment": "Video lectures: There are much better lectures on YouTube - Andrew NG for ML and Silver for RL. The lectures are superficial and pander to math phobia of students. Don't expect any deep insights from lectures. Instructor says this is by design as the course is a survey course. However, I have taken several survey courses before (this is my second graduate degree) and none were this shallow. The bigger problem, however, is that these video lectures were recorded in 2014 and have not been revised since then to incorporate any feedback from students. The professor thinks everything is just perfect.The Professor: He is an egomaniac who thinks he has optimized everything and there is nothing left for him to improve. He derives particular pleasure by putting down his students - your questions will usually draw some sarcastic putdown. His interaction with students on Piazza and Slack is mostly snark. Some students love it but several just go quiet and don't ask questions. To make it worse, his TAs have started emulating his snarky style, which is definitely above their pay-grade (yes, Himanshu - I am referring to you).Assignments: I like the open ended nature of assignments but in some cases the volume of asks was repetitive and didn't make any sense. As with the videos, these assignments have not been revised for years and any student feedback is sarcastically dismissed. To those who saying that these 12-page reports are like real-life research reports, my only question is if they have ever seen one? I mean they are OK as a learning exercise but to equate them to research papers is a bit of a hyperbole. And so is any claim of how this course has validated people's life choices, made ML their new love, and similar bs.Unless you are gifted, plan on putting in at least 30-40 hours of work per week to ensure an A.Exams: Midterm (mean 49) is designed to fail students, but the grading is very liberal - people get points for putting black on white. If this was not true, the class mean would be probably 20 points lower. Final (mean 51) is more like a traditional exam and fair, but grading is tougher. You don't get points for writing any bs. Exams are closed book everything and you are not even allowed to have a pen and scratch paper - a ridiculous requirement as some people use scratch paper not for doing calculations but to formulate their thoughts.Grading: Grading is fair on the whole but some graders are much harder than others. It is easy to get 80 - 90. But to get above 90 and how many points you lose going from 90 to 100 is a crap shoot depending on the grader.In summary - while the course may deliver on its promise to provide you with a survey of ML, there are better resources and better instructors out there to achieve the same goal. The only value add in this course is assignments. The professor has structured testing of learning outcomes to unnecessarily have a high cognitive overhead - you will never get time to reflect on what you have learned and it would be race from one deliverable to the next.", "rating": "Neutral", "workload": "40 hours/week", "author": "XJDqfCveGfgraIHwX9f4q1K8xVD2", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/23/18, 8:48 PM"}, {"comment": "I think the course was one of the most informative in OMSCS (obviously more-so if concentrating in ML) and very well taught by Isbell and Littman. They supply a lot of detail in the lectures and supplement that with many external readings (generally optional, but are very beneficial to understanding the theories).The course is pretty tough up front and mellows out a bit towards the end. Projects require minimal code (theoretically zero depending how you approach it) and are focused more on the write-ups and understanding of the concepts.Be prepared to spend a lot of time on projects (especially on the first one). Once you get the feedback from that one, you will understand how to approach the rest.Midterm and Final were quite challenging with mean grades in the 30s and 40s respectively. In the end it's hard to assess how you are doing in the course, but the \"curve\" is quite generous and Isbell/Littman make it very clear if you should stay in the course or not. As long as you are understanding the material and can portray that, I'd say a B is very doable; even if your grades do not seem that way.", "rating": "Liked", "workload": "20 hours/week", "author": "6alMpAmy2Scqtz0FtUfW7gNTyu03", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/28/18, 11:48 AM"}, {"comment": "This course was interesting. The projects feel similar to an industry project as they are open-ended and require you to back up your statements in the report. The first 3 projects use the same data sets doing different things (supervised learning, optimization, and clustering) while the final project is a reinforcement learning problem. The midterm was pretty rough but the final was much easier.A few tips for people getting ready to take the class:Use JonTay's code repo. Yes, it's stealing code but this is one of the few times this is allowed in the program. You may learn more by programming it yourself but honestly not much more (as you shouldn't really program the algorithms yourself anyways). Using this repo likely cuts 10-20 hrs off per project. Several times I tried to get more own solution working than gave up and spent more time running additional experiments.Trust the curve. It will change every time but you can expect to pass the class unless you are near 10% (seriously, I got a 65% in the course and wound up with an A).Pick data sets early. Choose binary classification data sets.Don't use messy data unless you're really looking for a challenge.Overall, I think this course and AI are great to take to understand the basics from theory, implementation, and application. While I enjoyed the AI course more (and felt like I learned more in that course) this course helps you tie it all together and understand the big picture of data science problems. On top of that, Isbell is a great instructor and very helpful (in a sarcastic way) and the videos are a joy to watch.", "rating": "Liked", "workload": "10 hours/week", "author": "wFUeh14b6Ug541hutU0FIbavCOM2", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/28/18, 10:18 PM"}, {"comment": "This course took a different approach compared to conventional classes. The focus of this class is to enhance the student's ability to take information and logically draw conclusions/synthesize new information out domain knowledge/presented material. As such, the lecture style consists of two professors conversing on the topic with one taking the role of lecturer and the other taking the role of the student. The approach is effective for those who derive understanding from thinking about the material, and significantly less so for those who are book/memorization learners. Note that this review comes from the perspective of a student in the former classification.Where this class falls flat on its face is the homework assignments. There are four in total, consisting of a coding section (where plaigarism of the code is openly encouraged) and an analysis section. The analysis is a 10-12 page writeup (each consisting of 10-15% of the total course grade) and is extremely subjective. Feedback and grades received vary widely across TAs and is entirely the luck of the draw (based on small sample size, it seems to be uniformly distributed between 50 and 100). As such, when approaching the complation of homeworks one needs to realize that the work is less about the grade (more on completion) and more about how the algorithm would be applied to a real data set/explained to a bystander. All homeworks are made available at the beginning of the course, but for a working professional it will be a struggle to stay on track with lectures and homeworks, let alone getting ahead.Exams are focused on how a student would apply the algorithms learned in class to (what should be) a problem that has not been viewed before. This may sometimes extend to simple calculations or even pseudocode, but tend to be very fair in terms of no surprises. Despite this, the exams are quite difficult to non-coders nonetheless. There are two optional problem sets whose problems are more closely related to the exam questions. These are often skipped but in a more conventional class would have been the focus of the graded homeworks and the current graded homeworks reworked into a semester-long project.Overall, an effective course in terms of teaching material, but the grading structure may be a shock to students who may be used to performing well. Even if the grade appears to be bad, as long your grade appears to be within one standard deviation, a B can be expected. Simply completing all of the homeworks and attempting the exam should net at least a passing C grade.Fall 2018Very HardNeutral20 hours/weekOMSAAuthor: rmpyf4RkiZOTjQ69YEwW3SYIJPV212/31/18, 1:16 PMLook at the chain of reviews below. Yet, If I am posting a \"Strongly Disliked\" comment for Fall 2018, it means that the instructors does not care about any feedback which he clearly said on the forum -\"I don't care\". The forum is flooded with that statement for any question you ask. The course will teach you names of quite a few ML algorithms. You have to forget your social life to finish the assignments. But then at the end of the course you realize that the course didn't teach you any single algorithm at it's depth. The mathematics of the algorithms are hardly explained. The lecture is delivered through chaotic interaction between two profs who probably know their stuffs but does not know how to teach and too arrogant to take any feedback to improve. Waste of time but you have to take the course to be in ML specialization. Never seen more useless TAs who never help students with anything conclusive answers for any questions. All the students discussing stuffs and trying to find their ways. The only good part was the explanation of RL material at the end of the course. Clearly such courses/MS are not meant to teach you anything but just for business purpose. Similar feedback is posted for many other OMSCS ML specialization courses where the course is not being improved, the prof has left but the course keep on continuing. Take Andrew Ng courses on courser before taking this course so that you have an understating what the prof is talking about. Lower your expectation down from the course. If this is your first ML course, its okay but if you already have idea and looking for a deeper understanding , this is not going to help.", "rating": "Strongly Disliked", "workload": "25 hours/week", "author": "MeImDRacyya4b7HRkhvlEZxvulw2", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/30/18, 11:30 PM"}, {"comment": "Look at the chain of reviews below. Yet, If I am posting a \"Strongly Disliked\" comment for Fall 2018, it means that the instructors does not care about any feedback which he clearly said on the forum -\"I don't care\". The forum is flooded with that statement for any question you ask. The course will teach you names of quite a few ML algorithms. You have to forget your social life to finish the assignments. But then at the end of the course you realize that the course didn't teach you any single algorithm at it's depth. The mathematics of the algorithms are hardly explained. The lecture is delivered through chaotic interaction between two profs who probably know their stuffs but does not know how to teach and too arrogant to take any feedback to improve. Waste of time but you have to take the course to be in ML specialization. Never seen more useless TAs who never help students with anything conclusive answers for any questions. All the students discussing stuffs and trying to find their ways. The only good part was the explanation of RL material at the end of the course. Clearly such courses/MS are not meant to teach you anything but just for business purpose. Similar feedback is posted for many other OMSCS ML specialization courses where the course is not being improved, the prof has left but the course keep on continuing. Take Andrew Ng courses on courser before taking this course so that you have an understating what the prof is talking about. Lower your expectation down from the course. If this is your first ML course, its okay but if you already have idea and looking for a deeper understanding , this is not going to help.", "rating": "Strongly Disliked", "workload": "25 hours/week", "author": "rmpyf4RkiZOTjQ69YEwW3SYIJPV2", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/31/18, 1:16 PM"}, {"comment": "Sorry, but this is a good course. Yes, the instructor holds the rubric private. That doesn't matter. Just answer all the questions asked in the assignment. Also address all the topics in the lecture and you'll definitely cover everything. Releasing a rubric would just further rob students of the work required to determine what sort of things it is important to report on. There are plenty of resources provided to help you.Another common complaint is that the class is curved. I think we need to get over ourselves and not expect that getting less than 90% on an exam is a basis for panic and complaints to the instructor. The curve is more or less the same every single year both off campus and off.Ultimately, this class delivers what it's supposed to deliver: a reasonable basis for evaluating algorithms and developing a sense of when one might perform better than another. This is an important skill and one you are unlikely to develop without taking a course like this or doing the same sort of work independently.If you've gone through OMSCS complaining that the professor is absent, this is the course for you. The instructor is always there to remind you that he already answered the question in the assignment. The course doesn't change from semester to semester, and everything you need to excel is made available to you.A valid concern that some people bring up is that the course doesn't touch on newer topics. This is perhaps fair, but the course is already packed. Learn this stuff, and you can go take a deep-learning course after this with a strong foundation.In general, try to know some math before taking this. That means linear algebra and calculus. If you take AI before, that might be helpful, but it really shouldn't be necessary. Additionally, you can take this course before RL, and that will be fine.", "rating": "Loved!", "workload": "15 hours/week", "author": "axXwTOt556PM2mBLv3H7dqAUOfP2", "difficulty": "Medium", "semester": "Fall 2018", "time": "1/1/19, 3:34 PM"}, {"comment": "Great amount of material covered, and great lectures. The encouragement to steal code & use whatever was very nice. Feedback on exams could be more detailed.", "rating": "Liked", "workload": "20 hours/week", "author": "LsXqiGDkeoW40udW0WBAgACo3GU2", "difficulty": "Hard", "semester": "Fall 2018", "time": "1/6/19, 1:27 PM"}, {"comment": "To me this was an OMSCS defining course. Office hours were run by great TAs who really knew their stuff. The assignments are ambiguous at times but I think it helped me really think things through. The tests were really hard.You can use any coding language you want but I used python for most of my assignments except for the A2 which was Jython. Also, I would recommend using Oreilly (free access with OMSCS) concurrently or before to learn how to build models in SciKit learn, Pandas, and OpenAI gym. They don't dictate solutions but if you are planning to use Python those are things you should be familiar with.", "rating": "Loved!", "workload": "20 hours/week", "author": "rbotfsDawtRHDPtup461gYgtmom2", "difficulty": "Very Hard", "semester": "Fall 2018", "time": "1/17/19, 10:52 PM"}, {"comment": "The lectures were entertaining even though at times they were a little long. This was understandable as there were a lot of concepts that were quite dense. I am still amazed at how much information was packed into a semester in this class. Professor Isbell said there would be \"tears of joy\" at the end of the semester and he was right. I struggled immensely, did poorly on the midterm, better on the final and my last project had a decent grade. Even though I struggled the entire semester I found the material very interesting. At times I found doing more experimentation with some of the concepts than actually working on the assignment itself. I made out well enough to finish the program and did indeed shed tears of joy. The grading was more than fair but you will work your tail off. I didn't realize how much I enjoyed the class until I found myself exploring the content on my own and reviewing what I could have done better on my assignments long after the course was over.", "rating": "Loved!", "workload": "30 hours/week", "author": "QvQfv18y5QScJQRaW3zfFcDiYoI3", "difficulty": "Very Hard", "semester": "Fall 2018", "time": "3/12/19, 10:29 PM"}, {"comment": "Bottom line: Very challenging course, unprofessional TAs, unclear expectations on assignments.I took this course in the Fall of 2018. I was really excited to take this course and based on the reviews from this site I knew it was going to be challenging. I had no data science or ML experience before but I have a BS in Computer science. However, I had to drop the course due to some life situations that didn't allow my full attention to the course.Though I didn't want to drop the course, I am glad i did because it was out of my frame of knowledge and the learning environment was not enjoyable.This was the sixth course I took in the OMSCS curriculum; Networks, info sec, Ed Tech, HCI, Soft Dev. All of those courses were challenging in their own way but not impossible to complete for a student working full time to complete.CS7641 was different compared to the courses i have taken in the following ways. 1> Expects the student to have a solid/advanced understanding of ML topics.2> Does not walk the student slowly into the curriculum. The first project gets you right into the material and there is extremely minimal guidance on what to do for the first project.3> The lectures are as clear but fall short of explaining the topics succinctly. The videos are lively but the extended amount of banter between the two professors draws out the videos and regularly I could not follow their train of thought.4> The TAs are not the best I've experienced. The TAs interaction with the students is simply unprofessional. Interactions between TAs and students on Piazza should be professional and there is no room for snide remarks when a student is asking a simple question.This course is for you if you if you are experienced with ML topics and have worked with popular ML packages before. If you really want to take this course without any prior ML knowledge I suggest you watch all the videos for the course on eDX or Udacity before taking the course and read the book for the class cover to cover. This will save you time to struggle through the projects.If you want an example of a professional and superbly taught OMSCS course take Educational Technology or HCI (anything taught by Dr. Joyner).", "rating": "Disliked", "workload": "10 hours/week", "author": "QGE2c4BBbQSiNSHEPlWhECUeDaA2", "difficulty": "Very Hard", "semester": "Summer 2018", "time": "9/24/18, 10:40 PM"}, {"comment": "First let me start by stating that this is a hard course, no doubt. But the course is made harder by a disastrous lecture sequence. What the hell were they thinking when they made the insanely long and meaningless lecture videos. Watching the lectures were a pain and a torture. Too many pointless trash talking that throws one off. They should really learn from Andrew ng's course in coursera and how to make the videos relevant and to the point. Heck, the videos of ML4T is so good and the explanations were so concise and clear. On the contrary, in ML there were too many hand waving, lame jokes, out of context talks and over the air explanation that made no sense or too difficult to comprehend. If you solely relied on lectures for this course, you are destined to not only fail but do worse than not watching anything at all. Its that bad. Prof Isbell is a smart guy but arrogant. Don't dare to ask him any obvious questions or he will ruin your credit history (He joked this in one of his Piazza posts). His answers are always standard, I DON'T CARE. The ML office hours are absolutely a waste of time. The TAs handling the OH are students who have no clue what they are talking. At times they seem lost in explaining even the basic stuff. And the projects description is the biggest joke of all. No clear instructions at all. All it says is, steal the code, I don't care. But write a report. Really? Even the lamest of a description would be better than that. Piazza is a total chaos with questions from confused students and equally confusing explanation. I am sorry to rant but this is not a very well run course. If there is anything wrong with OMSCS, it would be the way this course is run. A perfect example of a poorly designed and mismanaged course. Unless they change the way it is run, this course will continue to see record churn. I hope something is done to fix this.P.S. I am taking this course in the fall of 2018 and this is how I felt half way through the course.", "rating": "Strongly Disliked", "workload": "20 hours/week", "author": "LvqblwCSqFUIjBYwFtnyQ7S1hwd2", "difficulty": "Hard", "semester": "Summer 2018", "time": "10/15/18, 9:15 PM"}, {"comment": "I actually took this class Fall 2018, it just wasn't available in the semester drop down.This is absolutely the worst class I have ever taken in my life, and I'm not even done with it yet, though I may just withdraw soon. The old adage of research professors not caring about their classes is fully exemplified in this class. The professors main interaction with the students is to tell them that he doesn't care at all, about what they use for projects or how they do them. His flippancy carries over to the TAs, and thus piazza is a jumbled, awful mess.The assigments are also awful. Instead of giving you anything to really go off, the class asks you to find some data set to use, and then re-use for all further assignments. If you, like me, don't really have any strong opinions or desire to explore any specific data, then this sucks! You wind up picking some random data sets, and then having to manufacture some problems for them, and then your lack of real interest in them shows through in the papers. In my opinion, no data set is really going to be that interesting, and if it is, then it probably can't be explored in the few weeks you have to do the assignment while also presumably working full-time.Perhaps this whole thing is being exacerbated also by the fact that I just got done taking Human-Computer Interaction with Dr. David Joyner, whose enthusiasm for teaching shows in every part of his course. He is a true professor, interested in interacting with and working with his students to ensure that they have a great learning experience. It could also be because I took Machine Learning for Trading two semesters ago with Dr. Balch (who is also a great professor), and that class had amazing assignments that were well thought out and provided you with a solid starting point for exploration and learning. Those assignments also came with expected results and test cases to check your work!I think this class could be fixed if they would give you the datasets and the code to run them. If all they really care about is the conclusions you draw from the results of running the code, then I think that would be the easiest thing to do. It would give them a stronger basis on which to grade things, because the data sets and results would be known, and it would free the students to really focus on the analysis, which is all that the class says that it wants. Even with that, they could still give you places to tweak the knobs if they really wanted to. There just is a big disconnect between what the professor says he wants and what the students actually need to do for the assignments.Of course, to fix it, the professors would have to care about it, and as mentioned above, they don't.If you are interested in the topic, the videos are alright, and the book recommended, Machine Learning by Tom M. Mitchell, is quite good. However, the assignments really detract from the course overall, and so I would strongly recommend against taking it if you can help it. To the point where I will probably switch my specialization so I don't have to take it.", "rating": "Strongly Disliked", "workload": "25 hours/week", "author": "OC0pzWjYEMaBuRyjgCl0XxDbNDD3", "difficulty": "Very Hard", "semester": "Summer 2018", "time": "10/13/18, 6:13 PM"}, {"comment": "(Taking Fall 2018. Review might be updated after end of Semester)I am torn about this class but ultimately have to say that is not a good course and the Prof has been very overrated. First the good stuff:Pros:1) Some of the lectures are actually interesting and well presented with some theory and insights that I would not have gotten elsewhere (Note: only some. see below)2) Assignments do give you practical ML experience working on real datasets.3) You get good feedback on assignmentsCons:1) Most lectures however are atrocious when you compare them to the other MOOCs. Andrew Ng set a high bar 5 years ago and if you took his MOOC you are walking out very little new knowledge that he didn't already explain much better. ML Theory part in particular is presented in an awful way. Neural Networks? We get a crappy subpar 15 min explanation on them.2) The Professor is awful. Isbell is rude, antagonistic and arrogant to his students. He creepily prowls piazza and slack to not answer student questions but to drop bait and then insult students for asking innocent even if they are annoying questions. TA quality is lacking. Slack in particular should be off limits for a Prof to criticize his students.3) The material is outdated. The book we use is 20 years old.The entire last 10 years worth of developments are ignored in this course so you end up wasting time on really old and less useful stuff like KNN or Decision Tree or K means which are not as important anymore. Tree and Instance based learning in particular has fallen out of favor and is seen by almost everyone in the ML community as a complete dead end yet we spend so much of the course talking about Decision Trees and stuff like KNN. Important and still very relevant topics like logistic regression and regularization is not even discussed in this course. There is also zero mention of deep learning here.4) Professor is sloppy and lazy and it shows in his assignments. They are poorly worded full of ambiguities and required stuff is not mentioned in there. Only casually in office hours. If students ask clarifying questions they are insulted. I personally stopped asking questions cause the professor was this rude.5) The assignments themselves are questionable in what they are teaching you. Lots of time spent hyperparameter tweaking. No real mathematucal rigor to any of it. Just throw some stuff see if it works blah and write a report with some charts. Not hard but very tedious and distracting from what we should be learning. You also have to get your own dataset so most people end with bad ill suited datasets for the problems and have no choice but to keep using them ending up with poor results and sub par papers to write6) Exams are dumb. Having taken AI the ML exams are disappointing. They make you write essay questions that encourage rote memorization in an ML exam. No math. Very little theory. Just cram as much and then hope you can remember. Only two Problem sets given to test your understanding but they're completley garbage because the \"answers\" are links to chapters in the book. No real problem solving and testing which is essential for ML.", "rating": "Disliked", "workload": "10 hours/week", "author": "ryUSScOyW9SNxLt2vB0GdRiBflA2", "difficulty": "Medium", "semester": "Summer 2018", "time": "11/4/18, 2:23 PM"}, {"comment": "Marked this for Summer 2018 as Fall 2018 isn't available.TLDR: It's difficult and time consuming and this course is amazing and everyone in OMSA should take it.This is tough class and you should prepare to invest a significant of time and effort into it even if you are very comfortable with ML. This class is very good. The videos are well done and the textbooks and extra readings (and yes generally you actually do need to read them) are well chosen. The class is basically 4 homework assignments that are each 10 to 12 page papers and two exams. Even if you can quickly and efficiently generate the models needed, writing the analysis (the only part that is graded) take a while especially if you want a good grade. The exams are hard but fair. The videos combined with the readings do a good job of conveying difficult topics and I found the banter between the professors to be entertaining.The biggest issues I found with this class were on the administrative side. The TAs ask that you send them questions ahead of office hours but they don't actually read any of the questions before office hours leading to a fair amount of \"we'll get back to you\" some prep on their end could have made office hours more effective. The administration of the mid term was also a mess with people not being able to access the exam initially. Grading on everything is slow so be prepared wait and since everything is hand graded there is unevenness in the grading across graders.I came into this class knowing a little about ML and I found this class to be a lifestyle. The homeworks can basically take as much time as you have available to pour into them. I learned so much by doing them, but by the end of the semester I was just completely worn out. This class just never let up from a workload perspective. The nice thing is that almost everyone gets a B or better in the class so I never found the class all that stressful, just exhausting.Summer 2018Very HardLoved!30 hours/weekOMSAAuthor: G9U6TrT94bRDBhvkYLpsaaXBz47212/10/18, 3:52 PMI actually took this in Fall 2018 but that was not an option.This is the best of the 8 courses I have taken so far in OMSA/OMSCS. A lot of courses (inside and outside GT) will teach you various ML algorithms. This course teaches algorithms but even more importantly gives you a conceptual framework for how the various facets of machine learning fit together (e.g. how is a neural net similar/different to a random forest or linear regression; how does unsupervised learning fit in; how do both relate to reinforcement learning).This course requires a lot of time and is mostly challenging due to the volume of material, more than the nature of the material itself. The instructors strike a really good balance between rigor and practical intuition (as does the required Mitchell text).The pacing of homework is tough, and somehow the mid-term needs to be worked in the middle as well. If you are new to ML, I recommend watching Andrew Ng's ML course on Coursera and reading the first half of Raschka's Python Machine Learning book before you start. You will have a big head start that will smooth the ride out a bit.Summer 2018HardLoved!25 hours/weekOMSAAuthor: PuTSLpQt7ldv0R5seMT0e6ea7j6212/14/18, 12:42 AMI took this course for Fall 2018. This was my first class for OMSCS. I had some experience with ML with Andrew Ng's Coursera course as well as some ML basics from Udacity's Self Driving Car Nanodegree. The lessons are great as they build intuition about concepts in ML. The concepts taught are little old, however the lessons are great as it teaches the intuition behind each concept. Also the format of lessons is unique are in such a way that one of the lecturer acts as a student asking questions when the other lecturer answers his questions. The assignments are not easy as it needs a lot of analysis. Work load during Midterms can get really crazy. The exams are tough and would need a thorough understanding of the concepts. It would have been helpful if there was an introduction to Deep Learning too, but that would mean increasing the workload significantly. Overall a great course if you are willing to put in the effort.", "rating": "Loved!", "workload": "25 hours/week", "author": "rLVAClqdmTbnqkc0yZ2OBUitLZu2", "difficulty": "Hard", "semester": "Summer 2018", "time": "12/8/18, 1:54 AM"}, {"comment": "I actually took this in Fall 2018 but that was not an option.This is the best of the 8 courses I have taken so far in OMSA/OMSCS. A lot of courses (inside and outside GT) will teach you various ML algorithms. This course teaches algorithms but even more importantly gives you a conceptual framework for how the various facets of machine learning fit together (e.g. how is a neural net similar/different to a random forest or linear regression; how does unsupervised learning fit in; how do both relate to reinforcement learning).This course requires a lot of time and is mostly challenging due to the volume of material, more than the nature of the material itself. The instructors strike a really good balance between rigor and practical intuition (as does the required Mitchell text).The pacing of homework is tough, and somehow the mid-term needs to be worked in the middle as well. If you are new to ML, I recommend watching Andrew Ng's ML course on Coursera and reading the first half of Raschka's Python Machine Learning book before you start. You will have a big head start that will smooth the ride out a bit.Summer 2018HardLoved!25 hours/weekOMSAAuthor: PuTSLpQt7ldv0R5seMT0e6ea7j6212/14/18, 12:42 AMI took this course for Fall 2018. This was my first class for OMSCS. I had some experience with ML with Andrew Ng's Coursera course as well as some ML basics from Udacity's Self Driving Car Nanodegree. The lessons are great as they build intuition about concepts in ML. The concepts taught are little old, however the lessons are great as it teaches the intuition behind each concept. Also the format of lessons is unique are in such a way that one of the lecturer acts as a student asking questions when the other lecturer answers his questions. The assignments are not easy as it needs a lot of analysis. Work load during Midterms can get really crazy. The exams are tough and would need a thorough understanding of the concepts. It would have been helpful if there was an introduction to Deep Learning too, but that would mean increasing the workload significantly. Overall a great course if you are willing to put in the effort.", "rating": "Loved!", "workload": "25 hours/week", "author": "G9U6TrT94bRDBhvkYLpsaaXBz472", "difficulty": "Hard", "semester": "Summer 2018", "time": "12/10/18, 3:52 PM"}, {"comment": "I took this course for Fall 2018. This was my first class for OMSCS. I had some experience with ML with Andrew Ng's Coursera course as well as some ML basics from Udacity's Self Driving Car Nanodegree. The lessons are great as they build intuition about concepts in ML. The concepts taught are little old, however the lessons are great as it teaches the intuition behind each concept. Also the format of lessons is unique are in such a way that one of the lecturer acts as a student asking questions when the other lecturer answers his questions. The assignments are not easy as it needs a lot of analysis. Work load during Midterms can get really crazy. The exams are tough and would need a thorough understanding of the concepts. It would have been helpful if there was an introduction to Deep Learning too, but that would mean increasing the workload significantly. Overall a great course if you are willing to put in the effort.", "rating": "Loved!", "workload": "25 hours/week", "author": "PuTSLpQt7ldv0R5seMT0e6ea7j62", "difficulty": "Hard", "semester": "Summer 2018", "time": "12/14/18, 12:42 AM"}, {"comment": "Not as challenging as everyone makes it out to be. The course does require time because each of the four projects requires you to write a 10+ page report. The key to succeeding in those projects (and, by extension) the course is to not write the code from scratch yourself and to instead put almost all of your time and energy into the writing. Fork resources you can find on GitHub for the code and look to examples of reports from the class that people have written in previous semesters to get a feel for what kinds of things to include in your report.Office hours were useless and piazza interactions were about the same. Having said that, the course videos are everything they're made out to be. Extremely useful and I expect to use them as a reference in the future.Tests require some effort to study for but are entirely manageable. I recommend re-watching the videos at 2x, making sure you've read through the relevant chapters of the Mitchell textbook (which is a great book), and doing the practice problem set.", "rating": "Liked", "workload": "10 hours/week", "author": "66VRqANhSwTJxvS1sl0WDCu9kAw2", "difficulty": "Medium", "semester": "Summer 2018", "time": "12/15/18, 8:19 AM"}, {"comment": "Not much to add here that hasn't been said already. I like the professors in the lectures but Dr. Isbell mostly does not participate in the course other than troll-type responses on the message board. The TAs hold weekly office hours, so if you have any questions don't bother with Piazza, try Slack or the office hours.It's a hard class but a high percentage gets A's. There is no set grade cutoff. The professor said he is more likely to award A's to students close to the cutoff who show upward trending grades over the semester so keep at it.", "rating": "Liked", "workload": "20 hours/week", "author": "6jxhn3PADQTuvlOw0lYggBeiPFR2", "difficulty": "Hard", "semester": "Summer 2018", "time": "12/18/18, 4:26 PM"}, {"comment": "Semester: Fall 2018 (No such option available yet)I took 7641 because it is mandatory for specialization in Machine Learning track. Have no relevant knowledge before. Here are my thoughts:1) There are some wonderful machine learning courses online you can take for free. I highly recommend you to take one beforehand. Otherwise you need to spend more time than average to search useful resources when working on those projects.2) You may or may not like professors' humor in the lectures but there are a LOT conversations about both professors made fun of each other. It is somehow distracting/annoying.3) Professor has no patience/respect to your questions on piazza. Students/TAs sometimes are more than willing to help.4) All four assignments are graded by analysis reports only. Coding files are not graded, and you are encouraged to \"steal\" code as mentioned by professor.", "rating": "Disliked", "workload": "30 hours/week", "author": "FBm7XPcGdcU93w5uwck4aXqa9dR2", "difficulty": "Hard", "semester": "Summer 2018", "time": "3/6/19, 2:36 PM"}, {"comment": "This was my favorite class that I have taken so far in the program, the professors were very knowledgeable and entertaining in the lectures. The projects were a good mix of theory and practice and gave me a very good understanding of the concepts.", "rating": "Loved!", "workload": "15 hours/week", "author": "IaEeVULL3YfOa9GXCAce8gbwICX2", "difficulty": "Hard", "semester": "Spring 2018", "time": "11/3/17, 11:32 AM"}, {"comment": "I don't think this is a good class. I would like to learn more about machine learning, but didn\u2019t learn much and don\u2019t like the setup of this class. \u2022 You get minimal feedback on projects and not know what to do to get the good grade on project. Doesn\u2019t understand what need to improve. \u2022 You won't receive your tests back and won't know what you missed. \u2022 Lectures are heavy math for me without adequate insight tying everything together, and not able to understand. I don\u2019t like the lectures. \u2022 Due to the limited feedback, and can\u2019t learn much without know what you do wrong.", "rating": "Strongly Disliked", "workload": "30 hours/week", "author": "ndlZOBxeXMSNVecGgL933BLnuWD3", "difficulty": "Hard", "semester": "Spring 2018", "time": "4/3/18, 2:47 AM"}, {"comment": "I agree that \"applied ML\" would be a better suiting title for this class. The Udacity videos are fun to watch and sufficient to introduce students into the topics discussed. My only concern about this class was the responsiveness of the prof or TAs on Piazza. I happened to get seriously ill at the start of the semester (almost 1 month of hospital treatment and reconvalescence). I approached the Office of the Dean of Students, they checked the supporting medical docs and forwarded my absence request to the prof. SImulataneouslY I made a private post on Piazza, asking for an extension (2 wks) of a P1 (a deadline had passed before). A TA asked me to fwd a message from the Office of the Dean of Students with a statement that after I do this, they would approve my extension. I did what I was asked for and nobody replied anymore. Tried to remind them, tried to escalate to the prof., no reply. I ended up withdrawing from the course (1st time in the OMSCS, after 7 courses passed with As).", "rating": "Neutral", "workload": "20 hours/week", "author": "facebook:102086461326592114/", "difficulty": "Hard", "semester": "Spring 2018", "time": "23/18, 4:31 AM"}, {"comment": "One of the best class on OMSCS that I've had. Something to keep in mind is that this class is a survey class. It goes over on a high level the various major topics pertaining to Machine Learning but if you want to dive in deep there are other classes like Reinforcement Learning itself. The projects are a great way to learn more about how things really work and I do highly recommend that you steal code for this class rather than writing it from scratch (yes this is allowed and encouraged for this class). It'll save you a lot of time and gives you more time to play around and write your actual analysis (which is basically the entire score for your projects).The lectures are great for me at least, but I do know of a few people who did not like the banter between the two professors. The extra readings, while not necessary, I believe is a great supplement to the lectures. Do read them to expand your understanding but is not really needed for the tests. All in all, a great class!", "rating": "Loved!", "workload": "15 hours/week", "author": "wKT75rE8IsYyfcFGF3XTsxNAT563", "difficulty": "Hard", "semester": "Spring 2018", "time": "4/28/18, 11:25 PM"}, {"comment": "As mentioned by others, this is one of the hardest course and unless you are specializing in ML or has a deep passion for ML, this course is not recommended. The class was overall good in terms of learning through some of the concepts were superficial and hard to grasp the concepts. As Prof. mentions you will smile once the course is done and will have happy tears. Overall I liked the course and probably teaching style would have little better in terms of clarifying content.", "rating": "Liked", "workload": "20 hours/week", "author": "TPzp2pgygKVTIRvpNVt4Cct1VG72", "difficulty": "Very Hard", "semester": "Spring 2018", "time": "4/29/18, 3:07 AM"}, {"comment": "This is a compulsory course for ML specialization and I loved it. The professors make the class very interesting. It strongly emphasizes on the analysis part of different algorithms rather the coding part. We are free to steal/use any code as we like for the projects. The workload is quite heavy, exams are ProctorTracked. Overall, a wonderful course.", "rating": "Loved!", "workload": "15 hours/week", "author": "IolNCBMq5YZ4kQK969QTg8yAqJF2", "difficulty": "Hard", "semester": "Spring 2018", "time": "4/29/18, 10:40 AM"}, {"comment": "As I studied the course longer, as I realized the two professors Charles and Micheal are so smart and good, I learned other ML courses from other universities, some of them are very hard to follow due to amount of math and equations, however, Charles and Micheal are very smart and experienced that they can extract the essence of this huge field and summarized into easily understood examples to guide you think and think. Study the course lectures and notes many times to understand otherwise the midterm and final are hard.", "rating": "Loved!", "workload": "25 hours/week", "author": "google:117944757433376593416", "difficulty": "Medium", "semester": "Spring 2018", "time": "5/1/18, 12:23 AM"}, {"comment": "*Overall: * It's a hard course even with a strong math background. I did not find the assignments to be very helpful (they sapped my enthusiasm), and the tests are hard. TAs were not very responsive in Piazza this semester (Spring 2018). This class is too laissez-faire (in my opinion) and fails to provide effective feedback on assignments.I had a fair amount of ML experience from previous learning (I had watched the Supervised Learning lectures a year earlier, and taken other AI classes in the past) coming into this course, but this course was still challenging.The lecture quality is pretty good; the professors Isbell and Littman are very knowledgable and their humorous banter in the videos is funny. I liked the conversational style they used in the videos - it's a dialogue between the teacher (alternates between Charles and Michael) and the other plays an inquisitive student who asks questions.The assignments were super open-ended and I felt graded quite harshly given the lack of concrete direction. There seemed to be a hidden rubric used to grade submissions that was not shared with students in the assignment descriptions. I felt frustrated with the assignments because I felt like I wasn't really learning much but simply twiddling hyperparameter knobs in order to generate plots for the report. Further, the feedback that I received from the TAs was usually weak and non-specific after they'd take off 30 points. I spent probably 30ish hours on average for the problem sets.I wish the course offered more structure (\"Students have successfully used this GitHub repo for Assignment #1. Train the model, plot learning curves (accuracy vs. time and accuracy vs. iterations), do tasks X, Y, Z\") rather than giving vague instructions (\"pick some interesting problems and fiddle with the hyperparameters for algorithms A, B, and C. Plot some stuff and tell us your observations\"). I'd also have appreciated a more specific rubric for what's expected on the assignments - I'd love to go on the intellectual journey, but please tell me the waypoints!The exams were hard but fair.I'm happy to have this course behind me. There were high points (lecture content is good), but the assignments were simply not helpful for my learning.", "rating": "Neutral", "workload": "20 hours/week", "author": "sJzxDn9gArYUxerusN4gl6UXfBI2", "difficulty": "Hard", "semester": "Spring 2018", "time": "5/1/18, 10:42 AM"}, {"comment": "Overall this is a pretty decent course. The material is interesting, but the lack of clarity makes this class a little more challenging than it needs to be. There is no set rubric for assignments, and the feedback varies based on the person grading your paper. You have to pay attention to office hours to fully understand what is needed in the assignments. The midterm is too long for the time given, but you know this going in. The Final is much more manageable in terms of time/question but is about the same as the midterm in terms of difficulty.", "rating": "Neutral", "workload": "15 hours/week", "author": "7wjp2eeVQofTBDo9sASehLGXLXc2", "difficulty": "Hard", "semester": "Spring 2018", "time": "5/4/18, 8:09 AM"}], "difficulty": 4.225, "enrolled": 787.0, "id": "CS7641"}, {"rating": 4.0, "workload": 21.406, "withdrew": 0.0, "comments": [{"comment": "Pros:This course will force you adapt to grad level study, which means you need to be able to read a paper and replicate the models in paperTAs reply on piazzaCons:Poor lecture, to many jokes and off-topic discussions in lecture videosZero coding sample in lecture, this courses is basically teach basic markov chain, DP, and game theories. You won't learn practical knowledge", "rating": "Strongly Disliked", "workload": "18 hours/week", "author": "aFl1yn9LA9PLnl0wEfzx2uzFfX82", "difficulty": "Hard", "semester": "Spring 2019", "time": "4/7/19, 3:19 PM"}, {"comment": "The worst course ever probably. Feel know very little in Reinforcement learning even studying very hard for a semester. This is my fourth postgraduate degree and I have taken over 40 courses from Georgia Tech. This is one of the worst ones IMO. The teaching is very theoretical, without anything truly useful. Projects are useless without learning anything from them. Hope everyone can skip this course. Compared to this course, David Silver's Reinforcement Learning is way better.TA's are pretty bad. A lot of them are just undergraduate students who have never gone to graduate school. (I checked their linkedin profiles and found that.) They are extremely unprofessional and not capable of grading and understanding your project, nor they are clear about the objective of the project. Many of them probably never read or know how to read research papers or do research. You will get very frustrated working with them.Overall, be very careful of this course. Probably like in a pitfall of some waste. Totally waste time and money to take it. Skip this course definitely.", "rating": "Strongly Disliked", "workload": "30 hours/week", "author": "DXek1u2FOWfkvUr9C9lYrWYR0FE3", "difficulty": "Hard", "semester": "Fall 2018", "time": "11/27/18, 10:15 PM"}, {"comment": "Probably the best class I have taken yet in the OMSCS program. You will have 3 challenging but very rewarding projects in the class; 2 where you will reproduce seminal RL papers, and another Deep RL project. It's hard work but very rewarding and you will learn a ton. There are also 6 homework assignments that are challenging but well designed to drive home some understanding of the material. Unless you are experienced in ML, I would recommend taking this class after ML4T (where you will get an intro to numpy, pandas, and RL) and DVA. You may also want to do ML first, which also provides an intro to RL for the last 1/3 of the class. You probably don't want to pair this class with another.The TAs in this class are the best I've seen in the entire OMSCS program. They understand the material thoroughly (many work in RL, one is writing a book for Manning), they understand the expectations for each homework assignment and project, and they put a lot of extra effort into the class. Each office hour is run very smoothly and well attended (both students and TAs). Usually, one TA will provide a brief overview of what you should be working on, and then usually a little talk about some of the material. There were also some extra study sessions conducted to try and help students with homework and prep for projects. Questions on Piazza are answered clearly and promptly. I've found the grading be fair and objective. They also tend to jump in a lot on the Slack channel (which has been a lot of fun).Bottom line; this is a great class with instructors who care about the subject and want to help others learn it. It is a lot of work, but it's also very rewarding. You will learn a lot! And RL is awesome.", "rating": "Loved!", "workload": "30 hours/week", "author": "QKl13GqAjZWR9LnNyz7c48tLTkn1", "difficulty": "Very Hard", "semester": "Fall 2018", "time": "11/29/18, 12:25 PM"}, {"comment": "This is a great course, very demanding in terms of time commitment, effort, complexity of the subject matter, and so on; but the TAs were great, up there with the best I've seen in all the courses I've taken up to now (this is my eighth course). At the end of the course, after the pain and the sweat, you'll have learnt a lot and feel a genuine satisfaction with your ability to reason and solve RL problems; of course, this is subject to you putting in the effort.", "rating": "Loved!", "workload": "40 hours/week", "author": "Pb0jSZJYUXZJ0hbNZbxcUS17NA43", "difficulty": "Very Hard", "semester": "Fall 2018", "time": "11/30/18, 1:29 PM"}, {"comment": "This is a solid class. Couple of things to note:Taking ML before this class is bound to be helpful, as others have noted. I did not take ML before this class, so picking up on some of the ML ideas was difficult. Second, the lectures aren't that great. Littman and Isbell have great chemistry, but a lot of the time, the importance or central idea of a concept is not clearly explained (sometimes terms aren't even defined), and is covered up in a lot of snark, which while amusing, does not help elucidate a lot of the topics. David Silver lectures should be used to supplement your understanding.HW's are way easier than the projects. The projects are pretty brutal, but overall enjoyable. Make sure you have extra time to do them, especially Project 2, the Lunar Lander.The final is garbage, but that's true of most OMSCS classes. There's really no idea what concepts are going to be focused on in the exam, and there's a ton of lectures, so it's easily possible to be asked a question about something you barely even focused on because it didn't seem that important. I understand the need for an exam like this to encourage students to watch the lectures, but they just aren't a really good gauge of how much you understand, so be sure to boost your grade up by doing well on the projects.Overall, TA's were fantastic, and professor wasn't very involved, which is pretty much the norm in OMSCS.", "rating": "Liked", "workload": "25 hours/week", "author": "hk0geEqZpjVVbE1Rck822p4eDqC3", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/9/18, 11:14 AM"}, {"comment": "I have mixed feeling about this course, unlike many other reviews unfortunately. On one hand, the material is really interesting and the projects and homework are also quite engaging and I've learnt a lot from doing those. The same can't be said about the lectures...which has been said by some other reviews. Most of times I find it quite difficult to follow the lectures and gain a deep understanding of the content. There's also too much readings than can be realistically done on a part-time basis. After this course has been completed, I find that the course is more like a survey of topics in RL rather going into details on any of the materials.", "rating": "Neutral", "workload": "10 hours/week", "author": "CsZkRTPoOQgKHgYpBpVIrfh3XqV2", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/10/18, 9:45 AM"}, {"comment": "I don't know why Isbell is still shown as the instructor for this class, he has 0 involvement beyond the lecture videos, which IMO is a very weak excuse to have him as lead instructor when he doesn't even once communicate with students during the semester. Miguel Morales, the head TA should be the head instructor for this class and he should have the power to modify the course, he's writing a book on RL, so he's pretty qualified.Regarding the workload it varies, I was very busy this semester and was still able to deliver all homeworks with some help from GitHub. The projects require replicating paper results, which is an absolute hell given that authors give very lackluster descriptions and not enough information to replicate their experiments, but even if you aren't able to replicate them 100% you can still get a decent grade, TAs are very fair as long as you show effort. The last project requires linear programming with CVXOPT, the second project requires knowledge of POMDPs, linear function approximation or Deep RL, the first project is just an implementation of TD(lambda).The only exam was the final exam, which I expected to be like the one in ML (i.e Isbell's questions, which can be very hard for normal people, but in this case the exam was easier. As long as you review the material completely and understand the basic concepts you should make it. I hadn't watched more than 60% of the lectures for the semester and I reviewed them in the last week and still I think I did good.You could dismiss most lectures and still have good grades on homeworks and projects, as long as you're fairly able to use Google effectively.If you're expecting some interaction with Littman of Isbell, it is NONEXISTENT, NULL, ZERO. Although the TA's (at least Miguel Morales) seem to be very knowledgeable.", "rating": "Neutral", "workload": "20 hours/week", "author": "RJBjQYJteDbIqmfpISNcM00g5oy1", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/11/18, 11:57 AM"}, {"comment": "I was only mildly interested in RL before taking this class and have preferred it to Computer Vision only because I liked Prof. Isbell and his teaching style after taking ML. But the class has certainly peaked my interest in RL and I now I want to learn more. There is no question about it - it's a demanding class and I spent more than 30 hours per week, overall, and easily more than 40 hours on projects. But I really enjoyed all of them. Projects and homeworks have been fun to work on, but writing papers was not as fun.Lectures were interesting, often long and required rewatching some of them to get some concepts.Professor was mostly absent from class, but the TA have done a great job of managing the class and helping students along the way.", "rating": "Loved!", "workload": "30 hours/week", "author": "SgNHeAQw7YVyZkFYVej0Vzb8CvB2", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/16/18, 12:52 AM"}, {"comment": "This is a tough course. The content is difficult to understand, the syllabus is huge, the tests are difficult, the projects too.Having said that there is a lot to learn. I will probably get a B, but I am happy to have learnt so many things.To succeed in the course:You need to be ahead of time. Watch David Silver's lectures onlineWatch all the Udacity video content (And more importantly make notes, so that you can refer them later. Not possible to remember everything)Explore OpenAI GymAttend or atleast watch all recorded OHBe active on SlackAnd you'll be good to go!The best part of this course is the TA support and the infrasttucture they have. Office Hours are priceless, even if you cant attend - the videos are recorded.The TAs are passionate about the subject: Miguel, Chris, Alec, Tim are very active on Slack as well on Piazza. I wish Prof. Isbell showed some love to CS7642 as much as CS7641Disclaimer: I have taken DVA, ML4T, AI4R before. This was my fourth course", "rating": "Liked", "workload": "30 hours/week", "author": "5dZ2iljlB8MV0VOOT65Q9nZVxEf2", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/17/18, 5:41 AM"}, {"comment": "This RL class is a foundational class towards your understanding and further study of Reinforcement Learning. It will be a compilation of the basics of RL. If one realizes, the videos are a distillation of the required reading. It is a very well-run class with excellent TAs whose enthusiasm will just spillover to the class. Office hours are something I look forward to, and definitely regret missing.Assignments are tough but doable - these actually test the intimate understanding of a topic - a great way to learn. Not only do you \"know\" something - you actually get to do something.Projects are tough but fun! It takes A LOT of time - but with proper time management - it should be doable - they give a month to finish a project! With the difficulty of the project comes learning also.Finally the final exam is super tough - but that will be a true test of your understanding of the course. Read and internalize the lessons. No such thing as winging it.The course will lay the foundations for RL - but will leave you yearning for more time to cover more material and to explore more things in depth. By going through the class though, you're likely be in a state capable to go about exploring and getting more information, or exploiting what you already know. Either way you should be able to reap some rewards.", "rating": "Loved!", "workload": "23 hours/week", "author": "2koveLZG8VZlEWlEGAwQttkYogy1", "difficulty": "Very Hard", "semester": "Fall 2018", "time": "12/18/18, 10:08 AM"}, {"comment": "OverviewThis was my first ML related course and it was a doozy! Very challenging topic and be prepared to do a lot of self studying. I hadn\u2019t taken ML or ML4T or really any linear algebra before this so I had to spend a lot of time wrapping my head around the concepts and the math. That being said, the TAs are phenomenal and never underestimate the value of Slack. Everyone is in the same boat as you and there are plenty of people wondering about the same questions you are so jump on slack and interact! I learned a lot through discussions in slack and was also able to contribute back as well.StructureHomework/projects were released in batches. I think it was something like 2 or 3 homework\u2019s and a project would all be released at the same time. Then 1 hw was due each week and if you kept on schedule you would have 2 weeks to do the project. Do not wait to start the projects. Start them as early as you can. There was also generally 1 lecture and 1-3 papers to read each week. I did find the papers a bit overwhelming at times. They are deep in many cases and I definitely didn\u2019t understand them all - though by the end of the course many of them did make a lot more sense, especially after applying and seeing some of the base material so many times. There was only 1 exam - 25 questions, T\\F and you must justify your answer to get full credit. The exam definitely tests your comprehension of the subject. You can\u2019t just read someone else\u2019s notes or study guide and expect to do well.LecturesThe lectures were great to watch. Isbell and Littman work very well together and make the lectures generally enjoyable and informative. That being said they can be very abstract so it really made you work to understand how you would actually apply the material.Hw and ProjectsI didn\u2019t find the homework\u2019s to be especially difficult and they mostly helped reinforce what you were learning. The projects were very challenging, especially the second one. It really gives you an appreciation for what\u2019s going on and makes you learn how to approach and solve a problem, especially when the solution domain is incredibly open ended. The projects often require a lot of re-reading papers and lectures and that can be time consuming. Your solution may also take a long time to run depending on how you designed it and what algorithm(s) you decided to use. So start them early and ask questions. Each project consisted of you writing your own code and then a max 5 page report.ConclusionOverall a really challenging, but fun course. I found it very taxing and trying at times, but am glad I took it. If you can, probably better to take ML before this course. I ended up with an A, but did spend a lot of time to get there. None project weeks were reasonably light but project weeks were really heavy.", "rating": "Loved!", "workload": "35 hours/week", "author": "ElTmTe0SN5eCzPCDUmyFfdGuYjs2", "difficulty": "Very Hard", "semester": "Fall 2018", "time": "1/5/19, 12:23 PM"}, {"comment": "Background: This was my 4th class, and I have taken ML4T (and 6340 and 6250) but not regular ML before taking this course. I also have done a fair bit of reinforcement learning at my day job in the past and had watched the David Silver RL lectures a couple years ago.Lectures: The lectures are starting to show their age. Deep learning for RL plays a much bigger part in the wild and is largely untouched in the lectures. Overall I thought the lectures were not too hard to follow but also didn't really help that much with the projects. They were more useful for the assignments and final review.Paper readings: There are kind of a lot of papers in this class. I think most of them your could probably skip. Just read the ones that are needed directly for the assignments/projects and skim the rest.Assignments: Much easier than the projects. I was able to 100% them all, finishing a few of them in only a few hours after really starting to code them up. Love it when classes have an autograder. Each one had 10 example inputs and you could attempt each one 10 times.Projects: In general it is totally unclear to me how these are graded and it was sometimes difficult to cram everything into the maximum 5 pages. I thought the first one was the hardest because I couldn't reproduce the charts at all even though my calculations seemed to match those that we crowd-sourced as a class. On the second one I took the opportunity to use some deep learning and probably ended up doing way more work than was necessary but because it was more open ended was more enjoyable. The last one I took less time on thanks again to helpful hints by other classmates and the short linear programming tutorial by one of the TAs. I also found the feedback totally lacking on these projects. We got P1 feedback right as P2 was due and even then the only thing I was told for my 85% was \"Good job, even though you couldn't reproduce the charts you seem to understand the experiments.\" P2 had slightly more feedback but also didn't come until after P3 was due and I have a hard time believing that P3 was really even properly read through.Final: 30 T/F with explanation in 90 minutes on ProctorTrack. Several obscure questions and a few things that were easy to get flipped in your brain. When taking it I didn't think I had missed that much but ended up getting like a 70% on it, so my explanations must have been inadequate.Overall: Thanks to the curve got an A. TAs were fine. BlueJeans for office hours was sometimes annoying. Poor audio a few times, screen messed up/resolution too low to read. I didn't listen to every one Piazza got quieter as the semester went on. I think Isbell made one comment the whole semester. In general I think a useful course but not sure how good it would have been if I didn't already know a lot about MDPs and Q learning beforehand.", "rating": "Neutral", "workload": "18 hours/week", "author": "CtQ0DcBe0dZXomeKmksYLIjTlnj1", "difficulty": "Hard", "semester": "Fall 2018", "time": "1/5/19, 5:31 PM"}, {"comment": "Comments were pretty spot on for this class though opinions will very. Not a killer like ML, AI, or GA but definitely on the more difficult end like a 4 out of 5 on the scale. Based around reading papers and replicating results so expect a lot of learning a lot of the more difficult mathematical/algorithmic concepts on your own.", "rating": "Neutral", "workload": "20 hours/week", "author": "o2VrhMXkRSbqXihLON4GkyMWACs2", "difficulty": "Hard", "semester": "Fall 2018", "time": "1/10/19, 6:27 PM"}, {"comment": "The material is engaging and fascinating. The lectures are competent, but cover almost no relevant theory and hand-wave all the interesting parts. I watched all of Andrew Silver's RL lectures beforehand, and I think that's necessary to avoid spinning your wheels on trying to understand RL through the lectures. The papers are well-curated and fascinating, while still accessible to the student audience. The TAs are decently responsive on Piazza, as is the knowledgeable portion of the students. Isbell is absent entirely, but as those who have taken ML will attest, this is entirely to RL's benefit.Two of the projects are well-designed. The middle one, which involves trying to put together a video-game-player using tools and infrastructure not covered in this class (or, frankly, in ML) was one of the most frustrating experiences of my life, and I am no stranger to over-ambitious projects. As compared to nearly every other class I've taken in OMSCS, the busy-work:workload ratio was the lowest of any class except CCA. This applies pretty evenly for every assignment except Project 2, which was a huge waste of potential.The concerns about grades are overhyped. The project averages hovered around 80%, and for some reason the exam average was 57%, but this was my first encounter with ML of any kind, and I never got below a 92% on any project or the exam. You just have to be willing to put in the research, work through the proofs, and understand the theory. From the piazza, it was pretty clear that there were a lot of people looking for shortcuts, which may account for the low average scores. With the extra credit, I wound up with 97%. Again, that's without any background in ML or CS. You just have to read the papers and follow the proofs.I'd recommend this class. I took it before ML, and thank goodness I did, because the difference could not be more stark (I likely wouldn't have taken RL if I'd had to endure ML first).", "rating": "Loved!", "workload": "15 hours/week", "author": "DH8uzIKaclWKUDzx4ddvo2wz2RV2", "difficulty": "Hard", "semester": "Fall 2018", "time": "3/25/19, 3:34 PM"}, {"comment": "You'll enjoy this class if you enjoy self-study.The course lectures are almost useless. They are more a catalog of topics than an explanation. Expect to spend lots of time deciphering obscure details of papers and trying to get things to match the behavior of the papers with no help.The projects are ridiculous. They take an inordinate amount of effort to complete and many people have trouble meeting the objective. Especially the last project was very poorly specified and required a lot of implementation and lots of debugging. Not a lot of code, but a lot of hair pulling. This is the exact opposite of say Computer Vision a class that has an insane workload but very well designed projects. This is by far the hardest class in the program, but not in a good way. I'd add that its probably the worst class in the program in spite of having some remarkably good TAs.Tips to succeed: do all the Silver lectures ahead of time. Take GA for better understanding of Linear Programs (before you do this class). Take ML for Trading to get a good handle on Reinforcement Learning before taking this class. Take ML to get a handle on the Professor's teaching style.The only thing good I can say about this class is that there are good alternatives on Coursera that you should prefer over this one. The TAs are very good too. But the way the class and projects are designed the class is a pretty horrible experience.Tips:Focus on writing a really good, complete and detailed paper in your projects. That will influence your grade the most.Historical grade information shows that the final grade has been somewhat lenient. So in spite of all your suffering you can end up with a good grade.Consider skipping", "rating": "Strongly Disliked", "workload": "40 hours/week", "author": "3c39ef91-4f6f-4acc-b037-1adb", "difficulty": "Very Hard", "semester": "Summer 2018", "time": "fa15ea7310/25/18, 2:57 AM"}, {"comment": "An extremely poor course that does an awful job at explaining what might very well be the most exciting field in Tech right now. One of the worst courses in the ML specialization. The first 3 to 4 lectures are okay but after that it's just downhill. Final exam is awful and tests you on nothing useful. Wasted opportunity.We basically teach ourselves watching videos from other universities. I barely watched any lectures until the last week. TAs themselves know nothing about the material save for maybe the head TA. The professor is absent and not very friendly. He also has disrespectful grading policies as well in addition to making poor distracting jokes in the lectures.Projects are tough. P1 is okay. P2 is time consuming to train but easiest of the 3 to implement. P3 is very hard. You replicate papers without any help.You will walk out with only superficial understanding of RL as most of the important material is never tested in any meaningful way. There are other resources online that will teach RL better.For context I got 90% (mean was 80) overall but I still feel i know very little about RL", "rating": "Strongly Disliked", "workload": "17 hours/week", "author": "ryUSScOyW9SNxLt2vB0GdRiBflA2", "difficulty": "Hard", "semester": "Summer 2018", "time": "8/8/18, 12:11 PM"}, {"comment": "I think the class is very good. It contains most of the important aspect of RL. The lecturers are interesting. There are 6 homework and 3 projects and a final for summer semesters. I only feel tough on the project #3 and the final exam. The final exam is 25 T/F questions, but you have to explain why your choose True or False. The final exam is quite hard to prepare... But overall, I think the class is great! I learned a lot !!!", "rating": "Liked", "workload": "21 hours/week", "author": "obDAa2oAfiTJHpgqK1r5IjuUnjk2", "difficulty": "Hard", "semester": "Summer 2018", "time": "7/30/18, 5:13 PM"}, {"comment": "This was my 7th course in the program. Taking this class in the summer is pretty relentless. 2 homework assignments and a project are released in 3 week intervals with the first 2 homework assignments due in the first 2 weeks and the project due the 3rd week of that interval. The homework assignments are autograded so you can see your grade immediately, and each one takes only 1-2 days to complete. For all of the assignments/projects, you have to start with a blank slate (no skeleton code given). Two of the projects were replicating research papers. I would say the first project was not that exciting, but project 2 was the coolest project I have done in OMSCS so far.About half of the lectures were not very well done -- It feels like you are watching the professors nerd out instead of explaining the material. They also assign multiple research papers to read in addition to the lectures that you have to watch every week. I would say its not feasible in the summer to read all of those papers (24 in total), although some students were able to fit it in.Miguel was a very helpful TA since he offered a few in depth help sessions in which he went through some of the assignments in detail. However, outside of the help session and regular office hours, the TAs avoid helping that much with the assignments/projects and usually give you more research papers to refer to if you are confused. I therefore recommend discussing on slack among your peers when you are in a bind.Despite some of the flaws, the subject material is extremely interesting, and I am very glad I chose to take this course. 4/5", "rating": "Liked", "workload": "30 hours/week", "author": "xS9l6eoTeYNiGI1QQsgKHcsjKcg2", "difficulty": "Hard", "semester": "Summer 2018", "time": "8/2/18, 1:32 PM"}, {"comment": "Well, RL is a great course and I took this as a successor to ML and it made some parts such as game theory easy as it was already covered in ML. Homeworks are kind of dicey and tricky and you might end up spending less or more time and some homework I had kind of a hard time to crack it. TAs are great and active piazza/slack channels help to understand the course lot better than what is covered in the videos. Videos are, well, hard to grasp and not very much interesting and not well taught. I always wondered why the content should be so tough to understand and why can't it be taught in an easier and understandable way. Projects are good, though I did not like the reproducing paper's projects. Final is a little hard though they are T/F type. You need to really get the concepts to crack finals. Overall, I liked the course tough some of the aspects mentioned could be improved.", "rating": "Liked", "workload": "20 hours/week", "author": "TPzp2pgygKVTIRvpNVt4Cct1VG72", "difficulty": "Very Hard", "semester": "Summer 2018", "time": "8/4/18, 8:52 PM"}, {"comment": "The course is a great introductory course to Reinforcement Learning. Its recommended, although not necessary to have some background in ML.The material is quite rigorous and covers all the theory, and is still kept quite interesting by the professors. Prof. Isbell and Littman, who teach the lectures, cover so much, and with such ease, that you'll wish they took all the classes. There is a lot of reading, that can be hard to keep up with, but some of the projects require you to implement those, and thus, you'll be forced to read some of the papers anyways. I did not consult any other material than the one already provided, and it worked just fine for me.The homeworks and projects are fun, and challenging. You will get to learn a lot from them. Final is T/F based, and will test the concepts taught in the lectures.RL is one of the frontiers in the field of ML/AI and has tremendous applications from Robotics, to even understanding human decision making and game theory. I'd strongly recommend this course for anyone who is interested in all that.", "rating": "Loved!", "workload": "20 hours/week", "author": "Vx0lXlvP6KOuWShW3xH2Li2tB073", "difficulty": "Hard", "semester": "Summer 2018", "time": "8/5/18, 1:31 AM"}, {"comment": "Interesting material, decent teaching style, lots of self study required.The class starts off easy. I read many of these reviews speaking to the difficulty and workload and was 4 homeworks and a project completed sitting nearly at 100% thinking I must be some sort of genius.I definitely was not. Once the second project hit, there was no way I could catch up to all of the required reading/lectures afterwards. Then the 3rd project continued to batter us when we were down and the final was a Mortal Kombat \"Finish him\" situation.That being said, this was still one of the better classes I have taken in the program and it could only be made better if the instructors planned homeworks and projects with an appropriate amount of time between. I did take it in the summer so the compressed schedule didn't help. However, I would suggest that if the homeworks were brought down to only 3 while keeping it at 3 projects, it would lead to a better experience for all.One last thing - I have seen many discussions that say it doesn't matter whether you took ML (CS7641) prior to this class. I have to say that I would STRONGLY recommend that you do if you want a good pedagogical experience.TL;DR: Hard but good class, P2 and P3 are 4-5X harder than P1 or other homeworks, take ML beforehand.", "rating": "Liked", "workload": "35 hours/week", "author": "b3ueQdJtQHRdbYfj3HWKdVUvJeN2", "difficulty": "Hard", "semester": "Summer 2018", "time": "8/6/18, 10:43 AM"}, {"comment": "Don't take this as a summer course, the workload is very heavy because they don't trim down anything.The lectures were useless. I get it that they are trying to make this fun and have banter, but I'd also like to learn. I highly recommend David Silver's lectures instead, they will take you through MDP's, Policy Iteration, Value Iteration, TD-learning, Q-learning, and DQN (which sets you up nicely for project 2).Project 1 was ok - really serves as a barometer for what they will be looking for in your papers going forward. Take the feedback seriously!Project 2 was great - lunar lander from openai gym. Implemented DQN, got to use tensorflow. Best project I've done in the program so far!Project 3 was very difficult - there are a lot of missing details from the paper whose result you are being asked to reproduce. A huge component here is Linear Programming, so if you are not familiar with it you are in a tough spot, because they explain it VERY POORLY in the lectures/office hours.Head TA was hard to understand. Frequently office hours left me more confused than before.", "rating": "Liked", "workload": "30 hours/week", "author": "GmAQhHM6gVMGt1l9VcFB8D4jIEE3", "difficulty": "Very Hard", "semester": "Summer 2018", "time": "8/6/18, 3:19 PM"}, {"comment": "This is a hard course to take in summer. Most of the students would have taken ML before RL know what to expect, but for other students like me who has NOT taken ML (yet) and RL is your first Dr. Isbell course, you are in for a ride. There is NO difference between taking RL in a summer or in a full semester. Unlike other courses, in RL there are NO cut-downs of assignments, projects. You just have less time to complete everything.Coursework: 3 projects and 6 assignments/homeworks and 1 exam.Extra credit is offered in 1 homework, but it's a very very small contribution to your overall grade.You can kinda front-load work because the assignments and projects are released in batches. It's 2 assignments+1 project released at once with different deadlines for each deliverable (project having the most time).The assignments/homeworks are just graded on the output of your program. No need for reports, but you need good understanding of readings and lectures to solve these problems.The grading of the project is primarily focused on your report (5 pages total MAX including everything) - unlike ML, you CAN'T steal code - you have to implement RL algorithms yourself and write a detailed technical report describing all the why's/how's/if's of the observations you saw in your experiments. P1 and P3 are paper replication+analysis and P2 is the most interesting one where you teach an agent to play a game. Hardest one for me was P3. Make sure you have enough time for it since you will also have to study for your exam.The final part (25% of your grade) depends on the final closed-book ProctorTrack exam. If you are taking the course in the summer, you better catch up with weekly reading or you are going to have one helluva time during the finals. EVERYTHING in the lectures+reading is a fair game for the final exam. If you don't do well on exams, better get high marks on the 3 projects and the homeworks you have (which account for 75% of your grade) and hope for the best in the exam.You really don't need any resources other than the ones provided by TAs and the lectures. Many suggest watching Silver's lectures, but they are not really needed IMHO. I did not watch them, but the slides were indeed helpful. If you have extra time, no harm in watching them! :)Taking notes was very useful to me in this class. Lot's of small facts are told here and there when the profs (Dr. Littman and Dr. Isbell) are conversing in the lectures. Make sure to note them as they will be very helpful for the exam!Overall, a very useful and well-organized course. Although, I am not sure how readily the concepts you learn here can be applied in real-life, it is still a good skillset to have.Finally, the TAs played a huge role in running the course smoothly even in summer! The TAs of this course have set my bars higher for future course TA expectations! :D The weekly office hours held by TAs are very useful for doing the projects and homeworks so don't miss them.", "rating": "Liked", "workload": "20 hours/week", "author": "AuPkmUYH5oZimXMWRqoZOibVeoh1", "difficulty": "Hard", "semester": "Summer 2018", "time": "8/6/18, 3:08 PM"}, {"comment": "This was my 8th class in the OMSCS program which included taking ML4T, AI, and ML prior to this one. Having some of that prior knowledge certainly made this class easier with respect to the reports and general flow of the course. If you plan to take this course, I do recommend the following:Really try to watch the lectures and do the weekly readings during the period they are assigned. This will make reviewing all that material again for the final easier to handle.What I saw a lot of people do, including myself, was stop watching the lecture videos after the first project. The lecture videos didn't seem to provide much help with the homework and projects after that point but trying to absorb those hours of lectures before the final can be daunting.Expect a really hard final but fairly graded given its difficulty. Professor Isbell is known for his tough and broad tests. When they tell you that you will be tested on any of the information that is given (lectures and all external readings) it is true.Consider not doing this one over the Summer. You are given fewer weeks than a Fall or Spring semester but have the same amount of work.Overall, this class was good, and IMO necessary if you are going to get into the field of ML. The TAs were very good and really want you to succeed, but don't expect a whole lot coming from Professor Isbell in terms of Piazza.", "rating": "Liked", "workload": "20 hours/week", "author": "apDnoxub3aX97JZ5r6UGLaEEyOB2", "difficulty": "Hard", "semester": "Summer 2018", "time": "8/6/18, 5:55 PM"}, {"comment": "This was a tough course, but I enjoyed it. 6 homeworks were relatively easy to get perfect scores on and the autograder worked well. The 3 projects were a challenge. Make sure you look at the directions really carefully and hit all the things they are asking for. They will take a long time to do and to do well. Make sure you start on them sooner rather than later. Grading of the projects are not super transparent, and it is a little slow, but I learned from the projects for sure. TAs are generally helpful with office hours and on piazza (apart from the slowish grading). There is only 1 test worth 25% of the grade. It is closed book closed notes closed everything. Takes the form of 25 t/F questions where you have to justify why you put T or F. It was a ton of information from the semester to take in for the one test. All the Udacity lectures and about 25 journal articles. I did not do super well on the exam, but liked the course overall and I feel like I learned a lot about Reinforcement Learning. I especially enjoyed the lectures and the banter between Isbell and Littman in the lectures.I would not take this as a first course, but I am glad I took it and would recommend it to others.", "rating": "Liked", "workload": "25 hours/week", "author": "JmiJ2fb8c8XtLhdki3sTYTvEZxC2", "difficulty": "Hard", "semester": "Summer 2018", "time": "8/7/18, 12:18 AM"}, {"comment": "The topics are very interesting. But I dont think the lectures explain them well enough. Compared with Sutton's book, David Silver's lecture, and lecture notes else where I found online, sometimes I feel our lectures explain the same concept in the weirdest way (maybe just not in line with my logic). As a result, I dont feel confident about what I've learnt. I participated in the first two help sessions organized by the TAs/TA, I feel the host (sorry I could not match face and name) explain some concepts in a very clear way, yeah, he knows what he is talking about, but after taking this class, I don't have that confidence (although I got over 90% in total).Reflecting in the exam, (25T/F with one or two sentence explanation), I reviewed quite a lot but I still feel the questions are very confusing to me. I knew the questions are not supposed to be easy but I feel my problem is simply that I do not understand the topics well.There are six assignments, they help you understand some basic theories mentioned in the lectures/papers. Seems most students got full marks.There are three projects. Two are replicating research papers. One is a deep learning project, which gives me a very good introduction to DQN. One of the papers to replicate is very vague and I guess we are not really expected to fully replicate it.Lessons I learnt: 1) regarding the projects, follow the requirements strictly and make it very clear in your paper that you are following them. 2) for the reports, i feel the thinking process is more important than the actual results. As the TAs mentioned, we can write a good report without great experiment results. 3) spend sometime learn linear programming. 4) start to prepare/google some lecture notes for yourself earlier. It will help a lot for the review. During the last week some google docs with lecture notes prepared by old students were circulated in the slack channel, some of them are very helpful high-level abstraction of the lectures.Note: I rate it as medium difficulty because I feel the projects are manageable if you aim at being reasonable instead of being perfect in terms of the results.", "rating": "Liked", "workload": "20 hours/week", "author": "xkc7y14czwQpRDEJKU1OTqnSxvQ2", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/7/18, 2:40 AM"}, {"comment": "This was a fairly interesting course. I enjoyed watching most of the lectures and a lot of the papers were useful. I don't think I learned as much as I hoped to, however, and the projects, while informative, did not engage me as much as I had hoped and were generally fairly easy, with the hardest part being the length of time required to run the scripts (even when vectorized) on my laptop. The homeworks were too easy to reinforce any of the learning from the lectures. Overall though, this gave me good insight into the algorithms that can be used for RL and also which researchers to follow in the future.", "rating": "Liked", "workload": "10 hours/week", "author": "ieKeXJGOTNcIMKX32RIBnBnH8QE3", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/7/18, 10:32 AM"}, {"comment": "This course extends what is taught in ML (even using the same video lectures) and consists of 6 homeworks (5% each, normally taking 1-5 hours), 3 projects (15%, each, taking anywhere from 20-60 hours for me) and a final (25%, 2 hours, T/F with explanation).The homeworks are generally fairly easy once you get the core problem, which most people do. They are autograded and you get a few submissions so you know your grade immediately. The first project is replicating a research paper and is relatively easy and not that interesting. Project 2 was a lot of fun, but much harder - it's the lunar lander problem from openAI gym. Project 3 was the hardest of the lot, involving linear programming to replicate another research paper. The grading was pretty haphazard and depended heavily on which TA you got. One tip is that the code does not matter at all - it doesn't matter if you replicate the research or not, it only matters that you talk about the algorithms used in the research paper. The exam was similar to the T/F questions from ML, and takes about 45 minutes to an hour (no rush).The lectures are comically bad. Unfortunately you do need to watch them to know what is going to be on the exam. As everyone has mentioned, watch David Silver's lectures first, then just skim through the Udacity lessons and try not to let them disrupt the things you learned from Silver. I also used a course from Udemy which helped.Pros:The TAs seem like nice people. I didn't find the office hours super helpful, but Miguel and Tim were capable head TAs, and Miguel held special 'help sessions' for the homeworks.The slack channel was great.Cons:Abysmal lectures. If this was a paid Coursera MOOC I would ask for my money back and then some more for damages.Projects aren't really related to the material.No rubric for projects.Haphazard grading. If you get generous TAs you will get an A.With all the good, free resources on ML and RL online, it's amazing that this course hasn't yet been Joyner-ified to catch up with them. Do this course because you need it for the ML specialization, not because you want to learn RL.", "rating": "Strongly Disliked", "workload": "20 hours/week", "author": "FyUS0J6Me9cYrpRq7s4VfElHc6E3", "difficulty": "Hard", "semester": "Summer 2018", "time": "8/9/18, 10:58 AM"}, {"comment": "I'm really on the fence about this class, even almost two weeks after being done. A slant towards dislike due to the poor grading policies. This is my 5th class in the program. My only ML background is ML4T and in retrospect I kind of wish I took ML first.I didn't watch David Silver's lectures until I started reviewing for the final. I only watched a few and I'm not really sure how helpful they were. I enjoyed the lecture format for the Udacity RL lectures, but I don't really know how much I actually learned from them. I'm in the same boat as the other reviewer who finished with 90% with a cursory understanding of the material. My % was less but still an A, thanks to a very generous curve.6 homeworks (30% total), 3 individual projects (45% total), 1 final exam (25%). Final is 25 T/F questions with explanations for each, whether we think T or F, and everything is fair game, including all lectures and all 30ish papers (a small number of which were more like books) we were assigned to read.I thought HW 1 was the hardest one by far. Each is challenging in its own way but once you have that \"aha\" moment they're very simple. I never got that with HW1 but I did find another way to do it. And since we run our code on provided test cases and submit answers to an autograder (limit of 10 tries per problem, which I found to be way more than needed, which is good), it doesn't matter whether we code it the \"right\" way or not. Overall I had a lot of fun with the HWs.Projects are coding with a report. Project 1 was about replicating results in a research paper. I enjoyed it since it was a perfect mix of everything. Challenging, but not so challenging that I just sat there wondering what to even do. It was rewarding to generate results and interesting to compare with classmates' results. Then came the grades. I lost nearly 10% for not doing something that wasn't even mentioned in the project description. Well, I actually did do it, but I didn't write about it because our reports had a hard limit of 5 pages. Given everything we had to write about and the types of graphs we had to include, it was a real struggle to stay in the limit, so the amount of extra stuff we can put in there is tiny, if anything at all. Based on class feedback it seemed like a common occurrence to lose points for things not specifically required. Speaking of feedback, many students said their feedback on P1 was extremely vague. I didn't have this problem on P1, but this was fixed in general for P2 and P3.Several students asked for full rubrics to clarify the P1 grades, and the TAs were very adamant about not giving those out. I completely understand why they don't want to do that (and I was surprised that ML4T essentially does do that), but it would have been nice for them to meet us halfway. It's very frustrating to be docked points for something you (1) have no idea you're supposed to do, and (2) can't fit into the report anyway because you're squeezing everything you were told to do in the 5-page limit. I teach and this is something I would never do to my students, which it makes it all the more frustrating.P2 was the OpenAI gym lunar lander project. I had fun with this at first but then it turned into a game of \"find the parameters\", which I find tedious, dull, and not educational. Parameter tuning is a big part of ML, RL, CV, etc., and it is why I'm heavily disinterested in these subjects now. I honestly don't know if I even want to take ML anymore.P3 was replicating research results again, this time using game theory and linear programming. This was challenging in an unpleasant way (sitting there wondering what to even do) but once I got over that hurdle it was a little more enjoyable, even if it was a little tedious. In the end I lost a few points for reasons similar to P1.This was the first course I've taken where we had absolutely no starter code for projects or homeworks. I like that since it's generally more rewarding to code something functional completely from scratch.Overall, this is definitely my least favorite class so far. But I highly enjoyed the other ones I've taken, so that's not necessarily saying this course is terrible. I guess I'm glad to have taken it, but... I don't know, it just wasn't what I was expecting I guess. I absolutely do not recommend this as a first course unless you have some hardcore ML/RL experience. I don't know if I recommend it at all, but you will need to take it if you're doing the ML spec and you want to avoid group projects.", "rating": "Disliked", "workload": "25 hours/week", "author": "qnAaiyrvyBN3lH75njavIsxcwOI3", "difficulty": "Very Hard", "semester": "Summer 2018", "time": "8/11/18, 1:35 PM"}, {"comment": "Good course. Covered contemporary RL. Theory focused.", "rating": "Liked", "workload": "20 hours/week", "author": "xlF8j1ueOOe3f13Ni7LIyQTBx1l1", "difficulty": "Hard", "semester": "Summer 2018", "time": "8/13/18, 4:54 PM"}, {"comment": "Good:-TA's are very responsive on piazza and active on slack.-Guest office hours with Professor Leslie Kaelbling was a really nice opportunity.-Project 2 was exciting and fun and helped to learn the material in an interesting way.-HW's were reasonable and helped to reinforce the course material.-Professor Littman and Isbell do a good job of working together and making sure questions that people might have are answered as they go through the material.-Reproducing results from papers in the field helped to internalize the material and develop a level of academic maturity and confidence.Bad:-The office hours format does not provide interaction. Just ask a single question and wait for a response.-Course load is too heavy. Less would give more time to absorb the material. Could probably be split into 2 courses with markov games as a separate class.-One or two office hours with the course instructor per semester would be very helpful.-Grading is a mystery, especially for projects.-Better rig gives you an advantage especially on projects 2 & 3.", "rating": "Liked", "workload": "20 hours/week", "author": "v0NryXA4GfY4chgz5SNU7XRdSnP2", "difficulty": "Hard", "semester": "Summer 2018", "time": "8/17/18, 7:21 AM"}, {"comment": "The recommended flow for ML courses are DV -> ML4T -> ML -> RL. I took the course in summer as my 2nd course and had to finally drop the course. My maths is pretty good and always scored very high in math but this course was dealing with probability. I had extreme difficulty understanding this course and also didn't get much help (maybe because it was summer) . The course does not give lecture slides and taught on whiteboard. The recommended readings are thesis/dissertations. Didn't get much TA help. I would never recommend this course as a first course or as a summer course. Depending on your interest the course may or may not be useful for ML track.", "rating": "Disliked", "workload": "20 hours/week", "author": "rmpyf4RkiZOTjQ69YEwW3SYIJPV2", "difficulty": "Very Hard", "semester": "Summer 2018", "time": "8/17/18, 8:52 PM"}, {"comment": "The final exam of this course is very hard. The mean is below 60...other than that, the homework and projects are not that difficult. I agree this course is mainly about self-learning, and I don't like the style of the lectures. However, I really liked the homework and project design. It's not about hours' tedious work but focused on your thinking. I learnt a ton from the assignments.Back to the lectures, I think the two professors are more focused on the details of RL. This is not friendly to beginners, but when I finished the whole course, I found the lectures not that bad.Tips:Take David Silver's RL course prior to this one. Very helpful.Read the given papers carefully. Project 1 and 3 will be much easier if you understand the details in the paper. Same for the homework.Some TA sessions are not helpful. So don't waste your time if you feel that at the first session.No GPU needed for project 2. I wasted too much time on that and found out CPU is even faster. Although TA warned this....", "rating": "Liked", "workload": "18 hours/week", "author": "MoS2hiUWjRf6iYufRZjUbzQTnzZ2", "difficulty": "Hard", "semester": "Summer 2018", "time": "8/24/18, 12:15 PM"}, {"comment": "Very interesting course. Lectures were sort of useful. Thank god for David Silver lectures", "rating": "Liked", "workload": "12 hours/week", "author": "EbH6KFXRo7RnNYatcFsbYCKCqR13", "difficulty": "Hard", "semester": "Summer 2018", "time": "10/16/18, 6:53 PM"}, {"comment": "This is a tough course but doable one. The projects are fun & very stimulating. Prof Isbell is not as active as in case of ML. But the TAs are very engaged so you won\u2019t miss the guidance needed.Miguel Morales needs a special mention. He is not only very knowledgeable but very humble too; he\u2019s very keen to teach as well so that makes it even better. Overall a very enjoyable class with lots of learning...", "rating": "Loved!", "workload": "15 hours/week", "author": "7720a2dd-ec5e-4403-9cc1-60f4", "difficulty": "Hard", "semester": "Summer 2018", "time": "072a3b3911/6/18, 12:39 PM"}, {"comment": "I don't agree with the exaggerated criticism from some students here. The lectures are pretty theoretical, but I believe they give a strong foundation if you really dedicate your time there. Be prepared to learn a lot by yourself and use other sources like the videos from Berkeley, DeepMind and David Silver on RL.I have a ML/DL background from Udacity - Deep Learning, so I decided to take this as my first course and I don't regret it. If you don't have a ML background I suggest taking this course first.There are 6 Homeworks and 3 projects. Project 1 and 3 are replication of papers and project 2 is the Lunar Lander from OpenAI Gym.Due to my time zone, I always watched the recorded OH sessions in Blue Jeans, which helped a lot. This is where the TAs give advice on how to to complete the HW or the Projects.TAs showed a lot of knowledge and where very active on Piazza. They would also show up on slack channel to help but perhaps also to monitor discussions.I have a busy work, a wife and a kid which posed a challenge to attend this course due to the time required to watch lectures and read the papers, but it is absolutely doable if you have discipline and start the assignments as soon as they are released.Interest in Reinforcement Learning has increased a lot in the last 3 years after the paper from DeepMind about a RL agent playing Atari Games and the launch of AlphaGo. Other players such as OpenAI, Unity are investing heavily on it.Everyone interested in ML/AI should definitely take this course!", "rating": "Loved!", "workload": "20 hours/week", "author": "CgCyCGLoS7buHuDpuEi92sfPNXH2", "difficulty": "Hard", "semester": "Summer 2018", "time": "12/12/18, 2:49 PM"}, {"comment": "(This is for Fall 2018)This course isn't so much hard as time consuming & frustrating.The material is complex but not impossible, especially if you have taken ML and/or ML4T in advance.The projects will make you nuts -- not implementing the concepts, but trying to reproduce with accuracy the original author's results. The time invested in testing and tuning doesn't match the knowledge accumulated. And many find the lack of an explicit rubric leads to surprising grades.The final exam format is, well, not my favorite. True/False Explain, and each question is crafted more as an inference trap then a test of your understanding.Professor Isbell is completely absent. This is a TA-run class, with mixed results. Some are quite good and supportive, while others only contribute to the confusion.Others are right, the Lunar Lander project is a gas. In all, I was glad to take this after ML, as I was prepared for the teaching style and test format.", "rating": "Liked", "workload": "20 hours/week", "author": "yhVk2rIbSWd0XVFcMZR5bGqadqm2", "difficulty": "Hard", "semester": "Summer 2018", "time": "12/18/18, 8:07 AM"}, {"comment": "NOTE: I took the course in FALL 2018, but this wasn't available to select in the dropdown.This course was a disappointment overall. The workload was challenging, but not for the right reasons. Most of the TAs were condescending and unhelpful. The regrading policy was draconian: If you asked for a regrade, but didn't get at least five points in the regrade, you would lose ten points (for failing to internalize criticism). This would be fine, except that you have no access to the grading rubric, because... reasons. Additionally, grading was super-slow, with often a month elapsing between submitting a project and getting the grade back. This was particularly annoying when they missed getting an important grade back prior to the drop deadline. To make matters worse, approximately 2/3 of the way through the course, they \"clarified\" that you could ask questions about your grade without requesting a regrade. Presumably, they'd received complaints, but it struck me that this system was put in place to save the TAs from having to work, rather than for any benefit of the students.The material is dated, and the lectures are very math heavy. The problem with that is that the math is presented as background material, and is poorly explained and has key details glossed over. Moreover, you don't actually need to know it for the course, and it's there at the expense of other explanations and more up-to-date material.On top of that, two of the three projects require techniques that aren't mentioned at all (or are only barely touched upon) in the lectures. (Deep Learning and Linear Programming, respectively).The projects are interesting, but more often than not, you are fumbling in the dark for solutions/hints that can only be found by searching the web, or watching David Silver's lectures.This course needs a serious revamp. For one, the field has advanced a lot since the lectures were recorded. Secondly, the teaching style, was fairly adversarial. I get that it's supposed to challenge the students, but the challenge should come from the material, not from the attitudes of the professor and TAs.Overall, I would not recommend this course. It was more difficult than it should have been, and for the wrong reasons. I want to feel like I'm being challenged to learn on a course, not condescended to. I was not the only one to feel this way.Note that I did well in this course, getting an A, so this is not just sour grapes on my part. This course has genuine problems. You should only take it if you really want to learn RL (outdated), and really don't mind being in the dark for most of the course.An additional tip if you take this course: Watch David Silver's lectures in addition to the course lectures. They cover the material much more thoroughly and clearly.In short, this course is a lot more work than it should be for the depth of material, and most of that time will be figuring out where to find missing information.", "rating": "Disliked", "workload": "20 hours/week", "author": "YrFddQ5pgDe6gwK2n8c81ELmSWa2", "difficulty": "Hard", "semester": "Summer 2018", "time": "12/31/18, 4:37 PM"}], "difficulty": 4.075, "enrolled": 0.0, "id": "CS7642"}, {"rating": 4.317, "workload": 10.359, "withdrew": 141.0, "comments": [{"comment": "While the material was interesting, I was surprised how poorly administered the class is. The projects are interesting. The midterm exam had mostly minor permutations of the sample exams. The learning experience is significantly degraded because the TA guidance is severely lacking, confusing, and self-contradictory. While they respond quickly to most questions, often the response is unsatisfactory and unclear. An example, after our midterms were graded, we were provided only a score. Only after a student posted to request to see our exam to know what we got wrong did a TA reply with \"ask your grader TA\" response. It shouldn't take additional action on our part to see our exam. Furthermore, even after recycling so many past midterm questions, the midterm still had out-of-scope questions and questions with incorrect answers. It is also implied that these questions will remain if a student doesn't contact the TA about their midterm. This is incredibly sloppy, and just one example of many blunders with how this class is now conducted. There are too many other excellent classes in this program than to waste your time, money, and effort on this one.", "rating": "Disliked", "workload": "6 hours/week", "author": "BstSbpR9NaSSjFpRJPciIzKwtq22", "difficulty": "Easy", "semester": "Spring 2019", "time": "3/19/19, 4:31 AM"}, {"comment": "I would highly recommend this course as a first course or a secondary course paired with a more difficult course. I completed this course along with ML. This course serves as an introduction to data manipulation with Python and Pandas and an introduction to a few basic machine learning concepts. If you have taken AI or CV before this one, then the projects will require no new learning with python at all except maybe how to graph data for some specific requirements. Similarly, you will not learn any meaningful depth if you have taken ML beforehand. Anyone gauging their interest into trading and financial software would benefit from this course. Anyone with experience with applying machine learning to trading will not learn anything new in this course.In terms of structure, the course starts with simple projects manipulating data in Python. These projects become modules in later learning agents before using everything at the end when applying machine learning to choose trades and make money. Therefore, this class is one of the easiest to complete work ahead of time with only minor changes once the project requirements are finalized. The midterm and final are easy multiple choice exams.", "rating": "Loved!", "workload": "8 hours/week", "author": "AAhVG90JRcQCBBqwZwGK78TaucU2", "difficulty": "Very Easy", "semester": "Fall 2018", "time": "12/3/18, 10:04 PM"}, {"comment": "This is a very good intro course for those that are new to programming in python and you can also learn a little bit of finance stuff. The most interesting project was the one where you build and simulate the market - buying stocks, selling stocks and backtesting strategy - it's very run and rewarding and maybe you can even extend it to building more serious trading systems (that capability is there IMHO). The TAs were very active and the results for the assignments were available almost immediately so you could clarify what you want as soon as possible. We have 2 exams - both are fully MCQ and are easy to ace if you have a good understanding of the subject.Overall would recommend all OMS students to take this course because it's a very light and interesting course where you learn a lot of useful stuff.", "rating": "Loved!", "workload": "5 hours/week", "author": "AuPkmUYH5oZimXMWRqoZOibVeoh1", "difficulty": "Very Easy", "semester": "Fall 2018", "time": "12/12/18, 1:01 PM"}, {"comment": "Overall, I enjoyed this course. This really feels like a combination MBA/CS course, so if you are looking for pure CS, this may not be for you. I have not taken any of the other ML courses yet, which did not seriously impact my ability to get things done, so for most people the same thing should apply. This course definitely got my excitement up for taking more ML courses!As for the projects - if you are not a strong programmer they can be extremely challenging. Do not come into this course expecting the opportunity to skill up from zero experience and be ready for later projects - you need a bit of familiarity with Python to get started, but the basic usage of NumPy and Pandas are covered in the lectures, but you're somewhat on your own figuring out how to make them work efficiently. Make sure you use an IDE (such as PyCharm) that can help you effectively write and debug code. In the Fall 2018 semester we were still using Python 2.7, and you must use specific packages for auto grading compatibility, but I believe Dr. Balch has stated they are working on getting to Python 3 and newer package versions soon. Almost all code is auto graded, with the majority of test cases provided to you, with a few hidden cases (hidden in that you haven't been given the auto grading case, but the assignment directions will definitely point to edge cases you may need to consider). In addition, some of the projects have both code and reports that must be written, so if writing is not your thing, be aware.The organization of this course was somewhat underdone, in that the course schedule wasn't finalized until about two weeks in, and most assignments were not finalized until about a week before their due date. There were usually only minor changes, if any, from what the assignment page on the course wiki originally had, although the final project had some moderate changes. This was the first time the course was on Canvas, so it may take a few semesters before things are running smoothly on Canvas. The lectures on Udacity are usually watched out of order, and there are additional lectures/recorded office hours on YouTube that are required, so not everything is in one place. In addition, you get to watch a movie for this class, \"The Big Short\", but have to procure it on your own - which is not a big deal, you can buy/rent it for streaming or a Blu-ray for less than most textbooks - but some were put off by the fact that they had to do this.The exams were entirely hosted on ProctorTrack (as in, none of the exam content was delivered using Canvas). That's a little annoying because I think Canvas provides a better test-taking experience for students. The exams themselves were multiple choice, with about a minute per question budget (30 questions \u2248 35 minutes). The content of the exams wasn't too difficult, and the second exam and crowdsourced from the students, which meant if you could memorize the questions, you could do very well on that exam.Finally, Piazza - this class had several sections combined into one Piazza section, and it was definitely messy. There were nearly 2500 posts over the semester, and many of them were duplicate questions or questions that were being covered on a pinned post. The course team did a pretty good job managing, and were very active in berating people who didn't look things up first. Some might find that harsh but I think it's almost required in order to get people to change their behavior.Overall - the pace of this course was a bit rapid, but it covered a lot and accomplished a lot. It may not have gone as deep for some, but again this is more of a survey and practical applications kind of course. It's definitely a good appetizer if you are just getting started with machine learning.", "rating": "Loved!", "workload": "12 hours/week", "author": "facebook:1010089235622961112", "difficulty": "Medium", "semester": "Fall 2018", "time": "/13/18, 2:56 PM"}, {"comment": "Best course so far that I took. I am only 3 courses in the program. The subject of finance and machine learning were both subjects that I have a strong interest, hence was making the class more smooth to take. I finished with a grade of 95% (A).However, even if I found the course interesting, it is far from being perfect.First of all, you won't be able to work in advance too much. Most of the time, the \"final version\" of the assignment are signed off 4-7 days before the date you need to submit. My schedule is challenging and I was able to rush at the middle of the semester but I had to come back to my assignments to do adjustment constantly.Second, the class is okay but some lectures video quality are from many years ago, with a very bad recording (blurry) whiteboard. They could have re-recorded it, they did not. Hence, it looks cheap. There is plenty of Youtube video with better quality. Georgia Tech must stay in touch with reality and offer better materials.Third, the teacher will give you a single example of most concepts. Only one. You will have to find more online. It annoys me that they deliberately provide as little as possible instead of having the goal to provide the best way to teach. For example, the notions around DYNA is wrong. If you implement the algorithm described, you end up with timeout for the assignment. No explanation in the lesson about it, it was through Piazza that a student gave the reason.The final exam was questions from students, a lot were bad qualities. Even if students had to vote on the best questions, it was still not okay. It also makes the whole class feel cheap. The teacher recycles content from many years ago and was not even there to write the final exam. Again, students pay for something that should be of better quality than what you can find online.I worked a lot on each assignment, way more than many people in the class. I was astonished to read student posting basic questions on the assignment with less than 24h before the submission while I already had worked 2-3 weeks on the assignment. I may not be as smart as these students, however, the level of the questions asked was basic, hence believe that some people are getting enough to pass the course without spending must time. I personally had to spend easily 20 hours per assignment. Most of the time was to understand the theory. Even if I watched all the lessons and read all the theory recommended, the implementation often puzzled me. Disclaimer: I have almost no experience in Python and Numpy/Pandas hence had to struggle a little for the first few assignments.Finally, instead of focusing on the machine learning part of trading, there were topics that were making no sense. For example, a lot of time spent on the crisis of 2008 with mortgages. Or, about option tradings. It does not belong in that class at all. These two parts must be taken off and have more examples, theory, applications in machine learning topics that were executed too fast.Pros:SubjectInteresting assignmentGood class to tiptoes on machine learner and Python/Numpy/PandasLectures were way better than my two first classesNo teamworkA mix of code and reportCons:Quality of lessonAssignments are very slow to be sealed in requirementNot enough fat around the bonesToo much offtopic subjects (like the movie, options trading)Two 30 minutes examsI have spent too much time on that class. I am more than happy with my grade, but I spent way too much. I have invested easily 18 hours per week. the breakdown is about 3 hours on theory (lectures and books) and 15 hours on assignment.", "rating": "Loved!", "workload": "18 hours/week", "author": "7BA2RA80xMU3ttzcuGrF8O88qgP2", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/16/18, 6:33 PM"}, {"comment": "Best course so far that I took. I am only 3 courses in the program. The subject of finance and machine learning were both subjects that I have a strong interest, hence was making the class more smooth to take. I finished with a grade of 95% (A).However, even if I found the course interesting, it is far from being perfect.First of all, you won't be able to work in advance too much. Most of the time, the \"final version\" of the assignment are signed off 4-7 days before the date you need to submit. My schedule is challenging and I was able to rush at the middle of the semester but I had to come back to my assignments to do adjustment constantly.Second, the class is okay but some lectures video quality are from many years ago, with a very bad recording (blurry) whiteboard. They could have re-recorded it, they did not. Hence, it looks cheap. There is plenty of Youtube video with better quality. Georgia Tech must stay in touch with reality and offer better materials.Third, the teacher will give you a single example of most concepts. Only one. You will have to find more online. It annoys me that they deliberately provide as little as possible instead of having the goal to provide the best way to teach. For example, the notions around DYNA is wrong. If you implement the algorithm described, you end up with timeout for the assignment. No explanation in the lesson about it, it was through Piazza that a student gave the reason.The final exam was questions from students, a lot were bad qualities. Even if students had to vote on the best questions, it was still not okay. It also makes the whole class feel cheap. The teacher recycles content from many years ago and was not even there to write the final exam. Again, students pay for something that should be of better quality than what you can find online.I worked a lot on each assignment, way more than many people in the class. I was astonished to read student posting basic questions on the assignment with less than 24h before the submission while I already had worked 2-3 weeks on the assignment. I may not be as smart as these students, however, the level of the questions asked was basic, hence believe that some people are getting enough to pass the course without spending must time. I personally had to spend easily 20 hours per assignment. Most of the time was to understand the theory. Even if I watched all the lessons and read all the theory recommended, the implementation often puzzled me. Disclaimer: I have almost no experience in Python and Numpy/Pandas hence had to struggle a little for the first few assignments.Finally, instead of focusing on the machine learning part of trading, there were topics that were making no sense. For example, a lot of time spent on the crisis of 2008 with mortgages. Or, about option tradings. It does not belong in that class at all. These two parts must be taken off and have more examples, theory, applications in machine learning topics that were executed too fast.Pros:SubjectInteresting assignmentGood class to tiptoes on machine learner and Python/Numpy/PandasLectures were way better than my two first classesNo teamworkA mix of code and reportCons:Quality of lessonAssignments are very slow to be sealed in requirementNot enough fat around the bonesToo much offtopic subjects (like the movie, options trading)Two 30 minutes examsI have spent too much time on that class. I am more than happy with my grade, but I spent way too much. I have invested easily 18 hours per week. the breakdown is about 3 hours on theory (lectures and books) and 15 hours on assignment.", "rating": "Loved!", "workload": "18 hours/week", "author": "7BA2RA80xMU3ttzcuGrF8O88qgP2", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/16/18, 6:36 PM"}, {"comment": "Fun course. Great intro to data manipulation in python. Easy if you know how to program and have some knowledge of or at least interest in finance. The ML aspects can be mostly abstracted away (which is both a positive and a negative). The tests were a breeze, and I finished each in ~15 minutes.", "rating": "Loved!", "workload": "10 hours/week", "author": "7OjkLJGKZvRGh6A673D6WR4q8fq1", "difficulty": "Easy", "semester": "Fall 2018", "time": "12/19/18, 6:04 PM"}, {"comment": "Overall, this course was very good and is a great first course. The material was well thought out and the assignments are great. Below are my thoughts on different areas of the course.TestsThe tests were honestly my least favorite part of this class. The first test was the midterm and we were given previous tests and their correct answers. Memorizing those was all you needed to do to get an A. For the final, we were asked to create a question on a specific subject in the course depending on our last name. After this, all of the questions that were student generated were sent out and we were required to grade 5 of them. Once this was over, the professor gave out all of the ratings. I studied the ones that had a score of 4+ and 3 or more ratings. This ended up being 250 questions. Doing this, I was able to get a 27/30 on the final. Overall, depending on your approach, the tests could have been more of a regurgitation of material rather than actual understanding of material. Not to say that memorizing these questions doesn't help with understanding of material. But, you get the point.TL;DR you can memorize material and do wellAssignmentsThe assignments were great & had awesome documentation / resources on how to complete them. There were 8 assignments total ranging from easy to very challenging in difficulty. The difficulties were given on the course wiki & I found them to be accurate. The first few assignments were great for getting me up to speed in python. The later ones were more difficult and reinforced material learned in the lectures. The assignments do start to build on themselves, so do not get behind. I started all of them very early & was able to finish them days before the due date. This was good because they did have reports that you needed to write after finishing the code.TL;DR start them early & check piazza -> you'll do well.PiazzaGood once you sorted through the countless duplicate posts. I had very little patience / empathy for people who continuously posted duplicate questions. Other than that, it was very active with good posts. The TAs & professor answered quickly and with good responses. If something comes off as offensive, don't take it personally. There are participation checks for Piazza. So make sure you're posting & reading posts through the app or website. Also, make sure you use the correct email in the settings. Your actual GaTech email, not the alias. Visit the site daily so you know where questions / answers are. This will be helpful and beneficial for projects.TL;DR read posts, ask questions, make sure your email is correct -> you'll do well.Do:Watch lectures - UdacityStart projects earlyPost on piazzaStudy for exams earlyDon't:POST DUPLICATES ON PIAZZAStart projects late. You have time. You always have time. Just. Do. It.Forget to check piazza or wiki before asking a questionAsk questions that you could easily search on piazzaSay 'Sorry if this is a duplicate, but...' because you will get a response tagging another post with your question. The TA's don't have time for you inability to search. Seriously.", "rating": "Loved!", "workload": "15 hours/week", "author": "8YyFirP9AfOdJ3KmpPuyYLR4X2h2", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/20/18, 1:14 PM"}, {"comment": "Projects are interesting and is a balance of finance and machine learning. It will strengthen your Python and Numpy skills. It is a wide range of difficulty but a ramp up. The Professor difficulty suggestion is subjective. I found that the two most difficult project was assess_learners(rated challenging) and manual_strategy(rated moderate). Assess_learners was challenging because of the assignment itself while manual strategy was difficult because the instructions were general and supporting material was limited. I would recommend to start on each project as early as possible as there is usually minor changes when the assignment is finalize.Exams were easy because one was similar to a prior exam and the second one was based on the top rated student question pools which you had access too.Overall, great course material of projects and lectures. Very clear expectations on most assignments, professor was active, and the Teaching Assistants were outstanding. Remember to check Piazza discussion and the Slack Channel as the staff was great.", "rating": "Loved!", "workload": "20 hours/week", "author": "l7DXVtQ5CVN2yvK2OSiZcPQ0EcE2", "difficulty": "Easy", "semester": "Fall 2018", "time": "12/31/18, 11:19 PM"}, {"comment": "Reasonably difficult for someone with little Python experience, but definitely not too difficult to figure it out on the fly. Gives you a great introduction to Python really.Projects are fun and interesting. Grading is fair and clear. Some projects were all programming and some had report aspects to them. Programming portions of projects could be tested using their test cases, but there are some extra tests that they don't provide.I risked it all semester and never used their test server due to stubbornness of figuring it out. But I would recommend figuring that out early on and testing all projects before submitting. Even though something works perfectly for you, they may have an older version of a python package installed that may not have a function you used....and don't wait until the last night to complete the last project....", "rating": "Loved!", "workload": "10 hours/week", "author": "aISgmIzxKogZWcp8QbIfSzTehKr1", "difficulty": "Medium", "semester": "Fall 2018", "time": "1/2/19, 1:39 PM"}, {"comment": "Enjoyed the course. You can front load the data, but the projects can change up to a week or so before the due date. So you may need to redo some things, but changes should be minimal. TAs super helpful and proof of the professor's existence was obvious in this class compared to others.", "rating": "Loved!", "workload": "10 hours/week", "author": "0ldoTegxLwZhW2klkgJCU8tmY8X2", "difficulty": "Medium", "semester": "Fall 2018", "time": "1/2/19, 2:58 PM"}, {"comment": "I was not confident with Python so I spent a lot of time doing assignments. You cant really finish your assignments ahead of time because they finalize the assignments like 7 days before the deadline. Good thing is they provide assignments from previous semesters so you can still get an idea. They also provide grading scripts for the assignments which was helpful. TA's grading on reports were pretty generous.Like others said, the exams were super easy.", "rating": "Liked", "workload": "12 hours/week", "author": "ydQSB8tJKWRJmUfliQK7q97yujk1", "difficulty": "Medium", "semester": "Fall 2018", "time": "1/4/19, 2:43 PM"}, {"comment": "This is an excellent course and should be your first if you are doing the ML track. You will code a lot, but the fun part is you use all the code for the later projects, so you eventually build up an repo that serves as the codebase for your final project. There is a very nice balance between difficult and not-so difficult projects.Definitely you need python skills for this course, if you don't have any -- be ready to learn. The course does a good job teaching some basics at the start, but you will have to ramp up fast.Videos are all quite good, I thoroughly enjoyed it all. The only quibble I have is that the course takes awhile to \"Finalize\" the projects, so it's somewhat hard to work ahead. That being said, you can certainly work ahead, just be ready to make minor changes. All the projects are available from the start of the course with detailed instructions on the course site, it's just they get tweaked as the course progresses.Exams are fair -- make sure to study the provided materials -- they are highly relevant. Our final exam was drawn from a question bank of student written questions! My question ended up on the exam!! I could not remember the answer!!! True story.TA's are very active, we had one god-mode TA who was literally always online and very kind. Even if she wasn't around, I'm know there was enough coverage from the others. Professor was also active on piazza.", "rating": "Loved!", "workload": "10 hours/week", "author": "I07SekgvkTN0TrDcc4iJuI6XekE2", "difficulty": "Medium", "semester": "Fall 2018", "time": "1/9/19, 10:46 AM"}, {"comment": "I really liked the class overall. The instructor was entertaining, the material interesting, and nothing was overly difficult. I felt that not only was the instructor a fun person, he also did an incredible job teaching concepts in a way I could understand. For example, I took AI and they covered decision trees and it kind of made sense but I struggled with it. This class also went over decision trees and I feel like it made complete sense after one lecture. Maybe I benefited from having already been introduced, but in the AI class I watched those lectures multiple times to no avail, and I got it first try in this class. So kudos to the teacher on that. Only thing I would recommend be different is that there be a little more focus on the machine learning and a little less on the trading, but the class is machine learning for training and there is a separate machine learning class, so I guess its not a big deal. I felt like I ended up learning only a tiny bit about machine learning and how it applied to trading, but I learned a lot about trading. So if you were more interested in trading anyway, this is the class for you!", "rating": "Liked", "workload": "4 hours/week", "author": "kvYfDnjwlvfpXHtck8iDRQeirkt1", "difficulty": "Easy", "semester": "Fall 2018", "time": "3/22/19, 12:42 PM"}, {"comment": "Overall a pretty solid (and very very gentle) intro to ML if you have had zero exposure. You will finish with a basic understanding of some of the rudimentary concepts in ML, and learn a few basic points about the markets. The assignments are pretty straightforward and fun.That being said, a few pain points:1) Assignment logistics aren't finalized until sometimes literally a few days before the due date. If you are someone who likes to not wait until the night before to complete an assignment, this can be difficult. Many students get flustered by this.2) Some of the material is arguably superfluous in an elementary fashion (re-watching movies to answer exam Q's, etc)3) The assignments are mostly rigid (scaffolded starter code, exact api specifications, etc) and don't allow for too much creativity, exploration, or struggle. This is the exact reason for the gap between academia and the real world. The projects need to be more open ended, involve dirtier data, etc; only then through a turbulent trial and error process involving practical roadblocks, will students truly learn ML4T techniques, and more importantly, learn how to solve problems with ML.Nevertheless, the course is quite enjoyable but could use an overhaul of content and coordination procedure.", "rating": "Liked", "workload": "5 hours/week", "author": "hL2I5LpLcxRE1pMMTN21jIRMMac2", "difficulty": "Very Easy", "semester": "Summer 2018", "time": "7/19/18, 9:48 PM"}, {"comment": "Pros:Good instructor and TA involvement.Project requirements are well communicated. Everything is also out in advance so you can easily work ahead.Course material is interesting.Cons:Class is too light on content. If you've been exposed to the ML concepts before, and/or have been introduced to NumPy/Pandas, then you won't find too much additional to learn. I had just taken AI so was fairly comfortable with the concepts and NumPy already. There really isn't enough here to fill a semester, even a compressed summer semester.Class uses lame \"Piazza participation\" metric, which counts for 5% of the grade and caused the forum to be mostly filled with \"thanks\" and \"+1\" messages. I didn't really need to visit Piazza for help during the semester but went there every day just to click through the messages and occasionally answer a question so I wouldn't get a zero on participation. This policy also seems to benefit greatly the students who are asking the really embarrassing questions (e.g. \"how do I install the python? I have no programming\").Overall though, I can't complain too greatly. It was somewhat interesting and not too stressful. Made for a relaxing summer.", "rating": "Liked", "workload": "4 hours/week", "author": "mMKMQ8O3kvegXTtHoN77W1gOOLt1", "difficulty": "Very Easy", "semester": "Summer 2018", "time": "7/30/18, 3:50 PM"}, {"comment": "This was my second course in the program and I very much enjoyed the project work in this class. The course provides a great overview and introduction to machine learning concepts, reinforcement learning and finance without diving into the weeds. But if you already have a introductory machine learning background this course likely won't provide much value to you. This would be a good course to pair with another course since the time commitment is not as large per week as some other courses. However, communication between the professor and TAs regarding finalization of projects and content covered on exams was severely lacking. In many instances official communications did not finalize the projects until a few day before they were due. Project descriptions from previous semesters were made available to us at the beginning of the course and luckily in many cases the descriptions changed minimally once the project was finalized. There was a midterm exam and a final exam administered via ProctorTrack.", "rating": "Liked", "workload": "10 hours/week", "author": "du7bZzS1MJVOAK5FCEpDPLzmrsu2", "difficulty": "Easy", "semester": "Summer 2018", "time": "7/30/18, 5:30 PM"}, {"comment": "As my first real ML course, it was a decent introduction to ML concepts, though I wish it had gone more in-depth into actual trading strategies. The pacing of the course feels a little off at times. You'll cover almost all of the Udacity lectures prior to the midterm and will be watching YouTube videos of live classroom-recorded lectures afterwards, which tend to drag on due to technical problems and other in-class reasons.While all assignments are posted on the wiki up front, we were warned they they were all subject to change and that they would be finalized at least two weeks prior to their deadline. This never happened and each was finalized just a few days before being due. Most assignments remained relatively unchanged, but the \"very challenging\" final project was finalized 5 days before it was due, and then changed again after being finalized to add a new section worth 15% of the grade. Needless to say, the instructor communication in this course was very poor. The TAs were great and grades were returned fastest of any of the 6 OMSCS courses I've taken, but it was obvious they had extremely limited say in how things were run. Professor Balch was MIA for most of the course, leading to a lot of unnecessary confusion on Piazza. Combined with the new \"Piazza participation\" metric worth 5% of our grade, Piazza was difficult to meaningfully follow.The projects were fairly easy overall. Some have YouTube videos with the professor walking you through a solution, while another took literally a few minutes to complete. There were 2 fewer projects in the Summer semester, though a portion of one was built into the final project. Two of the projects required writing reports, though neither was very intimidating due to the rubric spelling out exactly what to include.There were 2 ProctorTrack exams of about equal, moderate-to-easy difficulty, though the final did include a few questions about The Big Short movie that were completely inappropriate/unrelated to this graduate-level course material.There were 3 books (1 required, 2 optional), but I didn't use any of them and had no problem getting As on every assignment and exam.Overall, an easy class even for summer, made mildly frustrating only due to the professor's lack of engagement in making simple clarifications and some students' lack of Piazza etiquette (exacerbated by the participation portion of our grade).Course material is publicly available at http://quantsoftware.gatech.edu/Machine_Learning_for_Trading_Course", "rating": "Liked", "workload": "6 hours/week", "author": "FXHiMYkeykR5gFPvejJHtlYaYLG2", "difficulty": "Easy", "semester": "Summer 2018", "time": "7/31/18, 10:54 AM"}, {"comment": "This was definitely a fun class. The projects were all well thought out and build on each other effectively. The lectures were pretty engaging and not hard to get through. The exams, though proctored, are basically 30 questions multiple choice, and not hard to succeed at if you review the study materials well enough before hand, and do the required reading/watch the recommended videos.All of the projects use python with pandas and numpy. It'll help a lot if you are already familiar with these libraries and vectorization with numpy!", "rating": "Loved!", "workload": "15 hours/week", "author": "V71KBZGkGTgJOBSBxceObM7yck53", "difficulty": "Medium", "semester": "Summer 2018", "time": "7/31/18, 5:22 PM"}, {"comment": "This course teaches you 1) how modern trading is done under the hood 2) how different machine learning methods are applied to trading. It is both a horizon-broadening opportunity and a good introduction to machine learning. Projects are not not difficult if you have experience in Python. I took it in the shorter summer semester, but I did not feel the workload is heavy at all. Lectures are well made. Assignments are well defined and have a template to start with. I especially like the last two assignments in which I got exposure to reinforcement learning.In general, I like this course. It is not that time consuming, but I actually have learnt stuff.", "rating": "Liked", "workload": "8 hours/week", "author": "pcFieZfIzsd59SxRKZJIjsWOfbg1", "difficulty": "Easy", "semester": "Summer 2018", "time": "8/4/18, 2:51 AM"}, {"comment": "This course was a (very) gentle introduction to ML, numpy, and pandas, as others have noted. I'd strongly recommend taking this before 7641 (Machine Learning) as a concrete example of Machine Learning construction methods for several learners as well as an example of how to organize and think about specific data before applying ML techniques.I'll say Prof Balch was absolutely approachable, entertaining (in a dad-joke way :) ), and authentic in his presentation.The nits I must pick are that the material is disorganized, the Piazza participation grade leads to chaos and overload, and the late-finalization of assignments is a little frustrating. Grading was super-quick though.", "rating": "Loved!", "workload": "12 hours/week", "author": "9nURtxBwQmQcirh7ZvK4bBvyQn22", "difficulty": "Easy", "semester": "Summer 2018", "time": "8/5/18, 1:59 PM"}, {"comment": "This class is a mix of introductory regarding finance and machine learning. I liked ML part a lot, it is very good introduction for people who have no prior experience of ML. Personally I could not be so interested in finance part though. Assignments (projects) are all python programming assignments (and some reports) and they were simply fun. We need to watch a long lecture video which is not designated for Udacity format but the professor explains what to implement step by step. As long as you attend Piazza regularly and ask if you need some help, someone can assist you and you should be able to complete all assignments (while the last one is bit difficult I think). I've never checked eventually but people also used Slack and it sounded very active.Midterm exam was not so difficult, it has a lot of resource to prepare but the last exam was basically with no hint for questions in advance, so it's bit random and it also asks very non-essential questions like a location of some scene in the movie....I recommend try getting full marks in assignments and attend Piazza regularly then you can get A with even 70-80 exam scores. At least for this summer class, no curve and no extra credits. Also recommend reviewing Python before the class. Also, start a project as early as possible. I first expected that I can start work on assignments after they're finalized, but sometimes it was finalized just a several days before a deadline. The differences were minimal from last semester so you shouldn't be worried about it so much.Generally the professor and TAs are very helpful and approachable.", "rating": "Liked", "workload": "8 hours/week", "author": "4oD0WVLeRgRl6f4XGAD99vfr90J2", "difficulty": "Easy", "semester": "Summer 2018", "time": "8/6/18, 5:50 AM"}, {"comment": "I took this class because of the rave reviews I read here, and I liked it but I didn't love it. I wanted to love it.The coding assignments were on the easy side, but I did learn a lot from them. And they were fun. Tests were a breeze but please spend some time studying for themProfessor Balch is a solid gem. He was more engaged in the class than I have seen from any other course Instructor. He is good natured and a great lecturer. The Udacity lectures are put together well.A handful of the TAs did an outstanding job, which, as far as I can tell from having taken 6 classes is what can make or break a course. And, although the TAs may vary from semester to semester, they don't change each semester. I've noticed that more involved Professors in a class are more involved with the TAs which means the TAs have more ability to be definitive and helpful in general.I knew NOTHING about finance or the stock market before taking this class, but I came away with a comfy familiarity. I'm not going to run out and bet the farm, but I am not so in the dark anymore about trading and its jargon.Note: I took AI before this class and would recommend going at it the other way: Take ML4T before AI for a more gentle intro to some basic concepts that will help you with AI homework.", "rating": "Liked", "workload": "10 hours/week", "author": "S3jm9BLIQAhjeeqHDq7XEsZFdSx1", "difficulty": "Easy", "semester": "Summer 2018", "time": "8/6/18, 2:33 PM"}, {"comment": "Here's my piazza thank you note (also serves as a review)Hello Everyone,I'd like to first thank the TAs and Prof.Tucker for this amazing summer trading adventure! This goes down as one of my favorite courses because of its high quality content on trading, and also because it helped us build 'applied' machine learning skills. I've taken ML courses at GT and CMU before, so I didn't come here to learn about ML as first-timer. I was planning on taking this course to do some applied machine learning and work with stuff like Pandas, numpy and I should say that I wasn't disappointed at all!This course also served as a great introduction to trading. In fact, I've been inspired to trade using Robinhood on the side. But that's a story for another day. Now, there were a few things that I disliked about the course and that doesn't have anything to do with the content:1) How it was run - I thought it was a mess. Frankly, TAs and the Prof. were kind of absent from Piazza. This might not be entirely a bad thing. But at some point I hoped that they intervened and confirmed a few things - such as grading questions, deadlines, rubric. I would like to thank my peers on piazza who helped people debug stuff, write test cases, and also posted strategies on tackling assignments. Yay crowdsourcing!2) The way assignments were released - Why weren't they finalized until the last moment ( like <5 days before the deadline) ? I do agree the most changes were really minor, but I'm highly uncomfortable doing old assignments with old information. This is a personal but I'd like to bring it up - I delayed doing all my assignments (yes even strategy learner!) until they were finalized, cause I couldn't mentally prepare myself working with old stuff that might change.3) Wiki issues - Why even have a \"Summer 2018\" page if it isn't updated. Seriously, why couldn't 1 TA spend half a day at the beginning of the semester and update all the wiki information? Here's what I find on the wiki page, even now, when the course has completed:\"You are on the page for information specific to the summer 2018 session of this course. Go here (Machine_Learning_for_Trading_Course) for overall course policies. Please note: This page is still in revision we will announce by email when it is finalized.\"I feel that these issues have degraded the quality of the course quite a bit. But overall, I'm satisfied because of the great content and teaching (thanks Prof. Tucker!)Thanks everyone", "rating": "Liked", "workload": "7 hours/week", "author": "xd3I0IgfqwU63C2Pc6swtcB87ix1", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/7/18, 1:12 AM"}, {"comment": "I thought the content of the course was interesting, and the professor (T.Balch) and the TAs were very engaged. This course had a decent amount of material (both financial and technical).I think the projects could have been more in depth, and some of the projects could have been portions of others. They did build on one another, which gave a flow and continuity, but I would like to have had more lectures on indicators, why some succeed vs fail, etc.Prof. Balch was the most engaged and interactive professor that I've had at GATech. He posted frequently on Piazza (whereas I had never seen that from a professor before, other than when complaining about students who are complaining), as did the TAs.The biggest area for improvement is 'finalizing projects', which sometimes had changes coming in until the last day or two. On the plus side, the legacy projects were available to start on, but one could not finish and submit until within 24-48 hours.", "rating": "Liked", "workload": "10 hours/week", "author": "5UTeYjNWdXhHkmgQZ8osyIUllDb2", "difficulty": "Easy", "semester": "Summer 2018", "time": "8/7/18, 8:10 AM"}, {"comment": "Took DVA and AI before this one, also had some background in finance (CFA charter holder). There're 3 min courses: python/pandas, finance, ml. For my background, most of the things are like refreshers, and only thing I learned from this course is how to use ML to make trading decisions, any maybe some different way to implement decision trees, random forrests and q-learning. Still interesting though, to see how ML and AI can help with trading securities. and this course's work load is perfect for a relaxing summer. Except the final project+repot took me 3 whole days, others (first 5 projects, 2 exams) are pretty light. There's also a homework to watch movie \"the big short\", which is interesting.I wish there's a follow up course that gets deeper into how ML can do with trading, but this course is a great introduction to people with minimum exposure to finance, hedge fund, python, pandas, and machine learning. Especially for the point that Dr. Balch would give very detailed guidance for home assignment/projects, which could be very helpful for learning, but maybe not that interesting for more experienced students.I would highly recommend as one of the first courses to get you started in OMSCS program.", "rating": "Liked", "workload": "8 hours/week", "author": "KtVcW3gDdYRNbGUHS5GHFpj6BRu2", "difficulty": "Easy", "semester": "Summer 2018", "time": "8/9/18, 5:36 PM"}, {"comment": "So, I really wanted to like this course more. It was a good intro to ML, but don't expect to be able to do any real trading after. The techniques taught are fairly basic and you would be destroyed if you actually tried to use them outside of the carefully controlled toy environment.The course was abbreviated over the summer (one of the projects was dropped, leaving 6). The lectures were pretty good, although both textbooks were totally unnecessary.I have two main complaints. The exams were trivial to the point of meaningless. There were questions on a movie that we were asked to watch (The Big Short) that you could have got the answers to by watching the trailer (they weren't financial questions either). The other questions were related to the material, but if you cram the relevant lectures in for a few hours before taking the exam, you're guaranteed to get a 90 or above (unless you just can't remember simple facts - little to no math required).Secondly, although this clearly wasn't the first time this course had been run throughout the summer, it may as well have been. Projects weren't finalized (or available on Canvas) until the last minute, and the final (hardest) project was still having fairly major tweaks right up until the weekend before it was due.Luckily, this didn't affect me because I'm lazy and had barely started it at that point, but others were not happy.In short, this is an easy course if you keep your wits about you. You'll likely have more difficulty keeping up with the changing requirements than you will with the actual material. So yeah - a fairly realistic preparation for real work in that sense.Overall, I recommend it, but you may not get as much out of it as you would hope.Additionally, some of the TAs were really unhelpful to the point of antagonism. I didn't personally run into this, luckily, but there were others that did.", "rating": "Liked", "workload": "10 hours/week", "author": "YrFddQ5pgDe6gwK2n8c81ELmSWa2", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/21/18, 2:30 PM"}, {"comment": "This was my second class in the program after AI in the first semester. AI was a really hard class and had really enjoyed it, but I wanted something lighter for the summer. It turned out to be a good decision. I would not call this class easy, as it needs fair amount of work in parameter tuning and developing reports / visualizations etc. But enjoyed building my own strategy to do some basic trading.Highlight of this class was the finance fundamentals combined with coding in Python. I did not have any prior finance background and this class taught me many valuable concepts. I could also get better at Python. Really liked the class overall. I'd recommend it for the first semester!P.S. One thing to add: for the last project, there were continuous changes to it till the last moment. That made us really confused regarding the details. There were updates regarding the number of charts allowed till the last 3-4 days before submission deadline. What added to frustration was there were a couple of changes even after the assignment was declared 'Finalized' and we had to redo the work a few times. I feel this caused unnecessary pressure and anxiety.", "rating": "Liked", "workload": "15 hours/week", "author": "5YZPFxS6YTfHFWHRFj5qwLFf0F42", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/23/18, 11:20 PM"}, {"comment": "Ah, to be able to take this course every semester!!!PROS:Gentle introduction to AI materials and python. In retrospect, I wish I had taken this before AI, which is a brutal introduction to similar topics.NO GROUP PROJECTS! All projects are individual.Light course load. The assignments don't change much (usually at all) between semesters and are available.The assignments are easy if you understand the material. This is not a given in other classes.The assignment have local tests which are basically the whole grade. Looking at you, AI.No dealing with Bonnie.CONS:Multiple choice exams that are sometimes arbitrary. The final had at least 5 question about \"The Big Short\", some being \"To what cities did characters travel?\" - Seriously? This is a gradschool level course. There are only 30 questions too so watching this movie and remembering this stuff was imperative. It felt like they ran out of things to ask.The final is based on the entire semester so you have to study the whole damn course beforehand.Exam is closed book so prepare to memorize equations.", "rating": "Loved!", "workload": "8 hours/week", "author": "sumEvEaIHgMgdjG9yh9Dozrq4wx2", "difficulty": "Easy", "semester": "Summer 2018", "time": "9/13/18, 5:13 AM"}, {"comment": "This was my second course on the OMSCS. I did have natural advantage in this course in that I have worked in the finance sector building trading systems for sell side brokers + I had taken AI as my first course (so my comments on ease of course may be a bit harsh)I took this course because(1) I wanted an easy summer after taking AI - which was brutal in comparison(2) I wanted to learn a bit about practical application of ML in the upstream systems that feed the trading systems I work on in my day jobEven without a background like mine I would say the course is extremely easy. As others have commented some of the exam questions were farcical for a graduate level course and a number of the assignments involved little more than mechanically coding formulae or spoon fed descriptions of solutions given in lectures. That said the course did provide a rgood general overview of how buy side hedge funds operate and the two main assignments did provide a bit more challenge.If you have limited financial or ML knowledge this course will provide you with a gentle and enjoyable introduction to both and it will supply you with good high level understanding of how financial markets operate. However you are given a very simplified view of the markets and it will not prepare you for dealing with any of complexities you would encounter with if you were trading in the real world.Overall the course was fun and I did feel I learnt some useful things from the course (although a good bit less than I had hoped)I do feel that the difficultly was below that of a graduate level course.and in my opinion the content and difficultly should be seriously increased. More depth and challenging open ended projects would make this a very interesting and valuable course rather than an easy but enjoyable summer option that does not really live up to its potential", "rating": "Liked", "workload": "4 hours/week", "author": "Gla1OgsFGNYUpyg1ebucjfLZoS93", "difficulty": "Very Easy", "semester": "Summer 2018", "time": "10/27/18, 8:49 AM"}, {"comment": "Very easy class with interesting materials for trading and great for summer or pairing with another course. You can easily front load the lectures. The exams are among the easiest in OMSCS and even the projects are very manageable.", "rating": "Liked", "workload": "5 hours/week", "author": "IIUnlRAGUHTz9ECYDPvU5gFiVRm1", "difficulty": "Easy", "semester": "Summer 2018", "time": "12/17/18, 3:49 AM"}, {"comment": "This is a great introductory course for ML. I suggest this should be the go-to course if you want to get your feet wet in ML/Python (especially numpy).If you've good exposure to numpy and python, in general, it would be easier. Professor Balch was active on Piazza and so were the TAs. Apart from the official lectures on Udacity, there were several youtube recordings where Prof. Balch explains about most the projects. These videos were really helpful.There were two proctored tests. One for the mid-term and the other for the final. There was sufficient material provided (collected by old students and TAs) for the mid-term. No material was provided exclusively for the final. However, if you've done the projects with all sincerity and watched the lectures, the finals is not a big deal.I would suggest not to lose steam since it's a relatively easier course. If you lose a few credits in a couple of assignments you might not end up with an A.I lost a couple of points in one of the project reports and not so perfect scores in the exams and I risked myself of not getting an A. I ended up with a low A.This class was a rewarding experience. Overall, a well-managed class.", "rating": "Liked", "workload": "20 hours/week", "author": "imX0E0Z9LjOu8srTd47cwwPFf9A2", "difficulty": "Medium", "semester": "Summer 2018", "time": "3/24/19, 3:18 AM"}, {"comment": "This is my third course at OMSCS. ML4T is a fun course and well run. Professor Balch is enthusiastic about the material and is highly engaged in running the course day to day, which I think is really important for an online program. I've enjoyed the projects a lot - they give a nice intro into the various ML concepts as well as pandas and numpy. This class isn't the hardest I've taken, but it's not the easiest either. It feels like a pretty good balance, and an excellent first class to take. The projects are not a wash and require a good time investment.It's been my largest class with 500? people I think, which leads to the one drawback - it's difficult to stay on top of the Piazza threads and participate meaningfully. They just explode very quickly around project deadlines and before exams. I know it's something Professor Balch has been experimenting with, such as using reddit last term.Overall I highly recommend this course.", "rating": "Loved!", "workload": "10 hours/week", "author": "WRLDyDaYY7OUmUb8hmAheQxtD8K2", "difficulty": "Medium", "semester": "Spring 2018", "time": "4/4/18, 6:20 PM"}, {"comment": "This was my first class in the OMSCS program and I am very glad that I was able to take it. I have never been interested in anything remotely related to finance, so I was slightly concerned about whether or not I would enjoy this course. Professor Balch does a great job explaining the finance content without assuming any prior knowledge about trading. I've actually had conversations with coworkers about day trading thanks to what I learned in this course. It is practical!I found the projects to be enjoyable throughout the semester. They do a good job of building upon each other as the semester progresses, and they're balanced appropriately. The two most difficult (time consuming) projects were spread throughout the semester. The midterm was fair and shouldn't be too challenging to anyone that stays on top of the course content throughout the semester.Major pro: all assignments for the semester were released in draft at the start of the course. This allowed you to work ahead if you knew you had scheduling challenges coming up during the semester.Biggest con: Although the projects built upon one another, we often had to copy and paste code from one file into another. I would have liked the different files/classes to interact with one another a little better. That being said, though, that's a pretty minor con.The coursework was never insanely difficult, but it did a great job providing an intro to some ML and RL concepts. I'd gladly take this course again and certainly recommend it!", "rating": "Liked", "workload": "12 hours/week", "author": "TZHJo8wyPEVluPoeIlphEk1BOcr1", "difficulty": "Medium", "semester": "Spring 2018", "time": "4/4/18, 6:25 PM"}, {"comment": "A good opportunity to practice machine learning concepts like decision tree and Q-Learning. Also a good course for practicing numpy and pandas. If you have extensive stock trading or machine learning experience this course is probably too easy for you. This is more of an intro course.Areas for improvement: Since the assignments build on each other it would be nice if the grading was faster. Also the assignments often don't get finalized until within a week of the due date. This created a lot of noise on Piazza in the beginning of the semester, but after a few assignments students realized that the assignments probably won't change much between draft mode and finalization so it's okay to work off of the draft version. Just be aware that the assignment descriptions are verbose so it is easy to miss a detail. I think improving communication regarding the assignments could save time for everyone by reducing the noise on Piazza.Overall I enjoyed this course.", "rating": "Liked", "workload": "7 hours/week", "author": "bBWTrqoRV5Tvki3JIX9RqWnK7yC2", "difficulty": "Easy", "semester": "Spring 2018", "time": "4/6/18, 4:47 PM"}, {"comment": "This was only my second course in the program and I am enjoying it. It gives a good introduction of some ML algorithms like Decision tree, Random forest, Bag learners. Later you learn Q learners and dyna and use that to the trading problem for the last assignment. Although you get a choice to use some earlier algorithms learned in the class, most end up using Q learner to solve it. It is advisable to learn some Pandas and numpy as they are used extensively throughout the assignments. I had a tough time using pandas for plotting graphs but managed it well in the end. Learning how array slicing works will help a lot. Also learning how to vectorize will shave some secs off your run time and you get bragging rights in slack and piazza for this. Make sure you are active on slack and piazza as tons of great advise are given by some great minds in the class. If not for slack, I would have struggled to understand and approach the problems on my own. And finally, the TAs in this class are a complete joke. You are assigned a specific TA and the one I had did not show up for the Office hour. Barring a few TAs, most don't help much and just ridicule you on Piazza if you ask something obvious. Having said that, I liked prof Balch's humor and approach. He supplemented the udacity videos with some youtube videos and that helped greatly for solving the assignments. Overall a great class. No wonder this is one of the most popular course in the program and more than 90% of the students end up taking this.", "rating": "Loved!", "workload": "10 hours/week", "author": "LvqblwCSqFUIjBYwFtnyQ7S1hwd2", "difficulty": "Easy", "semester": "Spring 2018", "time": "4/9/18, 5:31 PM"}, {"comment": "I really enjoyed this course and would definitely recommend it. It presents some machine learning concepts, like decision trees, gradient descent, and reinforcement learning, in a context with direct application. The ML methods were not discussed in too much detail but enough to give the students an understanding of how they worked.If you wanted to prepare for this course ahead of time brush up on pandas, numpy, and pyplot. You'll spin your wheels a while if you've never used these libraries. Some assignments can't be completed without leveraging the numpy and pandas matrix operations effectively (for loops cause the grader to time out) and there are some assignments that require reports with charts and graphs built with pyplot. All the financial and market information you need for the course is presented at the beginning and I never wished I had studied that before hand.I should mention that the course starts off a bit disorganized but that improves. Expect the first week or so to be on your own. Also, the assignment instruction are often in a \"draft\" state until less than a week before they're due but none of them had significant changes when they were finalized. Definitely, start them as early as you can. You might be able to wrap them up ahead of time and have some stress free weeks.", "rating": "Loved!", "workload": "10 hours/week", "author": "tjJxUnzB1lZPgy3oDtdEWzQeF5d2", "difficulty": "Easy", "semester": "Spring 2018", "time": "4/22/18, 10:56 AM"}, {"comment": "Love, love, love this class! A very gentle and applied introduction to ML. It also teaches you NumPy and pandas from scratch. There is a lot of info about this course publicly available at http://quantsoftware.gatech.edu/.There are 8 projects in the class, and for the most part they increase in difficulty as you go along. The first two were almost nothing; they can barely be classified as projects. But it makes sense because they're supposed to serve as introductions. All of the projects were very interesting and fun to do. I have no previous ML experience (except for some basic boosting/bagging from CV but that was hardly a decent exposure, as much as I enjoyed CV) and that didn't hurt me in this class at all. It was so cool in the final project to program a trading system based on machine learning and look at the results. Code is tested on real stock data from real companies with some made up companies thrown in every now and then.All of the project info is available ahead of time (see the link above) with the caveat that everything is in \"draft mode\" at first and will be \"finalized\" later. For some reason this was a huge problem for some people in the course. They refused to start until the project was finalized, which is kind of stupid on their part. We were told repeatedly not to do that and that any changes made would be minimal. The biggest change that I remember is in the second project. We had to optimize something different from the previous semester's students. Aside from that I think one or two other projects had a minor change and all the others had literally no change. People blew this draft mode thing way, way out of proportion.There is a proctored midterm and a proctored final. Both are closed everything. The final is not cumulative. The midterm was extremely easy and was almost a regurgitation of previous midterms. It sounded like that won't always be the case.3 textbooks. One is required and is co-written by the professor. It's fairly cheap (especially for a textbook) and is a pretty good read. You'll definitely want it for the midterm at least. The other two books are Python for Finance by Hilpisch and the ML book by Mitchell. I can't remember if those two were actually required, but I didn't find them completely necessary. The lectures were enough.It's often said that a finance background is helpful for this course. I think what people mean is a trading background, not a finance one. I have almost no finance background but I do have a relatively extensive trading background, and that helped a lot. I think manual_strategy would be the most difficult for people with no trading background since it requires an understanding of technical analysis and indicators. This stuff isn't too difficult, but it is a lot to learn on top of everything else if you're new to it.That's kind of true of the course in general. It's not that this material is difficult, it's just that there is sometimes a lot of work in a short timespan. If you have a good background in Python or trading then it'll be less work, of course.This is a good first class if you can get in your first semester. Also, this course potentially pairs well with other courses, depending. I paired it with IIS and had no problems. If you have no Python background and no trading background then I don't recommend taking it over the summer. But, I do recommend this course in general overall.", "rating": "Loved!", "workload": "15 hours/week", "author": "qnAaiyrvyBN3lH75njavIsxcwOI3", "difficulty": "Easy", "semester": "Spring 2018", "time": "4/24/18, 11:25 AM"}], "difficulty": 2.529, "enrolled": 1156.0, "id": "CS7646"}, {"rating": 3.893, "workload": 17.472, "withdrew": 0.0, "comments": [{"comment": "Pretty disappointing course by a sadistic GTech Professor who is more interested in touting his own horn than teaching students. This course has some times where you may not have much work to do, and other weeks where you can spend 30-40 hours trying to do a project. The lectures themselves are very very dry and Sebastian Thrun (the main instructor) does a terrible job of relaying material and concepts beyond the first lecture. The projects can be very confusing on what needs to be done, and expect to spend lots of time debugging the issues. I want a disclaimer that I got a high A in this course, so I am not just some disgruntled student but I was very unhappy with the execution. If I had to say one positive thing about this course, the TA's were pretty quick and helpful.", "rating": "Strongly Disliked", "workload": "15 hours/week", "author": "FtnL8NIde7XTt6UxKgy7daaLnhZ2", "difficulty": "Hard", "semester": "Fall 2018", "time": "12/5/18, 5:53 PM"}, {"comment": "This was my first OMSCS course, and it worked out well. The lectures are all available on Udacity, and the course more or less follows the pacing of the course there. The material was produced by Sebastian Thrun, who narrates the videos. Thought he was awesome, given his on-the-ground expertise in the field. Dr Thrun did office hours several times, which was \"really, really great\" (as he likes to say). The instructor for the course -- Dr Jay Summet -- was great as were the TA's. Both were super responsive. The forums were super helpful as was the Slack channel.In terms of the material itself, it's really AI-lite in as much as the focus is on entry-level algorithms used in self-driving vehicles -- actual AI/ML is outside the scope of this course. I feel like I learned quite a number of really interesting algorithms -- Kalman filters, Particles filters, A star, Theta star, PID, SLAM. The assignments were all fairly straight forward, except the very first one -- Runaway Robot -- which I found very challenging. I would suggest getting through the first few sections of the course straight away, and start work on Runaway immediately.So you can assess my review appropriately, I have 15+ years of software engineering experience across the stack. I am super comfortable with learning new frameworks/languages, and researching things I don't understand. I have a partial CS undergraduate degree.", "rating": "Liked", "workload": "15 hours/week", "author": "RBYabKwxhQgIYTtZ4uQAkfzGqcs2", "difficulty": "Medium", "semester": "Fall 2018", "time": "4/7/19, 10:42 AM"}, {"comment": "AI4R was a great introduction to fundamental concepts of robotics; localization, Kalman and Particle Filters, PID control, A* and various search algorithms, and finally SLAM. All topics are taught around the concept of a self-drivng vehicle. The projects are the highlight of the course and main source of learning. The projects are very well constructed, challenging, and quickly reviewed.Python is the language de jour in AI4R. I tried to use NumPy as much as possible while not required. I would not take this course without some Python background although its an easy language to pick up. It would be nice if the projects were designed for C++ given that is the predominant language in the industry.The instructor, Dr Jay Summet, was very active on Piazza as were the TA's. The course is well organized and coordinated. Dr Sebastian Thrun, who originally developed the material for the course, does some offices hours which is neat, but not directly useful for the courses. He is a good lecturer but I don't like how many quizes are built into the Udacity lectures.Advice for the course, work ahead on the lessons, allocate 40+ hours for each project, and take advantage of the hardware challenges, as much as you have time.I highly recommend this course for anyone with a mild interest in robotics.", "rating": "Loved!", "workload": "12 hours/week", "author": "pZKf9jBBvUehSjdHvZJKaYjh6hq2", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/6/18, 4:27 PM"}, {"comment": "Great course. Fun to learn. But I think its hard. I recommend, before taking this course, revise your probability, trigonometry and algebra lessons. Do get some hands on with python programming, so that you are comfortable with the syntax (This is very important). There are no exams. The evaluation is based on the projects. There will be enough time to work on them. The TA's are extremely helpful. There will be a lot of help coming in on piazza both from TA's and students. The grades are released super fast, this is a very good thing about this course.", "rating": "Loved!", "workload": "25 hours/week", "author": "Jq99tO9KiBf3JiUNCsPy03EfEH03", "difficulty": "Very Hard", "semester": "Fall 2018", "time": "12/6/18, 6:11 PM"}, {"comment": "AI4R was my first course in the program, my first college course in decades, and my first course in the Computer Science field (I'm an electrical engineer by education & career). Although I liked the class, I decided to withdraw in late Oct when it became clear I was unlikely to get a final grade of \"B.\"For non-traditional students like myself with a steeper Computer Science / python learning curve, I recommend finding the \"easiest\" two classes to start with, regardless of specialization area, to improve the chances that you will successfully complete two foundational classes with a B or better in your first 12 months.Professor Summet & his TAs were helpful and engaged in trying to help students over the humps. My main complaint in this course was that .. even after projects were graded, they still would not share code solutions. I got a 50% on one of the early projects (which was fair because I did not grok how-to translate the approach into working code at the time). However, even after getting that poor final project grade, they still would not share code solutions. It seems to me there should be a middle-road to show students what they did wrong without resulting in professors having to develop new projects from scratch every ~four months.Lastly, I'd like to share the office hour links .. Dr Thrun's comments are all excellent, but in particular his remarks on the relevance of some portions of this current AI4R course really should be reviewed by students considering this class in the future. He makes great recommendations for additional (or even alternative) educational opportunities in the autonomous vehicle arena.Office Hour Week 15 https://www.youtube.com/watch?v=T2v77_zTQtEDr. Sebastian Thrun Office Hour https://www.youtube.com/watch?v=82zUf32flMsOffice Hour Week 14 https://www.youtube.com/watch?v=qaIGjD4HY8MOffice Hour Week 13 https://www.youtube.com/watch?v=g-rjspBWoRIOffice Hour Week 12 https://www.youtube.com/watch?v=4aXtJTqwyvIDr. Sebastian Thrun Office Hour https://www.youtube.com/watch?v=SMkLwYe1GZ8Office Hour Week 10 https://www.youtube.com/watch?v=gK0XX2kjHAcDr. Sebastian Thrun Office Hour https://www.youtube.com/watch?v=5KRHwFGE_xYOffice Hour Week 8 https://www.youtube.com/watch?v=b6J7dk2TApwOffice Hour: Wek 7 https://www.youtube.com/watch?v=1YTxpeVYZpUOffice Hour: Week 6 https://www.youtube.com/watch?v=4EqofDEngA0Office Hour: Week 5 https://www.youtube.com/watch?v=Xtc7XFUCo7MOffice Hour: Week 4 https://www.youtube.com/watch?v=UNrumNzuADgOffice Hour: Week 3 https://www.youtube.com/watch?v=KPeXOFeyOG8Office Hour: Week 2 https://www.youtube.com/watch?v=hK7zHYxJQK4", "rating": "Liked", "workload": "30 hours/week", "author": "tcXOahkghYNDlN2l4XrVxbNjTVG3", "difficulty": "Very Hard", "semester": "Fall 2018", "time": "12/9/18, 9:13 AM"}, {"comment": "=========================My Background ===================Have been working for 2 years as a Software Engineer with Python as my main language. This was my first course======================= General Summary ===================The course is a great first course for OMSCS. The content is certainly wide but not deep. Prof. Thrun does a great job of explaining the mathematical aspects of the content in a very intuitive way. However, the actual mathematics is not delved into deeply. Diving deep into the mathematical derivations is not necessary to get good grades, but if you do decide to do that, the course (which is otherwise moderate) becomes very difficult.=========================Pros ============================You get a good idea about how Bayes Theorem works in localization problems. In my opinion, the best part of the course was mini-projects and projects. I have found a new appreciation for the practical aspects of Robotics. Who knew noise control could be so tough!You will learn a good deal about a variety of topics - from localization, to control, to search, and finally to SLAM.This semester (Fall'18), the course was conducted very well. I think this was the first time a project on SLAM was introduced. Sr. Lecturer Jay Summet was always present on Piazza to clear our doubts and help us in all possible ways. The TAs were responsive. Projects were timely graded and the overall experience was very positive.========================Cons===============================Do take the course if you want to know how self-driving cars are working. If you do not have much interest in the area, you might not enjoy the course much. The content lacks mathematical depth which I think is fair, but would be nice to touch upon.", "rating": "Liked", "workload": "7 hours/week", "author": "iGQW6epZ3ZQhTJvaYGNRerGJy173", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/9/18, 11:54 AM"}, {"comment": "AI4R was my first course, and I recommend it as a first course. I work full time and it was the only course I took. I really enjoyed it and got an A. In fact, here is the grade breakdown for all of the students (we received this info from the TA):A 53.11% B 26.89% C 6.89% D 7.54% F 5.57% I thoroughly enjoyed the course. I read many comments on Piazza where several students had problems locating a target (for the mini projects) using the Kalman Filter and/or Particle Filter, so I just used mathematics (trig, geometry, etc.) and made the program work just fine. I would have preferred to get the filters to work, but I strongly desired and A and didn't want to take a chance in not getting filters to work. I got a 97.5% overall.", "rating": "Liked", "workload": "13 hours/week", "author": "kb4FtqBD7rT2wHyrOxL7XtZ4qEx2", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/10/18, 11:23 PM"}, {"comment": "This was my third course in the program and it was an interesting survey of techniques used in robotics. The course covers robot localization with Kalman filters and particle filters, motion planning search algorithms like A*, PID control, and simultaneous localization and mapping (SLAM) algorithms. This is very much an engineering course so make sure to brush up on your probability, linear algebra, trigonometry and python. The course is all projects so depending on how diligent you are you may find yourself doing next to nothing some weeks and working 30 hours another week to finish a project. I recommend this course for a first semester student. I do wish we went a little more in depth into the details and proofs of some of the algorithms but given the wide range of material covered it may have been impractical.", "rating": "Liked", "workload": "15 hours/week", "author": "du7bZzS1MJVOAK5FCEpDPLzmrsu2", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/15/18, 3:56 PM"}, {"comment": "IntroductionThis is my fifth course in OMSCS and have previously completed ML4T, SDP, IIS and CP. I have good enough programming background and comfortable with writing non trivial code. All assignments are in Python and assignments are usually released with two weeks to work. I would rate the workload slightly lower than Computational Photography and equivalent to ML4T.Problem SetsThere are six problem sets which are evaluated in Udacity itself. The TAs require the students to answer in Udacity and upload the answers in Canvas as well. This constitutes 25% of the grade and the answers are there in Udacity videos itself. You can review the videos and ensure that the last submission is the correct one. The Canvas upload is used only as a backup if Udacity results are unavailable.Mini ProjectsThere are two mini projects and Runaway Robot was the first one. This follows close to the video lectures and brushing up on trigonometry and motion models should make this simple enough to finish. (spent time: 3 hrs)The second mini project PID Controller was even more a simpler one and following the videos closely could get the code completed easy (spent time: 2 hrs)Mini project test suites are provided along with the template code and getting the test cases to pass is sufficient.Mini-Projects and Project 1 constitute 30% of the grade.ProjectsThere are three projects:Project 1 - Polygon robot [Time spent: 15 hours]Project 2 - Robot in a warehouse [Time spent: 30 hours]Project 3 - Rover robot on ice [Time spent: 45 hours]These are non trivial projects which increase in terms of complexity and also builds off each other. The test suite provided is not complete with more rigorous hidden test cases which made me lose the Project 1 scores to only 75%. It is important to test the shared tests by other students and share your edge cases as well in Piazza. The TAs usually released the projects early by atleast a week, sometimes even 10 days giving ample amount of time to complete them.Extra CreditThere was an extra credit of 2% for exceptional H/W systems being built out of their own interest. This would help if you are on the verge of a letter grade upgrade. For example 89% with extra credit would give you an 'A'Lectures and RelevanceThe lectures were fun and Dr. Thrun does a fantastic job of making the videos engaging and working throw the topics. The only problem is that they are clearly too basic to prepare the students for the projects themselves. The videos are great for getting a fundamental understanding. However the transference to the project code is not trivial.Good to learnBrushing up on geometric models, basic motion structures would help work on the projects better.MaterialThough the book \"Probabilistic Robotics\" is a good read, it was not really required for this course and all the grading is based only on assignments and there are no exams.", "rating": "Loved!", "workload": "18 hours/week", "author": "oCERnU12iCh9HmPLAoJFNSAKkA52", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/18/18, 12:34 PM"}, {"comment": "This was my first course and it was a great experience. The professor Dr. Jay Summet and TA's were super responsive and empathetic. The lectures by Dr. Sebastian Thrun were presented well and the office hours were always very interesting. It was helpful that we could watch them later, in case we missed it. The projects were very intensive and were set up in such a way that we could apply what we learnt or we could research and come up with alternate implementations. We had a very active Piazza forum without which I would have been stuck on the projects many times.I normally spend >40 hours per week at my workplace and took only one course as my first course. At times during projects it was really a stretch, but I was able to manage it because of some \"down time\" they gave in between.Overall, I enjoyed the course and learnt a lot. My background is in VLSI, so not a lot of actual software experience. But topics like path planning are relevant to my field, so it was enjoyable to code it from a robot perspective. I really appreciate how structured this class was and also the fact that the projects were released earlier so that non-traditional students like me had enough time to work on it. I highly recommend this course.", "rating": "Loved!", "workload": "25 hours/week", "author": "OUNe7JZp4bP51segq1FHMReTb3M2", "difficulty": "Medium", "semester": "Fall 2018", "time": "12/19/18, 7:02 PM"}, {"comment": "Overall, a well-designed course that is heavily (primarily) project-based in its approach. The projects are difficult, but doable in the allotted timeframe. The course material itself is good, but seems very limited. You will learn some probabilistic approaches to decision-making in robotics, but I don't know that I would call it \"AI\" really. That said, the material is great for expanding your vocabulary and knowledge base if you are at all interested in robotics, game design, or basic AI at the path-finding level. The course instructor and TAs were very helpful and responsive. It was also nice to hear from Sebastian Thrun himself on a few office hours. Overall I'd definitely recommend this course if you enjoy project-based learning, but with the caveat that the material itself is very limited in scope.", "rating": "Liked", "workload": "12 hours/week", "author": "5Xa4zOVzKcbHbZ2MRsi35IxjO3I2", "difficulty": "Medium", "semester": "Fall 2018", "time": "2/25/19, 9:43 PM"}, {"comment": "This is an engineer's course where you understand the concepts and code it. There is some Math involved like conditional probability, Basic Geometry and linear algebra, Bayesian theory, Matrix Math and so on. A self driving car is extremely complex and you are learning from a self driving car pioneer Dr. Thrun which is very good. However you only learn the basics in this course and would barely scratch the surface. Having said that this course covers pretty much the heart of what is needed like Localization using Kalman filter and Particle filter, different search techniques like A*, PID control and SLAM. I found SLAM the toughest to understand and comprehend. This course has no reports or writing which is the best part. Its pure coding and the projects are all or nothing. It starts out pretty simple with the Runaway Robot and gets progressively harder as the course progresses. Project 3 : SLAM Warehouse is the toughest of all and unfortunately for the summer course this was excluded for obvious reasons. But I was glad I got to do the SLAM Problem set 6 which itself was challenging despite being an introduction to SLAM. A piece of advise is to start early on the projects and assignments as they are released very early. If you time and plan all the projects and assignments early enough, you will have a month for the final project3 and trust me, you would need all the time in the world for that. The drop deadline is pretty much useless for this course unless you screw up the earlier projects which is unlikely. The TAs for this course were the best I have encountered so far. Prof. Summet is very active on Piazza and super helpful. The office hours are recorded so there is little reason to watch it live. Being active on Piazza and the Slack channel is the key as you gain immensely from fellow students insights and advise. Overall an excellent course and the experience was very satisfying.", "rating": "Loved!", "workload": "12 hours/week", "author": "LvqblwCSqFUIjBYwFtnyQ7S1hwd2", "difficulty": "Medium", "semester": "Summer 2018", "time": "7/30/18, 3:43 PM"}, {"comment": "The most well structured class I have taken; quizzes and assignments built very well in relation to the lecture material. Very active Piazza board and extremely helpful discussions.", "rating": "Loved!", "workload": "8 hours/week", "author": "t0q0YLWdOXYX3NcuKHMtqYhbCL22", "difficulty": "Easy", "semester": "Summer 2018", "time": "8/1/18, 9:40 PM"}, {"comment": "It is a hard course. 30% of course points were a giveaway. But I had to struggle hard for the rest of 70%. For summer they removed SLAM. It reduced workload but it would have been better to have learnt it. There were no tests nor group projects nor papers to write. 2 projects and 1 mini project had to be implemented in python. Got an A- just managed to scrape through. Professor Jay Summet is excellent and so are the TAs. Slack and Piazza are life savers.I had fun learning!", "rating": "Liked", "workload": "20 hours/week", "author": "5dZ2iljlB8MV0VOOT65Q9nZVxEf2", "difficulty": "Hard", "semester": "Summer 2018", "time": "10/15/18, 7:42 PM"}, {"comment": "I enjoyed the class a lot, that maybe because I already took AI and Algorithms, so I was already familiar with A*. The TAs and the instructor were super engaged throughout the class, grading was lightning fast (within days). The class is very well organized, the projects are really fun. I definitely recommend it!", "rating": "Loved!", "workload": "4 hours/week", "author": "iNCKcWuJgehk3LF04polVfYKt483", "difficulty": "Easy", "semester": "Summer 2018", "time": "8/6/18, 10:53 AM"}, {"comment": "Super great. By FAR the fastest grading I've seen at OSMCS so far. The class seems to be designed from the ground up to scale for being online, and it makes a huge difference. I agree with other reviews that this course comes more from an engineering perspective than a science perspective. Principles are taught in class and they are useful in the projects, but the projects will throw some real-world curveballs at you, so you need to do some real-world problem solving, and find some workable heuristics to use with the principles. And if you find a 'cheap' solution that doesn't even use the class material, that's okay - the rule here is if it works, it's not stupid! That's a delightful approach; without it, students sometimes end up having to play \"guess what the instruct is expecting you to think\".", "rating": "Loved!", "workload": "10 hours/week", "author": "LsXqiGDkeoW40udW0WBAgACo3GU2", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/10/18, 12:38 PM"}, {"comment": "I enjoyed this class, overall. It wasn't super difficult, but the projects were sufficiently challenging and engaging. The runaway robot project can be tough without prior experience with Kalman/particle filters (it helps having already taken CV, since one of the projects in there uses these filters). And the final project (project 2 for the summer course) was definitely a big challenge - one that combined most of the topics learned in the class - but was extremely rewarding at the end.I wish the course also included the SLAM project and more content from that area, but I understand the difficulty in cramming more material in a shorter window. I feel like the course could be reworked to include this if certain aspects of the prior projects were modified.Either way, I'd recommend taking this course if you're interested in robotics and automation. It's not insanely in-depth, but the projects are engaging, and the topics are interesting.Also, I think this often gets recommended as a potential first course. I actually would not recommend taking this first, unless you are very confident in your Python/Numpy/linear algebra skills. I think getting some more experience in those areas goes a long way with the projects in this class.", "rating": "Liked", "workload": "10 hours/week", "author": "vfBawONILeYqh4y4Hr8hSSIPq722", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/16/18, 10:29 AM"}, {"comment": "AI4R was a great class! It was a suitable option for summer session, as the third project, which is definitely a difficult and time consuming one, was dropped. There were opportunities for extra credit as well, which was great if you were wanting to ensure you don't just miss out on a grade by a percent or two.The lectures are well done, but you will have to do a lot of extra reading to supplement the videos. It's not too bad, but I can understand if people are put off by this fact, especially if they're not expecting it. The videos do a good job of covering the foundations and touch on some of the more advanced details, but you will likely have to read some papers or other resources to get a handle on more advanced techniques and implementation of these techniques.The projects are fairly well defined; we had two mini-projects, and two full projects. The full projects were definitely time consuming, so I would suggest starting on them soon after release. Even if it's just playing around with different ideas and trying different approaches, it will help you get a handle on how the problems are set up and how you should be tackling them. The nice thing about the projects is that they're fairly open-ended in terms of implementation, as you can choose from a few viable algorithms or approaches to solve the problems.Assignments are your answers to the quizzes in the Udacity videos. You also have to upload your code and answers to ensure nothing gets lost in case Udacity loses your answers on their end. These were easy and basically a free 30%.TAs were excellent; they were extremely responsive and informative. Assignment and project grades were given back VERY fast, sometimes in the same day.All-in-all, it was a well-run class and I would highly recommend. If you want to learn SLAM, which is an important and very powerful algorithm for robot localization and mapping, to the fullest extent the class can offer, I would advise taking this during the regular term so you don't miss out on project 3. Be warned that it IS very difficult, however. So if you don't mind missing out on this last project, this class is a decent choice for summer. Though it's probably still not the easiest, it's enjoyable and very much doable.", "rating": "Loved!", "workload": "16 hours/week", "author": "WI6Lt9NmqYZAO9vyNJKFRgf8JQ32", "difficulty": "Medium", "semester": "Summer 2018", "time": "8/20/18, 7:58 PM"}, {"comment": "There was plenty of time to get ahead of the work in this class even in the somewhat shorter Summer semester. Really enjoyed this class in terms of the content and projects. Some projects were more challenging while others weren't too bad to knock out in 1-2 sittings.", "rating": "Loved!", "workload": "12 hours/week", "author": "ZSokHE3YXURjksmCfdbSXXShvbz1", "difficulty": "Hard", "semester": "Summer 2018", "time": "11/7/18, 3:51 PM"}, {"comment": "Took this in Fall 2018. The material are pretty straight forward. The course is focused on practicality more than theory. A lot of implementation exercises. The projects are straight forward with a trick or two. The projects took time but the material and exercises did not. The instructors were available for questions on piazza. To do well follow questions and discussions on piazza", "rating": "Liked", "workload": "8 hours/week", "author": "NdoQSXAD8eOTcUCKOSBPAF3V8fw2", "difficulty": "Easy", "semester": "Summer 2018", "time": "12/12/18, 5:45 PM"}, {"comment": "AI 4 robotics is a misnomer - it is basically graph and mapping algorithms for automated car.I would have actually preferred a generic robotics course (the skills of which might actually be useful to a hobbyist with limited funds), with some focus on robot car. Here, the probability of putting any of this to real use is infinitesimal unless you work for a robot car company.The projects could be tough - esp because some of the code the prof demoed was buggy. IMO the lectures are now dated given the amount of errata and they need to be revised.There is almost complete neglect of theory (a big problem with this course). This comes and bites in the projects, which are heavily mathematical / numerical code and \"copy paste\" will not work.", "rating": "Neutral", "workload": "15 hours/week", "author": "p1cOrMVL0caAYHY729sDF0e3FG22", "difficulty": "Medium", "semester": "Summer 2018", "time": "1/7/19, 11:51 AM"}, {"comment": "This is a very good introduction curse, as well as a course that prepares you to other courses such as AI/ML. If you want to learn more in-depth of the algorithm(particle filter) and do an extensive project(project 3) using python, please do not choose the course during summer as time is limited. It contains project and application in the field of probability theory (Bayesian Network) and algorithms such as A* Kalman Filter and Particle Filter, also some control theory as well. I could review this course a little bit earlier but I realized I didn't commit as much as other courses I've taken so far. And the content and works of this course seemed just very easy to skipping I felt like and didn't keep me very consistently involved during the class.", "rating": "Liked", "workload": "12 hours/week", "author": "TVMuhcH8hNUShV4FV083Is3NJPR2", "difficulty": "Medium", "semester": "Summer 2018", "time": "1/8/19, 9:33 PM"}, {"comment": "This class was a good intro to robotics and autonomous systems. The only downside with it is how much it depends on parameter tuning and how you can easily shoot yourself in the foot by this.", "rating": "Disliked", "workload": "20 hours/week", "author": "8FCBcDgSfQQstEgmliKEkeCHysD3", "difficulty": "Hard", "semester": "Summer 2018", "time": "4/3/19, 3:34 PM"}, {"comment": "Was already familiar with many of the algorithms that were covered in lecture. Later strategies were interesting. The projects are a whole other beast as they test much more than what is covered in lecture. Compared to other courses such as Computational Photography or Computer Vision I would say the projects are 'easier' conceptually but 'significantly less straightforward' to implement.Eg a project which was basically 'implement particle filters' which I've implemented at least 3 times before took 10x as much time to finish as in other classes. This is due to a lack of scaffolding provided compared to other courses (you have to integrate your code and write almost everything that's not related to the core algorithm). I will say they did cover how to implement particle filters quite well. Just that the bulk of your time in the projects is not spent on the core algorithms the lectures cover.The projects build on one another so if you didn't manage to get earlier projects be ready to devote significant time on later projects catching up. Lastly the grades are all or nothing (very much like real life) unlike other courses which test each part of the project separately.If you are not familiar with the concepts taught in this class you will struggle with having enough time to implement them. That being said the lectures do cover the material quite well. It's just due to the all or nothing nature it'll be hard for you to know whether it is a bug with the algorithms or an integration bug somewhere else.Semi extra credit in terms of additional projects/challenges was offered, but I don't consider them realistic given the time devoted to core projects.I would NOT recommend this to new students to the program. For the final project around 1/3 of the students got 0% on the grade on a piazza poll and less than 1/2 got >50% due to the all or nothing nature.Tip for project 3: Ignore almost everything that is suggested for this project by lecture. The biggest challenge is not related to what the project seems to want to test you on at all. If you waste your time on the algorithm covered in lecture. You won't have time to work on the actual time consuming part of the project. You won't even need anything you implemented in Project 2 or Project 1B. Just use the strategy from Project 1A to deal with inputs and focus on the real challenge. Learned this the hard way when I ran out of time and discovered my optimized implementation wasn't even needed or used in the final solution. Also for the mini project before hand, there's a significantly simpler alternative that's much easier than the suggested algorithm. Save your time for Project 2/3 instead of the miniproject.", "rating": "Neutral", "workload": "30 hours/week", "author": "dI2xZ5pYZzePqM5FYOPZqEK21CH3", "difficulty": "Medium", "semester": "Spring 2018", "time": "5/3/18, 6:56 AM"}, {"comment": "This is the first course of Gatech. I have CS background and quite familiar with python. As I look at some previous review of this course, quite a few people consider it as \"bird\" course. However, from my experience, this is NOT a bird course. Lectures are very good and straightforward, you will be given problem set to solve after every series of lectures, but all problem sets are straightforward. However, all projects are NOT easy. I did a little bit trick on couple projects to get 100%. But in the last project, I spent more than 15 hours for 3 weeks, I still couldn't completely solve it. Again, python for this course is easy, but math is difficult, make sure understand the math before any implementation.", "rating": "Liked", "workload": "18 hours/week", "author": "y3erFP4fMpRbVcNr3lBf1Ucs3VU2", "difficulty": "Medium", "semester": "Spring 2018", "time": "5/1/18, 2:03 PM"}, {"comment": "Overall, I really enjoyed this class. I enjoyed most of the projects and found the lectures to be enjoyable. Be careful about the last project in the class which is insanely difficult. All of the other projects were doable and really enjoyed them overall. This was my first class I did for OMSCS ever and while I enjoyed this class, I'm not sure if I can recommend it as a first class to take mainly because of the last project and how little time you have to complete it especially if you work full time. The topic is really fun and interesting and there are no tests and papers as well which is a big plus.", "rating": "Liked", "workload": "18 hours/week", "author": "8XS7IJ6s1xfJFo6TQKimR20IHcw1", "difficulty": "Medium", "semester": "Spring 2018", "time": "5/2/18, 10:01 PM"}, {"comment": "I took this course along with DVA for my first semester. I liked DVA, but I thought this course was much better - I loved it.Positives:Dr Thrun's lectures are fascinating, and he has boundless enthusiasm for the subject. That enthusiasm didn't just come through in the lectures, but in the three office hours he gave throughout the semester. These office hours were interesting too, and he took questions from students ranging from project implementation details to research and industry topics. Pretty cool.Dr Summet's office hours were very useful, and he held them every week. He was also very involved on Piazza and personally answered many student questions.The projects are fun. The course doesn't cover that many topics, but you will become an expert in A*/DP path planning, Kalman/Particle filters, and PID control. When/if you finish the projects, you'll feel proud. And if you're like me, you'll replay the Python scripts over and over once you're done just to watch what you made.In my semester, the students on Piazza were valuable and supportive.There were no tests, and the homework answers were given for free (they still counted towards your grade). No group projects. You'll have many weeks to prepare for most of the projects.NegativesThe projects really seem all-or-nothing. They use an automated grader to score your projects, and you'll probably have to spend double digit hours just to maybe get a tiny amount of points from the sample grader. The real test cases they will grade with are not given in advance, but sample cases are provided that closely match. Don't underestimate the time commitment you'll need for those projects. We had a week extension on the last project, and still many people reported that they could not get any points on their test runs before having to turn it in.TipsPython is heavily used, and it will be valuable if you're already familiar with it. Start the projects right when they become available. Try to do the projects in stages, like making sure you have basic functionality before meeting the full requirements.I wouldn't go so far to say that the lectures didn't cover what you need for the projects (like others have stated). The core of my logic for every project was solely stuff we learned in class. That being said, there are implementation details that will take a while to work out, and parameters that will need to be heavily tuned. You'll have to get creative.", "rating": "Loved!", "workload": "15 hours/week", "author": "ee1HCYAlJbgdvaIUBd9LNCbm7mq2", "difficulty": "Medium", "semester": "Spring 2018", "time": "5/7/18, 1:29 PM"}], "difficulty": 3.81, "enrolled": 0.0, "id": "CS8803"}]

